INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','','Nasze warunki dostawy towarów','wysyłka, dostawa, transport','<h2>Przesyłki i zwroty</h2>\n<h2>Twoja przesyłka paczki</h2>\n<h4>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i wysyłane za pośrednictwem firmy UPS z opcją śledzenia i nadania bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego prosimy o kontakt przed wybraniem tej metody. Bez względu na to, jaką wysyłkę wybierzesz, udostępnimy Ci link do śledzenia przesyłki online.<br /><br /><br /><br /><br />Opłaty za wysyłkę obejmują opłaty manipulacyjne i pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Radzimy grupować przedmioty w jednym zamówieniu. Nie możemy grupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Twoja przesyłka zostanie wysłana na własne ryzyko, ale dokładamy wszelkich starań, aby chronić delikatne przedmioty.<br /><br /><br /></h4>\n<h2>Pudełka mają duże rozmiary, a Twoje przedmioty są dobrze chronione.</h2>','dostawa'),(2,1,1,'Nota prawna','','Nota prawna','legalność, prawo','<h2>Prawne</h2>\n<p>Koncept i produkcja</p>\n<p>Ta strona powstała dzięki <a href=\"http://www.prestashop.com\">PrestaShop</a>™ platformie open-source.</p>','nota-prawna'),(3,1,1,'Warunki użytkowania','','Nasze warunki użytkowania','conditions, terms, use, sell','<h2>Nasze warunki użytkowania</h2>\n<h3>Warunek 1</h3>\n<p>warunek 1</p>\n<h3>Warunek 2</h3>\n<p>Warunek 2</p>\n<h3>Warunek 3</h3>\n<p>warunek 3</p>','warunki-uzytkowania'),(4,1,1,'O nas','','Dowiedz się więcej o naszym sklepie','informacje, o nas','<h2>O nas</h2>\n<h3>Nasza firma</h3>\n<p>Nasza firma</p>\n<h3>Nasz zespół</h3>\n<p>Nasz zespół</p>\n<h3>Informacje</h3>\n<p>Informacje</p>','o-nas'),(5,1,1,'Bezpieczne płatności','','Nasze płatności są bezpieczne','paypal, visa, mastercard, maestro, płatności','<h2>Bezpieczne płatności</h2>\n<h3>Nasze bezpieczne płatności</h3>\n<p>Mamy SSL</p>\n<h3>Używaj Visa/Mastercard/Paypal</h3>\n<p>O usługach</p>','bezpieczne-platnosci');
