INSERT INTO `ps_product_lang` VALUES (1389,1,1,'Lampka LED do zawieszania Hayley z dziewięcioma wspaniałymi szklanymi kulami o szlachetnym, złotym wyglądzie  Specjalna wisząca lampa LED Hayley charakteryzuje się eleganckim wzornictwem i nowoczesną technologią LED. Zarówno okrągły daszek, jak i filigranowe elementy metalowe, które otaczają spodnią część szklanej kuli, uzyskały złote wykończenie.  Wnętrze dziewięciu kul zaskakuje dekoracyjnie wkomponowanymi bąbelkami powietrza, które podkreślają indywidualny charakter lampy. Zainstalowane na stałe diody LED o wysokiej intensywności emitują przyjemne, ciepłe, białe światło, które nadaje się również do oświetlania większych powierzchni pomieszczenia. Światło jest rozprowadzane pośrednio i równomiernie w pomieszczeniu bez oślepiania. Szlachetny i efektowny design tego pięknego źródła światła może być zintegrowany z różnymi meblami i pozostawia długotrwałe wrażenie na obserwatorze. Pobierz:   Instrukcja obsługi                    (554 KB)','','lucande-hayley-lampa-wiszaca-led-9-punktowa-zlota','','','','Lucande Hayley lampa wisząca LED 9-punktowa, złota','','','',''),(1390,1,1,'Lampa wisząca Dallas z chromowanymi szklanymi kulami  25-punktowa lampa wisząca Dallas ma bajecznie piękny wygląd: podłużny klosz stanowią szklane kule w odcieniu chromu przymocowane do długiego metalowego pręta. Cała lampa sprawia bardzo nowoczesne, a jednocześnie uroczyste wrażenie – ze względu na swój odcień oświetlone szklane kule emitują wyjątkowo piękne światło.  To niezwykle atrakcyjne źródło oświetlenia obszarowego i ogólnego do nowoczesnej przestrzeni mieszkalnej, które nadaje każdemu pomieszczeniu ekskluzywny charakter.','','lampa-wiszaca-dallas-chrom','','','','Lampa wisząca Dallas, chrom','','','',''),(1391,1,1,'Oprawa wisząca LED Artist - przyjemne oświetlenie stołu w płaskim wzornictwie  Jednopłomienna lampa wisząca Artist przekonuje nowoczesnym, przejrzystym designem płaskiego, okrągłego klosza. Jego czarna metalowa obudowa posiada od spodu opalową osłonę z tworzywa sztucznego, która rozprasza ciepłobiałe światło zintegrowanych diod LED i zapewnia w ten sposób szerokie i przyjemne oświetlenie obszaru pod lampą. Na przykład do indywidualnego oświetlenia stołu w jadalni, ale także nad stołem w restauracji lub w grupie wzdłuż lady, lampa wisząca LED Artist może być idealnie wykorzystana.  - ściemniane zewnętrznie przez sekcję fazową','','lampa-wiszaca-led-artist-o-40-cm-czarna','','','','Lampa wisząca LED Artist, Ø 40 cm, czarna','','','',''),(1392,1,1,'Narisa – wyjątkowa lampa wisząca LED z kloszem z wielu elementów metalowych  Nieregularnie uformowane, zazwyczaj owalne elementy metalowe z chromowaną powierzchnią zostały w lampie wiszącej LED Narisa uszeregowane, tworząc niezwykły klosz lampy. Tak właśnie powstała czarująca struktura, która będzie stanowić centralny element każdego pomieszczenia. Żarówki są umiejscowione za dyfuzorem z białego akrylu, przez co emitują jednorodne światło w dół, podczas gdy przez liczne przestrzenie klosza oraz przez odbicia światła na wygiętych elementach powstają wokół świetne efekty świetne na ścianach i elementach wyposażenia.','','wspaniala-lampa-wiszaca-led-narisa','','','','Wspaniała lampa wisząca LED Narisa','','','',''),(1393,1,1,'Okrągła designerska lampa wisząca Filoreta z czarnym metalowym kloszem i detalami w kolorze mosiądzu - szlachetna do kuchni i jadalni  Filoreta ma okrągły, ale płaski metalowy klosz, który tym samym uosabia pewną prostolinijność, jak to często bywa w stylu Mid-Century, który ma szczególny urok retro, ponieważ przypomina wnętrza z połowy ubiegłego wieku i podchwytuje wzornictwo lat 40-tych, 50-tych i 60-tych. Metal jest ciężki i poddany wysokiej jakości obróbce, dzięki czemu lampa wisząca Filoreta może błyszczeć solidną konstrukcją, a jednocześnie uosabia prostą elegancję.  Ponieważ metal jest materiałem nieprzezroczystym, światło jest naturalnie kierowane w dół na powierzchnię, którą w wielu przypadkach jest stół w kuchni lub jadalni. Stół ten może być wtedy dobrze i jasno oświetlony, zwłaszcza że zastosowano dwie żarówki E27 (często o wyglądzie filamentu lub rustykalnym i wydajnej technologii LED), ale światło otoczenia wydaje się dość przytulne i stosunkowo nieoślepiające. Metalowy klosz z matową czarną powierzchnią uzupełniają detale w kolorze szczotkowanego mosiądzu, które tworzą modny kontrast, ale także harmonijnie współgrają ze sobą. Również pokryty tkaniną kabel, który prowadzi do mocowania sufitowego lampy wiszącej, jest dopasowany kolorystycznie. Ogólnie rzecz biorąc, projekt oprawy wykazuje wyczucie dla specjalnych i wybranych szczegółów, które razem tworzą luksusową aurę z przyjemną dyskrecją. Pobierz:   Instrukcja obsługi                    (355 KB)','','lucande-filoreta-lampa-wiszaca-35-cm-czarna','','','','Lucande Filoreta lampa wisząca, 35 cm, czarna','','','',''),(1394,1,1,'Pięciolampowa designerska lampa wisząca Jorna z czerwonymi przewodami z tkaniny  Jorna to bardzo przykuwający uwagę, wyjątkowy element oświetleniowy do nowoczesnych stylizacji, który potrafi zapunktować niezwykłymi walorami aranżacyjnymi i przyciąga wzrok nie tylko dzięki połączeniu kolorystycznemu w czerni i czerwieni. Jednocześnie lampa wisząca przyciąga wzrok dzięki swojemu ikonicznemu wzornictwu i zawsze wywołuje efekt domowy i dekoracyjny, a minimalistyczny design dzięki odpowiedniemu doborowi materiałów wyróżnia całą koncepcję. Nie ma klasycznych kloszy, jest za to rama z czarnego żelaza, z której luźno zwisają gniazda. Od gniazdka elektrycznego do źródeł światła prowadzą czerwone kable tekstylne, co rozluźnia ogólny wygląd mocnym odcieniem koloru i wyraźnie indywidualizuje wygląd. Kable można dowolnie rozmieszczać, a lampa wisząca Jorna jest z pewnością odpowiednim elementem oświetleniowym dla indywidualistów, którzy poszukują takich elementów wyposażenia, za pomocą których można się wyróżnić. Ogólny design również dobrze wpisuje się w trend industrialny, a aby dopełnić wygląd w stylu, należy wybrać lampy kuliste w formacie G95, które są większe niż standardowe lampy i nie tylko ze względu na brak kloszy przyciągają wzrok i są obecną częścią oprawy.  Pobierz:   Instrukcja obsługi                    (407 KB)','','lucande-jorna-lampa-wiszaca-5-pkt-kabel-czerwony','','','','Lucande Jorna lampa wisząca 5-pkt, kabel czerwony','','','',''),(1395,1,1,'Wyprodukowana w Niemczech lampa wisząca LED o regulowanej wysokości Lian, zewnętrzne ściemnianie, kolory mosiądzu, CRI 90  Lian to lampa wisząca LED, która idealnie pasuje nad stołem w jadalni. Obie osłony zostały misternie wykończone ręcznie w pięknej, matowej tonacji mosiądzu i mają zaokrąglony kształt. Listwa świetlna wewnątrz nowoczesnego i ekstrawagancko ukształtowanego klosza lampy jest wyposażona w diody LED w taki sposób, że powstaje bezpośrednie i pośrednie światło, a otoczenie zostaje przyjemnie oświetlone. Jasność wiszącej lampy można perfekcyjnie regulować za pomocą zewnętrznego ściemniacza (ściemniacz z trybem odcinania fazy lub fazowo-kątowy), a barwa światła jest tak samo ciepła, jak w przypadku żarówek tradycyjnych, dzięki czemu uzyskuje się przytulny obraz świetlny, który bardzo ładnie wpasowuje się w przestrzeń mieszkania. Dodatkowo, powierzchnia w kolorze mosiądzu zapewnia ciepłą emisję światła barwionego, a Lian jest jednym z produktów oświetleniowych, które są produkowane z najwyższą precyzją w Niemczech i charakteryzują się najwyższą jakością.   Za pomocą jednego lub dwóch ruchów ręki, wysokość zawieszenia można regulować w dowolnym momencie (od 105 cm do 195 cm), stwarzając optymalne warunki oświetleniowe w jadalni wraz z innymi cechami, które charakteryzują lampę Lian. Dzięki bardzo dużej przestrzeni połączeniowej w puszce sufitowej szczególnie wygodny jest montaż lampy wiszącej z jasnymi i wydajnymi diodami LED.   Oddawanie barw przez diody LED jest doskonałe, CRI jest większy, niż 90, dzięki czemu można zapewnić jak najbardziej naturalne odwzorowanie kolorów, nawet przy sztucznym oświetleniu pomieszczeń. Pobierz:   Instrukcja obsługi                    (268 KB)','','lucande-lian-lampa-wiszaca-led-mosiadz-regulacja','','','','Lucande Lian lampa wisząca LED, mosiądz, regulacja','','','',''),(1396,1,1,'Duża tekstylna lampa wisząca Edano o wspaniałym wzornictwie, funkcja Steppdim  Wisząca lampa LED Edano pojawia się z jednej strony swoim rozmiarem, a z drugiej strony swoją specjalną konstrukcją bardzo niezwykłą. Długi odcień wykonany z materiału tekstylnego wygląda bardzo interesująco z jego krzywiznami i wywołuje skojarzenia ze skrzydłami szybowca na wietrze.   Ekran zawiera ciepłe białe diody LED, które mogą być ściemniane bez konieczności instalowania ściemniacza nad jakimkolwiek konwencjonalnym przełącznikiem ściennym. Poprzez kilkakrotne naciśnięcie przełącznika można przełączyć światło na trzy poziomy jasności (100 %, 40 % lub 10 %), czwarta operacja przełączania wyłącza światło.  3-stopniowe przyciemnianie + wyłączanie:  Za pomocą włącznika ściennego można włączać i wyłączać lampę jak zwykle. Dzięki 3-stopniowej technologii ściemniania ze zintegrowaną funkcją wyłączania, można ją również przyciemnić do trzech różnych poziomów jasności poprzez wielokrotne naciskanie przełącznika: 100 %, 40 % i 10 %. Pobierz:   Instrukcja obsługi                    (1.2 MB)','','lucande-edano-lampa-wiszaca-led-3-stopniowa','','','','Lucande Edano lampa wisząca LED, 3 stopniowa','','','',''),(1397,1,1,'','','lampa-wiszaca-led-narisa-5xg9-o47cm-biala','','','','Lampa wisząca LED Narisa 5xG9, Ø47cm, biała','','','',''),(1398,1,1,'Kularowa lampa wisząca Dustian w ekstrawaganckim wykonaniu z czarnego metalu i szkła  Projekt tej okrągłej oprawy wiszącej wydaje się szlachetny i nieco zabawny i uosabia elegancki dwuskładnikowy wygląd, ponieważ klosz w formie kuli wykonany jest z czarnego metalu i przezroczystego szkła w mniej więcej równych częściach. Mechanizm skrętu pozwala na szybkie zdemontowanie obu elementów podczas wymiany lampy, a następnie równie szybkie złożenie ich z powrotem. Otwór jest tak duży, że można stosować nawet lampy kuliste o średnicy do 9,5 cm. Za przezroczystym szkłem, tak duża lampa jest wtedy oczywiście szczególnie piękna. Alternatywą jest zastosowanie reflektora lustrzanego dla szczególnie komfortowych warunków oświetleniowych lub lamp o bardzo ciepłej barwie światła. Pasuje to do modnego czarnego wykończenia powierzchni.   Jako oprawa wisząca, Dustian jest prawdziwym typem charakteru o unikalnym wyglądzie i może być wkomponowany w wiele przestrzeni mieszkalnych, gdzie nie tylko dostarcza światła, ale także wywiera rzeczywiste wrażenie jako element wyposażenia o charakterze obiektowym. Pobierz:   Instrukcja obsługi                    (377 KB)','','lucande-dustian-lampa-wiszaca-szklana-kula','','','','Lucande Dustian lampa wisząca, szklana kula','','','',''),(1399,1,1,'Designerska lampa wisząca Screen o mobilnym wyglądzie  Oprawa wisząca Screen daje wspaniały efekt nawet wtedy, gdy nie jest oświetlona, ponieważ dziesięć różnej wielkości elementów klosza o wiklinowym designie sprawia, że wygląda ona jak mobile i dzięki temu ma dużą wartość dekoracyjną dla wystroju wnętrza. Oprawka żarówki jest zamontowana pośrodku kloszy, żarówka (nie zawarta w zestawie) promieniuje swoim światłem równomiernie na wszystkie strony i rozświetla klosze. W rezultacie otrzymujemy przytulny efekt świetlny z bardzo estetyczną grą światła i cienia. Jasność można regulować za pomocą zewnętrznego ściemniacza.  Screen jest częścią corocznej kolekcji MARKET SET, młodej marki, pod którą francuska firma Corep SAS wprowadza na rynek modele z puli młodych projektantów.','','market-set-screen-xl-lampa-wiszaca','','','','MARKET SET Screen XL lampa wisząca','','','',''),(1400,1,1,'Fiona – lampa wisząca z falbaniastym kloszem z papieru  Puchaty klosz lampy wiszącej Fiona składa się z wielu pojedynczych warstw papieru, które są rozdymane jak falbanki i nałożone na siebie. Żarówka z trzonkiem E27 (maks. 40 W, można stosować także żarówki LED) nastrojowo rozświetla klosz i zamienia białą oprawę świetlną w romantyczną lampę w sypialni.','','lampa-wiszaca-fiona-z-falbaniastym-kloszem','','','','Lampa wisząca Fiona z falbaniastym kloszem','','','',''),(1401,1,1,'Fascynująco zaprojektowana oprawa wisząca Narisa LED  Wiele metalowych elementów, które składają się na cień oprawy wiszącej Narisa LED, ma kształt dużych i małych łyżek i jest pomalowanych w różowym złocie. Wewnątrz znajduje się akrylowy dyfuzor, który w jednolity sposób kształtuje światło emitowane przez zintegrowane lampy LED (G9) i kieruje je w dół. Ponadto, światło jest również kierowane do otoczenia poprzez wiele przestrzeni pomiędzy elementami. Ponadto, zarówno odbicia światła, jak i refleksy tworzą bardzo nastrojowy obraz świetlny.  Oprawa wisząca, która tworzy wrażenie zarówno jako podstawowe oświetlenie w pomieszczeniu, jak i źródło światła nad stołem jadalnym.','','lampa-wiszaca-led-narisa-o-46-cm-rozowa-brazowa','','','','Lampa wisząca LED Narisa Ø 46 cm różowa/brązowa','','','',''),(1402,1,1,'Designerska lampa wisząca Smithfield marki FLOS  Lampa wisząca Smithfield jest wyposażona w cylindryczny i płaski klosz. Krawędzie są zaokrąglone u góry, dzięki czemu kształt wygląda bardzo nowocześnie. Poniżej, nad czterema źródłami światła, zamontowany jest dyfuzor z poliwęglanu, który rozprowadza światło równomiernie w dół. W ten sposób tabele mogą być użytecznie oświetlone. Smithfield może być również stosowany do oświetlenia ogólnego.  Lampa wisząca Smithfield została zaprojektowana przez Jaspera Morrisona i wyprodukowana w najwyższej jakości przez designerskiego producenta FLOS. Włoska firma znana jest ze współpracy z renomowanymi projektantami, a także z wysokiej jakości lamp Made in Italy.','','flos-smithfield-s-lampa-wiszaca','','','','FLOS Smithfield S lampa wisząca','','','',''),(1403,1,1,'Oprawa wisząca Singapour XS z fascynującym efektem świetlnym  Ta oprawa wisząca jest czymś wyjątkowym: jej niezwykły design pochodzi z MARKET SET, marki, pod którą firma produkcyjna Corep SAS wprowadza na rynek innowacyjne projekty młodych, początkujących projektantów, z nową kolekcją każdego roku.  Szczególną atrakcją lampy Singapour XS jest klosz, a dokładniej połączenie dwóch różnej wielkości płóciennych kloszy i stożkowego klosza ze splotu rattanowego, umieszczonego pod dolnym kloszem z tkaniny. W trakcie emisji światła wyraźnie zaznacza się splot pod tkaniną. Oprawa wisząca, która idealnie nadaje się na przykład do nastrojowego oświetlenia stołu lub do oświetlenia podstawowego w salonach i sypialniach. Wyposażony w kabel tekstylny.  - ściemniane zewnętrznie','','market-set-singapour-xs-lampa-wiszaca','','','','MARKET SET Singapour XS lampa wisząca','','','',''),(1404,1,1,'Lampa wisząca Void mini w stylu glamour  Inspiracją dla brytyjskiego projektanta Toma Dixona przy tworzeniu odcienia Void mini była kolba próżniowa. Metale półszlachetne uformowano w dwuścienny klosz i nadano mu błyszczące wykończenie, które dodatkowo wspaniale odbija światło emitowane przez zastosowaną lampę. Oprawa wisząca, która - umieszczona pojedynczo - jako źródło światła nad stołem jadalnym tworzy szczególnie piękne oświetlenie otoczenia z przytulną atmosferą. Ułożone w kilku rzędach odpowiednio oświetlają również długą ladę.  Designerska lampa brytyjskiego Toma Dixona, którego marka obecna jest już w 65 krajach na całym świecie. Za swoje zasługi dla brytyjskiego wzornictwa Dixon został odznaczony Orderem Imperium Brytyjskiego w 2001 roku.','','tom-dixon-void-mini-lampa-wiszaca-o-155-cm','','','','Tom Dixon Void mini lampa wisząca Ø 15,5 cm','','','',''),(1405,1,1,'4-punktowa lampa wisząca belka Sotiana z przezroczystymi szklanymi kulami - idealna do oświetlania miejsc do spożywania posiłków  Sotiana to lampa wisząca w kształcie belki z czterema pięknie ukształtowanymi kulistymi szkłami, które są całkowicie przezroczyste. Dzięki temu nic nie traci się na jasności żarówek, ale oczywiście przemawia to również za dobrą widocznością samych żarówek, dlatego też należy je dobierać starannie, tak aby stylowo uzupełniały ogólne wzornictwo. Żarówki rustykalne i filament w kształcie kropli i z technologią LED są więc tutaj źródłem światła pierwszego wyboru.   Wizualnie, Sotiana przekonuje nowoczesnym wyglądem, ale także walorami stylu vintage. Podstawa lub uchwyt sufitowy oraz belka wykonane są z metalu i są czarne, natomiast mosiężne oprawy lamp wyróżniają się stylowo i wraz ze szkłem tworzą elegancki, trójskładnikowy wygląd. Podłużna, 4-punktowa forma lampy wiszącej belki jest idealna do oświetlania stołu w jadalni.','','lucande-sotiana-lampa-wiszaca-szklane-kule-4-pkt','','','','Lucande Sotiana lampa wisząca szklane kule, 4-pkt.','','','',''),(1406,1,1,'Biały wisior designerski Filoreta w okrągłym odcieniu metalu i mosiężnych detali - idealny nad stołem w kuchni  Jeśli chodzi o styl, to lampę wiszącą Filoreta można z pewnością sklasyfikować jako wzór z połowy wieku, który opiera się na wnętrzach z połowy dekad ubiegłego wieku i może być uznany w latach 40, 50 i 60. Charakteryzuje się on m.in. zredukowanymi kształtami geometrycznymi, które również tutaj można dostrzec, ponieważ metalowy klosz, mimo że ma kształt okrągły, jest całkowicie płaski, a zatem charakteryzuje się również pewną prostoliniowością. Ponadto metalowy klosz, który jest szczególnie ciężki i ma solidną konstrukcję, zapewnia, że światło wydostaje się tylko na dół i oświetla znajdujący się tam obszar w sposób skoncentrowany i jasny, podczas gdy w innym przypadku światło jest pozbawione olśnień i jest odbierane jako bardzo przyjemne.   Matowe, białe wykończenie metalu jest ponadczasowe i charakteryzuje się harmonią, a elementy ze szczotkowanego mosiądzu i tekstylny kabel w tym samym kolorze uzupełniają wygląd o niewielki kontrast. Oczywiste jest, że oprawa została zaprojektowana z dbałością o szczegóły, a każdy z nich na swój sposób przyczynia się do luksusowego wyglądu serii. Pobierz:   Instrukcja obsługi                    (366 KB)','','lucande-filoreta-lampa-wiszaca-35-cm-biala','','','','Lucande Filoreta lampa wisząca, 35 cm, biała','','','',''),(1407,1,1,'Lampa wisząca Carmina z kloszem o wyjątkowym designie  Klosz tej lampy wiszącej jest wykonany z polipropylenu i poliwęglanu i nie tłucze się. Jego design o stonowanych liniach należy rozumieć jako nawiązanie do pofałdowanego krajobrazu wydmowego na duńskim wybrzeżu. Carmina wzbogaca każde naturalnie zaprojektowane wnętrze o nordycki minimalistyczny design i miękkie, przytulne światło.   Lampa wisząca Carmina została stworzona we współpracy z dwoma projektantami: Sørenem Ravnem Christensenem – twórcą i współzałożycielem duńskiej firmy oświetleniowej UMAGE –oraz Andersem Klemem, który ukończył studia w Duńskiej Królewskiej Akademii Sztuk Pięknych/Szkole Designu w 2013 roku i pasjonuje się opracowywaniem nowoczesnych lamp.  UMAGE jest zaangażowana w rozwój historycznego skandynawskiego wzornictwa. Projekty firmy łączą w sobie estetykę, prostotę i funkcjonalność, dopełniając je starannym wykonaniem i ekologicznym podejściem do środowiska. Tak powstają niezwykłe designy o zrównoważonych proporcjach.Pobierz:   Instrukcja obsługi                    (1.8 MB)    Specyfikacja techniczna                    (1.5 MB)','','wyjatkowa-lampa-wiszaca-carmina-medium','','','','Wyjątkowa lampa wisząca Carmina medium','','','',''),(1408,1,1,'Lampa wisząca Swinging LED Sakina wykonana z żelaza o ciekawym kształcie  Lampa wisząca LED Sakina przekonuje swoim efektownym wyglądem. Klosz, wykonany z żelaza i aluminium, składa się z wąskiej rozpórki, która porusza się wokół siebie w sposób wymiatający. Stałe diody LED biegną wzdłuż tej belki, które wytwarzają ciepłe białe światło i rozdzielają je w pomieszczeniu w niezwykły sposób. Nowoczesny i różnorodny design sprawia, że doskonale nadaje się do salonu lub jadalni i stanowi miłe uzupełnienie wystroju wnętrza. Ponadto posiada on praktyczne funkcje techniczne, które zapewniają pewien stopień elastyczności w oświetleniu. Wyłącznik ścienny umożliwia włączanie i wyłączanie światła jak zwykle. Dzięki 3-stopniowej technologii ściemniania ze zintegrowaną funkcją wyłączania, można ją również przyciemnić do trzech różnych poziomów jasności poprzez kilkakrotne naciśnięcie przełącznika: 100 %, 40 % i 10 %. Wisząca oprawa Sakina LED tworzy efektowne akcenty na sufitach mieszkań i może być łatwo zintegrowana z nowoczesnym stylem wyposażenia. Pobierz:   Instrukcja obsługi                    (331 KB)','','lucande-sakina-lampa-wiszaca-led-czarna-o-49cm','','','','Lucande Sakina lampa wisząca LED czarna Ø 49cm','','','',''),(1409,1,1,'Czarna lampa wisząca LED o regulowanej wysokości Lian z dwoma zakrzywionymi przesłonami, wykonana w Niemczech  Lampa wisząca LED Lian ma wydłużony kształt, przy czym przesłony są pięknie wygięte, a lampa może być również wykorzystywana jako oświetlenie stołu jadalnego. Jest to również wspierane przez regulację wysokości, ponieważ Lian może być regulowana w dowolnym momencie w zakresie od 105 cm do 195 cm podczas pracy, co zapewnia zwiększoną elastyczność. Lampa została wyprodukowana w Niemczech zgodnie z najwyższymi standardami jakości i posiada wykończenie powierzchni w kolorze czarnym, które zostało misternie wykonane ręcznie. Mocowanie sufitowe stanowi piękny kontrast, ponieważ jest utrzymane w matowym odcieniu aluminium i służy jako efektowny dodatek do całego wzornictwa.   Jeśli lampa wisząca LED ma być ściemniana, potrzebny jest zewnętrzny ściemniacz, który może być sterowany zarówno za pomocą odcinania fazy, jak i regulacji kąta fazowego. Światło wychodzi zarówno w górę, jak i w dół, oświetlając pomieszczenie zarówno bezpośrednio, jak i pośrednio, zapewniając w ten sposób najlepsze warunki dla naturalnie wyglądającego oświetlenia. Poziom oddawania barw jest szczególnie wysoki, dzięki czemu wszystkie odcienie barw w pomieszczeniu mogą być prezentowane w sposób niezmieniony.   Bardzo duża przestrzeń połączeniowa w puszce sufitowej umożliwia prosty i wygodny montaż lamp, w których wszystkie elementy wymagające schowania mogą być bezpiecznie i dobrze umieszczone.  Pobierz:   Instrukcja obsługi                    (269 KB)','','lucande-lian-lampa-wiszaca-led-czarna-aluminium','','','','Lucande Lian lampa wisząca LED, czarna, aluminium','','','',''),(1410,1,1,'Papierowa lampa ryżowa do zawieszania Formakami JH4 Jaime\'a Hayona  Hiszpański projektant Jaim Hayon, posiadający studia w Hiszpanii, Włoszech i Japonii, ma bardzo oczywiste miękkie miejsce na japońskie lampy ryżowe. Swoją serię lamp Formakami opracował na wzór tradycyjnych lamp azjatyckich. Odcień objętościowy, pod którym znajdują się dwa gniazdka E27, wykonany jest z papieru ryżowego koloru kości słoniowej. Przerywają go ciemne detale wykonane z barwionego drewna dębowego.  Jaime Hayon widzi siebie jako artystę, projektanta i architekta wnętrz. Pasjonuje go rzemiosło i związane z nim szczegóły, tworzone ręcznie z miłością i talentem.  Duński producent oświetlenia i mebli &amp;Tradition produkuje przede wszystkim klasyki wzornictwa, ale również aktualne, ponadczasowe produkty, które mają potencjał, aby stać się klasyką pewnego dnia.','','tradition-formakami-jh4-lampa-wiszaca','','','','&Tradition Formakami JH4 lampa wisząca','','','',''),(1411,1,1,'Nowoczesny i zarazem klasyczny element designerski: Lampa wisząca Silvia mini w kolorze białym  Charakterystycznym elementem designerskim tej lampy wiszącej Silvia jest klosz, który składa się z wielu naturalnie wyglądających, trójkątnych liści. Lampa wisząca Silvia przyciąga wzrok nawet wtedy, gdy jest wyłączona, gdy zaś światło jest załączone bardzo rozjaśnia pomieszczenie i gwarantuje bardzo zaakcentowane, wygodne oświetlenie ogólne lub powierzchniowe. Jako że ma barwę klasycznej bieli, można ją również łączyć z wieloma kolorami wnętrz.  UMAGE – firma z siedzibą w Danii – znana jest na całym świecie z estetycznych lamp, które emanują purystycznym pięknem skandynawskiego designu. Celem producenta jest połączenie funkcjonalności z prostym a zarazem pięknym designem oraz uwzględnienie interesów środowiska naturalnego, a tym samym zrównoważonego rozwoju swoich produktów przy uprawianiu rzemiosła.Pobierz:   Instrukcja obsługi                    (3.1 MB)    Specyfikacja techniczna                    (323 KB)','','ekstrawagancka-lampa-wiszaca-silvia-mini-biala','','','','Ekstrawagancka lampa wisząca Silvia mini, biała','','','',''),(1412,1,1,'Piękna lampa wisząca GOCCIA zapewni optymalne oświetlenie pomieszczenia  Forma lampy przypomina kroplę i kojarzy się z biżuteryjnymi przywieszkami. Jest przy tym prosta i szlachetna. Tworzą ją dwa, stykające się elementy ze szkła opalowego, tworzące jedną całość, którego centum zajmuje źródło światła. Górna, stożkowa część lampy znajduje swoje odwrócone odbicie w oprawie sufitowej. Lampa GOCCIA roztacza, dzięki swojej łagodnej formie, całkowicie swoisty urok. Może wisieć zarówno samodzielnie, jak i w grupie lamp, rozwieszonych pomysłowo, bez narzucania jakiegokolwiek ładu.  Pobierz:   Instrukcja obsługi                    (326 KB)    Specyfikacja techniczna                    (77 KB)    Photometric Data LDT                    (8 KB)    Light distribution curve                    (738 KB)','','lampa-wiszaca-goccia-45-w-formie-kropli','','','','Lampa wisząca GOCCIA 45 w formie kropli','','','',''),(1413,1,1,'Designerska lampa wisząca Eos large, jasnoszara  Duża lampa wisząca Eos natychmiast przyciąga wzrok, co z jednej strony wynika z jej niezwykłego wyglądu, a z drugiej związane jest z fantastycznymi efektami świetlnymi, jakie daje ta lampa wszędzie tam, gdzie się znajdzie. Zawdzięcza to zarówno samej konstrukcji klosza, jak i wykorzystywanym do jego stworzenia naturalnym materiałom. Jasnoszary klosz składa się z ok. 4 500 naturalnych gęsich piór. Tym samym Eos large stanowi wspaniałą atrakcję, zarówno wtedy, gdy jest wyłączona, jak i wtedy, kiedy ją załączymy.  Duńczyk Søren Ravn Christensen jest odpowiedzialny za design. Udało mu się w najpiękniejszy sposób wprowadzić w życie maksymę UMAGE, wedle której skandynawski design winien charakteryzować się czystym pięknem i naturalnością. Odbywa się to również z należytym uwzględnieniem kwestii ochrony środowiska i trwałości produktów.  Wskazówka: Jeśli na lampie osiądzie kurz, można go łatwo usunąć suszarką do włosów.  - Nie użyto tu piór żywych zwierząt.Pobierz:   Instrukcja obsługi                    (3.8 MB)    Specyfikacja techniczna                    (1.1 MB)','','eos-duza-lampa-wiszaca-jasnoszary-klosz','','','','Eos - duża lampa wisząca, jasnoszary klosz','','','',''),(1414,1,1,'Dziewięciolampowa lampa wisząca Parena z kloszami ze szkła  Lampa wisząca Parena przekonuje nowoczesnym wyglądem, który charakteryzuje się kontrastami kolorów i materiałów. Obudowa tej lampy została wykonana z solidnego żelaza i poddana obróbce z matowym, czarnym wykończeniem. Klosze wykonane są ze szkła i stanowią piękny kontrast dla ramy.  Parena oferuje dobre oświetlenie dzięki dziewięciu palącym się punktom i może być umieszczona zarówno nad ladą, jak i nad większym stołem w jadalni. Wykorzystanie jest możliwe zarówno we własnych czterech ścianach, jak i w obszarze hotelarstwa czy gastronomii. Pobierz:   Instrukcja obsługi                    (297 KB)','','lucande-parena-lampa-wiszaca-ze-szklanymi-kloszami','','','','Lucande Parena lampa wisząca ze szklanymi kloszami','','','',''),(1415,1,1,'Lampa wisząca Tulipani z przezroczystym i białym szkłem z Murano  Źródło światła jest niewidoczne w przypadku tej lampy wiszącej ze szkła z Murano, ponieważ zostało ono zakryte lekko wygiętymi szklanymi elementami. Światło jest przytłumiane przed wypłynięciem i wypełnia pomieszczenie w miękki i równomierny sposób. Szklane dekory przypominają swoim rozmieszczeniem pięknie zdobioną rybę lub upierzenie pięknego ptaka. Poszczególne elementy zostały polakierowane na środki w kolorze białym i zamykają obrzeże, co wygląda niezwykle elegancko. Dekoracyjna lampa wisząca na wiele okazji, do wielu stylów i pomieszczeń.','','lampa-wiszaca-tulipani-ze-szkla-z-murano-45-cm','','','','Lampa wisząca Tulipani ze szkła z Murano, 45 cm','','','',''),(1416,1,1,'Lampa wisząca Illumin Philo - designerska lampa w efektownym zielonym kolorze  Niezliczone liście z tworzywa sztucznego w kształcie liści filodendrona tworzą efektowny zielony klosz lampy wiszącej Illumin Philo, która staje się elementem przyciągającym wzrok w każdym pomieszczeniu. Są one ułożone na drutach wokół środka i otaczają żarówkę E27 (nie dołączona). Jego światło rozproszone i efektowne prześwituje przez szczeliny do otoczenia i uwypukla liście w cieniu. Ze względu na białą spodnią stronę liści, zieleń liści wydaje się jaśniejsza lub ciemniejsza w zależności od odbicia światła.  Frank Kerdil, duński projektant produktów, wielokrotnie nagradzany za swoje projekty, zaprojektował serię lamp wiszących Illumin dla firmy oświetleniowej Dyberg Larsen, również z siedzibą w Danii. Do lampy dołączony jest biały, powlekany tkaniną kabel o długości 300 cm, róża sufitowa Rosetta® oraz ściereczka antystatyczna do czyszczenia.','','dyberg-larsen-illumin-philo-lampa-wiszaca-zielona','','','','Dyberg Larsen Illumin Philo lampa wisząca zielona','','','',''),(1417,1,1,'Designerska lampa wisząca Mountain View ma zapierający dech w piersiach widok  Projektując tę nadzwyczajną lampę wisząca LED, rosyjski projektant Dima Loginoff wykonał kawał dobrej roboty: Jasność klasycznie ukształtowanego szklanego klosza z dmuchanego szkła stanowi perfekcyjną ramę dla górskiego masywu, który rozpościera się pod ochronnym szkłem, niczym zabezpieczony na wieczność. Górski krajobraz ze wszystkimi dolinami i wzniesieniami jest oświetlany przez zamontowane na środku u góry źródło światła LED o barwie ciepłej bieli, dzięki czemu powstaje wrażenie, jakby południowe słońce znajdowało się w zenicie, oświetlając góry pełnym blaskiem. Unikatowy wygląd Mountain View w połączeniu z najróżniejszymi stylami urządzenia wnętrz jest elementem przyciągającym wzrok, którego urokowi nie oprze się żaden obserwator. Ponadto ta ekstrawagancka designerska lampa wisząca LED włoskiego producenta lamp Axo Light, którego początki sięgają roku 1996 i który jest znany ze swoich wysokiej jakości produktów do przyjemnego oświetlenia otoczenia, które jest niezbędne dla stworzenia przytulnej atmosfery','','axolight-mountain-view-lampa-przezroczysty-chrom','','','','Axolight Mountain View lampa przezroczysty-chrom','','','',''),(1418,1,1,'Atrakcyjnie zaprojektowana lampa wisząca PH 4/3 – 40 cm średnicy  Lampa wisząca PH 4/3 wygląda bardzo dekoracyjnie, gdy jest wyłączona. Ma ona bowiem atrakcyjny potrójny klosz. Gdy tylko światło zostanie włączone, ujawnia się prawdziwe piękno tego sprawdzonego i wizualnie ciągle nowego źródła światła.  Ponadczasowość designu sprawia, że obserwator nawet nie przypuszcza, że potrójna struktura klosza istnieje od 1925/26 roku, kiedy to duński projektant Poul Henningsen stworzył ten właśnie wariant, starając się uzyskać lampę, emitującą światło, które zupełnie nie oślepia. Podobnie jak klosze z tamtych czasów, tak samo i dziś klosz lampy wiszącej PH 4/3 wykonany jest z metalu, w tym przypadku z ciągnionego aluminium, lakierowanego na biało.  Światło emitowane przez lampę jest skierowane głównie w dół i bardzo równomiernie i komfortowo oświetla otoczenie, na przykład w jadalni.  Firma oświetleniowa Louis Poulsen przywiązuje dużą wagę do maksymy „forma podąża za funkcją”, która zapewnia, że światło jest uwzględnione w projektach i że produkty wyglądają estetycznie, gdy są włączone i wyłączone. Pobierz:   Instrukcja obsługi                    (837 KB)    Photometric Data LDT                    (837 Bytes)','','louis-poulsen-ph-4-3-lampa-wiszaca-40cm','','','','Louis Poulsen PH 4/3 – lampa wisząca, 40 cm','','','',''),(1419,1,1,'Wyrazista lampa wisząca LED Tense wykonana z materiału Tyvek nadającego się w 100% do recyklingu  Lampa wisząca Tense prezentuje się wdzięcznie i z pewną lekkością, która potrafi przekonać do siebie zarówno w nowoczesnych salonach, jak i w pomieszczeniach komercyjnych. Klosz, który składa się z papierowego i półprzezroczystego materiału Tyvek, w 100% nadaje się do recyklingu, a jego zwiewny wygląd przypomina delikatną chmurę. Innowacyjną konstrukcję oświetla najnowocześniejsza technologia oświetleniowa LED.  Lampa wisząca Tense pochodzi od New Works, duńskiego producenta oświetlenia, którego projekty oświetleniowe opierają się na skandynawskiej historii rzemiosła i materiałowości. Projektanci Panter &amp; Tourron stworzyli w ten sposób oprawę oświetleniową, która swoim designem przesuwa granice współczesnego wzornictwa.','','new-works-tense-lampa-wiszaca-led-recykling-100','','','','New Works Tense lampa wisząca LED, recykling 100%','','','',''),(1420,1,1,'Lampa wisząca LED Jube z kloszem z przezroczystego szkła  Lampa wisząca LED Jube prezentuje się elegancko w znany i jednocześnie bardzo modny sposób. Atrakcyjny podwójny układ optyczny z wiszącą lampą LED w środku i przezroczystym kloszem zewnętrznym przypomina lampy z lat 60-tych, w wyglądzie, który nigdy nie wydaje się wychodzić z mody. Jube nadaje się do ogólnego oświetlenia pomieszczeń, jak również do bardzo komfortowego oświetlenia stołu.  Projektanci Favaretto &amp; Partner z Padwy (Włochy) otrzymali nagrodę Archiproducts Design Award 2017 za serię opraw Jube.  - z dmuchanym w usta, wielowarstwowym szkłem','','lampa-wiszaca-jube-sp-1-p-ze-szkla','','','','Lampa wisząca Jube SP 1 P ze szkła','','','',''),(1421,1,1,'Szklana oprawa wisząca Clyde z estetycznie rowkowanym kloszem  Oprawa wisząca Clyde przyciąga wszystkie oczy atrakcyjnym, dmuchanym w usta kloszem o atrakcyjnej, rowkowanej strukturze nawet po wyłączeniu. Po włączeniu oferuje nieporównywalnie piękne oświetlenie otoczenia, które rozciąga się we wszystkich kierunkach i ozdobnie oświetla każde miejsce w pomieszczeniu.  Clyde może być używany na przykład do oświetlania stołów jadalnych lub jako źródło światła nad stołem bocznym w części siedzącej. Zaaranżowany indywidualnie lub w grupie, tworzy bardzo szczególną atmosferę dobrego samopoczucia ze światłem bogatym w refleksy.  - Ręcznie robione we Włoszech','','lampa-wiszaca-clyde-130-cm','','','','Lampa wisząca Clyde 130 cm','','','',''),(1422,1,1,'3-punktowa lampa wisząca nh S3 14 z elastycznym ustawieniem  Praca duetu projektantów Neri&amp;Hu opiera się na dynamice i badaniach. Podczas gdy te ostatnie są rozumiane jako narzędzie projektowe, realizacja elementów poznawczych odbywa się w dynamicznym współdziałaniu doświadczenia, detalu, materiału, formy i światła, co doskonale widać w 3-punktowej lampie wiszącej nh S3 14.  Dzięki trzem ruchomym aluminiowym ramionom, na których zawieszone są kule wykonane z satynowanego dmuchanego szkła, lampa wisząca pozwala na wysoki stopień indywidualnego dopasowania oświetlenia. nh S3 14 sprawia wrażenie nieskończonych krajobrazów oświetleniowych z zastosowaniem elementu przypominającego latarnię, którego pierwowzór można odnaleźć w tradycji orientalnej.  Włoska firma produkująca lampy Artemide, założona w 1960 roku przez Ernesto Gismondiego, znana jest ze swoich niepowtarzalnych lamp, które są produkowane przy użyciu sprawdzonych, nowoczesnych metod produkcji i materiałów wysokiej jakości. Nowoczesna technologia, dobre samopoczucie człowieka i świadomość ekologiczna to kolejne filary wizji Artemide. Pobierz:   Specyfikacja techniczna                    (121 KB)    Instrukcja obsługi                    (2.8 MB)    Instrukcja obsługi 2                    (2.8 MB)    Light distribution curve                    (100 KB)    Photometric Data IES                    (3 KB)    Photometric Data LDT                    (4 KB)    File Dialux                    (2.7 MB)','','artemide-nh-s3-14-lampa-wiszaca-3-punktowa','','','','Artemide nh S3 14 lampa wisząca, 3-punktowa','','','',''),(1423,1,1,'Lampa wisząca Boule design, minimalistyczna i nowoczesna  Niezależnie od tego, czy używane jako pojedyncze światło, czy w połączeniu z kilkoma z tych wyjątkowo pięknych wiszących świateł, Boule stawia światło dokładnie tam, gdzie jest potrzebne i otacza źródło światła estetycznym ciałem. Kulista i wypolerowana na wysoki połysk, elegancka oprawa oświetleniowa ze stali nierdzewnej inspiruje plecionym kablem przymocowanym do czaszy w kształcie lejka. Dzięki czterometrowej długości przewodu można go dowolnie skracać w trakcie instalacji i dostosowywać do okoliczności. Odcień jest otwarty tylko na dole i nie pozwala na ucieczkę światła dookoła - zamiast tego, powierzchnia odbija efekty w otoczeniu i odbija je. Wiązka światła jest skierowana bezpośrednio w dół i oświetla powierzchnie stołów i lady w pomieszczeniach prywatnych i publicznych.  - Nadaje się do żarówek GU10 o Ø 5 cm i długości','','innermost-boule-lampa-wiszaca-kulista','','','','Innermost Boule lampa wisząca, kulista','','','',''),(1424,1,1,'Klosz z plisowanego tworzywa sztucznego: oprawa wisząca LED Gè marki Kartell  Kształt klosza lampy wiszącej Gè jest bardzo klasyczny. Lekko stożkowaty, zwęża się ku górze. Jednak to, co czyni go tak nowoczesnym i innowacyjnym, to fakt, że wygląda jak klosz plisowany, ale nie jest wykonany z tkaniny, lecz w całości z tworzywa sztucznego. Dzięki przejrzystości i plisowanej strukturze uzyskuje się promienny blask światła, który zapewnia ogólne oświetlenie i przyjemną atmosferę w pomieszczeniu.  Do najbardziej znanych designerskich dzieł firmy Kartell z siedzibą w Mediolanie należą na przykład krzesło dziecięce K 1340 i wyciskarka do cytryn KS 1481. W dziedzinie oświetlenia jest to model 4006 autorstwa Achille i Piergiacomo Castiglioni z 1959 roku oraz seria Tic Tac, które służą jako okręt flagowy i mają wysoką wartość rozpoznawczą. Wiele z designerskich dzieł mediolańskiej firmy nie tylko otrzymało różne nagrody, ale mimo stosunkowo młodego wieku można je już podziwiać w muzeach i zaliczyć do współczesnej klasyki.','','kartel-ge-lampa-wiszaca-led-przezroczysta','','','','Kartel Gè - lampa wisząca LED, przezroczysta','','','',''),(1425,1,1,'Prosta i prosta lampa wisząca Jugen  Lampa wisząca Jugen firmy Miloox to bardzo wdzięczna lampa wisząca, której klosz wykonany jest z dmuchanego szkła mrożonego. Klosz przymocowany jest do mosiężnego uchwytu, który łączy się w cienki mosiężny pręt, a następnie w kabel lampy. Mosiężny pręt jest pomalowany na czarno od połowy długości kabla. Kabel zakończony jest daszkiem, który również wykonany jest z mosiądzu i który mocuje zgrabną lampę do sufitu. Ekonomiczne żarówki LED można włożyć do gniazda E27.','','lampa-wiszaca-jugen-1-punktowa','','','','Lampa wisząca Jugen 1-punktowa','','','',''),(1426,1,1,'Oprawa wisząca LED Niewidoczna z obrotową głowicą oprawy  Francesc Vilaró jest odpowiedzialny za niepowtarzalny wygląd oprawy wiszącej Invisible LED i jej zmienną funkcjonalność. Dzięki Invisible udało mu się stworzyć oprawę, która mimo lub nawet dzięki prostemu wzornictwu przyciąga wzrok i doskonale integruje się z wieloma nowoczesnymi wariantami mieszkalnymi.  Głowica oprawy może być obracana o 350°, dzięki czemu światło może być zawsze skierowane tam, gdzie jest potrzebne. Jasność może być kontrolowana przez zewnętrzny ściemniacz fazy krawędzi czołowej. Pobierz:   Instrukcja obsługi                    (1.4 MB)    Specyfikacja techniczna                    (216 KB)    Specyfikacja techniczna 2                    (216 KB)','','grok-invisible-lampa-wiszaca-led-00-5693-o-15cm','','','','Grok Invisible lampa wisząca LED 00-5693, Ø 15cm','','','',''),(1427,1,1,'Wisior Clava - Retro-Look w połączeniu ze skandynawską elegancją  Oprawa wisząca Clava wykonana z wysokiej jakości aluminium gwarantuje, że nie pozostanie niezauważona nawet po wyłączeniu. Jego błyszcząca powierzchnia ma szeroki wzór otworów biegnących dookoła, przez które lampa migocze delikatnie. Efekt świetlny jest bardzo nastrojowy i jednocześnie przytulny. Po włączeniu, do pomieszczenia wrzucany jest ekscytujący wzór, który jest wspierany przez bezpośrednią wiązkę światła w dół.  Źródło światła w stylu retro jest ponadczasowe i zawsze pozostanie nowoczesne. Dzięki swojemu dość delikatnemu, ale efektownemu wyglądowi, oprawa wisząca może być z łatwością zintegrowana z wieloma pomieszczeniami i, szczególnie w połączeniu z innymi oprawami Clava nad ladami lub aneksami kuchennymi, naprawdę robi wrażenie. Okrągłe, kuliste zawieszenie w kolorze czarnym tworzy dyskretne, proste wykończenie, które nie umniejsza piękna klosza.  Projektant Søren Ravn Christensen jest współzałożycielem duńskiej firmy oświetleniowej UMAGE. Swoją działalność rozpoczęli od produkcji ponadczasowych, wysokiej jakości lamp, które charakteryzują się estetyką, prostotą i funkcjonalnością. Zrównoważony rozwój i wyjątkowość są decydujące dla projektów.','','umage-clava-lampa-wiszaca-z-cannonball-czarna','','','','UMAGE Clava lampa wisząca z Cannonball czarna','','','',''),(1428,1,1,'Lampa wisząca LED Sakina o ciekawym kształcie w piaskowej czerni  Lampa wisząca LED Sakina jest modnym elementem wyposażenia i źródłem światła o praktycznych funkcjach. Korpus lampy jest wykonany z żelaza i aluminium i jest utrzymywany w kolorze czarnym piaskowym. Jego rzucający się w oczy kształt składa się z wydłużonej rozpórki, która krąży wokół siebie w sposób wymiatający. Wzdłuż tego pręta zamontowane są na stałe diody LED, które dzięki swojemu specjalnemu kształtowi generują ciepłe, białe światło, które jest atrakcyjnie rozmieszczone w pomieszczeniu. Za pomocą włącznika ściennego możliwe jest włączanie i wyłączanie światła jak zwykle. Dzięki 3-stopniowej technologii ściemniania ze zintegrowaną funkcją wyłączania, można ją również przyciemnić do trzech różnych poziomów jasności poprzez wielokrotne naciskanie przełącznika: 100 %, 40 % i 10 %. Nowoczesny i nieco zabawny wygląd oprawy wiszącej Sakina LED można łatwo zintegrować z szeroką gamą stylów aranżacji wnętrz. Stawia atrakcyjne akcenty na sufitach mieszkań i przekształca każde pomieszczenie w coś bardzo wyjątkowego.','','lucande-sakina-lampa-wiszaca-led-czarna-o-58cm','','','','Lucande Sakina lampa wisząca LED czarna Ø 58cm','','','',''),(1429,1,1,'','','lampa-wiszaca-orbit-czarna','','','','Lampa wisząca Orbit, czarna','','','',''),(1430,1,1,'Niezwykła metalowa lampa wisząca LED Gravity 1  Niezrównany design spotyka się z bardzo szczególnym efektem świetlnym. To dzieło sztuki, uformowane z wielu drobnych metalowych listew, łączy w sobie różne kształty i łączy je w niezwykłą koncepcję oświetleniową. Gravity 1 to oprawa wisząca, która ma w sobie to coś i zajmuje centralne miejsce w każdym pomieszczeniu, nawet gdy jest wyłączona.  Jego klosz tworzy w sumie pięć dużych elementów - wygięta w dół misa, która dzięki rozpórkom ma wiele szczelin, jest specjalnie oświetlona od góry cylindrycznym, wąskim korpusem, w który włożona jest lampa GU10. Dalej w dół, w różnych rozmiarach i szerokościach, idą kolejne wygięte w górę klosze z metalowych listew. W środku - podobnie jak w przypadku grzybka - znajduje się nieprzezroczysty, metalowy korpus, w którego głowie umieszczony jest moduł LED, rozsiewający ciepłe, białe światło po całym pomieszczeniu. Jako zakończenie w dół następuje kolejny cylindryczny korpus, w którym umieszczona jest lampa GU10, zapewniająca punktualne, bezpośrednie oświetlenie.  Projektantka tej lampy - Kateryna Sokolova - w pełni stosuje się do swojej zasady: \"Aby powstał dobry projekt, trzeba zmieszać trzy składniki: Prostota, funkcjonalność i pasja.\" Uważa się za szefa kuchni i zawsze tworzy charakterystyczne produkty na nowe sposoby dla francuskiego producenta designerskiego oświetlenia Forestier. Forestier wyznaje trzy podstawowe wartości: pasję, wolność i odkrywanie, dzięki którym powstaje doskonała równowaga między wzornictwem a rzemiosłem.','','forestier-gravity-1-lampa-wiszaca-o86cm','','','','Forestier Gravity 1 lampa wisząca Ø86cm','','','',''),(1431,1,1,'Trzylampowa oprawa wisząca Zostań w stylu skandynawskim  Lampa wisząca wykonana z aluminium została zaprojektowana przez Marię Berntsen i wnosi duński styl do pomieszczeń mieszkalnych i jadalni. Trzy klosze w kształcie stożka są otwarte u góry i u dołu i zapewniają oświetlenie dużej powierzchni, które promieniuje również w górę. Trio jest połączone z okrągłą czaszą sufitową za pomocą tekstylnego kabla. Trzy oprawy oświetleniowe mieszczą odpowiednie lampy, które można zamówić bezpośrednio z akcesoriów. Skandynawski wygląd jest generowany przez jednobarwną i matową powierzchnię oprawy i doskonale pasuje do wielu wnętrz.','','lampa-wiszaca-stay-3-punktowa-ukosne-klosze','','','','Lampa wisząca Stay, 3-punktowa, ukośne klosze','','','',''),(1432,1,1,'Czarna lampa wisząca Baliko o podłużnym kształcie - idealna do oświetlenia jadalni  Lampa wisząca Baliko zachwyca nowoczesnym wyglądem. Wykonany jest w całości ze stali i posiada efektowne wykończenie w kolorze czarnym. Pięć punktów świetlnych jest umieszczonych w rzędzie wzdłuż stalowego pręta i zapewnia doskonałe oświetlenie stołu w jadalni.  Projekt jest zredukowany do szczegółów i skupia się na tym, co najważniejsze. Światło emitowane jest bezpośrednio w dół, dzięki czemu nie ma ryzyka oślepienia podczas jedzenia lub siedzenia razem. Możliwe jest również zastosowanie nad licznikiem. Pobierz:   Instrukcja obsługi                    (571 KB)','','lindby-baliko-lampa-wiszaca-5-pkt-czarna','','','','Lindby Baliko lampa wisząca, 5-pkt., czarna','','','',''),(1433,1,1,'Lampa wisząca Amsfield z owalnym bambusowym kloszem  Lampa wisząca Amsfield wnosi naturalny urok do każdego pomieszczenia, w którym zostanie zainstalowana celem oświetlenia stołu. Owalny kształt klosza lampy składa się z bambusowych rozpórek i plecionego pierścienia bambusowego w środku wokół klosza. Dzięki otwartej konstrukcji większość światła jest emitowana bezpośrednio do otoczenia, a rozpórki klosza tworzą cienie w pomieszczeniu. Ponieważ żarówka jest widoczna w kloszu, należy zastosować wariant dekoracyjny. Wyboru odpowiednich żarówek można dokonać w polu „Wybierz żarówkę”, dzięki czemu będzie można od razu je zamówić.','','lampa-wiszaca-amsfield-z-bambusa-owalny-ksztalt','','','','Lampa wisząca Amsfield z bambusa, owalny kształt','','','',''),(1434,1,1,'Valeria – wykonana ze szkła lampa wisząca, pozwalająca uzyskać przytulne oświetlenie  Klosz lampy wiszącej Valeria wykonano ze szkła, które równomiernie rozdziela i zmiękcza emitowane światło. W ten sposób powstaje przytulny, przyjemny efekt świetlny, odpowiedni do spożycia posiłku czy wspólnego spędzania czasu w kuchni. Także wizualnie lampa Otis bez problemu wpasuje się w wystrój wnętrza. Jeśli chodzi o źródła światła, w tym modelu można stosować dobre, stare żarówki lub lampy halogenowe, ale też dużo efektywniej wykorzystujące prąd lampy LED, które teraz dostępne są w takim wyborze, że nie muszą ustępować wyglądem lampom żarowym.  Pobierz:   Instrukcja obsługi                    (292 KB)','','okragla-szklana-lampa-wiszaca-valeria-do-kuchni','','','','Okrągła, szklana lampa wisząca Valeria do kuchni','','','',''),(1435,1,1,'1-punktowa lampa wisząca LED Hayley z elementami chromowanymi i kulą ze szkła bąbelkowego  Kompaktowa lampa wisząca Hayley utrzymana jest w bardzo nowoczesnym stylu, który doskonale pasuje do wielu obiektów mieszkalnych z nowoczesnym wyposażeniem. Klosz jest kulisty i wykonany głównie ze szkła o niezwykłej strukturze bąbelkowej. Tylko w dolnej części uzupełnia go metalowy element, który, podobnie jak mocowanie sufitowe, jest chromowany na wysoki połysk. Emitowane światło jest zarówno pośrednie, jak i bezpośrednie. W miejscach, gdzie światło wychodzi bezpośrednio, znajduje się biała osłona, co zapewnia miękki rozkład światła o bardzo przytulnym charakterze. Diody LED lampy wiszącej mają dobrą wydajność i zużywają mało energii elektrycznej pomimo odpowiedniej jasności.    Pobierz:   Instrukcja obsługi                    (409 KB)','','lampa-wiszaca-led-hayley-szklana-kula-1-pkt-chrom','','','','Lampa wisząca LED Hayley szklana kula 1-pkt. chrom','','','',''),(1436,1,1,'Lampa wisząca LED Ezana, biała  Ta lampa wisząca LED Ezana staje się hitem w każdym wnętrzu, gdzie dominują proste kształty. Łączy w sobie wyjątkowy design z ciepłym, ściemnianym nastrojowym światłem.   Zawieszenie lampy wiszącej ma w całości kolor biały i łączy w sobie elementy metalowe i plastikowe, tworząc harmonijną całość. Dzięki temu lampa elegancko komponuje się z nowoczesnymi stylami wystroju wnętrz. Trzy pierścienie świetlne są przymocowane do rozpórek lampy i pasują do siebie niczym pierścienie w układzie planetarnym. Zapewniają one dyskretną grę światła i cienia. Światło natomiast można przyciemniać trójstopniowo za pomocą przełącznika ściennego, korzystając z funkcji ściemniania. Pobierz:   Instrukcja obsługi                    (259 KB)','','lampa-wiszaca-led-ezana-trzy-pierscienie-biala','','','','Lampa wisząca LED Ezana, trzy pierścienie, biała','','','',''),(1437,1,1,'Okazała lampa wisząca Dolores z białego szkła  Lampa wisząca Dolores jest niezwykłym elementem oświetleniowym. Ma ona całkowicie biały szklany klosz i kontrastuje kolorystycznie z satynowanym, niklowanym elementem stanowiącym lamówkę, przechodzącą w przezroczysty przewód. Opalowy matowy klosz wykonany z wysokiej jakości szkła zapewnia, że światło w przeważającej części jest emitowane na obszar znajdujący się pod lampą, dzięki czemu stół w jadalni lub lada stają się idealnym miejscem do zastosowania tej właśnie lampy. Jasna kolorystyka światła stanowi nowoczesny i przyjazny dla oka akcent w salonie. Zastosowanie lampy Dolores sprawia, że salon wygląda ona znacznie bardziej przytulnie, ponieważ jej duży, jasny kontur dopełnia gustownie urządzone wnętrze.  Pobierz:   Instrukcja obsługi                    (206 KB)','','biala-lampa-wiszaca-dolores-ze-szkla','','','','Biała lampa wisząca Dolores ze szkła','','','',''),(1438,1,1,'Czarno-złota lampa wisząca belka z tkaniny Vasilia.  W tej lampie wiszącej belce Vasilia lekkość i siła, jaką ma w sobie stal, idą ramię w ramię, ponieważ dzięki czterem ustawionym w rzędzie oprawom szczególnie pięknie oświetla ona stół lub korytarz, a także wspaniale wygląda w salonie.  Lampa zawieszona jest pod sufitem za pomocą dwóch cienkich kabli, dzięki czemu, mając środek o barwie złota, sprawia wrażenie szlachetnej i filigranowej, przez co imponująco dopełnia atmosferę w domu. Prosta obudowa w kolorze czarnym znacząco przyczynia się do stylowego wyglądu tej lampy wiszącej. Pobierz:   Instrukcja obsługi                    (319 KB)','','lampa-wiszaca-belka-vasilia-tkanina-czarno-zlota','','','','Lampa wisząca belka Vasilia, tkanina, czarno-złota','','','',''),(1439,1,1,'','','lampa-wiszaca-led-salinas-z-funkcja-switch-dim','','','','Lampa wisząca LED Salinas z funkcją Switch-Dim','','','',''),(1440,1,1,'Elegancka lampa wisząca Fabronia z asymetrycznym kloszem kratkowym i opalowo białą szklaną kulą  Fabronia jest naprawdę miłym elementem przyciągającym wzrok, który robi prawdziwe wrażenie w nowoczesnych obiektach. Ściśle mówiąc, lampa wisząca składa się z dwóch kloszy, nie tylko z jednego. Element zewnętrzny tworzy kratka w okrągłej, asymetrycznej formie z wąskimi rozpórkami o czarnym wykończeniu, podczas gdy kula z białego szkła znajduje się bezpośrednio nad żarówką, co nie tylko sprawia, że światło wydaje się szczególnie przytulne i miękkie, ale również stanowi część ogólnego efektu. Lampa wisząca nadaje się do wielu celów i może być również używana jako oświetlenie stołu w salonie.  Pobierz:   Instrukcja obsługi                    (449 KB)','','lindby-fabronia-lampa-wiszaca-kratka-szklana-kula','','','','Lindby Fabronia lampa wisząca kratka, szklana kula','','','',''),(1441,1,1,'Pięciolampowa oprawa wisząca Baliko z cylindrycznymi kloszami w kolorze mosiądzu  Ta oprawa wisząca jest stworzona do zastosowania nad stołem jadalnym lub ladą. Dzięki wydłużonemu kształtowi powierzchnia stołu może być zawsze dobrze oświetlona. Projekt jest prosty, zredukowany w szczegółach i nowoczesny, a jednak emanuje czymś wyjątkowym. Jest to przede wszystkim zasługa pięciu kloszy, które mają cylindryczny kształt i matową powierzchnię w atrakcyjnym odcieniu mosiądzu. Kontrast kolorystyczny w połączeniu z czarnym paskiem jest harmonijny, ale i skuteczny, dzięki czemu w jadalni powstało szczególnie stylowe źródło światła, które może się pochwalić elegancką charyzmą. Pobierz:   Instrukcja obsługi                    (392 KB)','','lindby-baliko-lampa-wiszaca-5-pkt-mosiezna','','','','Lindby Baliko lampa wisząca, 5-pkt., mosiężna','','','',''),(1442,1,1,'5-punktowa lampa wisząca LED Hayley ze szklanymi kulami i elementami w kolorze złotym  Hayley w wersji 5-punktowej bardzo dobrze pasuje do długiego stołu w jadalni gdzie zapewnia efektowne światło. Klosze są kompaktowe i mają kształt kul, z których większość wykonana jest z przezroczystego szkła o strukturze bąbelkowej. To nie tylko bardzo ładnie wygląda, ale także tworzy lśniący efekt świetlny. W dolnej części znajdują się złote elementy metalowe, które mogą być traktowane jako szczególna dekoracja i które indywidualizują wygląd i nadają lampie szlachetny efekt. Światło wydostaje się w górę i w dół, otwory u dołu są wyposażone w białe szkło, dzięki czemu światło może wydostawać się w sposób bardziej miękki i równomierny, bez oślepiania.  Pobierz:   Instrukcja obsługi                    (398 KB)','','lampa-wiszaca-led-hayley-5-pkt-podluzna-zlota','','','','Lampa wisząca LED Hayley 5-pkt. podłużna, złota','','','',''),(1443,1,1,'Najwyższa estetyka dzięki lampie wiszącej Gerwina, z zewnątrz białej, wewnątrz złotej  Ta lampa wisząca ma metalowy klosz i jest otwarta tylko od spodu. Dzięki temu Gerwina doskonale nadaje się do oświetlenia stołu, tworząc przytulny efekt. Komfort ten jest wielokrotnie potęgowany przez złocone wnętrze klosza, ponieważ matowe złoto odbija światło o ciepłej temperaturze. Aby podkreślić harmonijny styl, który również dobrze koresponduje z wnętrzami skandynawskimi, warto wybrać źródła światła nawiązujące wyglądem do tradycyjnych żarówek. Należą do nich przede wszystkim żarówki rustykalne z technologią filamentową. Są one teraz dostępne również w bardzo ciepłych, jasnych barwach, dzięki czemu przytulność nie zna granic i zapewnia doskonałe samopoczucie, zachęcając do odpoczynku przy stole lub na kanapie. Wspaniałe uzupełnienie pięknych wnętrz! Pobierz:   Instrukcja obsługi                    (259 KB)','','metalowa-lampa-wiszaca-gerwina-bialo-zlota','','','','Metalowa lampa wisząca Gerwina, biało-złota','','','',''),(1444,1,1,'','','lampa-wiszaca-cubus-6-pkt-miodowa-brazowa','','','','Lampa wisząca Cubus, 6-pkt., miodowa/brązowa','','','',''),(1445,1,1,'','','lampa-wiszaca-noak-3-pkt-liniowa-biala-drewno','','','','Lampa wisząca Noak 3-pkt. liniowa biała/drewno','','','',''),(1446,1,1,'5-punktowa lampa wisząca LED Arina o metalowych kloszach w kształcie stożka, w kolorze czarnym Ta lampa wisząca LED to bardzo dobra lampa do jadalni, która charakteryzuje się stylową elegancją i może być łączona z elementami stylu skandynawskiego. Górna część kloszy wykończona jest drewnianym detalem, który emanuje naturalnością i zapewnia piękny kontrast z chłodem czarnej metalowej powierzchni. Żarówki LED, znajdujące w tej lampie wiszącej, mają cokół E14 i dobrą wydajność energetyczną, jakiej oczekują nowocześnie myślący konsumenci. Pobierz:   Instrukcja obsługi                    (322 KB)','','lampa-wiszaca-led-arina-z-5-czarnymi-kloszami','','','','Lampa wisząca LED Arina z 5 czarnymi kloszami','','','',''),(1447,1,1,'Metalowa lampa wisząca Jasminka, z wnętrzem w kolorze złotym, idealna do oświetlania stołu i lady  Jasminka to metalowa lampa wisząca w stylu industrialnym, wyróżniająca się swym pięknym wyglądem. Metalowa powierzchnia zewnętrznej części lampy jest czarna, a wnętrze klosza ma atrakcyjny złoty odcień, który nie tylko tworzy piękny kontrast kolorystyczny, ale także sprawia, że światło emanuje niezwykłym ciepłem i daje wrażenie przytulności.   Jasminkę jako lampę wiszącą można z powodzeniem umieścić nad stołem, który wówczas będzie przytulnie oświetlony, lub tez wykorzystać ją jako element zapewniający alternatywne oświetlenie blatu. Do tego typu zastosowań zaleca się montowanie kilku lamp w rzędzie, co pozwala nie tylko uzyskać bardziej efektowny wygląd, ale również zapewnić oświetlenie większej powierzchni.  Pobierz:   Instrukcja obsługi                    (273 KB)','','czarna-lampa-wiszaca-jasminka-styl-industrialny','','','','Czarna lampa wisząca Jasminka, styl industrialny','','','',''),(1448,1,1,'Biała, szklana lampa wisząca Vinsta  Klosz tej lampy wiszącej, wykonany z opalowobiałego szkła, ma nowoczesny, cylindryczny kształt – prosty, lecz efektowny, dzięki czemu ten wszechstronny model będzie pasować do wielu wystrojów wnętrz. Lampa emituje przyjemne, równomiernie rozdzielane światło, które rozjaśni dowolne pomieszczenie, w jakim zostanie zawieszona. Montując jednocześnie kilka egzemplarzy lampy można uzyskać jeszcze jaśniejsze, piękne, stylowe oświetlenie, na przykład nad ladą barową.  Pobierz:   Instrukcja obsługi                    (274 KB)','','prosta-waska-lampa-wiszaca-vinsta','','','','Prosta, wąska lampa wisząca Vinsta','','','',''),(1449,1,1,'Okrągła lampa wisząca Ritana z pięknym aluminiowym kloszem w kolorze czarnym i złotym  Ritana doskonale wpisuje się w stylowe wnętrza o nowoczesnym charakterze, nawiązujące do aranżacji skandynawskich. Klosz, bardzo wąski u góry, rozszerza się ku dołowi i na końcu ma otwór. W ten sposób światło może być emitowane tylko do dołu, ponieważ aluminium jest materiałem nieprzepuszczającym światła. Zmniejsza to odblaski, ale jednocześnie pozwala na skoncentrowanie światła na powierzchni stołu i zapewnienie mu jasnego oświetlenia. Kontrast między czarną stroną zewnętrzną a złotym wykończeniem wnętrza nie tylko modnie wygląda, ale również zapewnia bardzo przytulny efekt świetlny z cudownie ciepłym blaskiem. Nie potrzebna jest już kolacja przy świecach, ponieważ nastrojowe światło lampy wiszącej Ritana wystarczy do stworzenia romantycznego klimatu.  Pobierz:   Instrukcja obsługi                    (462 KB)','','lampa-wiszaca-ritana-czarno-zlota','','','','Lampa wisząca Ritana, czarno-złota','','','',''),(1450,1,1,'Lampa wisząca LED Ezana, biała  Lampa wisząca LED Ezana ma wyrafinowaną konstrukcję składającą się z trzech koncentrycznych pierścieni o futurystycznym i jednocześnie szlachetnym designie. Dyskretny kolor niklowania pozwala na połączenie go z wieloma stylami wyposażenia wnętrz.  Zawieszenie składa się z dziewięciu żyłek, które ustawiają pierścienie pod różnymi kątami. Dzięki taśmom LED, umieszczonym po bokach pierścieni, światło świeci na zewnątrz i do wewnątrz. Dzięki funkcji ściemniania jasność można dowolnie zmieniać. Tym samym lampa wisząca oświetla pomieszczenie w sposób bardzo nastrojowy. Pobierz:   Instrukcja obsługi                    (303 KB)','','lampa-wiszaca-led-ezana-trzy-pierscienie-nikiel','','','','Lampa wisząca LED Ezana, trzy pierścienie, nikiel','','','',''),(1451,1,1,'5-punktowa lampa wisząca LED z pięknie wyprofilowanymi kulami szklanymi i chromowanymi detalami  Szkło pięciu kul nie jest przezroczyste, ale ma w swojej strukturze dekoracyjne pęcherzyki, które nie tylko wyglądają ekstrawagancko, ale także przyczyniają się do efektownego oświetlenia. Na spodzie szklanych kul znajduje się również element ozdobny z błyszczącego chromu, który stylowo dopełnia całość wzornictwa. Światło wydostaje się bezpośrednio i pośrednio, jest miękkie i jednorodne od spodu dzięki białemu elementowi szklanemu, w związku z czym nie powoduje odblasków. Dzięki swojej konstrukcji lampa wisząca z wydajnymi diodami LED doskonale nadaje się do oświetlenia stołu w przestrzeni mieszkalnej.  Pobierz:   Instrukcja obsługi                    (609 KB)','','lampa-wiszaca-led-hayley-5-pkt-okragla-chrom','','','','Lampa wisząca LED Hayley 5-pkt. okrągła chrom','','','',''),(1452,1,1,'Błyszcząca lampa wisząca LED Hayley do jadalni, szklane kule uszlachetnione chromowanymi detalami  Hayley to atrakcyjna Lampa wisząca LED z pięcioma kloszami z dmuchanego szkła, którą można łatwo zamontować nad stołem w jadalni. Podłużny kształt i pięć kloszy gwarantują wielkopowierzchniowe oświetlenie powierzchni stołu. Światło może być emitowane zarówno w górę, jak i w dół. Aby światło nie oślepiało świecąc w dół, w tym miejscu znajduje się biała szklana osłona. Ponadto klosze są wyposażone w dekoracyjne chromowane osłony, dzięki którym światło pięknie błyszczy i wygląda przez to szczególnie efektownie. Pobierz:   Instrukcja obsługi                    (394 KB)','','lampa-wiszaca-led-hayley-5-pkt-podluzna-chrom','','','','Lampa wisząca LED Hayley, 5-pkt., podłużna, chrom','','','',''),(1453,1,1,'Lampa wisząca Tirane z kloszami z kolorowego szkła  Różne kolory lampy wiszącej Tirane uzupełniają się wzajemnie, tworząc udaną całościową koncepcję. Klosze są już przekonujące, gdy patrzy się na nie oddzielnie. Ale razem rozwijają swój pełny splendor, a szczególnie wyróżnia się żółty klosz. Wygląda na jasny i przyjazny, dzięki czemu w każdym nowoczesnym salonie można położyć szczególny akcent. Pozostałe trzy klosze, z ich stonowaną, ciemną barwą, stanowią wizualną przeciwwagę dla lśniącej żółci. Kolory doskonale harmonizują.  Pobierz:   Instrukcja obsługi                    (953 KB)','','lindby-tirane-lampa-wiszaca-kolorowe-klosze','','','','Lindby Tirane lampa wisząca, kolorowe klosze','','','',''),(1454,1,1,'Czarno-złota lampa wisząca Cosmina w wersji 3-punktowej - idealna do oświetlenia stołów w jadalni i lad  Cosmina to bardzo atrakcyjna lampa wisząca z trzema nowocześnie wyglądającymi metalowymi kloszami, które mają na górze wąski, cylindryczny element, który u dołu przechodzi w lekko pękaty klosz. Na zewnątrz klosze i podstawa są utrzymane w kolorze matowej czerni, wewnątrz wykończenie złotą folią tworzy specjalne akcenty i wspaniały efekt świetlny, który jest bardzo przytulny i dlatego doskonale nadaje się do oświetlania obszaru spożywania posiłków. Ta lampa wisząca idealnie nadaje się również do stosowania nad stołem, dzięki wydłużonemu kształtowi i trzypunktowej konstrukcji, która zapewnia dobre, równomierne oświetlenie.  Pobierz:   Instrukcja obsługi                    (477 KB)','','arcchio-cosmina-lampa-wiszaca-3-pkt-dluga-czarna','','','','Arcchio Cosmina lampa wisząca 3-pkt. długa czarna','','','',''),(1455,1,1,'Lampa wisząca Sofian z trzema okrągłymi szklanymi kloszami – idealna do jadalni  Sofian to lampa bardzo atrakcyjna wizualnie, nosząca znamiona ponadczasowości. Lampa wisząca składa się z trzech białych kloszy w kształcie kul, które są wykonane ze szkła. Dzięki temu mamy pewność, że otrzymamy miękkie, równomierne światło, które dobrze uzupełnia atmosferę przytulności i jest zawsze mile widziane, szczególnie w jadalni. Ta lampa wisząca Sofian o z racji swej 3-punktowej konstrukcji zapewnia równomierne rozchodzenie się światła i miłe dla oka doświetlenie całej powierzchni stołu. Kombinacja białego szkła i elementów metalowych o barwie satynowanego niklu pasuje do wielu przestrzeni mieszkalnych. Pobierz:   Instrukcja obsługi                    (264 KB)','','szklana-lampa-wiszaca-sofian-3-punktowa','','','','Szklana lampa wisząca Sofian, 3-punktowa','','','',''),(1456,1,1,'3-punktowa lampa wisząca Marla ze szklanymi kloszami  Trzy szklane klosze lampy wiszącej Marla są utrzymane w pięknym kolorze szarego dymu i mają różne kształty. Podłużny, pękaty lub raczej okrągły, każdy szklany klosz ma swój własny urok. Wspaniałe wzornictwo lampy wiszącej podkreśli zastosowanie dekoracyjnych żarówek filamentowych lub żarówek modernizowanych, które pięknie podkreślają raczej nostalgiczny charakter lampy Marla. Idealna do stosowania w jadalni lub salonie, gdzie lampa wisząca Marla wspaniale się sprawdzi jako oświetlenie stołu. Pobierz:   Instrukcja obsługi                    (390 KB)','','lindby-marla-lampa-wiszaca','','','','Lindby Marla lampa wisząca','','','',''),(1457,1,1,'Innowacyjna lampa wisząca Chloe o nowoczesnej warstwowej stylistyce  Artystyczna lampa wisząca Chloe łączy w sobie dwa aksamitne klosze o nowoczesnym, warstwowym wyglądzie, przez co stanowi prawdziwy hit designerski. Złoty kolor wnętrz dwóch kloszy dodaje purystycznej lampie wiszącej niezwykłego eleganckiego blasku. Ten luksusowy element na suficie urzeka nie tylko asymetrycznym, warstwowym wyglądem, ale także przezroczystym zawieszeniem kablowym. Tak czy inaczej, kształt lampy powinien wysuwać się na pierwszy plan obok metalowych akcentów, olśniewających złotą barwą, podczas gdy prowadnica kablowa odgrywa bardziej dyskretną rolę statysty.','','dwukolorowa-lampa-wiszaca-chloe-jak-warstwowa','','','','Dwukolorowa lampa wisząca Chloe, jak warstwowa','','','',''),(1458,1,1,'','','lampa-wiszaca-noak-1-pkt-biala-drewno-naturalne','','','','Lampa wisząca Noak 1-pkt. biała/drewno naturalne','','','',''),(1459,1,1,'Lampa wisząca Siw zachwyca fascynującym designem  Klosz lampy wiszącej Siw, który dzięki przemyślanej konstrukcji nadaje jej niemal egzotycznego wyglądu, składa się z niezliczonych białych elementów z tworzywa sztucznego, które razem tworzą źródło światła. Dzięki temu nawet bez oświetlenia Siw wygląda jak dzieło sztuki, które nadaje wysoką wartość dekoracyjną każdemu pomieszczeniu. Światło znajduje drogę na zewnątrz, przenikając przez elementy z tworzywa sztucznego.','','fascynujaca-lampa-wiszaca-siw','','','','Fascynująca lampa wisząca Siw','','','',''),(1460,1,1,'','','lampa-wiszaca-gama-3-3-punktowa-czarna','','','','Lampa wisząca Gama 3, 3-punktowa, czarna','','','',''),(1461,1,1,'Ekscytująca lampa wisząca LED Loki z czterema elementami oświetleniowymi  Czarna lampa wisząca LED Loki inspiruje swoim nowoczesnym i niezwykłym wzornictwem. Dzięki zastosowanym materiałom wysokiej jakości i energooszczędnym diodom LED obiecuje on długą żywotność. Zwłaszcza nad stołem w jadalni stworzy świetny wygląd i przytulną atmosferę.  Diody LED są zainstalowane jako pasma świetlne w czterech zakrzywionych elementach, które wiją się wokół poziomego, sztywnego pręta. Pozwala to na przenikanie światła we wszystkich kierunkach i delikatnie oświetla pomieszczenie. Ponadto lampa wisząca jest wyposażona w technologię Simply Dim. Ta funkcja ściemniania umożliwia ciągłą regulację jasności lampy za pomocą istniejącego przełącznika światła, czy to przełącznika przełączanego, ciągniętego, przewodowego czy ściennego. Funkcja pamięci zapisuje ostatnie ustawienie jasności do następnego włączenia lampy.','','lampa-wiszaca-led-curls-czarna-sciemniana','','','','Lampa wisząca LED Curls, czarna, ściemniana','','','',''),(1462,1,1,'Czarna lampa wisząca Joffrey z czterema kloszami  Dzięki swojemu minimalistycznemu wyglądowi lampa wisząca Joffrey szczególnie dobrze komponuje się z nowocześnie urządzonym mieszkaniem. Cztery klosze są podłużne i mają atrakcyjny kształt cylindra. Czarny kolor i wzornictwo sprawiają, że Joffrey jest elegancką lampą, która stylowo tworzy scenerię na przykład długiego stołu w jadalni lub jednostki kuchennej. Pobierz:   Instrukcja obsługi                    (396 KB)','','lindby-joffrey-lampa-wiszaca-4-punktowa-czarna','','','','Lindby Joffrey lampa wisząca, 4-punktowa, czarna','','','',''),(1463,1,1,'Oprawa wisząca LED Artist - przyjemne oświetlenie stołu w płaskim wzornictwie  Jednopłomienna lampa wisząca Artist przekonuje nowoczesnym, przejrzystym designem płaskiego, okrągłego klosza. Jego czarna metalowa obudowa posiada od spodu opalową osłonę z tworzywa sztucznego, która rozprasza ciepłobiałe światło zintegrowanych diod LED i zapewnia w ten sposób szerokie i przyjemne oświetlenie obszaru pod lampą. Na przykład do indywidualnego oświetlenia stołu w jadalni, ale także nad stołem w restauracji lub w grupie wzdłuż lady, lampa wisząca LED Artist może być idealnie wykorzystana.  - ściemniane zewnętrznie przez sekcję fazową','','lampa-wiszaca-led-artist-o-40-cm-czarna','','','','Lampa wisząca LED Artist, Ø 40 cm, czarna','','','',''),(1464,1,1,'3-punktowa lampa wisząca Jusra – idealna jako oświetlenie stołu  Jusra ma trzy klosze w kształcie klatki, składające się z metalowych lamelek, delikatnie wytłumiających światło i dających niezwykły efekt migotania. Jako że ta lampa wisząca jest 3-punktowa, można nią wspaniale oświetlić szczególnie powierzchnię stołu. Cała lampa wygląda szczególnie stylowo, gdy użytkownik sięgnie po żarówki filamentowe. Wyglądają one jak klasyczne żarówki żarnikowe, ale dzięki technologii LED zużywają mniej prądu.  Pobierz:   Instrukcja obsługi                    (508 KB)','','lampa-wiszaca-jusra-z-czarnego-metalu-3-pkt','','','','Lampa wisząca Jusra z czarnego metalu, 3-pkt.','','','',''),(1465,1,1,'Okrągła lampa wisząca Sayra z przytulnym efektem świetlnym i powierzchnią w kolorze czarno-złotym  Sayra jest bardzo stylowym elementem oświetleniowym, który doskonale sprawdza się w nowoczesnych wnętrzach. Klosz składa się z większej i mniejszej okrągłej kopuły, która zakrywa klosz od dołu i w ten sposób zapewnia nieco bardziej pośrednią emisję światła, choć część światła może również wydostawać się w dół. Na zewnątrz klosz jest czarny, a wnętrze pokryte jest złotą folią, dzięki czemu powstają cudownie ciepłe odbicia światła, które są niczym stworzone dla przytulnej atmosfery.  Pobierz:   Instrukcja obsługi                    (331 KB)','','lindby-sayra-metalowa-lampa-wiszaca-czarno-zlota','','','','Lindby Sayra metalowa lampa wisząca czarno-złota','','','',''),(1466,1,1,'Betonowa lampa wisząca LENNA o szarej powierzchni  Osoby, które pragną zastosować we wnętrzu oświetlenie z niestandardowych materiałów, powinny zdecydować się na oprawy z betonu, gdyż zapewnia on niecodzienny wystrój pomieszczenia. Lampa wisząca LENNA jest wykonana właśnie z betonu i posiada szary klosz o zaokrąglonej, zwężanej ku górze formie. Wewnątrz znajduje się oprawka E14, która pozwala na wybór wielu rodzajów żarówek. Nie muszą to być koniecznie klasyczne żarówki. Z powodzeniem zastąpią je żarówki LED z odpowiednim trzonkiem, które oprócz tego, że atrakcyjnie wyglądają, zużywają mało prądu. Pobierz:   Instrukcja obsługi                    (305 KB)','','betonowa-lampa-wiszaca-lenna-szara','','','','Betonowa lampa wisząca LENNA, szara','','','',''),(1467,1,1,'Oprawa wisząca na kółku w kolorze złotym  Minimalistycznie zaprojektowana oprawa wisząca Circle LED urzeka złotym akcentem czaszy i wieńca świetlnego. Dzięki swojemu nowoczesnemu, a zarazem prostemu wzornictwu przyciąga wzrok nad stołem w salonie lub w jadalni.   Wąski, okrągły łuk podtrzymywany jest przez trzy cienkie przewody i nadaje instalacji lekki i pływający wygląd. Nawet po wyłączeniu, lampa ta oferuje dekoracyjną wartość dodaną w salonie. Dzięki technologii LED nie tylko wygląda stylowo, ale także zachwyca wysoką klasą efektywności energetycznej i długą żywotnością.','','lampa-wiszaca-led-circle-zlota-o-39-cm','','','','Lampa wisząca LED Circle, złota, Ø 39 cm','','','',''),(1468,1,1,'','','lampa-wiszaca-sopel-laser-3-pkt-zlota','','','','Lampa wisząca Sopel Laser, 3-pkt., złota','','','',''),(1469,1,1,'Ponadczasowo piękna lampa wisząca SEBATIN z cylindrycznym abażurem z materiału  Abażur tej lampy wiszącej jest wykonany z cienkiej tkaniny i od spodu przykryty jest białym dyfuzorem również pokrytym materiałem. Nie trzeba wcale wielkiej wyobraźni, by się domyślić, że lampa ta od razu zapewnia niezwykle przytulne światło. Ponadto lampa odznacza się stonowanym designem bez zbędnych ozdób, dlatego doskonale wpasuje się w purystyczny wystrój wnętrz, urządzonych zgodnie z maksymą „mniej znaczy więcej”. Oczywiście świetnie odnajdzie się również w klasycznych aranżacjach, ponieważ cechą charakterystyczną dla wszystkich lamp o prostym designie jest ich uniwersalność.   Dzięki trzem oprawkom E27 na żarówki lampa SEBATIN jest w stanie zapewnić dużo światła, dlatego doskonale nadaje się do powieszenia nad stołem lub innych miejscach, które wymagają silnego oświetlenia. Dostawa obejmuje żarówki LED E27, które odznaczają się wysoką energooszczędnością.   Cechy dołączonych do zestawu żarówek:  - bardzo wydajna technologia LED, oszczędności energii do 85% (EKK A+)  - niezwykle długi okres użytkowania do 30 000 godzin  - niewielkie promieniowanie UV i cieplne  - minimalny czas zapłonu (natychmiast 100% światła)  - wyprodukowano bez rtęci  - bez możliwości ściemniania  - współczynnik wydajności &gt; 0,5 Pobierz:   Instrukcja obsługi                    (298 KB)','','kremowa-lampa-wiszaca-led-sebatin-z-materialu','','','','Kremowa lampa wisząca LED SEBATIN z materiału','','','',''),(1470,1,1,'Lampa wisząca Joffrey nadaje elegancki wygląd  Lampa wisząca Joffrey ma cztery klosze, które dzięki swojemu smukłemu cylindrycznemu kształtowi wydają się eleganckie i jednocześnie nowoczesne. Klosze wykonane są z metalu, który ze względu na swoją nieprzezroczystość zapewnia ukierunkowane oświetlenie, co jest szczególnie przydatne do oświetlania stołu jadalnego lub lady. Dzięki swojemu liniowemu wzornictwu i niklowanemu metalowi oprawa wisząca Joffrey szczególnie dobrze komponuje się z nowoczesnymi koncepcjami pomieszczeń i dodaje stylowego charakteru otoczeniu. Pobierz:   Instrukcja obsługi                    (400 KB)','','lindby-joffrey-lampa-wiszaca-4-punktowa-nikiel','','','','Lindby Joffrey lampa wisząca, 4-punktowa, nikiel','','','',''),(1471,1,1,'','','lampa-wiszaca-elio-1-punktowa-niebieska','','','','Lampa wisząca Elio, 1-punktowa, niebieska','','','',''),(1472,1,1,'Ponadczasowo piękna lampa wisząca SEBATIN z cylindrycznym abażurem z materiału  Abażur tej lampy wiszącej jest wykonany z cienkiej tkaniny i od spodu przykryty jest białym dyfuzorem również pokrytym materiałem. Nie trzeba wcale wielkiej wyobraźni, by się domyślić, że lampa ta od razu zapewnia niezwykle przytulne światło. Ponadto lampa odznacza się stonowanym designem bez zbędnych ozdób, dlatego doskonale wpasuje się w purystyczny wystrój wnętrz, urządzonych zgodnie z maksymą „mniej znaczy więcej”. Oczywiście świetnie odnajdzie się również w klasycznych aranżacjach, ponieważ cechą charakterystyczną dla wszystkich lamp o prostym designie jest ich uniwersalność.   Dzięki trzem oprawkom E27 na żarówki lampa SEBATIN jest w stanie zapewnić dużo światła, dlatego doskonale nadaje się do powieszenia nad stołem lub innych miejscach, które wymagają silnego oświetlenia. Poza tradycyjnymi żarówkami oraz żarówkami halogenowymi lampa przystosowana jest do zużywających mało prądu żarówek LED lub żarówek energooszczędnych. Umożliwia to klientom wybór odpowiedniego źródła światła dopasowanego do ich indywidualnych potrzeb i warunków pomieszczenia. Pobierz:   Instrukcja obsługi                    (211 KB)','','lampa-wiszaca-sebatin-z-materialu-kremowa','','','','Lampa wisząca SEBATIN z materiału, kremowa','','','',''),(1473,1,1,'Oprawa wisząca Grisela wykonana z metalu w kolorze czarnym z pięknym zawieszeniem  Czteropłomieniowa lampa wisząca Grisela to nie tylko źródło światła, ale także wisząca półka, na której można ustawić mniejsze przedmioty dekoracyjne. Pasuje do nowoczesnej jadalni, jak również do kuchni nad wyspą lub ladą do gotowania i może być wyposażony np. w małe garnki na zioła lub puszki na przyprawy. Rama oprawy wykonana jest z matowej stali malowanej na czarno, co w połączeniu z liniowym wzornictwem nadaje jej nowoczesny wygląd. Zawieszenie na czterech stalowych linkach wzmacnia nowoczesny akcent. Lampa wisząca Grisela dostarczana jest z dwoma zestawami zawieszek - jednym w kolorze czarnym i jednym w przezroczystym.  Oprawa wyposażona jest w cztery oprawki E27 skierowane w dół, w których lampy są swobodnie widoczne. Bardzo atrakcyjny wygląd uzyskuje się, gdy wybiera się dekoracyjne źródła światła - na przykład energooszczędne i trwałe lampy LED z przezroczystym lub lekko zabarwionym szkłem i żarówką. Pobierz:   Instrukcja obsługi                    (891 KB)','','lindby-grisela-lampa-wiszaca-4-punktowa','','','','Lindby Grisela lampa wisząca 4-punktowa','','','',''),(1474,1,1,'Prosta lampa wisząca Stannis z białymi kloszami tekstylnymi  Podłużny kształt i cztery eleganckie klosze sprawiają, że lampa wisząca Stannis jest doskonałym rozwiązaniem oświetleniowym dla długiego stołu w jadalni. Klosze wykonane są z białej tkaniny, dzięki czemu światło jest nie tylko kierowane bezpośrednio w dół, ale również rozprowadzane jest w postaci miękkiego blasku światła do otoczenia. Podstawa i rozeta sufitowa są raczej dyskretnie zaprojektowane i pozwalają skoncentrować się na tekstylnych kloszach.','','lindby-stannis-lampa-wiszaca-z-tkanina-4-punktowa','','','','Lindby Stannis lampa wisząca z tkaniną, 4-punktowa','','','',''),(1475,1,1,'Kulista lampa wisząca LED Hayley z elementami w kolorze złotym i szklanym kloszem ze strukturą bąbelkową  Hayley wyróżnia się wyrazistym wyglądem zewnętrznym i jest kompaktową lampą wiszącą LED, którą można stosować w niektórych obiektach mieszkalnych, gdzie przyciąga wzrok jako element ozdobny. Możliwe jest również zastosowanie kilku opraw w jednym rzędzie, na przykład do oświetlenia baru. Diody LED są zarówno wydajne, jak i energooszczędne, dzięki czemu dobra jasność zużywa niewiele energii. Szklana kula wyróżnia się ciekawą powierzchnią o strukturze bąbelkowej, natomiast na spodzie znajduje się metalowy element, który, podobnie jak mocowanie sufitowe, utrzymany jest w połyskującym złotym odcieniu, nadając oprawie wiszącej klasycznego wyglądu. Emisja światła jest nie tylko bezpośrednia, ale również pośrednia, dzięki czemu bezpośrednia część światła przechodząca przez biały element szklany wydaje się jak najbardziej miękka i przytulna.  Pobierz:   Instrukcja obsługi                    (402 KB)','','lampa-wiszaca-led-hayley-szklana-kula-1-pkt-zlota','','','','Lampa wisząca LED Hayley szklana kula 1-pkt. złota','','','',''),(1476,1,1,'Lampka LED do zawieszania Hayley z dziewięcioma wspaniałymi szklanymi kulami o szlachetnym, złotym wyglądzie  Specjalna wisząca lampa LED Hayley charakteryzuje się eleganckim wzornictwem i nowoczesną technologią LED. Zarówno okrągły daszek, jak i filigranowe elementy metalowe, które otaczają spodnią część szklanej kuli, uzyskały złote wykończenie.  Wnętrze dziewięciu kul zaskakuje dekoracyjnie wkomponowanymi bąbelkami powietrza, które podkreślają indywidualny charakter lampy. Zainstalowane na stałe diody LED o wysokiej intensywności emitują przyjemne, ciepłe, białe światło, które nadaje się również do oświetlania większych powierzchni pomieszczenia. Światło jest rozprowadzane pośrednio i równomiernie w pomieszczeniu bez oślepiania. Szlachetny i efektowny design tego pięknego źródła światła może być zintegrowany z różnymi meblami i pozostawia długotrwałe wrażenie na obserwatorze. Pobierz:   Instrukcja obsługi                    (554 KB)','','lucande-hayley-lampa-wiszaca-led-9-punktowa-zlota','','','','Lucande Hayley lampa wisząca LED 9-punktowa, złota','','','',''),(1477,1,1,'1-punktowa lampa wisząca LED Hayley z elementami chromowanymi i kulą ze szkła bąbelkowego  Kompaktowa lampa wisząca Hayley utrzymana jest w bardzo nowoczesnym stylu, który doskonale pasuje do wielu obiektów mieszkalnych z nowoczesnym wyposażeniem. Klosz jest kulisty i wykonany głównie ze szkła o niezwykłej strukturze bąbelkowej. Tylko w dolnej części uzupełnia go metalowy element, który, podobnie jak mocowanie sufitowe, jest chromowany na wysoki połysk. Emitowane światło jest zarówno pośrednie, jak i bezpośrednie. W miejscach, gdzie światło wychodzi bezpośrednio, znajduje się biała osłona, co zapewnia miękki rozkład światła o bardzo przytulnym charakterze. Diody LED lampy wiszącej mają dobrą wydajność i zużywają mało energii elektrycznej pomimo odpowiedniej jasności.    Pobierz:   Instrukcja obsługi                    (409 KB)','','lampa-wiszaca-led-hayley-szklana-kula-1-pkt-chrom','','','','Lampa wisząca LED Hayley szklana kula 1-pkt. chrom','','','',''),(1478,1,1,'Valeria – wykonana ze szkła lampa wisząca, pozwalająca uzyskać przytulne oświetlenie  Klosz lampy wiszącej Valeria wykonano ze szkła, które równomiernie rozdziela i zmiękcza emitowane światło. W ten sposób powstaje przytulny, przyjemny efekt świetlny, odpowiedni do spożycia posiłku czy wspólnego spędzania czasu w kuchni. Także wizualnie lampa Otis bez problemu wpasuje się w wystrój wnętrza. Jeśli chodzi o źródła światła, w tym modelu można stosować dobre, stare żarówki lub lampy halogenowe, ale też dużo efektywniej wykorzystujące prąd lampy LED, które teraz dostępne są w takim wyborze, że nie muszą ustępować wyglądem lampom żarowym.  Pobierz:   Instrukcja obsługi                    (292 KB)','','okragla-szklana-lampa-wiszaca-valeria-do-kuchni','','','','Okrągła, szklana lampa wisząca Valeria do kuchni','','','',''),(1479,1,1,'Bursztynowa szklana lampa wisząca Tymoni w wersji 3-punktowej  Tymoni to lampa wisząca, która idealnie nadaje się do oświetlania jadalni w mieszkaniu. Ma wydłużony kształt belki i składa się z trzech przezroczystych szklanych kloszy, które mają piękny, zabytkowy wygląd i dlatego mogą być szczególnie dobrze łączone z odpowiednim wnętrzem. Bursztynowy odcień szkła uzupełnia bardzo atrakcyjny wygląd ogólny i sprawia, że światło wydaje się cieplejsze, co daje bardzo przytulny efekt w mieszkaniu. Szczególnie pasują do niej żarówki filamentowe lub żarówki rustykalne o stylowym wzornictwie tradycyjnej żarówki.  Pobierz:   Instrukcja obsługi                    (207 KB)','','lindby-tymoni-szklana-lampa-wiszaca-bursztyn-3-pkt','','','','Lindby Tymoni szklana lampa wisząca bursztyn 3-pkt','','','',''),(1480,1,1,'Okazała lampa wisząca Dolores z białego szkła  Lampa wisząca Dolores jest niezwykłym elementem oświetleniowym. Ma ona całkowicie biały szklany klosz i kontrastuje kolorystycznie z satynowanym, niklowanym elementem stanowiącym lamówkę, przechodzącą w przezroczysty przewód. Opalowy matowy klosz wykonany z wysokiej jakości szkła zapewnia, że światło w przeważającej części jest emitowane na obszar znajdujący się pod lampą, dzięki czemu stół w jadalni lub lada stają się idealnym miejscem do zastosowania tej właśnie lampy. Jasna kolorystyka światła stanowi nowoczesny i przyjazny dla oka akcent w salonie. Zastosowanie lampy Dolores sprawia, że salon wygląda ona znacznie bardziej przytulnie, ponieważ jej duży, jasny kontur dopełnia gustownie urządzone wnętrze.  Pobierz:   Instrukcja obsługi                    (206 KB)','','biala-lampa-wiszaca-dolores-ze-szkla','','','','Biała lampa wisząca Dolores ze szkła','','','',''),(1481,1,1,'Elegancka lampa wisząca Fabronia z asymetrycznym kloszem kratkowym i opalowo białą szklaną kulą  Fabronia jest naprawdę miłym elementem przyciągającym wzrok, który robi prawdziwe wrażenie w nowoczesnych obiektach. Ściśle mówiąc, lampa wisząca składa się z dwóch kloszy, nie tylko z jednego. Element zewnętrzny tworzy kratka w okrągłej, asymetrycznej formie z wąskimi rozpórkami o czarnym wykończeniu, podczas gdy kula z białego szkła znajduje się bezpośrednio nad żarówką, co nie tylko sprawia, że światło wydaje się szczególnie przytulne i miękkie, ale również stanowi część ogólnego efektu. Lampa wisząca nadaje się do wielu celów i może być również używana jako oświetlenie stołu w salonie.  Pobierz:   Instrukcja obsługi                    (449 KB)','','lindby-fabronia-lampa-wiszaca-kratka-szklana-kula','','','','Lindby Fabronia lampa wisząca kratka, szklana kula','','','',''),(1482,1,1,'5-punktowa lampa wisząca LED Hayley ze szklanymi kulami i elementami w kolorze złotym  Hayley w wersji 5-punktowej bardzo dobrze pasuje do długiego stołu w jadalni gdzie zapewnia efektowne światło. Klosze są kompaktowe i mają kształt kul, z których większość wykonana jest z przezroczystego szkła o strukturze bąbelkowej. To nie tylko bardzo ładnie wygląda, ale także tworzy lśniący efekt świetlny. W dolnej części znajdują się złote elementy metalowe, które mogą być traktowane jako szczególna dekoracja i które indywidualizują wygląd i nadają lampie szlachetny efekt. Światło wydostaje się w górę i w dół, otwory u dołu są wyposażone w białe szkło, dzięki czemu światło może wydostawać się w sposób bardziej miękki i równomierny, bez oślepiania.  Pobierz:   Instrukcja obsługi                    (398 KB)','','lampa-wiszaca-led-hayley-5-pkt-podluzna-zlota','','','','Lampa wisząca LED Hayley 5-pkt. podłużna, złota','','','',''),(1483,1,1,'','','lampa-wiszaca-cubus-6-pkt-miodowa-brazowa','','','','Lampa wisząca Cubus, 6-pkt., miodowa/brązowa','','','',''),(1484,1,1,'Lampa wisząca Rozalie w stylu vintage z czarną podstawą i przezroczystym szkłem o strukturze pęcherzyków  Rozalie przekonuje nostalgicznym wyglądem i jako lampa wisząca przypomina klasyczną latarnię. Podstawa wykonana jest z czarnego metalu, a szklana wkładka jest przezroczysta z dekoracyjnymi pęcherzykami powietrza. Wpływają one nie tylko na wygląd lampy, ale również obraz świetlny nieco zyskuje na wartości. Wydajne żarówki LED o wyglądzie rustykalnym lub z technologią filamentową są bardzo odpowiednie, ponieważ najbardziej przypominają optycznie klasyczne żarówki.  Pobierz:   Instrukcja obsługi                    (352 KB)','','lindby-rozalie-lampa-wiszaca-latarnia-czarna','','','','Lindby Rozalie lampa wisząca, latarnia, czarna','','','',''),(1485,1,1,'Piękna lampa wisząca do jadalni Otis, w klasycznym stylu  Lampa Otis stanowi uosobienie klasycznego stylu i doskonale pasuje do wnętrz o podobnym wystroju. Ze względu na podłużny kształt z dwoma kloszami o białej, lśniącej powierzchni wyśmienicie nadaje się do zastosowania nad stołem w jadalni, gdzie zapewni przyjemne, równomierne oświetlenie. Szczególnie godna uwagi jest rama o pięknych detalach, pokryta warstwą lakieru w kolorze postarzanego mosiądzu, przydająca całości antycznego charakteru.  Pobierz:   Instrukcja obsługi                    (318 KB)','','2-punktowa-lampa-wiszaca-do-jadalni-otis','','','','2-punktowa lampa wisząca do jadalni Otis','','','',''),(1486,1,1,'Lampa wisząca LED Hayley z trzema szklanymi kulami i metalowymi elementami w błyszczącym złotym kolorze  Hayley w wersji 3-punktowej pięknie wygląda nad stołem w jadalni i urzeka specjalnym efekte