e chromowane osłony, dzięki którym światło pięknie błyszczy i wygląda przez to szczególnie efektownie. Pobierz:   Instrukcja obsługi                    (394 KB)','','lampa-wiszaca-led-hayley-5-pkt-podluzna-chrom','','','','Lampa wisząca LED Hayley, 5-pkt., podłużna, chrom','','','',''),(1496,1,1,'3-punktowa lampa wisząca Marla ze szklanymi kloszami  Trzy szklane klosze lampy wiszącej Marla są utrzymane w pięknym kolorze szarego dymu i mają różne kształty. Podłużny, pękaty lub raczej okrągły, każdy szklany klosz ma swój własny urok. Wspaniałe wzornictwo lampy wiszącej podkreśli zastosowanie dekoracyjnych żarówek filamentowych lub żarówek modernizowanych, które pięknie podkreślają raczej nostalgiczny charakter lampy Marla. Idealna do stosowania w jadalni lub salonie, gdzie lampa wisząca Marla wspaniale się sprawdzi jako oświetlenie stołu. Pobierz:   Instrukcja obsługi                    (390 KB)','','lindby-marla-lampa-wiszaca','','','','Lindby Marla lampa wisząca','','','',''),(1497,1,1,'','','lampa-wiszaca-gama-3-3-punktowa-czarna','','','','Lampa wisząca Gama 3, 3-punktowa, czarna','','','',''),(1498,1,1,'6-Punktowa lampa wisząca do jadalni z kulami w kolorze bursztynowym, szarego dymu i niebieskim  Dzięki podłużnemu kształtowi lampa wisząca Avalyn jest przeznaczona do użytku w jadalni nad stołem. Dzięki 6-punktowemu oświetleniu można zagwarantować dobre oświetlenie powierzchni stołu. Pod względem optycznym lampa jest szczególna i nie jest wcale codzienna, ponieważ jej czarną podstawę uzupełniają kolorowe szklane kule, które wyglądają trochę jak balony. Dwie kule w kolorze bursztynu, szarego dymu i niebieskozielonym, tworzą piękne, niezwykłe połączenie kolorystyczne, które wygląda bardzo stylowo. Zabarwienie czystego szkła ma również korzystny wpływ na obraz świetlny. Jeśli Avalyn jest używana jako jedyne światło w jadalni, emituje różnokolorowe plamki światła, które tworzą piękną atmosferę.  Pobierz:   Instrukcja obsługi                    (391 KB)','','lindby-avalyn-lampa-wiszaca-kolorowa-czarna','','','','Lindby Avalyn lampa wisząca, kolorowa, czarna','','','',''),(1499,1,1,'Lampa wisząca Dallas z chromowanymi szklanymi kulami  25-punktowa lampa wisząca Dallas ma bajecznie piękny wygląd: podłużny klosz stanowią szklane kule w odcieniu chromu przymocowane do długiego metalowego pręta. Cała lampa sprawia bardzo nowoczesne, a jednocześnie uroczyste wrażenie – ze względu na swój odcień oświetlone szklane kule emitują wyjątkowo piękne światło.  To niezwykle atrakcyjne źródło oświetlenia obszarowego i ogólnego do nowoczesnej przestrzeni mieszkalnej, które nadaje każdemu pomieszczeniu ekskluzywny charakter.','','lampa-wiszaca-dallas-chrom','','','','Lampa wisząca Dallas, chrom','','','',''),(1500,1,1,'','','lampa-wiszaca-elio-1-punktowa-niebieska','','','','Lampa wisząca Elio, 1-punktowa, niebieska','','','',''),(1501,1,1,'Klasycznie wyglądająca szklana lampa wisząca Samu z metalowym elementem w kolorze mosiądzu  Samu ma wygięty szklany klosz i doskonale nadaje się na lampę kuchenną, gdyż jej światło skierowane jest w większej części ku dołowi. Powierzchnia klosza jest biała i opatrzona satynowaniem, co sprawia, że światło rozchodzi się równomiernie. Sama zaś lampa wisząca u góry zakończona jest metalowym elementem o barwie starego mosiądzu. Element ten następnie przechodzi w zawieszenie. Żarówka jest tu dobrze widoczna, żarówki rustykalne z kolei doskonale komponują się ze stylem tego przedmiotu i podkreślają nostalgiczny charakter tej lampy wiszącej.  Pobierz:   Instrukcja obsługi                    (370 KB)','','szklana-lampa-wiszaca-samu','','','','Szklana lampa wisząca Samu','','','',''),(1502,1,1,'Lampa wisząca Tymoni ze szklanymi kulkami w kolorze bursztynu w modnym stylu vintage  Tymoni to bardzo atrakcyjna lampa do salonu, której klosz składa się z przezroczystej szklanej kuli z bursztynowym zabarwieniem. Obraz świetlny również korzysta z tej kolorystyki, ponieważ światło wydaje się naturalnie cieplejsze i bardziej zachęcające. Ogólny wygląd ma wyraźny, zabytkowy charakter, który bardzo dobrze pasuje do lampy wiszącej. Można ją umieścić nad stołem, ale również stanowi dobry akcent w innych miejscach w mieszkaniu.  Pobierz:   Instrukcja obsługi                    (304 KB)','','lindby-tymoni-szklana-lampa-wiszaca-bursztyn-1-pkt','','','','Lindby Tymoni szklana lampa wisząca bursztyn 1-pkt','','','',''),(1503,1,1,'Lampa zawieszenia Verona w klasycznym, skandynawskim stylu  Wisząca oprawa z Werony oferuje uderzający kontrast kolorystyczny z kolorami czarno-białymi, co również nadaje temu źródłu światła nowoczesny wygląd. Dwa opalowo-białe, wygięte elementy szklane o płaskich i wąskich kształtach tworzą cień, zaś czapka wykonana jest z metalu. Szkło opalowe rozprasza światło wychodzące na boki i do góry, dzięki czemu oprócz światła skierowanego w dół, powstaje harmonijne oświetlenie otoczenia. To sprawia, że Werona szczególnie nadaje się do oświetlania stołu.','','lampa-wiszaca-verona-w-kolorze-bialym-i-czarnym','','','','Lampa wisząca Verona w kolorze białym i czarnym','','','',''),(1504,1,1,'Ponadczasowo piękna lampa wisząca LED Gunda z białym, opalizowanym szklanym kloszem, przyciemniana za pomocą przełącznika  Ze względu na ponadczasowy szklany klosz w białym kolorze Gunda pasuje do wielu pomieszczeń i stylów i jest lampą o bardzo harmonijnym uroku. Dzięki białej szklanej powierzchni światło jest miękkie i równomierne oraz tworzy przytulny klimat zapewniający dobre samopoczucie. Lampa wisząca zasilana żarówkami LED pięknie prezentuje się zwłaszcza nad stołem w jadalni, gdzie sprawia wrażenie estetycznej nowej interpretacji klasycznej okrągłej lampy kuchennej.   Żarówki LED wewnątrz szklanego klosza nie tylko świecą jasno, ale także zużywają bardzo mało energii elektrycznej i tym samym są efektywne energetycznie, co z pewnością przekonuje nie tylko nowoczesnych konsumentów. Dodatkowo zintegrowana jest specjalna technologia ściemniania, która umożliwia trzystopniową regulację natężenia światła bezpośrednio za pomocą zwykłego włącznika ściennego, dzięki czemu można dostosować jasność do różnych potrzeb, a z tą lampą wiszącą LED posiłek w stylu romantycznej kolacji przy świecach nie stanowi żadnego problemu.  Pobierz:   Instrukcja obsługi                    (978 KB)','','lampa-wiszaca-opalowa-led-gunda-w-kolorze-bialym','','','','Lampa wisząca opalowa LED Gunda w kolorze białym','','','',''),(1505,1,1,'Sferyczna lampa wisząca Rhona z opalowego szkła z żarówką LED E27 RGB, ściemnialna i o zmiennej barwie światła  Sferyczne lampy wiszące ze szkła opalowego są w pewnym sensie evergreenami, ponieważ ich kształt jest tak ponadczasowy i nigdy nie wychodzi z mody. To samo dotyczy wyboru materiałów i kolorów. W pomieszczeniach mieszkalnych za pomocą takiej oprawy jak Rhona stworzysz bardzo stylowy wyraz, a jednocześnie możesz stworzyć światło o ciepłej przytulności. Ponieważ podstawową barwą światła lampy LED Rhona jest ciepła biel, wyraz ten jest doskonale podkreślony przez efekt świetlny.  Niektórzy mogą szeptać, że to jakoś zbyt nudne i że trzeba się odważyć na coś w kwestii oświetlenia. I oto jego szept jest słyszalny, ponieważ nawet jeśli oprawa wisząca LED może prezentować się jako bardzo dyskretny dawca światła, to potrafi również świecić kolorowymi barwami światła, ponieważ źródło światła LED posiada funkcję RGB. Funkcja zmiany kolorów jest sterowana za pomocą aplikacji Tuya (dostępnej dla systemów iOS i Android), która jest obsługiwana przez WiFi i umożliwia również przyciemnianie światła. Aplikacja jest kompatybilna z Google Home i Amazon Alexa, dzięki czemu może być sterowana za pomocą głosu. Pobierz:   Instrukcja obsługi                    (457 KB)','','lindby-smart-lampa-wiszaca-led-rgb-rhona-app','','','','Lindby Smart lampa wisząca LED RGB Rhona, app','','','',''),(1506,1,1,'3-punktowa lampa wisząca LED Hayley z wyjątkowymi efektami świetlnymi i szklanymi kulistymi kloszami  Hayley to zasilana diodami LED, energooszczędna lampa wisząca LED z chromowanymi elementami dekoracyjnymi i trzema szklanymi kloszami o strukturze bąbelkowej, które tworzą niepowtarzalne efekty świetlne. Błyszczący chrom wygląda niezwykle szlachetnie, podobnie jak klosze z pęcherzykami powietrza. Dzięki temu Hayley jest lampą w stylu glamour, która w wersji 3-punktowej doskonale sprawdzi się nad stołem w jadalni. Światło wychodzi zarówno bezpośrednio, jak i pośrednio, a w miejscach ze światłem bezpośrednim znajduje się element białego szkła zapewniający miękkie rozprowadzanie światła, natomiast reszta szklanego klosza wyróżnia się atrakcyjnym szkłem bąbelkowym, które jest przezroczyste i gwarantuje wspaniały efekt.  Pobierz:   Instrukcja obsługi                    (562 KB)','','lampa-wiszaca-led-hayley-szklana-kula-3-pkt-chrom','','','','Lampa wisząca LED Hayley szklana kula 3-pkt. chrom','','','',''),(1507,1,1,'Lampa wisząca 5975 z efektownym szklanym kloszem w optyce Tiffany  Lampa wisząca 5975 jest wyposażona w cudownie zaprojektowany szklany klosz, który składa się głównie ze szklanych elementów w różnych odcieniach niebieskiego, na których uwijają się urocze ważki. Błękit jest złagodzony przez górną krawędź żółtych kawałków szkła i subtelne zielone detale. Gdy tylko zapali się światło, motyw zwierzęcy jeszcze lepiej się uwidacznia.  Rama jest również atrakcyjnie zaprojektowana z drążkiem do zawieszania na środku i dekoracyjnie zdobionymi linkami do zawieszania, które prowadzą od klosza do uchwytu sufitowego i utrzymują duży klosz w równowadze.','','lampa-wiszaca-5975-kolorowy-styl-tiffany','','','','Lampa wisząca 5975, kolorowy styl Tiffany','','','',''),(1508,1,1,'','','lampa-wiszaca-cubus-1-punktowa-grafit','','','','Lampa wisząca Cubus, 1-punktowa, grafit','','','',''),(1509,1,1,'Estetycznie zaprojektowana oprawa wisząca Nostalgia - 3 płomień  Dzięki swojemu geometrycznemu dotykowi, który tworzy zarówno liniowy kształt oprawy, jak i kulisty kształt szyby lampy, trzylampowa lampa wisząca Nostalgia natychmiast przyciąga wzrok w każdym pomieszczeniu, a to już nieoświetlone. Gdy tylko oprawa zostanie włączona, opalowo-białe okulary kuliste świecą w jasnym świetle.   Kolorystyka ramki w matowym złocie i czerni uderzająco kontrastuje z bielą odcieni szkła.  - Regulacja wysokości tylko podczas montażu','','lampa-wiszaca-nostalgia-3-punktowa','','','','Lampa wisząca Nostalgia, 3-punktowa','','','',''),(1510,1,1,'Czteropłomieniowa lampa wisząca do jadalni Philika z kulistymi kloszami z delikatnego szkła wędzonego  Philika przekonuje olśniewającym akcentem i czterema odcieniami szarości dymnej szkła sferycznego, które są absolutnie modne swoim wyglądem i przyczyniają się do uzyskania pięknego efektu świetlnego w pomieszczeniach mieszkalnych i jadalnych. Są one utrzymywane w miejscu przez drewnianą belkę o szlachetnym dębowym wyglądzie, która nadaje wiszącej lampie naturalny charakter. Te dwa materiały wraz z ich kolorystyką uzupełniają się, tworząc harmonijną całość o stylowym wyrazie. Dzięki podłużnemu kształtowi oprawa wisząca z gniazdami E27, którą można dowolnie montować - najlepiej ze stylowymi żarówkami LED - jest idealna do oświetlania stołu w jadalni.','','lindby-philika-szklana-lampa-wiszaca-4-punktowa','','','','Lindby Philika szklana lampa wisząca, 4-punktowa','','','',''),(1511,1,1,'Lampa wisząca LED w formie belki Simeon z regulacją wysokości i podstawą w kolorze mosiądzu, 4-punktowa  Lampa wisząca LED w formie belki Simeon idealnie nadaje się do oświetlania stołów w kuchni lub jadalni. Ta lampa wisząca ma bowiem podłużny kształt i jest 4-punktowa. Ponadto jej wysokość można wygodnie regulować za pomocą zintegrowanego mechanizmu linkowego.   Cztery szklane klosze równomiernie rozprowadzają światło i nadają mu przytulnego charakteru. Metalowa podstawa z wykończeniem z mosiądzu podkreśla klasyczną stylistykę lampy wiszącej LED w formie belki.     Pobierz:   Instrukcja obsługi                    (218 KB)','','lampa-wiszaca-led-simeon-do-jadalni','','','','Lampa wisząca LED Simeon do jadalni','','','',''),(1512,1,1,'Prosta elegancja - lampa wisząca Tessi ze szklanym kloszem  Lampa wisząca Tessi ma bardzo prosty i dość purystyczny wygląd. Niemniej jednak emanuje ona niezaprzeczalną elegancją, którą uzyskano głównie poprzez zastosowanie pękatego klosza. Jest on wykonany z białego satynowanego szkła i jest stylowo uzupełniony zawieszeniem i rozetą sufitową z satynowanego niklu. Światło jest bardzo miękkie i raczej rozproszone przez satynowane szkło, dzięki czemu powstaje wystarczająco jasny, ale jednocześnie przyjemny nastrój świetlny. Tak wyposażona lampa wisząca Tessi bardzo dobrze nadaje się do oświetlenia nowoczesnych salonów lub jadalni, na przykład jako stylowe oświetlenie stołu.','','lucande-tessi-szklana-lampa-wiszaca','','','','Lucande Tessi szklana lampa wisząca','','','',''),(1513,1,1,'Lampa wisząca RIEKA w formie okrągłej latarni, śr. 25 cm  Piękna latarnia RIEKA prezentuje się niezwykle stylowo i elegancko. Jest wykonana z brązowego metalu oraz przezroczystego szkła. Doskonale pasować będzie do gustownych wnętrz, w których dzięki trzem żarówkom w kształcie świeczek zapewni nastrojowe, przytulne oświetlenie otoczenia. Całkowita wysokość lampy RIEKA wynosi 120 cm. Odpowiednia długość łańcuchów może być dostosowana podczas montażu.','','okragla-lampa-wiszaca-latarnia-rieka-25-cm','','','','Okrągła lampa wisząca-latarnia RIEKA, 25 cm','','','',''),(1514,1,1,'Biała szklana lampa wisząca Nicus w kształcie cylindrycznym z atrakcyjnym drewnianym dekorem z jasnego dębu  Nicus jest wspaniałym elementem oświetleniowym dla różnych mieszkań, zapewniającym jednocześnie przytulność. Smukły, cylindryczny klosz został wykonany ze szkła, a jego górne zakończenie przechodzące w zawieszenie wykonano z drewnianego elementu z w kolorze jasnego dębu. Efektem jest atrakcyjny wygląd, który również pięknie uzupełnia styl wiejskiego domu lub pasuje do skandynawskich stylu urządzenia wnętrz.  Pobierz:   Instrukcja obsługi                    (484 KB)','','lindby-nicus-drewniana-lampa-wiszaca-1-punktowa','','','','Lindby Nicus drewniana lampa wisząca, 1-punktowa','','','',''),(1515,1,1,'','','lampa-wiszaca-hour-chrom-z-opalowym-szklem','','','','Lampa wisząca Hour, chrom, z opalowym szkłem','','','',''),(1516,1,1,'Elegancka lampa wisząca Kordelia z obrotowymi ramionami  Lampa wisząca Kordelia to sprytne rozwiązanie oświetleniowe do stołu w salonie lub jadalni. Eleganckie klosze są klasycznie ułożone w rzędzie, ale mają oddzielne zawieszenia. Zawieszenia te są montowane obrotowo i dodatkowo mają regulowaną wysokość, dzięki czemu Kordelia zawsze zapewnia optymalne oświetlenie. Szkło kloszy jest satynowane i dzięki temu zapewnia przyjemny rozkład światła. Oprócz tego lampa jest zaprojektowana raczej dyskretnie, tak aby można było skoncentrować się na kloszach Pobierz:   Instrukcja obsługi                    (287 KB)','','lindby-kordelia-lampa-wiszaca-regulacja-wysokosci','','','','Lindby Kordelia lampa wisząca, regulacja wysokości','','','',''),(1517,1,1,'Lampa wisząca do jadalni Sofian z bursztynowymi kloszami kulistymi ze szkła, 3-punktowa  Sofian przekonuje bardzo przytulnym światłem i nowoczesnym wyglądem ogólnym. Lampa wisząca jest wyposażona w trzy klosze, które wyglądają tak samo i mają bursztynową powierzchnię, która pięknie błyszczy i tworzy szczególnie przytulną atmosferę w pomieszczeniu. Ze względu na bursztynowy kolor, światło bardzo przytulnie i ciepło przenika do otoczenia. Oprawy E27 mogą być wyposażone w dowolne żarówki, można również stosować żarówki posiadające zintegrowaną nowoczesną technologię LED. Istnieją również szczególnie stylowo wyglądające żarówki filamentowe i rustykalne, które przypominają klasyczne żarówki.  Pobierz:   Instrukcja obsługi                    (212 KB)','','lindby-sofian-lampa-wiszaca-3-punktowa-bursztyn','','','','Lindby Sofian lampa wisząca, 3-punktowa, bursztyn','','','',''),(1518,1,1,'Elegancka lampa stojąca Elif z ręcznie wykonaną kolumną z litego drewna  Szlachetne drewno dębowe, naturalnie barwione i misternie wykonane ręcznie, jest tutaj elegancko i stylowo uzupełnione kloszem z białej tkaniny i połączone w ponadczasową lampę stojącą, która zapewnia przyjemne światło otoczenia. Dzięki białemu kloszowi z chintz, światło świeci przyjemnie miękko i oferuje odpowiednie oświetlenie dla przyjemnych wieczornych godzin.   Dzięki swojemu naturalnemu wzornictwu, lampa stojąca Elif zapewnia również szczególną, kreatywną nutę, która może być zintegrowana z wieloma współczesnymi koncepcjami wyposażenia wnętrz. Czy to w przytulnym domku na wsi, czy w nowocześnie urządzonych, czy też wyposażonych w skandynawskim stylu pokojach dziennych, wysokiej jakości lampa podłogowa wszędzie przyciąga wzrok. Jednocześnie, Elif jest zdecydowanie prosty, bardzo elegancki i bardzo harmonijny dzięki doborowi poszczególnych materiałów. Oprócz klosza z tkaniny i drewnianej kolumny, okrągła stalowa podstawa nie tylko zapewnia wystarczającą stabilność, ale także doskonale dopełnia ogólny wygląd lampy podłogowej Elif dzięki matowemu niklowemu akcentowi kolorystycznemu.  Lampę podłogową można wygodnie i łatwo włączać i wyłączać za pomocą przełącznika, który jest umieszczony bezpośrednio na oprawie. NW ten sposób światło można obsługiwać na przykład z ulubionego fotela bez konieczności wstawania.   Elif to wysokiej jakości lampa stojąca, która jest produkowana w Niemczech. Oprócz stolarki, która jest wykonywana ręcznie, Elif oferuje również klosz wyposażony w specjalną folię trudnopalną. Projekt, funkcja i dobór materiałów - wysokiej jakości obróbka made in Germany.  Pobierz:   Instrukcja obsługi                    (1.3 MB)','','lucande-elif-lampa-stojaca-biala-cylinder-natural','','','','Lucande Elif lampa stojąca biała cylinder natural','','','',''),(1519,1,1,'Wygięta lampa stojąca Anjita ze szklanym kloszem i czarną podstawą  Anjita przekonuje już na pierwszy rzut oka i jest lampą podłogową, która może być wkomponowana zarówno w nowoczesne otoczenie, jak również stosowana tam, gdzie styl vintage dominuje we wnętrzu. Lampa stojąca składa się z przezroczystego, atrakcyjnie ukształtowanego szklanego klosza i zakrzywionej podstawy, która wydaje się dość filigranowa i ostatecznie kończy się okrągłą, stabilną metalową stopą. Dzięki temu uzyskuje się atrakcyjny, a jednocześnie dyskretny wygląd. Szczególnie atrakcyjna jest dobrze widoczna przez szkło oprawa lampy w mieniącym się mosiężnym kolorze, który pięknie kontrastuje kolorystycznie, tworząc trójskładnikowy wygląd, który czyni lampę stojącą czymś wyjątkowym. Żarówki filament z technologią LED są odpowiednimi źródłami światła nie tylko ze względu na swoją wydajność, ale także stylowo uzupełniają ogólny wygląd, ponieważ przypominają stare dobre żarówki tradycyjne.  Pobierz:   Instrukcja obsługi                    (1.7 MB)','','lucande-anjita-lampa-podlogowa-szklany-klosz','','','','Lucande Anjita lampa podłogowa, szklany klosz','','','',''),(1520,1,1,'Srebrna harmonia kolorów: lampa stojąca LED Marija zapewnia szlachetne oświetlenie  Ta lampa stojąca Marija, będąca lampą bardzo smukłą, to doskonały wybór dla każdego użytkownika będącego miłośnikiem nowoczesnego stylu aranżowania wnętrz. Okrągła podstawa i zakrzywiona metalowa przesłona są płaskie i srebrne, podobnie jak element oświetleniowy. Oba elementy są wygięte w przeciwnych kierunkach, co nadaje temu przedmiotowi miłą dla oka przestrzenną głębię. Dzięki takiemu połączeniu kolorów i kształtów, lampa stojąca LED Marija podkreśla szlachetną atmosferę i nie traci nic ze swojego efektu nawet w stanie wyłączonym. Oczywiście, późnym wieczorem, po zmierzchu wyrafinowany wygląd lampy staje się szczególnie widoczny. Lampa może być ściemniana w trzech stopniach.  Pobierz:   Instrukcja obsługi                    (308 KB)','','lampa-stojaca-led-marija-szlachetne-srebro','','','','Lampa stojąca LED Marija, szlachetne srebro','','','',''),(1521,1,1,'2-punktowa lampa podłogowa Sotiana z dwiema szklanymi kulami, szlachetny styl vintage  Sotiana to lampa podłogowa, która szczególnie pięknie się prezentuje dzięki swojemu eleganckiemu wyglądowi i stanowi prawdziwą ozdobę salonów. Z boku od wąskiego, czarnego metalowego drążka odchodzą dwa klosze, każdy składający się z przezroczystej szklanej kuli i zamontowany na różnych wysokościach. Wzornictwo uosabia pewien klasyczny wygląd i jest dekoracyjnie uzupełnione elementami metalowymi o szlachetnym wykończeniu powierzchni z mosiądzu. Ze względu na szklaną konstrukcję zalecane są atrakcyjne żarówki filament w kształcie kropli, które pięknie podkreślają ogólny wygląd.','','lucande-sotiana-lampa-stojaca-szklane-kule-mosiadz','','','','Lucande Sotiana lampa stojąca szklane kule mosiądz','','','',''),(1522,1,1,'Lampa stojąca Thea z trójnogiem o regulowanej wysokości i filcowym kloszem  Można je znaleźć w wielu nowoczesnych salonach – trójnożne lampy stojące z tekstylnymi abażurami. Lampa stojąca Thea jest wyrobem niemieckiego designu oświetleniowego, utrzymanym w modnej skandynawskiej stylistyce. Zestawiono tu dwa naturalne materiały – drewno i filc, które wspólnie tworzą harmonijną całość. Stabilności nadaje lampie trójnóg wykonany z drewna warstwowego o naturalnym wyglądzie, które zabezpieczono specjalnym przezroczystym lakierem. Trzy nogi przytwierdzone są do aluminiowego korpusu, zapewniającego odpowiednią stateczność. Śruba umieszczona na aluminiowym korpusie pozwala na regulowanie wysokości tej lampy stojącej w zakresie od 140 do 160 cm. Wielkość lampy Thea można więc bez problemu dostosować do indywidualnych upodobań.  Szary filc nałożono tu na folię nośną, która jest trudno zapalna jak materiały budowlane klasy B2. Filc nadaje lampie przyjemny i przytulny wygląd, zwłaszcza gdy prześwituje przez niego światło, a otoczenie zanurza się w domowej atmosferze.  Lampa stojąca wyposażona jest w przełącznik na oprawie w celu ułatwienia obsługi. Pobierz:   Instrukcja obsługi                    (1.6 MB)','','drewniana-lampa-stojaca-thea-z-szarym-kloszem','','','','Drewniana lampa stojąca Thea z szarym kloszem','','','',''),(1523,1,1,'Doskonałej jakości lampa stojąca Thea z trójnożną drewnianą podstawą i czarno-złotym kloszem  Lampa stojąca Thea z trójnożną podstawą , wykonaną z doskonałej jakości sklejki drewnianej i czarno-złotym kloszem z tkaniny chintz to lampa, która łączy w sobie dwa modne designy. Czarno-złote lampy wszelkiego rodzaju można znaleźć w aktualnych poradnikach wnętrzarskich, podobnie jak trójnożne lampy stołowe i stojące. Połączenie ciemno lakierowanej podstawy ze sklejki i dużego klosza z tkaniny chintz, który na zewnątrz ma prosty czarny kolor, a wewnątrz lśni złotem, sprawia, że ta lampa stojąca, produkowana w Niemczech nie tylko jest odpowiednim obiektem wyposażeniowym w ramach wielu różnych stylów aranżacji, ale także zapewnia niezbędną przytulność w salonie lub sypialni. Kiedy tylko załączymy światło, dzięki refleksom świetlnym pojawiającym się na błyszczącej złotej powierzchni, we wnętrzu klosza pojawia się ekskluzywny blask.  Thea przekonuje nie tylko swą designerską jakością, ale także najlepszą technologią. Pod czarną dekoracyjną tkaniną, z której wykonano klosz, skrywa się folia nośna o jakości B1, która sprawia, że niełatwo ulega ona zapłonowi. Za pomocą śruby regulacyjnej tę lampę stojącą można regulować na wysokość w zakresie od 140 cm do 160 cm wysokości, co pozwala na jej indywidualne dostosowanie do warunków panujących w pomieszczeniu. Przełącznik jest łatwo dostępny, ponieważ jest zamontowany bezpośrednio na lampie.  Pobierz:   Instrukcja obsługi                    (1.6 MB)','','lampa-stojaca-thea-z-czarno-zlotym-kloszem','','','','Lampa stojąca Thea z czarno-złotym kloszem','','','',''),(1524,1,1,'Costanza - lampa stojąca o nowoczesnej elegancji ze ściemniaczem  Estetyczna i treściwa lampa stojąca Costanza została zaprojektowana w 1986 roku przez Paolo Rizzatto, który postawił na to, co najważniejsze, a mianowicie prostokątną oprawę z aluminium i stożkowy klosz z białego poliwęglanu. Klosz jest przymocowany do oprawy za pomocą dwóch uchwytów i kołysze się, gdy się do poruszy, ale nie spada. Teleskopowa podstawa pozwala na regulację wysokości w zakresie od 120 cm do 160 cm, z kolei ściemniacz dotykowy pozwala na dostosowanie jasności światła do sytuacji.','','estetyczna-lampa-stojaca-costanza','','','','Estetyczna lampa stojąca Costanza','','','',''),(1525,1,1,'Perfekcyjna lampka do czytania z nagrodzonym włoskim wzornictwem  Lampa stojąca Tolomeo Lettura należy do unikalnej serii lamp Tolomeo włoskiego producenta lamp Artemide. Perfekcyjnie przemyślana pod względem funkcjonalności i ponadczasowa pod względem wzornictwa. Lampa stojąca jest wyposażona w obudowę z powlekanej aluminium stali i dwa ruchome przeguby. Te przeguby umożliwiają zmienne dopasowanie wysokości i szerokości lampy stojącej. Również wyposażona w przegub, a przez to swobodnie ruchoma i obrotowa jest głowica lampy z matowo anodowanego aluminium. Ta swoboda ruchów sprawia, że lampa stojąca Tolomeo Lettura jest idealną lampą do czytania, niezależnie od tego, czy zostanie ustawiona w gabinecie, czy też obok ulubionego fotela. Włącznik lampy stojącej został umieszczony bezpośrednio na głowicy, dzięki czemu możliwe jest wygodne włączanie i wyłączanie bez konieczności wstawania.   Jedyne w swoim rodzaju wzornictwo, które wywodzi się z końca lat 80-tych i które powstało podczas opracowania lampy biurkowej, jest dziełem dwóch architektów i projektantów, Michele De Lucchi i Giancarlo Fassina. Różne lampy serii Tolomeo zostały nagrodzone i wyróżnione międzynarodowymi nagrodami za wzornictwo. Lampa stojąca Tolomeo Lettura pochodzi z roku 1990 i ze względu na swoją ponadczasową elegancję wciąż stanowi obiekt pożądania. Pobierz:   Instrukcja obsługi                    (1.2 MB)','','elastyczna-lampa-stojaca-tolomeo-reading-floor','','','','Elastyczna lampa stojąca Tolomeo Reading Floor','','','',''),(1526,1,1,'Designerska lampa podłogowa Singapour z atrakcyjnym podwójnym kloszem  Splot rattanowy, z którego wykonany jest wewnętrzny, stożkowy klosz lampy podłogowej Singapour DBL, nadaje tej pięknej lampie dodatkowej niepowtarzalnie azjatycki charakter, który idealnie nadaje się do oświetlania np. kącika wypoczynkowego w salonie. Przy włączonym oświetleniu struktura wikliny efektownie wyróżnia się także pod dwukolorowym kloszem z lnu. Singapour jest wygodnie włączany i wyłączany za pomocą przełącznika nożnego na kablu.  Stylowo zaprojektowana lampa podłogowa, która doda tego czegoś do wielu stylów wnętrz i wniesie przytulną atmosferę do salonów i sypialni.  - Wyposażony w kabel tekstylny  - Projekt: MARKET SET (Francja)','','market-set-singapour-dbl-lampa-stojaca','','','','MARKET SET Singapour DBL lampa stojąca','','','',''),(1527,1,1,'Duża, przyciągająca wzrok lampa stojąca Xirena I wykonana z metalu w kolorze rdzy  Lampa stojąca Xirena I zasadniczo różni się od klasycznych lamp stojących, gdyż o jej wyjątkowości decydują futurystyczny wygląd, trójnożna podstawa i odchylany, okrągły klosz, które niezawodnie przyciągają wzrok. Trzy nogi mają możliwość regulacji wysokości, dzięki czemu lampę stojącą Xirena I można nie tylko dowolnie ustawiać, ale także regulować wysokość jej strumienia świetlnego. Duży klosz można odchylać, co umożliwia wybór dokładnej wysokości i kąta nachylenia oraz zapewnia w pomieszczeniu ukierunkowane światło punktowe. Dzięki pomalowanemu na rdzawy kolor metalowi i nietypowemu kloszowi lampa stojąca Xirena I sprawdza się w nowoczesnych pokojach i podkreśla ich wygląd nawet wtedy, gdy jest wyłączona.','','rdzawa-trojnozna-lampa-stojaca-xirena-i','','','','Rdzawa trójnożna lampa stojąca Xirena I','','','',''),(1528,1,1,'Reflex² - minimalistycznie zaprojektowany naświetlacz sufitowy z aluminium  Reflex² to prosta, nowoczesna oprawa podłogowa LED, która emituje pośrednie światło do pomieszczenia przez sufit, zapewniając w ten sposób całkowicie nieoślepiające oświetlenie w biurze, w prywatnych pokojach lub w publicznych salonach. Oprawa, pomyślana jako współczesne ujęcie klasycznej oprawy sufitowej, prezentuje się w formie otwartego prostopadłościanu, którego kontury wyznaczają smukłe, zaokrąglone od wewnątrz aluminiowe rozpórki. Otwarty, liniowy design sprawia, że oprawa staje się minimalistycznym obiektem oświetleniowym w pomieszczeniu. Jasność można regulować za pomocą wbudowanego w podstawę ściemniacza, a funkcja dim-to-warm daje cieplejsze światło w zakresie od 3 000 K do 2 200 K.  Reflektor sufitowy LED Reflex² został zaprojektowany przez Jeana-Marca da Costę. Urodzony w Szwajcarii projektant założył wraz z Manfredem Wolfem firmę serien.lighting, która jest inicjatorem i innowatorem w zakresie wzornictwa, technologii i metod produkcji.','','serienlighting-reflex-s-lampa-stojaca-led','','','','serien.lighting Reflex² S lampa stojąca LED','','','',''),(1529,1,1,'Wspaniała designerska lampa podłogowa z wikliny z niesamowitymi efektami świetlnymi  Jak większość produktów designerskich, także ta lampa podłogowa posiada różnego rodzaju cechy szczególne, z których nie wszystkie rzucają się w oczy na pierwszy rzut oka. Optyka jest jednak oczywiście jedną z rzeczy, które natychmiast otwierają się przed widzem. Ciemny klosz otwiera się ku górze w kształcie lejka i tym samym przypomina pod względem funkcji również uplighter. Efekt świetlny jest podobnie przytulny, ale klosz designerskiej lampy podłogowej Flechtwerk punktuje wyjątkową strukturą, która również przypomina szachownicę. Pominięcia w kloszu i małe, grafitowe elementy przeplatają się w stałej strukturze i są odpowiedzialne za elegancki efekt świetlny po włączeniu lampy, który oddziałuje nie tylko bezpośrednio na lampę, ale jeszcze na otaczające ją powierzchnie projekcyjne, na których ukazuje się wspaniały wzór światła i cienia.  Klosz, który jest produkowany w Niemczech, nie jest wykonany z plastiku, ale z innowacyjnego biomateriału, który charakteryzuje się lekkością, stabilnością i możliwością wycierania, bazą materiałową są wyłącznie surowce odnawialne, a ponadto jest wolny od ropy naftowej i składników toksycznych. Produkcja w drukarce 3D odbywa się przy zerowej emisji i wykorzystaniu zielonej energii elektrycznej, a także idea zero odpadów (zużywane jest tylko to, co faktycznie stanowi część klosza) jest zgodna z ideą zrównoważonego rozwoju, którą projektanci kierują się przy produkcji swoich lamp.','','lampa-podlogowa-flechtwerk-lejek-grafit','','','','Lampa podłogowa Flechtwerk, lejek, grafit','','','',''),(1530,1,1,'Lampa stojąca o zmiennej regulacji Tolomeo  Lampa stojąca Tolomeo, zaprojektowana przez Michele De Lucchi i Giancarlo Fassina dla włoskiego producenta lamp Artemide, może być regulowana za pomocą specjalnego mechanizmu zarówno pod względem wysokości, jak i rozpiętości. Tworząc już w roku 1986 lampę stołową Tolomeo, Michele De Lucchi zainspirował się Trabucchi, tradycyjnymi żurawiami rybackimi rybaków z Apulii. W przypadku tych żurawi drążki, do których przymocowano sieć, są utrzymywane przez liny. Zasadę, zgodnie z którą za pomocą ramienia podnoszącego i liny można zawiesić drążek, de Lucchi wykorzystał w swoim modelu Tolomeo.  Ponadczasowy wygląd sprawia również, że lampa stojąca Tolomeo jest obiektem wyposażenia wnętrz dla każdego stylu mieszkania.  - wysokiej jakości produkt firmy Artemide Pobierz:   Specyfikacja techniczna                    (182 KB)    Instrukcja obsługi                    (2.7 MB)','','artemide-tolomeo-lampa-podlogowa-e27-aluminium','','','','Artemide Tolomeo lampa podłogowa E27 aluminium','','','',''),(1531,1,1,'Nowoczesna lampa stojąca Marija z diodami LED w kolorze czarnym i złotym  Zamontowana centralnie w okrągłej podstawie, zakrzywiona rura z diodami LED wygina się delikatnie w górę. Z nią połączona jest metalowa przesłona w kolorze czarnym, która jest również lekko wygięta i tworzy zdecydowanie rustykalną atmosferę, natomiast tylna strona przesłony jest utrzymana w kolorze złotym. Lampa stojąca LED Marija jest więc elementem przyciągającym wzrok o każdej porze dnia. Oczywiście jest to szczególnie widoczne, gdy światło jest włączone, ponieważ oświetlenie o barwie ciepłej bieli nie tylko oświetla pomieszczenie, ale również kieruje uwagę obserwatora na artystycznie i harmonijnie zaprojektowaną lampę. Ta wąska lampa stojąca Marija idealnie nadaje się do zastosowania w rogu pomieszczenia lub bezpośrednio w pobliżu kompletu wypoczynkowego.  Lampa stojąca może być ściemniana w trzech stopniach.  Pobierz:   Instrukcja obsługi                    (304 KB)','','lampa-stojaca-led-marija-w-kolorze-czarnym','','','','Lampa stojąca LED Marija w kolorze czarnym','','','',''),(1532,1,1,'Lampa podłogowa LED o regulowanej wysokości Przeciwwaga z Luceplanu  Purystycznie zaprojektowana przeciwwaga lampy podłogowej LED korzysta ze specjalnego mechanizmu przesuwnego, który pozwala na płynną regulację wysokości aluminiowej głowicy oprawy w kształcie maski na całej długości pręta. Głowica posiada jeszcze jedną szczególną cechę, a mianowicie przełącznik ściemniacza, który umożliwia regulację światła w trzech stopniach: 0 procent, 50 procent, 100 procent.   Głowica jest również bardzo elastyczna w kierunku poziomym; można ją przechylać o 90° i obracać o 360°. Przeciwwaga oferuje więc największą możliwą elastyczność, której na pierwszy rzut oka nie można zakładać w przypadku tej bardzo prosto skonstruowanej oprawy.','','luceplan-counterbalance-lampa-stojaca-led-czarna','','','','Luceplan Counterbalance lampa stojąca LED, czarna','','','',''),(1533,1,1,'Ponadczasowy klasyk: lampa stojąca ROMEO SOFT T1 firmy FLOS emituje ciepłe światło, które zaprasza do poczucia się komfortowo  Można by pomyśleć, że plisowany klosz jest tak stary, jak historia samej lampy. Słowo „plisa” pochodzi z języka francuskiego i oznacza coś „ułożonego w fałdy”, co bez wątpienia dotyczy również tego przypadku. Dzięki fałdom, które wyglądają bardzo szykownie, klosz przepuszcza w kilku miejscach mniej światła niż w innych, przez co, w połączeniu z tworzywem w kolorze kremowym, powstaje ciepły promień światła. Lampa wygląda tak samo pięknie w klasycznie, jak i w nowocześnie urządzonych pomieszczeniach.   Firma FLOS istnieje już od ponad 50 lat, projektując niezwykłe i wysokiej jakości lampy dzięki zespołowi znanych projektantów. Jej produkty znane są na całym świecie i były wielokrotnie wyróżniane. Pobierz:   Instrukcja obsługi                    (708 KB)    Specyfikacja techniczna                    (312 KB)    Photometric Data LDT                    (3 KB)','','lampa-stojaca-romeo-soft-f-o-blogim-swietle','','','','Lampa stojąca Romeo Soft F o błogim świetle','','','',''),(1534,1,1,'Lampa stojąca Nature Straight - każdy egzemplarz jest unikatem  W przypadku lampy stojącej Nature Straight nowoczesna elegancja spotyka się z czystą naturą. W Indonezji zbierane jest dryfujące drewno ukształtowane przez morze. Pojedyncze znaleziska są przetwarzane na indywidualne lampy i czynią każdą z nich niepowtarzalnym okazem. Naturalnie rosnące drewno na solidnej stopie - taka jest podstawa lampy stojącej Natur Straight. Spoczywający na niej klosz, który wygląda szlachetnie i elegancko, jest wykonany z bawełny. Został on zaprojektowany w kolorze czarnym na zewnątrz i złotym wewnątrz, dzięki czemu świecące światło jest bardzo przytulne.   Każdy egzemplarz lampy stojącej Straight jest unikalny i może różnić się od wersji pokazanej na zdjęciu kształtem, fakturą i kolorem elementu z dryfującego drewna.Pobierz:   Instrukcja obsługi                    (433 KB)','','kare-nature-straight-lampa-podlogowa-z-drewna','','','','KARE Nature Straight lampa podłogowa z drewna','','','',''),(1535,1,1,'Flat - prostokątna lampa stojąca LED z aluminium ze ściemniaczem  Flat to wysokiej jakości lampa stojąca wyprodukowana w Niemczech, która odznacza się prostokątną formą. Zarówno stopka, jak i trzon i głowica są wykonane z oszlifowanego aluminium. Klosz z satynowanego szkła umieszczony jest w metalowej głowicy i jest nieco wysunięty. Tak jak w przypadku lampy oświetlającej sufit Flat daje ciepłobiałe, przyjemne światło o temperaturze barwowej 2700 kelwinów, które skierowane jest do góry, zapewniając oświetlenie pośrednie. Wbudowany ściemniacz przyciskowy umożliwia dostosowanie światła do potrzeb i danej sytuacji.   Lampa stojąca LED Flat to dzieło tradycyjnego przedsiębiorstwa BOPP z siedzibą w Odenwald. Firma produkuje oświetlenie domowe od 1912 roku . Każdy produkt odznacza się wysoką jakością i najlepszym wykonaniem.','','flat-lampa-stojaca-led-ze-sciemniaczem','','','','Flat - lampa stojąca LED ze ściemniaczem','','','',''),(1536,1,1,'Niezwykła lampa stojąca TOIO o przemysłowym designie  Na pierwszy rzut oka lampa TOIO ma niewiele wspólnego z klasyczną lampą stojącą stosowaną w pomieszczeniu i wygląda wyjątkowo technicznie. Ten szczególny wygląd czyni z niej interesujący przedmiot do zastosowania w nowoczesnych, a nawet purystycznie urządzonych mieszkaniach i domach. Jednak po dokładnym przyjrzeniu się dają się zauważyć przyjemne elementy, które świadczą o komforcie użytkowania tej klasycznej lampy stojącej: jednym z nich jest wbudowany ściemniacz, który umożliwia ustawienie jasności światła wedle potrzeb, a kolejnym regulacja wysokości lampy w zakresie od 158 do 195 cm, co zapewnia jej dużą elastyczność. Tak czy inaczej, lampa stanowi interesującą atrakcję o bardzo dużej mocy światła.   Firma FLOS istnieje już od ponad 50 lat, projektując niezwykłe i wysokiej jakości lampy dzięki zespołowi znanych projektantów. Jej produkty znane są na całym świecie i były wielokrotnie wyróżniane.','','lampa-stojaca-toio-firmy-flos','','','','Lampa stojąca TOIO firmy FLOS','','','',''),(1537,1,1,'Lampa stojąca Glo-Ball F3 - klasyk projektu Jaspera Morrisona  Jeśli lampy projektantów przemieniają się w klasyki, nie musi to oznaczać, że są one wyjątkowo ekstrawaganckie i niezwykłe - wręcz przeciwnie, może być również zupełnie odwrotnie, jak w przypadku lampy stojącej Glo-Ball F3. Duże znaczenie mają w niej prostota i minimalistyczny design o kulistym, z boku owalnym szklanym kloszu oraz stosunkowo wąskim korpusie z okrągłą podstawą. Z tego względu z pewnością nadąży za duchem czasu, działając tak samo ponadczasowo, a nawet współcześnie, co dzisiaj. Uwagę obserwatorów przyciąga nie tylko wygląd lampy. Dzięki kloszowi z białego szkła emituje ona wyjątkowo piękne i przytulne światło.  Firma FLOS istnieje już od ponad 50 lat, projektując niezwykłe i wysokiej jakości lampy dzięki zespołowi znanych projektantów. Jej produkty znane są na całym świecie i były wielokrotnie wyróżniane. Pobierz:   Instrukcja obsługi                    (1.6 MB)    Specyfikacja techniczna                    (420 KB)    Photometric Data LDT                    (3 KB)','','prosta-klasyczna-lampa-stojaca-glo-ball-f3','','','','Prosta klasyczna lampa stojąca Glo-Ball F3','','','',''),(1538,1,1,'Designerska lampa stojąca BIBLIOTHEQUE NATIONALE – lampa z półką na książki i gniazdkiem USB  Praktyczna, funkcjonalna, na czasie – lampa BIBLIOTHEQUE NATIONALE to ekskluzywny projekt Philippe\'a Starcka, który zachwyca pod każdym względem. Właściwie charakteryzuje się klasycznym designem, ale to detale świadczą o jej uroku: kilka półek ze stali szlachetnej przecinają trzon zapewniając miejsce na książki, telefon czy tablet, które zawsze będą w zasięgu ręki. Znajdujące się na podstawie gniazdo USB służy za stację ładującą do wszystkich obecnych na rynku smartphone\'ów ( w tym iPhone\'a 5).  Dzięki temu lampa ta to nie tylko stylowe oświetlenie wnętrza, ale również odpowiedź na codzienne wymagania współczesnego klienta.  Od ponad 50 lat od czasu swojego powstania marka FLOS, współpracując ze znanymi projektantami, tworzy wyjątkowe, wysokiej jakości oświetlenie, które cieszy się międzynarodowym uznaniem i jest nagradzane w wielu konkursach. Pobierz:   Instrukcja obsługi                    (436 KB)    Specyfikacja techniczna                    (258 KB)','','lampa-stojaca-bibliotheque-nationale-fumee','','','','Lampa stojąca BIBLIOTHEQUE NATIONALE, Fumée','','','',''),(1539,1,1,'Szklana kula w centrum symetrii – lampa stojąca IC  Seria lamp IC została zainspirowana artystą cyrkowym, który żongluje kilkoma kulami, które przelatują mu przez ramię i znów wpadają do dłoni. Obraz ten projektant tej lampy postanowił uwiecznić w modelu IC. Szklana kula wydaje się jakby unosić na tle symetrycznej konstrukcji.   Od ponad 50 lat od czasu swojego powstania marka FLOS, współpracując ze znanymi projektantami, tworzy wyjątkowe, wysokiej jakości oświetlenie, które cieszy się międzynarodowym uznaniem i jest nagradzane w wielu konkursach.   Pobierz:   Instrukcja obsługi                    (1.3 MB)    Specyfikacja techniczna                    (296 KB)    Photometric Data LDT                    (100 KB)','','ic-f1-lampa-stojaca-marki-flos-szczotk-mosiadz','','','','IC F1 - lampa stojąca marki FLOS, szczotk. mosiądz','','','',''),(1540,1,1,'Nadzwyczajna dekoracja wnętrza – lampa stojąca i wisząca w jednym OK  Nie jest to typowa lampa stojąca, wisząca też nie, a może 2 w 1? Nie zawsze konieczne jest przyporządkowanie danego przedmiotu do odpowiedniej kategorii, jednak jeśli ktoś by bardzo chciał trafnie określić tę lampę, natychmiast przekona się, że nie jest to takie proste. Jeśli określimy ją jako wiszącą, szybko zauważymy, że nie ma w niej nic z klasyki ani z przytulności. Należy przede wszystkim zacząć od tego, że nie da się jej zawiesić nad żadnym obiektem, na przykład stołem, gdyż równocześnie wymaga miejsca do zamontowania w podłodze, aby ustawić ją w prawidłowej pozycji. OK jest zatem nietypową lampą, która nade wszystko ujmujące swym designem oraz funkcjonalnością.  W zestawie z włącznikiem ze ściemniaczem i technologią Soft-Touch.  Od ponad 50 lat od czasu swojego powstania marka FLOS, współpracując ze znanymi projektantami, tworzy wyjątkowe, wysokiej jakości oświetlenie, które cieszy się międzynarodowym uznaniem i jest nagradzane w wielu konkursach.','','stojaca-lampa-led-ok-z-zawieszonym-kloszem','','','','Stojąca lampa LED OK z zawieszonym kloszem','','','',''),(1541,1,1,'Nowoczesna lampa stojąca SENO o wysokiej funkcjonalności - idealna do pracy lub do czytania. Możliwość regulacji ustawienia zapewnia optymalne oświetlenie. Z zintegrowanym przełącznikiem. Doskonała jakość made in Germany.  Eleganckie lampy wyposażone w najnowszą technologię LED i szklaną obudowę, która wspaniale rozjaśni każde wnętrze mieszkalne.  Tradycje rzemieślnicze w połączeniu z nowoczesną technologią wytwarzania stanowią dla 50 pracowników firmy bazę umożliwiającą im produkcję dekoracyjnych lamp spełniających najwyższe oczekiwania. Główny nacisk kładzie się na produkcję lamp stojących, stołowych i lamp ściennych.  Nawet klosze lamp zostały wykonane w firmie. Podstawowym materiałem jest tutaj zasadniczo wyłącznie czysty mosiądz, którego powierzchnię poddano obróbce w prawie wszystkich produktach, także w produkcji własnej. Najwyższe znaczenie przypisuje się zawsze czystej i perfekcyjnej obróbce i dopracowaniu powierzchni.  Knapstein produkuje klasyczne wyroby MADE IN GERMANY i nie oferuje towarów importowanych z krajów Dalekiego Wschodu czy też innych krajów.','','lampa-stojaca-led-seno','','','','Lampa stojąca LED SENO','','','',''),(1542,1,1,'Lampa stojąca Babel ze spiralnym abażurem  Abażur lampy to zwężające się ku górze okręgi, tworzące spiralnie formę wieży. Między nimi przenikaja swobodnie strumienie światła, w kierunku sufitu i podłoża. Podstawa lampy w formie statywu robi szczególne wrażenie i sprawia, że lampę postrzegamy nie tylko jako źródło efektownego światła, lecz również jako ciekawy obiekt dekoracyjny.   Lampa ściemnialna, jeśli zastosujemy ściemnialne źródło światła.','','lampa-stojaca-babel-ze-spiralnym-abazurem','','','','Lampa stojąca Babel ze spiralnym abażurem','','','',''),(1543,1,1,'Lampa podłogowa Oppo LED o wysokości 120 cm z innowacyjną koncepcją oświetleniową  Ta lampa podłogowa LED, stworzona przez austriackiego projektanta Thomasa Feichtnera, nie posiada wcale reflektora. Najnowsza technologia LED pozwala wbudowanemu źródłu światła działać jako dyfuzor i emitować przyjemne światło zarówno w kierunku sufitu jak i podłogi. Nazwa Oppo, jak \"opposite\" po angielsku lub \"opposto\" po włosku, wywodzi się z tego wzajemnego oświetlenia. Wyrazista konstrukcja nie odwraca uwagi od podstawowej, zaledwie 10 mm cienkiej powierzchni świetlnej, która jest wsparta prostokątną konstrukcją. Dyfuzor dwukierunkowy wykonany z metakrylanu zapewnia 90% rozproszenia emitowanego światła. Oświetlenie LED o mocy 33 W wytwarza ciepłe białe światło o strumieniu świetlnym 3500 lumenów. Zintegrowany ściemniacz pozwala na bezstopniową regulację jasności w zależności od indywidualnych potrzeb.  - 2.700 Kelwinów Pobierz:   Instrukcja obsługi                    (403 KB)    Specyfikacja techniczna                    (908 KB)','','mala-lampa-stojaca-led-oppo-120','','','','Mała lampa stojąca LED Oppo 120','','','',''),(1544,1,1,'Lampa stojąca WHITE - niezwykła kreacja urozmaici ekstrawaganckie nowoczesne wnętrze  Lampa stojąca WHITE natychmiast wpada w oko. Jej niezwykły wygląd przypomina roślinę w doniczce. 42 białe, splecione ze sobą elementy ze szkła kryształowego sprawiają, że powstaje jasno lśniące światło. Lampa stojąca WHITE jest ekskluzywną ozdobą każdego salonu i jadalni oraz np. pomieszczeń wystawowych, w których ważne jest stworzenie szczególnego nastroju.','','okazala-lampa-stojaca-white','','','','Okazała lampa stojąca White','','','',''),(1545,1,1,'Lampa stojąca Me z wyginaną podstawą, o najmodniejszym designie  Dzięki tej atrakcyjnie zaprojektowanej lampie stojącej designerów Morten&amp;Jonas, dodatkowe oświetlenie w każdym nowocześnie urządzonym pomieszczeniu może być zgodne z najwyższymi standardami, zarówno estetycznymi jak i funkcjonalnymi. Jako że ta lampa stojąca Me ma prosty, szary kolor, pasuje do wnętrz urządzonych w najrozmaitszej kolorystyce. Szczególną cechą tej lampy designerskiej jest ruchoma część podstawy pod głowicą lampy, która umożliwia obracanie części głowicy w żądanym kierunku. Dzięki temu ta lampa stojąca Me doskonale nadaje się na przykład do zapewnienia dodatkowego oświetlenia w salonie, a w razie potrzeby może być również używana jako lampka do czytania. Wyposażona jest w przewód zasilający o długości 200 cm w kolorze czarnym.  - z przełącznikiem nożnym   Pobierz:   Instrukcja obsługi                    (96 KB)    Specyfikacja techniczna                    (163 KB)','','szara-designerska-lampa-stojaca-me','','','','Szara designerska lampa stojąca Me','','','',''),(1546,1,1,'Imponująca lampa stojąca Flat  Nomen omen - tak zdecydowanie można podsumować wygląd lampy stojącej Flat, która została zaprojektowana i wykonana w wyjątkowo płaskiej formie, przy czym zastosowano głównie chrom i pleksiglas. Lampa w kształcie żarówki składa się z dwóch płyt w kolorze pomarańczowym, białym lub czarnym i środkowej przezroczystej płyty z tworzywa sztucznego, co daje wyjątkowy efekt wizualny. Noga lampy i oprawa utrzymane są w kolorze chromu. Ta lampa stojąca jest doskonałą atrakcją w modnym stylu wystroju.','','wyjatkowa-lampa-stojaca-flat','','','','Wyjątkowa lampa stojąca Flat','','','',''),(1547,1,1,'Fascynująca lampa stojąca LED SUITE  Na pierwszy rzut oka SUITE przypomina półkę lub stolik, a nie lampę. Właściwie jest połączeniem tych dwóch rzeczy. Trzy, umieszczone na różnych wysokościach powierzchnie tworzą praktyczne półki, na których zmieszczą się różne drobiazgi. Pod nimi znajdują się taśmy LED, które zapewniają pośrednie, łagodne światło. Uwagę przyciąga mała ściemniana lampka do czytania LED umieszczona na najwyżej położonej półce. Jej klosz można obracać o 360°. Ta lampa stojąca zapewni błogie chwile przy przytulnym świetle. Dodatkowo została wyposażona w gniazdo USB pozwalające podłączyć różne urządzenia takie jak smartphone czy tablet.  VIBIA – design na wieczność Lampy marki VIBIA odznaczają się czystymi, minimalistycznymi formami. Firma powstała w 1987 roku w Barcelonie i współpracuje z różnymi projektantami. Dzięki swoim innowacyjnym pomysłom przyczyniają się oni do międzynarodowej renomy tego hiszpańskiego producenta lamp. Oświetlenie marki VIBIA charakteryzuje indywidualny charakter oraz wysoka jakość materiałów oraz ponadczasowość.','','lampa-stojaca-led-suite-112-cm','','','','Lampa stojąca LED SUITE, 112 cm','','','',''),(1548,1,1,'Dźwięk - lampa podłogowa specjalnego rodzaju  Lampa podłogowa Sound inspiruje swoim nowoczesnym i niezwykłym wzornictwem. Sześć metalowych pierścieni o jedwabiście lśniącym, złotym wykończeniu zostało umieszczonych jeden nad drugim na biegunie lampy o wysokości 225 cm. Aby nie przeszkadzała stopa na podłodze, lampę podłogową montuje się na suficie z zawieszeniem u góry, a pręt mocuje się do podłogi u dołu. Pięć lamp halogenowych (nie wchodzi w skład zestawu - G9) umieszczonych jest w różnych miejscach pierścieni, a każda z nich jest obustronnie zasłonięta małymi satynowanymi szklanymi kloszami, co zapewnia równomierne, a przede wszystkim pozbawione olśnień oświetlenie.  Lampa podłogowa Sound - wysokiej jakości lampa renomowanego włoskiego producenta oświetlenia, stworzona przez projektanta Giovanniego Battistę Gianolę i wykonana z wysokiej jakości materiałów - jest fascynującym i niezwykłym źródłem światła w nowoczesnych pomieszczeniach mieszkalnych. Pobierz:   Specyfikacja techniczna                    (652 KB)    Instrukcja obsługi                    (1.2 MB)','','lampa-podlogowa-sound-zlota','','','','Lampa podłogowa Sound złota','','','',''),(1549,1,1,'Obracana i odchylana designerska lampa stojąca Max. Floor ze ściemnianymi LED-ami  Wydaje się, jakby ta filigranowa designerska lampa stojąca Max. Floor całkowicie przeczyła prawu ciążenia. Optycznie wygląda ona tak, jakby stosunkowo mała stopa nie stanowiła żadnego punktu oparcia dla długiego i wąskiej obudowy wraz z kloszem, gdy punkt ciężkości lampy zmienia się poprzez jej obrót i wychylanie. Jednakże w praktyce Max. Floor przekonuje nas, że jest inaczej. Smukły stelaż, przymocowany na końcu stopy lampy w przegubie, można obracać i odchylać bez trudu w każdym kierunku, bez obawy o to, że Max. Floor utraci w którymś momencie swoją stabilność. Jeszcze większą elastyczność posiada reflektor w kształcie stożka, który można dowolnie obracać i wychylać za pomocą uchwytu. Jaka lampa stojąca potrafi skierować światło dokładnie w odpowiedni punkt lepiej, niż Max. Floor?  Pod względem jakości Ingo Maurer również w przypadku tej lampy zachował swój wysoki poziom. Diody LED o barwie ciepłej bieli, które kryją się w kloszu lampy, osiągają przy CRI równym 90 bardzo dobry współczynnik oddawania barw. Zintegrowany w przewodzie zasilającym ściemniacz umożliwia bezstopniową regulację jasności lampy Max. Floor. Pobierz:   Instrukcja obsługi                    (596 KB)','','ingo-maurer-max-floor-lampa-podlogowa-klosz-alu','','','','Ingo Maurer Max. Floor lampa podłogowa klosz alu','','','',''),(1550,1,1,'Klasyk wśród lamp stojących autorstwa Vilhelma Lauritzena: model VL38 teraz z diodami LED  Do najsłynniejszych dzieł duńskiego architekta Vilhelma Lauritzena (1894-1984) należy budynek duńskiego radia „Radiohuset” w Kopenhadze i pierwsze lotnisko w stolicy Danii. Z punktu widzenia technologii oświetleniowej najbardziej znany dzięki modelowi VL38 nazwanemu jego imieniem, który zaprojektował pod koniec lat 30. właśnie dla „Radiohuset”. Duński producent opraw oświetleniowych Louis Poulsen włączył ten model do swojego ówczesnego katalogu, a dziś klasyk ten przeżywa renesans. Został on wyposażony w technologię LED i dlatego jest nowoczesnym rozwiązaniem oświetleniowym, utrzymanym w popularnym stylu retro.   Głowicę i stelaż lampy stojącej można łatwo przechylić i dostosować do potrzeb użytkownika. Jasność można przełączać dwustopniowo (50 i 100 %). Ściemniacz ma także funkcję pamięci. Kolejną praktyczną funkcją lampy stołowej LED VL38 jest timer, który automatycznie wyłącza lampę po czterech lub ośmiu godzinach.   Uwaga: Mosiężne części lampy stojącej nie są poddane obróbce i z czasem może pojawić się na nich patyna.','','louis-poulsen-vl38-lampa-stojaca-led','','','','Louis Poulsen VL38, lampa stojąca LED','','','',''),(1551,1,1,'Designerska lampa stojąca Eos medium z trójnożnym statywem i kloszem z gęsich piór  Połączenie dwóch przedmiotów designerskich duńskiego projektanta Sørena Ravna Christensena sprawia, że ta lampa stojąca Eos medium jest wyjątkową konstrukcją oświetleniową: Zastosowano tu jasnoszary klosz Eos medium i biały lakierowany, trójnożny statyw, tworząc tym samym piękną lampę stojącą, która wygląda bardzo atrakcyjnie, gdy światło jest załączone oraz przy świetle włączonym.  Klosz składa się z papierowej bazy, na którą nałożono łącznie około 1 800 prawdziwych gęsich piór. Natychmiast po załączeniu światła ten naturalny materiał tworzy wspaniały efekt świetlny, który sprzyja powstawaniu przytulnej atmosfery.  Stojak podłogowy zachwyca przejrzystą konstrukcją i jest wyposażony w kabel o długości 300 cm, opatrzony tekstylną osłoną i przełącznikiem.  Wskazówka: Jeśli klosz jest zabrudzony, wystarczy go wyczyścić suszarką do włosów.  Duński producent opraw oświetleniowych, firma UMAGE, produkuje doskonałej jakości wyroby, stawiając na staranne ręczne wykonanie, które zachwyca estetycznym skandynawskim designem. Jego dalszy rozwój jest głównym celem działalności firmy.  - Nie użyto tu piór żywych zwierząt.','','umage-eos-medium-lampa-podlogowa-trojnik-szara','','','','UMAGE Eos medium lampa podłogowa trójnik szara','','','',''),(1552,1,1,'Designerska lampa stojąca Eos medium: jasnoszary klosz, biały trójnożny statyw  Ta lampa stojąca emanuje bardzo szczególnym blaskiem. Dzięki jasnoszaremu kloszowi z piór wygląda ona bardzo naturalnie, a zarazem niezwykle nowocześnie, gdyż ma białą trójnożną podstawę. Pozwala to na dopasowanie jej do wielu współczesnych stylów wyposażenia wnętrz. Eos medium, zaprojektowana przez Sørena Ravna Christensena, wzbogaca kącik do siedzenia w salonie o przyjemne, delikatne oświetlenie.   Christensen jest twórcą i współzałożycielem duńskiej firmy oświetleniowej UMAGE, której linia produktów koncentruje się na dalszym rozwoju skandynawskiego designu i kładzie nacisk na staranne wykonanie, z jednoczesnym uwzględnieniem aspektów ekologicznych.  - Nie użyto tu piór żywych zwierząt.  - Klosz można czyścić suszarką do włosów.','','umage-eos-medium-lampa-podlogowa-trojnik-brazowa','','','','UMAGE Eos medium lampa podłogowa trójnik brązowa','','','',''),(1553,1,1,'Matowa czarna designerska lampa stojąca Carronade  Carronade oznacza po polsku armatę. Patrząc na klosz lampy łatwo zauważyć, że jedna z nich zainspirowała duńskiego projektanta Markusa Johanssona do zaprojektowania tej lampy stojącej. Składa się on ze stali lakierowanej na matowy czarny kolor i spoczywa w ozdobnej ramie amerykańskiego orzecha na delikatnej, trójnożnej podstawie. Dwie śruby blokujące po bokach klosza umożliwiają obracanie klosza i blokowanie go w żądanej pozycji. Lampa stojąca Carronade wnosi nordycki urok do każdego pomieszczenia.  Designerska lampa stojąca Carronade jest produkowana przez duńskiego producenta lamp Le Klint, firmę o długiej tradycji. Firma została założona w 1943 roku, a pierwszy sklep flagowy został otwarty w Kopenhadze. Sklep Le Klint jest nadal w tym samym miejscu, a lampy zaprojektowane przez Le Klint w chwili założenia firmy, z ręcznie składanymi kloszami, nadal należą do asortymentu lamp i bestsellerów, tak samo, jak wtedy.','','le-klint-carronade-high-czarna-lampa-podlogowa','','','','LE KLINT Carronade High - czarna lampa podłogowa','','','',''),(1554,1,1,'Lampa podłogowa Vera ST LED w minimalistycznym stylu  Włoska lampa podłogowa Vera składa się z filigranowej ramy i głowicy oświetleniowej, która podobnie jak rama wykonana jest z aluminium. Ta głowica oświetleniowa to pierścień, którego górna część jest wyposażona w diody LED. Pierścień jest montowany na pręcie w taki sposób, aby mógł oświetlić zarówno ścianę, jak i część sufitu.   Lampa podłogowa Vera ST zapewnia jedynie oświetlenie pośrednie, podobne do reflektora sufitowego, a tym samym tworzy szczególnie domową atmosferę. Oprawy podłogowe, takie jak Vera ST, są ważnym elementem dekoracyjnego oświetlenia pomieszczeń, w którym to przypadku oprawy podłogowe przyczyniają się w równym stopniu do oświetlenia ogólnego, co do oświetlenia atmosferycznego.','','icone-vera-st-designerska-lampa-stojaca-led','','','','ICONE Vera ST - designerska lampa stojąca LED','','','',''),(1555,1,1,'Lampa podłogowa LED Slimline wykonana z szlachetnego aluminium i z możliwością sterowania dotykowego  Elegancka lampa podłogowa Slimline została zaprojektowana przez Mathiasa Schifferdeckera, który stworzył tę niezwykłą serię lamp dla producenta Escale. Lampa podłogowa przekonuje swoim awangardowym wyglądem i przemyślaną funkcjonalnością. Podstawa lampy posiada magnetyczny układ kulowy, za pomocą którego lampa podłogowa może być obracana prawie całkowicie wokół własnej osi. W ten sposób światło może być skierowane bardzo konkretnie. Wąski korpus lampy jest mocowany za pomocą czerwonego klipsa, który można zamocować w dowolnym miejscu kija świetlnego, co pozwala na indywidualny projekt. Przekonującą konstrukcję dopełnia inteligentne sterowanie za pomocą gestów, dzięki którym lampa podłogowa może być wygodnie przyciemniana w zakresie jasności.','','escale-slimline-lampa-stojaca-led','','','','Escale Slimline lampa stojąca LED','','','',''),(1556,1,1,'Szlachetna designerska lampa stojąca, stworzona przez niemiecką manufakturą DOMUS, autorstwa Iris Kremer &amp; Domus Team  Elegancka sylwetka tej lampy o doskonałej jakości kształtuje wygląd pomieszczenia, nie dominując nad nim. Podstawa i klosz tej lampy stojącej rozszerzają się ku górze, co sprawia, że całość wygląda atrakcyjnie i emanuje ponadczasową elegancją. Materiały zastosowane do stworzenia tej lampy to połączenie drewna, lunopalu i aluminium, producent zapewnia więc, że nic z naturalnego piękna drewna nie zostanie utracone. Dlatego też unika się tu stosowania lakierów, a obróbka powierzchni jest wykonywana głównie przy użyciu olejów roślinnych i naturalnych wosków. Lunopal to tworzywo sztuczne przypominające papier i dające efekt wspaniałego, przytulnego światła. Również funkcjonalność tej lampy jest taka, o jakiej można tylko marzyć, sama lampa zaś ma odporność na działanie promieni UV, nie żółknie, nie łamie się, a przy tym można ją łatwo umyć. Wbudowany ściemniacz nożny umożliwia dostosowanie jasności do indywidualnych wymagań.   Równowaga ekologiczna dzięki ręcznie wykonanym produktom z Niemiec – harmonijna koegzystencja człowieka i przyrody w centrum procesu produkcji oświetlenia  Jako producent oświetlenia marka DOMUS może pochwalić się długoletnim doświadczeniem, gdyż powstała w 1966 roku. Od tego czasu nie zmieniła swej filozofii wprowadzania światła do domów, udoskonalając przy tym proces produkcji z zachowaniem doskonałej jakości oraz równowagi ekologicznej. Nawet jeżeli produkcja odbywa się przy pomocy doskonałego pod względem technicznym sprzętu, marka DOMUS uważa się za manufakturę, w której utalentowani ludzie z oddaniem i znawstwem sztuki rzemiosła tworzą ręcznie wysokiej jakości lampy dla innych ludzi. We współpracy z projektantami, znawcami drewna, konstruktorami oraz projektantami oświetlenia powstają ponadczasowe i wytrzymałe pod względem technicznym lampy, które spełniają nawet najbardziej wygórowane oczekiwania klientów. Odpowiedzialność ekologiczna marki DOMUS przejawia się w stosowaniu w dużej mierze naturalnych surowców odnawialnych oraz unikaniu niepotrzebnego transportu w procesie produkcji w Niemczech.','','lampa-stojaca-seba-ze-sciemniaczem-noznym','','','','Lampa stojąca Seba ze ściemniaczem nożnym','','','',''),(1557,1,1,'Wyjątkowa lampa podłogowa Jugen z dwoma kloszami  Wersja dwupłomieniowa lampy podłogowej Jugen jest wizualnie bardzo zbliżona do wersji jednopłomieniowej. Podstawa i dolna część stoiska również są tutaj pomalowane na czarno i łączą się w górę w mosiądz szczotkowany. Dwa klosze nie są jednak montowane na górze, lecz na różnych wysokościach po bokach podstawy. Dzięki temu klosze kuliste stoją pod kątem prostym do stojaka, a każdy z nich posiada w środku gniazdo E27, które idealnie nadaje się do zamontowania ściemnianych lamp LED (lampy nie wchodzą w skład zestawu).  Szczególną cechą jest tu również włącznik nożny na kablu lampy wyposażony w ściemniacz, który nie tylko pozwala na włączanie/wyłączanie lampy, ale również na jej ściemnianie.','','mosiezna-lampa-podlogowa-jugen-2-punktowa','','','','Mosiężna lampa podłogowa Jugen 2-punktowa','','','',''),(1558,1,1,'Lampa podłogowa LED Typ 75 Giant - zaprojektowana przez Sir Kennetha Grange\'a  Lampa podłogowa Type 75 Giant LED to przyciągająca wzrok, nowoczesna alternatywa dla oryginalnej oprawy 1227, wprowadzonej na rynek w 2016 roku i stworzonej przez Sir Kennetha Grange\'a, przemysłowego projektanta z Anglepoise® od 2003 roku, oferująca nie tylko szeroki zakres ustawień, ale także bardzo atrakcyjny wygląd.  Podczas gdy podstawowy projekt Grange wydaje się raczej ponadczasowy, realizacja znanego projektanta Paula Smitha jako Edycja 1 z letnią kolorystyką jest bardzo nowoczesna. Lampa podłogowa, która nadaje się do łączenia z szeroką gamą stylów wnętrz.  Wyposażona w wygodny mechanizm stałej sprężyny lampy roboczej Anglepoise®, opracowany w 1930 roku przez projektanta przemysłowego George\'a Carwardine\'a, którego sprężyny naśladują aktywność ludzkich mięśni ramion i tym samym zapewniają lampie niesamowitą mobilność, Original 1227 Giant floor lamp szybko staje się niezastąpionym towarzyszem życia codziennego.  Przed dołączeniem do Anglepoise®, Sir Kenneth Grange był już znany z projektowania produktów codziennego użytku, takich jak zapalniczki, golarki, długopisy i aparaty fotograficzne dla dużych firm, takich jak Wilkinson, Parker i Kodak. Stworzył również projekt zewnętrzny dla angielskiego pociągu InterCity 125.','','anglepoise-type-75-giant-lampa-stojaca','','','','Anglepoise Type 75 Giant lampa stojąca','','','',''),(1559,1,1,'Trójnożna lampa stojąca Oslo Wood - cała w kolorze czarnym  Lampa stojąca Oslo Wood prezentuje się jako korpus lampy, który wyraźnie wyróżnia się na tle innych lamp stojących dzięki kardanowo odchylanemu kloszowi, ale dzięki opływowemu, nowoczesnemu wzornictwu pasuje do innych wiodących projektów oświetleniowych.   To nie przypadek, że Oslo Wood nosi taką nazwę. Jej twórca, Ove Rogne, zainspirował się miejskimi drzewami norweskiej metropolii, które filtrują światło miejskie, oświetlając niebo w ciemną zimową noc. Lampa stojąca, która symbolizuje nordyckie wzornictwo mieszkaniowe nawet w stanie nieoświetlonym, a po zaświeceniu światła zapewnia niezapomnianą atmosferę.  Wbudowany przełącznik ściemniacza pozwala na indywidualną regulację jasności.  Ove Rogne, założyciel i CEO firmy Northern, posiada tytuł magistra ekonomii i rozpoczął karierę związaną z doradztwem biznesowym. Jego decyzja o bardziej kreatywnej pracy i wizja rozjaśniania oświetlenia doprowadziła w 2005 roku do założenia firmy Northern Lighting. W międzyczasie firma nie tylko tworzy projekty oświetleniowe, ale również zajmuje się wzornictwem mieszkaniowym i działa pod nazwą Northern od 2018 roku. Pobierz:   Instrukcja obsługi                    (75 KB)    Specyfikacja techniczna                    (452 KB)','','northern-oslo-wood-lampa-podlogowa-czarna-czarna','','','','Northern Oslo Wood lampa podłogowa czarna/czarna','','','',''),(1560,1,1,'Kompatybilna z aplikacjami lampa podłogowa LED Ilio ze ściemniaczem  To, co od razu rzuca się w oko w przypadku tej lampy stojącej, to jej purystyczny kształt. Korpus tej lampy, wykonany z aluminium, jest bardzo prosty, a przy tym niezwykle praktyczny, ma bowiem postać wąskiego cylindra. Źródło światła znajduje się w górnej części, dzięki czemu Ilio wygląda jak lampa oświetlająca sufit. Dzięki stosunkowo mocnemu strumieniowi świetlnemu ta lampa stojąca może zapewnić pośrednie oświetlenie ogólne w pomieszczeniu. Strumień świetlny można regulować przy użyciu wbudowanego ściemniacza mikroswitch.   Ta wersja lampy stojącej LED Ilio jest również kompatybilna z aplikacją Artemide.  Ernesto Gismondi, projektant Ilio w 1960 roku założył firmę produkującą lampy designerskie, Artemide. Sama firma Artemide jest obecnie uważana za światowego lidera w swojej dziedzinie. Główna siedziba firmy znajduje się w pobliżu Mediolanu. Pięć własnych zakładów produkcyjnych, dwie fabryki szkła oraz centrum badań i innowacji z laboratoriami badawczymi również należą do struktur przedsiębiorstwa, tak samo, jak ogólnoświatowa sieć dystrybucji.','','artemide-ilio-lampa-stojaca-led-aplikacja','','','','Artemide Ilio lampa stojąca LED, aplikacja','','','',''),(1561,1,1,'Regulowana lampa stojąca Giulie z stylu lampy biurkowej  Ta lampa stojąca ma kilka przegubów, umożliwiających dowolne jej ustawianie, wizualnie zaś przypomina klasyczną lampę biurkową. Ma jednak też jednak zupełnie inny wymiar i wydaje się, że coś znanego zostało umieszczone tu w nowym kontekście. Jest to cecha, która była często spotykana w obiektach zorientowanych na design i która sprawia, że takie lampy stojące jak Giulie stają się czymś wyjątkowym. Tę lampę stojącą możemy umieścić obok kanapy i tym samym otrzymać przyjemne światło do czytania a zarazem lampę o stylowym wyglądzie.  Pobierz:   Instrukcja obsługi                    (296 KB)','','czarna-lampa-stojaca-giulie-ruchoma-podstawa','','','','Czarna lampa stojąca Giulie, ruchoma podstawa','','','',''),(1562,1,1,'Industrialnie zaprojektowana lampa podłogowa Lenius z regulowanym ramieniem  Lampa podłogowa Lenius jest klejnotem wzornictwa przemysłowego. Lampa wykonana jest z metalu i prawie w całości lakierowana na kolor czarny. Wyjątkiem jest ramię lampy i gniazdo. Oba elementy lśnią w ciepłym odcieniu starego mosiądzu, który dodatkowo podkreśla industrialny wygląd. Wysokość klosza można regulować za pomocą ruchomego ramienia. Efekt industrialny jest szczególnie podkreślony przez zastosowanie dekoracyjnych żarówek z optyką żarową. Lampa wyposażona jest w wyłącznik.','','lampa-podlogowa-lenius-z-ruchomym-kloszem','','','','Lampa podłogowa Lenius z ruchomym kloszem','','','',''),(1563,1,1,'Lampa stojąca Devon w stylu industrialnym z trójnożnym statywem i osłonami umieszczonymi z boku klosza  Devon to lampa stojąca, której wygląd nawiązuje do stylu industrialnego lub też do obrazów z dziedziny fotografii czy filmu. Lampa wygląda bowiem jak klasyczny reflektor sceniczny i umiejętnie stawia rzeczy warte zobaczenia w odpowiednim świetle. Boczne klapy czarnego klosza, umieszczone po bokach, wyglądają tu niezwykle autentycznie. Stylistyka reflektora w tej lampie zostaje wizualnie uzupełniona o filigranowy statyw lub też trójnożną podstawę.   Włącznik nożny znajduje na przewodzie zasilającym, zakończonym wtyczką.  Pobierz:   Instrukcja obsługi                    (324 KB)','','trojnozna-lampa-stojaca-devon-w-kolorze-czarnym','','','','Trójnożna lampa stojąca Devon w kolorze czarnym','','','',''),(1564,1,1,'Wspaniała lampa podłogowa Ebbi z nutką nostalgii i wykończeniem w kolorze starego mosiądzu  Ebbi to niewątpliwie przykład jednej z lamp, reprezentujących styl industrialny. Powierzchnia jest polakierowana na nostalgiczny kolor starego mosiądzu, a trójnożna podstawa wygląda jak statyw. Oba klosze są wyposażone w kratkę z przodu i można je swobodnie odchylać, co pozwala na indywidualne ustawienie kierunku padania światła. Przełącznik znajduje się na przewodzie lampy.  Pobierz:   Instrukcja obsługi                    (377 KB)','','dwupunktowa-lampa-stojaca-ebbi-z-metalu','','','','Dwupunktowa lampa stojąca Ebbi z metalu','','','',''),(1565,1,1,'Regulowana lampa podłogowa Anne Dolphin - wzornictwo przemysłowe  Lampa podłogowa Anne Dolphin może być wizualnie przyporządkowana do stylu skandynawskiego, ale także w widoczny sposób pokazuje cechy wzornictwa przemysłowego. Z wyjątkiem wewnętrznej części klosza, która jest utrzymywana w kolorze białym dla optymalnego odbicia światła, lampa podłogowa Anne Dolphin jest całkowicie czarna lakierowana. Górna część ramy jest regulowana, podobnie jak głowica lampy. Oznacza to, że kierunek padania światła może być zawsze dostosowany do indywidualnych wymagań. Doskonałe, na przykład, jako źródło światła obok krzesła do czytania w salonie. Wyposażony w wyłącznik kablowy.  - wyposażone w gniazdo E27 dla wszystkich typów lamp','','lampa-podlogowa-anne-dolphin-czarna','','','','Lampa podłogowa Anne Dolphin czarna','','','',''),(1566,1,1,'Lampa podłogowa Delhi z metalową ramą  Smukła i bez falban, lampa podłogowa Delhi szczególnie dobrze komponuje się w pomieszczeniach o szyku przemysłowym. Mała, ale solidna podstawa łączy się w smukłą metalową ramę, która ostatecznie kończy się półokrągłym kloszem. Drewniany element nadaje tutaj ciepły akcent, bawiąc się kontrastami.  Półokrągły, srebrzysty klosz świecący może być również obracany w różnych kierunkach, tak aby kącik do czytania, część mieszkalna lub komoda w korytarzu świeciły pięknym, celowo wykorzystanym światłem. Nie ma więc żadnych ograniczeń dla kreatywności w koncepcji oświetlenia domowego.','','lampa-podlogowa-delhi-z-metalowa-podstawa','','','','Lampa podłogowa Delhi z metalową podstawą','','','',''),(1567,1,1,'Czarna lampa stojąca Plow z drewna i stali  Lampa stojąca Plow z dwoma kloszami idealnie nadaje się do oświetlania obszarowego obok sofy. Rustykalny i przemysłowy wygląd zapewnia zdecydowana lampa, która przekonuje nawet po wyłączeniu ze względu na swoje wyraźne wzornictwo.   Wiązka światła dwóch metalowych kloszy może być regulowana w zależności od potrzeb poprzez obrót i wychylanie kloszy. ','','lampa-podlogowa-plow-2-spoty-czarna-ciemne-drewno','','','','Lampa podłogowa Plow 2 spoty, czarna/ciemne drewno','','','',''),(1568,1,1,'Lampa podłogowa Swantja w kolorze czarnym i złotym z ramką stojącą  Przemysłowy wygląd oprawy jest tu niepowtarzalny, gdyż wydaje się, że ma ona zapożyczenia z fabrycznego designu, ale dobrze komponuje się również z licznymi wnętrzami, które również integrują nostalgicznie wyglądające antyczne akcesoria. Klosz jest czarny i jest uzupełniony siatką na spodzie. Oznacza to, że złote wnętrze lampy jest nadal wyraźnie widoczne, podobnie jak żarówka. Powinno to wyglądać stylowo i idealnie być energooszczędne, tak jak w przypadku nowych żarówek LED, które stają się coraz bardziej popularne, ponieważ wyglądają bardzo podobnie do starych dobrych żarówek. Rama statywu bardzo dobrze uzupełnia ogólny wygląd i jest również wykonana z czarnego metalu. Pobierz:   Instrukcja obsługi                    (1.3 MB)','','lindby-swantja-lampa-stojaca-z-krata-czarno-zlota','','','','Lindby Swantja lampa stojąca z kratą, czarno-złota','','','',''),(1569,1,1,'','','lampa-podlogowa-skansen-regulowana-szara','','','','Lampa podłogowa Skansen, regulowana, szara','','','',''),(1570,1,1,'Trójnożna lampa stojąca Ebbi o industrialnym wyglądzie  Dzięki trójnożnej podstawie Ebbi przywodzi na myśl statyw fotograficzny. Klosz wykonany jest z metalu, który jest tu połączony z kratką. Wykończenie powierzchni o barwie starego mosiądzu nadaje lampie wygląd trochę zabytkowy i dobrze pasuje do industrialnego stylu, jakim cechuje się ta trójnożna lampa stojąca. Ebbi można załączać i wyłączać za pomocą wbudowanego w przewód zasilający przełącznika.  Pobierz:   Instrukcja obsługi                    (310 KB)','','trojnozna-lampa-stojaca-ebbi-w-stylu-industrialnym','','','','Trójnożna lampa stojąca Ebbi w stylu industrialnym','','','',''),(1571,1,1,'Rustykalna lampa podłogowa Asya z czarnego żelaza i dębu z wiejską atmosferą  Lampa podłogowa Asya przekonuje swoją ekscytującą i solidną konstrukcją. Smukła żelazna noga wznosi się z kątowej podstawy, w której znajdują się dwie drewniane ławki wykonane z drewna dębowego, z których każda skierowana jest w jednym kierunku. Na końcu tej drewnianej belki znajduje się element imadła, który nadaje oprawie rustykalny wygląd. Do każdego z tych elementów dołączone jest gniazdo, w które można włożyć odpowiedni oświetlacz. Jeżeli nietypowy wygląd oprawy ma być tu jeszcze bardziej podkreślony, wskazane jest wybranie żarówki żarniwnej. Lampa podłogowa Asya rozprzestrzenia swój przytulny wiejski styl i bardzo dobrze pasuje do salonu. Tutaj tnie on delikatną sylwetkę szczególnie obok kanapy ze względu na swoją smukłą konstrukcję i przekształca pomieszczenie w coś bardzo wyjątkowego. Pobierz:   Instrukcja obsługi                    (300 KB)','','lindby-asya-lampa-podlogowa-drewno-czarne','','','','Lindby Asya lampa podłogowa, drewno, czarne','','','',''),(1572,1,1,'Lilly – lampa stojąca LED o wyglądzie industrialnym, w kolorze czarnym i złotym  Ta lampa stojąca LED ma trzy klosze, które mogą być indywidualnie ustawiane i są czarne na zewnątrz, a złote wewnątrz. Ta kombinacja kolorów jest jednym z najbardziej charakterystycznych trendów w branży oświetleniowej, nie tylko dlatego, że wyglądają one tak harmonijnie, ale również dlatego, że wewnętrzna strona w kolorze złotym promieniuje tak ciepłym i przytulnym światłem. Kształt i rozmieszczenie kloszy tworzą skojarzenia z przemysłowym stylem i czynią tę lampę stojącą LED idealnym elementem oświetleniowym na poddaszu lub w innej podobnej przestrzeni mieszkalnej.  Pobierz:   Instrukcja obsługi                    (467 KB)','','czarna-lampa-stojaca-led-z-trzema-reflektorami','','','','Czarna lampa stojąca LED z trzema reflektorami','','','',''),(1573,1,1,'Scharlie - lampa podłogowa o modnym wzornictwie industrialnym  Dzięki pięknemu metalowemu kloszowi i drewnianej podstawie w formie trójnogu lampa stojąca Scharlie przyciąga wzrok na całej linii. Jest ona utrzymana w stylu modnego wzornictwa industrialnego, inspirowanego przez fabryki i magazyny. Jako element dekoracyjny Scharlie doskonale komponuje się z nowoczesnym salonem lub modnym loftem. Żarówka znajduje się w półokrągłym kloszu. Światło jest tłumione przez okrągłą metalową osłonę, dzięki czemu nie oślepia. Zapewnia to przyjemne oświetlenie i przytulną atmosferę. Lampa jest obsługiwana za pomocą praktycznego przełącznika nożnego, który znajduje się na dwumetrowym kablu. Pobierz:   Instrukcja obsługi                    (304 KB)','','lindby-scharlie-lampa-podlogowa-metalowy-klosz','','','','Lindby Scharlie lampa podłogowa, metalowy klosz','','','',''),(1574,1,1,'','','lampa-podlogowa-skansen-regulowana-czarna','','','','Lampa podłogowa Skansen, regulowana, czarna','','','',''),(1575,1,1,'Elegancka lampa stojąca LED Zera, pięknie rozświetlająca przestrzeń mieszkalną, ściemniana przełącznikiem  Ta lampa stojąca jest dostarczana z żarówką LED, która może być przyciemniana za pomocą przełącznika. Dlatego Zera umożliwia szybką i wygodną zmianę jasności. W celu uruchomienia procesu ściemniania szybko wyłączamy i natychmiast ponownie załączamy przełącznik. Z kolei jeśli nie wykonasz żadnej czynności, jasność spadnie do 10 % wartości maksymalnej. Możliwe jest jednak również ustawienie jasności w zakresie od 100 do 10 procent, jeśli powtarzany jest proces przełączania w trakcie trwającego już procesu ściemniania.   Zera wygląda zarówno minimalistycznie, jak i nieco nostalgicznie. To ostatnie wynika z faktu, że powierzchnia została opatrzona wykończeniem w kolorze antycznej rdzy. Przyjemnie kontrastuje to ze złotym wnętrzem ekranu, który promieniuje ciepłym blaskiem światła i czyni pomieszczenie bardziej przytulnym.  Pobierz:   Instrukcja obsługi                    (544 KB)','','lampa-stojaca-led-easydim-zera-rdzawo-zlota','','','','Lampa stojąca LED easydim Zera, rdzawo-złota','','','',''),(1576,1,1,'Trójnożna lampa stojąca Hilma z drewnianą podstawą i kloszem o wyglądzie reflektora  Podstawą lampy stojącej Hilma jest trójnożny drewniany statyw. Klosz lampy nie jest natomiast klasycznym kloszem i przypomina raczej reflektor sceniczny, nadając oprawie świetlnej prawdziwie industrialnego wyglądu. Dla wszystkich, którzy chcą być w świetle reflektorów we własnych czterech ścianach!  Pobierz:   Instrukcja obsługi                    (388 KB)','','drewniana-lampa-stojaca-hilma-z-trojnozna-podstawa','','','','Drewniana lampa stojąca Hilma z trójnożną podstawą','','','',''),(1577,1,1,'Rustykalna lampa podłogowa Asya wykonana z żelaza i drewna w stylu wiejskiego domu  Lampa podłogowa Asya łączy w sobie eleganckie żelazko z rustykalnymi elementami drewnianymi. Wąska noga wznosi się z okrągłej podstawy, z kątową drewnianą belką z każdej strony. Na końcu każdej wiązki znajduje się gniazdo, do którego można włożyć odpowiednią lampę i które jest przymocowane za pomocą imadła. Dla uzyskania specjalnego efektu, zaleca się wybranie żarówki. Zwięzły projekt lampy podłogowej Asya roztacza we wnętrzu przytulną atmosferę wiejskiego domu, a generowane światło tworzy relaksującą atmosferę. Oprawa wygląda szczególnie dobrze obok kanapy w salonie i przekształca pokój w coś bardzo wyjątkowego. Wygląd wiejskiego domu przyciąga uwagę i przyciąga ciekawskich spojrzeń. Pobierz:   Instrukcja obsługi                    (300 KB)','','lindby-asya-lampa-podlogowa-drewno-chrom','','','','Lindby Asya lampa podłogowa, drewno, chrom','','','',''),(1578,1,1,'','','lampa-podlogowa-skansen-regulowana-biala','','','','Lampa podłogowa Skansen, regulowana, biała','','','',''),(1579,1,1,'Lampa podłogowa Loft D1240 - francuskie wzornictwo przemysłowe  Przykuwająca uwagę i z pozoru solidna w detalach lampa przypomina obserwatorowi budynki fabryczne z ubiegłego wieku, nadając pomieszczeniu gustowny styl retro. Szczególnie w pomieszczeniach w stylu przemysłowym lampa podłogowa stanowi dekoracyjny akcent świetlny. Ale nie tylko projekt jest przekonujący, ale także jego cechy techniczne. Oprawa wyposażona jest w przeguby umożliwiające jej obracanie o 300° do przodu i do tyłu. Dzięki dwóm mechanizmom obrotowym oprawa i głowica mogą być raz obracane na własnej osi, co daje niezliczone możliwości regulacji.   W 1952 roku Jean-Louis Domecq zaprojektował swoją pierwszą lampę \"Standard\" z konieczności, a następnie wprowadził ją na rynek pod nazwą Jieldé. Później stała się to kolekcja lamp Loft, która do dziś produkowana jest ręcznie w fabryce w pobliżu Lyonu i nadal zachwyca swoim charakterystycznym wzornictwem ludzi na całym świecie.','','jielde-loft-d1240-lampa-podlogowa-przegubowe-ramie','','','','Jieldé Loft D1240 lampa podłogowa przegubowe ramię','','','',''),(1580,1,1,'Lampa podłogowa Loft D9403 w szyku retro  W latach 50. brak oświetlenia przemysłowego zmusił Jeana-Louisa Domecqa do zaprojektowania własnego modelu, który zapewniałby wystarczającą ilość światła, był solidny i nie wymagał dokuczliwych kabli zasilających. W rezultacie powstała oprawa Standard, pierwszy produkt producenta Jieldé, który obecnie można znaleźć w prywatnych domach na całym świecie pod nazwą Loft. Lampa podłogowa Loft D9403 jest również częścią tej kolekcji i jest prezentowana w znanym wzornictwie w stylu przemysłowym.   Podobnie jak oryginał, lampa podłogowa Loft obiecuje użytkownikowi wysoki stopień funkcjonalności. Można go obracać za pomocą przegubów uderzających, a mechanizmy obrotowe na głowicy i podstawie światła umożliwiają dalszą regulację. Wokół głowicy lampy znajduje się uchwyt, który umożliwia łatwe pozycjonowanie ukierunkowanej wiązki światła. Szeroka, solidna podstawa lampy zapewnia również niezbędną stabilność.','','jielde-loft-d9403-przegubowa-lampa-podlogowa','','','','Jieldé Loft D9403 przegubowa lampa podłogowa','','','',''),(1581,1,1,'Lampa podłogowa Jieldé - dekoracyjnie zaprojektowana i imponująco elastycznie regulowana  Ta lampa podłogowa jest nie tylko stylistycznie odpowiednim dodatkiem do środowiska życia w stylu przemysłowym, ale także oznacza wyjątkową elastyczność w regulacji kierunku światła.  W latach 50. Jean-Louis-Domecq stworzył serię opraw Loft, na której bazuje seria Signal, a tym samym także SIC843. Dla niego mobilność, a tym samym funkcjonalność, były głównym tematem jego pracy. Dziś seria Loft jest jedną z klasyków wzornictwa francuskiego stylu przemysłowego.  Lampa podłogowa SIC843 wyposażona jest w ramę składającą się z dwóch lekko zakrzywionych ramion, połączonych ze sobą, za pomocą trzech zawiasów, z podstawą i głowicą lampy. Przeguby mogą być obracane o 300°, głowica lampy może być obracana o 360°. SIC843 jest wygodnie włączany i wyłączany za pomocą przełącznika nożnego zintegrowanego z kablem zasilającym.  - Produkt wysokiej jakości z Jieldé (Francja)  - ręcznie robione  - zaopatrzony w unikalną numerowaną tabliczkę','','jielde-signal-sic843-lampa-stojaca-regulowana','','','','Jieldé Signal SIC843 lampa stojąca, regulowana','','','',''),(1582,1,1,'Industrialna lampa stojąca Gear Floor ze ściemniaczem  Gear Floor to kanciasta lampa podłogowa z matowym czarnym lakierowaniem, która dzięki swojemu industrialnemu designowi wzornictwu przyciąga wzrok w pomieszczeniu i stanowi efektowny kontrast do jasnych elementów wyposażenia. Podobnie jak w przypadku zmiany biegów w samochodzie, nachylenie lampy można regulować za pomocą dźwigni, przy czym koła zębate w podstawie lampy przy każdym ruchu działają jak zapadka, co gwarantuje absolutną stabilność i perfekcyjne mocowanie.  Lampa stojąca Gear Floor wyposażona jest w dwumetrowy czarny kabel z wbudowanym przełącznikiem ściemniającym, dzięki czemu nie tylko położenie lampy, ale również natężenie światła może być wybierane w różny sposób.  Lampa stojąca Gear Floor została zaprojektowana przez szwedzkiego projektanta Johana Lindsténa, który po ukończeniu Uniwersytetu Sztokholmskiego założył niezależne studio projektowe, którego celem jest nadawanie osobowości produktom przemysłowym. Dla Northern zaprojektował on serię lamp Gear, która skupia się na użytkowniku. Oprawy z serii Gear charakteryzują się obecnością dźwigni i kół zębatych umożliwiających ręczne ustawianie lamp.     Pobierz:   Instrukcja obsługi                    (203 KB)    Specyfikacja techniczna                    (91 KB)','','northern-gear-floor-czarna-matowa-lampa-stojaca','','','','Northern Gear Floor – czarna matowa lampa stojąca','','','',''),(1583,1,1,'Lampa podłogowa z możliwością dostosowania Aicler AID433  Dzięki przegubom i mechanizmowi obrotowemu na podstawie, lampa podłogowa Aicler AID433 może być umieszczona w dowolnym miejscu, ponieważ w pełni dostosowuje się do lokalnych warunków. Oprawa wykonana jest w całości z metalu, dzięki czemu jest niezwykle wytrzymała. Cylindryczny cień zapewnia ukierunkowaną wiązkę, która optymalnie oświetla kącik odczytu. Jego design pozwala również na szeroką gamę kombinacji, podkreślając przestrzenie w stylu przemysłowym i zapewniając ciekawy kontrast z koncepcjami pomieszczeń, które mają tendencję do minimalizmu.  Wygląd oprawy we wzornictwie przemysłowym jest charakterystyczny dla producenta marki Jieldé z Francji. Twórczość opiera się na pomysłach założyciela Jean-Louis Domecq, który z konieczności zaprojektował oprawę oświetleniową na potrzeby przemysłu w latach 50-tych XX wieku. Wtedy, tak jak teraz, wszystkie lampy są starannie wykonane ręcznie i oznaczają wyjątkową jakość.','','jielde-aicler-aid433-lampa-podlogowa-4x30cm','','','','Jieldé Aicler AID433 lampa podłogowa 4x30cm','','','',''),(1584,1,1,'Lampa podłogowa LED Oryginalna 1227: ruchomy dozownik światła do pomieszczeń mieszkalnych i roboczych  W 2012 roku gama opraw Anglepoise® została rozszerzona o lampę podłogową, która jest podobna do lampy stołowej Anglepoise® na górze. Różnica polega na tym, że elastyczna część oprawy, z jej ramieniem przegubowym o stałym mechanizmie sprężynowym, została uzupełniona o prostą ramę, nadając jej wygląd bardziej zbliżony do tradycyjnej lampy podłogowej. Jest to jednak tylko optycznie, funkcjonalnie pozostaje duża elastyczność i równowaga Anglepoise®. Lampa podłogowa, która jest idealna jako lampa do czytania, na przykład w salonie obok kanapy lub obok fotela.  Oryginalny projekt Anglepoise® został stworzony przez angielskiego projektanta przemysłowego George\'a Carwardine\'a, który w 1930 roku przeniósł swoją wiedzę z projektowania samochodów, gdzie był odpowiedzialny za rozwój amortyzatorów, na rozwój lampy roboczej. Lampa robocza Anglepoise® została wyposażona w specjalne sprężyny, które imitowały ruchliwość ludzkiego ramienia.  - wyposażony w gniazdo E27  - inkluzywny iluminant  - Masa lampy powinna wynosić od 25 do 60 g, aby nie zagrażać równowadze.','','anglepoise-original-1227-lampa-stojaca','','','','Anglepoise Original 1227 lampa stojąca','','','',''),(1585,1,1,'Lampa podłogowa Fabryka z ciągnikiem nożycowym i kloszem lnianym  Dzięki swojemu przemysłowemu wyglądowi, lampa podłogowa Factory w urokliwy sposób łączy wzornictwo z funkcjonalnością. Lekkie ramię można łatwo odchylić na wszystkie strony. Ponieważ jest zbudowany jak nożyczki-hoist, może być przedłużony z 35 cm do maksymalnie 55 cm. Dzięki temu przyjemnemu źródłu światła łatwo jest dodać indywidualny akcent do salonu bez zakłócania domowej atmosfery pomieszczenia. Aby uzyskać większe oświetlenie podstawowe w salonie, można wspaniale połączyć to piękne światło z innymi lampami z serii Factory.','','lampa-podlogowa-factory-z-lnianym-kloszem','','','','Lampa podłogowa Factory z lnianym kloszem','','','',''),(1586,1,1,'Solidna lampa podłogowa Loft D1200 z metalu  Smukły kark i dość mała główka lampy podłogowej Loft D1200 są raczej zarezerwowane, jednak lampa jest optyczną atrakcją obok kanapy lub fotela. Jego wygląd przypomina przemysłowe lampy z ubiegłego wieku, dzięki czemu wzbogaca przede wszystkim koncepcje pomieszczeń w stylu przemysłowym lub vintage. Oferuje on również dużą elastyczność dzięki uderzającym przegubom na szyjce oprawy oraz mechanizmom obrotowym na głowicy i podstawie oprawy.  Konstrukcja lampy podłogowej Loft D1200 jest znakiem towarowym francuskiego producenta Jieldé. Producent ten już w latach 50. produkował lampy do użytku przemysłowego, a później także dla gospodarstw domowych. Pomysły na projekt Loft oparte są na pierwszej lampie autorstwa założyciela i projektanta przemysłowego Jean-Louis Domecq.','','jielde-loft-d1200-lampa-podlogowa-regulowana','','','','Jieldé Loft D1200 lampa podłogowa, regulowana','','','',''),(1587,1,1,'Lampa stojąca Rocky - w oku tygrysa  Lampa stojąca Rocky przejawia bardzo szczególne zachowanie. Klosz przypomina budynek przemysłowy, w którym Balboa kiedyś przygotowywał się do walki ze swoimi przeciwnikami. Czarny klosz z kratką ochronną w połączeniu z jasnym drewnem sosnowym nadaje elegancki akcent i tworzy stylową całość dzięki klasycznemu kształtowi. Drewniane ramię posiada w połowie przegub i dzięki temu można bezstopniowo regulować jego wysokość. Również przemysłowo zaprojektowany klosz może być obracany do żądanej pozycji za pomocą przegubu. Pobierz:   Instrukcja obsługi                    (373 KB)','','kare-rocky-lampa-podlogowa-z-metalu-i-drewna','','','','KARE Rocky lampa podłogowa z metalu i drewna','','','',''),(1588,1,1,'Lampa podłogowa z możliwością regulacji Typ 75 - w zestawie źródło światła LED  Lampa podłogowa LED typu 75 zapewnia optymalne światło do czytania, ponieważ może być regulowana w unikalny sposób dzięki technologii stałej sprężyny Anglepoise®. Technologia ta pozwala ramieniu lampy poruszać się tak samo elastycznie jak mięśniom ludzkiego ramienia.   Elegancki, klasyczny wygląd sprawia, że oprawa wolnostojąca Type 75 jest akcesorium meblowym, które nie pozostawia nic do życzenia pod względem wyglądu i funkcjonalności, a ponadto harmonizuje z wieloma stylami wyposażenia wnętrz.  Dla uzyskania idealnej równowagi lampy podłogowej zaleca się stosowanie lamp o wadze od 25 do 60 g. Jedna lampa LED wchodzi w zakres dostawy.  - zaprojektowany przez Sir Kennetha Grange\'a, znanego projektanta przemysłowego i od 2003 roku dyrektora ds. wzornictwa w Anglepoise®.','','anglepoise-type-75-lampa-stojaca','','','','Anglepoise Type 75 lampa stojąca','','','',''),(1589,1,1,'Lampa stojąca LED Type 75 kolekcja Margaret Howell  Lampy Type 75 zostały zaprojektowane w 2004 roku przez projektanta przemysłowego Sir Kennetha Grange\'a i należą do absolutnej klasyki wśród lamp. Teraz lampy stojące świecą w nowych, świeżych kolorach, wybranych wyłącznie przez brytyjską projektantkę mody Margaret Howell. Oczywiście, lampa ta jest również wyposażona w mechanizm stałej sprężyny, z którego słynie markowy producent Anglepoise®, co czyni ją idealnym towarzyszem w domowym kąciku do czytania.    Lampa stojąca ma klasyczne, industrialne wzornictwo, które pasuje do najbardziej zróżnicowanych stylów wystroju wnętrz. W połączeniu z nowymi kolorami doda pikanterii każdemu pomieszczeniu, bez względu na to, jak bardzo jest ono ponure.','','anglepoise-type-75-lampa-podlogowa-margaret-howell','','','','Anglepoise Type 75 lampa podłogowa Margaret Howell','','','',''),(1590,1,1,'Lampa podłogowa łukowa Loft C1260 - Wzór przemysłowy wykonany we Francji  Metalowa lampa podłogowa Loft C1260 stanowi pożądany kontrast w stosunku do klasycznych, dobrze znanych lamp łukowych, ponieważ nawet z małą, półokrągłą głowicą lampy osiąga wspaniałe efekty w przestrzeni mieszkalnej. Głowica oprawy jest otoczona uchwytem, który ułatwia dokładne ustawienie stożka świetlnego i jednocześnie podkreśla przemysłowy design lampy podłogowej. Wygięty korpus jest wyposażony w trzy przeguby, które umożliwiają indywidualne ustawienie oprawy. Konstrukcja jest zakończona szeroką podstawą lampy, która zapewnia bezpieczną podstawę.  Lampa łukowa wykonana jest z metalu od stóp do głów i jest starannie wykonana ręcznie przez francuskiego producenta lamp Jieldé. Wszystkie lampy Jieldé są zaopatrzone w identyfikator z numerem, który identyfikuje je jako unikalne i oryginalne.','','jielde-loft-c1260-lukowa-lampa-stojaca','','','','Jieldé Loft C1260 łukowa lampa stojąca','','','',''),(1591,1,1,'2-punktowa lampa stojąca Barnstaple w stylu vintage  Wraz z lampą stojącą Barnstaple do domu trafia prawdziwie duże źródło światła. Elegancka lampa z wąskim stalowym prętem w kolorze czarnym i dwoma spotami umieszczonymi niesymetrycznie na końcu pręta stoi na okrągłej podstawie z drewnianą płytą. Klosze wykonane są z cynku i wyglądają na używane, a przy tym urzekają industrialnym urokiem.  Dwa spoty tej lampy stojącej można ustawić w dowolnym kierunku, co pozwala zapewnić optymalne oświetlenie otaczającego pomieszczenia. Ta stylowa lampa zapewnia jasne światło, które barwnie podkreśla wygląd mebli w domu i stawia je na pierwszym planie, czy to w salonie, czy w biurze, czy też w kąciku do czytania.','','2-punktowa-lampa-stojaca-barnstaple','','','','2-punktowa lampa stojąca Barnstaple','','','',''),(1592,1,1,'Prosta lampa podłogowa Aicler AID833 z ramieniem przegubowym  Lampa podłogowa Aicler AID833 w stylu przemysłowym dodaje do pomieszczenia nutkę nostalgii i stanowi interesujący akcent oświetleniowy w wielu różnych koncepcjach pomieszczeń. Oprawa posiada długie, smukłe ramię, które jest wyposażone w przeguby i dzięki temu może być indywidualnie regulowana. Odcień ma klasyczny cylindryczny kształt i jest wykonany z nieprzezroczystego aluminium, dzięki czemu zapewnia ukierunkowaną wiązkę światła, która jest idealna do wielogodzinnego przeglądania ulubionej książki.  Aicler AID833 jest starannie wykonany ręcznie w fabryce francuskiego producenta Jieldé. Firma została założona w latach 50-tych i jest znana z lamp o charakterystycznym wzornictwie przemysłowym i dużej elastyczności.','','jielde-aicler-aid833-8030cm-lampa-podlogowa','','','','Jieldé Aicler AID833 80+30cm lampa podłogowa','','','',''),(1593,1,1,'Wykonana z rdzawobrązowych rurek - Przemysłowa lampa podłogowa Amarcord z trzema gniazdami  Ta lampa podłogowa jest absolutnym hitem wzornictwa przemysłowego. Rozgałęzione, wygięte rury wodne o zardzewiałym wyglądzie tworzą wszystkie sekcje Amarcord. Na końcach bocznych odgałęzień i górnym końcu ramy znajdują się trzy skierowane do góry oprawki lampowe, które mogą być idealnie wyposażone w żarówki dekoracyjne z uwagi na otwartą konstrukcję bez klosza. Jako autentyczna ozdoba, na dole ramki znajduje się manometr. Z włącznikiem na przewodzie wtykowym.','','lampa-stojaca-amarcord-rdzawo-brazowa-trzypunktowa','','','','Lampa stojąca Amarcord rdzawo-brązowa trzypunktowa','','','',''),(1594,1,1,'Lampa podłogowa Aicler AIC433 łączy w sobie wzornictwo i elastyczność  Francuska tradycyjna firma Jieldé oznacza niepowtarzalny design w stylu przemysłowym i największą możliwą elastyczność. Lampa podłogowa Aicler AIC433 również uosabia te cechy dzięki sześciu przegubom na ramieniu i podstawie lampy. Oznacza to, że oprawa jest nie tylko regulowana na wysokość, ale może być również ustawiona w odpowiedniej pozycji zgodnie z preferencjami użytkownika. Przyciągające wzrok łączenia i szeroka podstawa podkreślają przemysłowy charakter oprawy, a zakrzywiony klosz nadaje jej klasyczny urok.   Na abażurze znajduje się tabliczka z nazwą firmy oraz indywidualnym numerem, który identyfikuje każdą lampę jako unikalną i oryginalną. Ponieważ wszystkie lampy Jieldé są produkowane w skomplikowanym procesie pracy ręcznej, jak już w latach 50. ubiegłego wieku przez założyciela i wynalazcę Jean-Louisa Domecqa.','','jielde-aicler-aic433-przegubowa-lampa-podlogowa','','','','Jieldé Aicler AIC433 przegubowa lampa podłogowa','','','',''),(1595,1,1,'Lampa podłogowa Aicler AIC833 z praktycznym ramieniem przegubowym  Po frustrujących poszukiwaniach odpowiednich opraw do miejsc pracy w fabryce, sam Jean-Louis Domecq szybko zaprojektował oprawę, która spełniała jego wymagania. W ten sposób powstał producent Jieldé, którego nazwa pochodzi od inicjałów Domecq i który do dziś produkuje ręcznie lampy o charakterystycznym wzornictwie przemysłowym. Tak było również w przypadku lampy podłogowej Aicler AIC833.  Oprócz zwięzłego wyglądu, lampa podłogowa jest również niezwykle elastyczna, ponieważ jej orientację można regulować indywidualnie za pomocą ruchomego ramienia. Zakrzywiony klosz oprawy zapewnia ukierunkowane oświetlenie, dzięki czemu oprawa szczególnie nadaje się do oświetlania kanapy lub kącika do czytania. Wytrzymała podstawa i przeguby, które trudno przeoczyć, podkreślają przemysłowy styl lampy, a klosz i długie, smukłe ramię nadają jej nowoczesny wygląd. Oprawa łączy się w ten sposób z najróżniejszymi koncepcjami pomieszczeń, od rustykalnych po nowoczesne minimalistyczne.','','jielde-aicler-aic833-lampa-podlogowa-8030cm','','','','Jieldé Aicler AIC833 lampa podłogowa 80+30cm','','','',''),(1596,1,1,'Lampa podłogowa Matryca z kloszem klatkowym w kolorze czarnym  Lampa podłogowa Matrix ustawia się uderzająco w pomieszczeniu i zachwyca otwartą, a jednocześnie stabilną konstrukcją. Umiejętne wykorzystanie materiałów z ciemnym wykończeniem daje każdemu pomieszczeniu to coś pewnego.   Uderzający wygląd jest siłą tej stylowej oprawy. Czarny metal spotyka się z ciemnym drewnem i dzieli lampę podłogową na harmonijne segmenty. Klosz na głowicy lampy nadaje instalacji lekkie wykończenie, z głównym naciskiem na przyjemny opad światła. W ten sposób każdy pokój jest uzupełniany przez zgrabny, żyjący dodatek.','','lampa-podlogowa-matrix-o-wygladzie-klatki','','','','Lampa podłogowa Matrix o wyglądzie klatki','','','',''),(1597,1,1,'Efektowna lampa podłogowa Loft D9406 w wykonaniu przemysłowym  Lampa podłogowa Loft D9406 nie jest niczym prostym, ponieważ dzięki swoim sześciu ramionom przyciąga wzrok każdego, a tym samym stanowi optyczny akcent w przestrzeni mieszkalnej. Ramiona posiadają przeguby na końcach, za pomocą których można obracać i regulować wysokość lampy. Zaokrąglona główka lampy zapewnia ukierunkowany stożek świetlny, który można ustawić we właściwej pozycji za pomocą uchwytu. Szeroka podstawa lampy zapewnia niezbędną stabilność i posiada mechanizm obrotowy, który umożliwia obracanie lampy o 360°. Dzięki temu lampa podłogowa może być w pełni dostosowana do wymagań użytkownika i warunków panujących w pomieszczeniu.  Za projektem lampy stoi francuski producent Jieldé, który został założony w latach 50-tych przez Jean-Louis Domecq. Podobnie jak w czasach zakładania firmy, lampy są nadal wykonywane ręcznie, dzięki czemu każda z nich jest niepowtarzalna. Lampy Jieldé tworzą równowagę pomiędzy formą, materiałem i funkcjonalnością i nadają każdemu pomieszczeniu pewien dodatek poprzez swój efektowny wygląd.','','jielde-loft-d9406-lampa-podlogowa-6x40cm','','','','Jieldé Loft D9406 lampa podłogowa 6x40cm','','','',''),(1598,1,1,'Dwupłaszczyznowa lampa podłogowa SI8380 z dwoma elastycznymi regulowanymi ramionami  Ta lampa podłogowa fascynuje z jednej strony swoim przemysłowym wyglądem, a z drugiej strony możliwością regulacji zintegrowanych przegubów. Rodzinna firma Jieldé z Saint-Priest niedaleko Lyonu, założona w 1955 roku przez Jeana-Louisa Domecqa, produkuje ten szlachetny dozownik światła w misternej pracy ręcznej.   Lampa podłogowa SI8380 wyposażona jest w stabilną podstawę oraz dwa ramiona o różnej długości. Każde ramię może być obrócone o 280° w obszarze podstawy. Jedno ramię jest jednoczęściowe, drugie dwuczęściowe z łącznikiem jako połączeniem między elementami. Obie głowice lamp mogą być obracane o 360°. Kierunek światła można zawsze elastycznie regulować. Z włącznikiem nożnym na kablu.  Każde z tych świateł jest unikalnym elementem, który jest podkreślony numerowaną tablicą na świetle.  - Odbłyśniki wewnątrz bieli - optymalne odbicie światła  - gniazdo ceramiczne','','jielde-signal-si8380-lampa-stojaca-2-pkt','','','','Jieldé Signal SI8380 lampa stojąca, 2-pkt.','','','',''),(1599,1,1,'CINE - nowoczesna lampa stojąca w stylu industrialnym  Zarówno służący za podstawę trójnóg, jak i regulowana głowica w formie reflektora nadają lampie stojącej CINE techniczny, industrialny charakter, dzięki czemu wprowadzi ona do każdego wnętrza klimat starej fabryki. Podstawa jest wykonana z pokrytego czarnym lakierem metalu, głowica zaś wraz z uchwytem i ochronną kratą mają błyszczącą, chromowaną powierzchnię. Przełącznik nożny na kablu zasilającym zapewnia komfortową obsługę lampy. Lampa jest wyposażona w oprawkę E27, dlatego przystosowana jest zarówno do tradycyjnych żarówek, żarówek LED, jak i żarówek energooszczędnych, co czyni z niej niezwykle ekonomiczne źródło oświetlenia dodatkowego oraz niecodzienną dekorację wnętrza.','','cine-lampa-stojaca-w-ksztalcie-reflektora','','','','CINE - lampa stojąca w kształcie reflektora','','','',''),(1600,1,1,'Metalowa lampa podłogowa Delhi z ramą trójnożną  Czy to obok kanapy czy krzesła do czytania, lampa podłogowa Delhi po prostu przycina dobrą figurę wszędzie i przez cały czas. Szczególnie jego filigranowa, trójnożna rama jest w centrum uwagi. Ciepłe drewno i chłodny metal doskonale się uzupełniają i nadają przemysłowy charakter otaczającemu pomieszczeniu.  Dzięki półokrągłemu kloszowi, który można dowolnie regulować, lampa podłogowa dostarcza światło dokładnie tam, gdzie jest ono potrzebne. Tworzy to naprawdę miłą atmosferę w domu - a ciemne zakątki bez wystarczającej przytulności są w końcu zapomniane.','','lampa-podlogowa-delhi-z-podstawa-trojnozna','','','','Lampa podłogowa Delhi z podstawą trójnożną','','','',''),(1601,1,1,'Makbet - Lampa podłogowa w stylu przemysłowym  Ich wzornictwo doskonale wpisuje się w nowoczesność, choć ich wygląd naśladuje dawno minione czasy. Odcień kopuły, który wygląda trochę grubo, i rama lampy podłogowej Makbeta są również w antycznym odcieniu miedzi. Szczególną cechą lampy podłogowej jest możliwość regulacji ramienia górnego i klosza. Jest to możliwe dzięki małym śrubom, które nie tylko są tu funkcjonalne, ale jednocześnie stanowią element konstrukcyjny. Lampa podłogowa Macbeth jest więc idealnym uzupełnieniem koncepcji wyposażenia wnętrz w stylu przemysłowym lub nowoczesnych pomieszczeń mieszkalnych, które poszukują szczególnego podkreślenia.','','lampa-podlogowa-macbeth-z-metalu-w-modnej-miedzi','','','','Lampa podłogowa Macbeth z metalu w modnej miedzi','','','',''),(1602,1,1,'Czarna lampa stojąca Karoli z elastyczną głowicą, idealna jako uzupełnienie minimalistycznych elementów wyposażenia i stylów aranżacji, w których dominuje nieco bardziej skandynawski design  Karoli ucieleśnia elegancki minimalizm, ponieważ z pewnością brak tu zbędnych detali, dominuje natomiast purystyczny wygląd, pełen prostej i szlachetnej elegancji. Cały korpus od głowicy aż po stopę wykonany jest z metalu i ma ciemne wykończenie o barwie matowej czerni, dzięki czemu z pewnością przyciągnie wzrok. Klosz nie przekonuje bogatymi formami, ale wręcz przeciwnie – nowoczesną prostolinijnością, a mając cylindryczny kształt, ucieleśnia swoisty uniwersalizm, który cieszy oko także po latach, gdyż nie podlega żadnej modzie. Tak wygląda prawdziwa elegancja!  Dzięki elastycznemu ramieniu głowicę można obracać w zależności od potrzeb, a tym samym wydajność świetlną można wyregulować kilkoma ruchami ręki. Ta lampa stojąca to wart uwagi element oświetleniowy, szczególnie jako lampka do czytania. Bardzo przekonująca jest także możliwość zastosowania jej jako źródła światła pośredniego, skierowanego do góry.  Pobierz:   Instrukcja obsługi                    (164 KB)','','lampa-stojaca-karoli-elastyczne-ramie-czarna','','','','Lampa stojąca Karoli, elastyczne ramię, czarna','','','',''),(1603,1,1,'Łukowa lampa stojąca Phileas, czerń i złoto  Większy rozmach we własnych czterech ścianach: Łukowa lampa stojąca Phileas dzięki swemu dużemu kloszowi wyczarowuje w pomieszczeniu duży snop światła, który idealnie nadaje się do czytania lub zapewnia oświetlenie podczas wspólnych chwil z rodziną. Złocenie od wewnątrz sprawia, że światło wydaje się niezwykle ciepłe, podczas gdy czarna część zewnętrzna wygląda bardziej powściągliwie.  Stabilna stopa lampy stojącej zapewnia stabilność przy postawieniu na podłożu. Metal jest szczególnie trwały i wytrzymały, a jego zakrzywiony kształt sprawia, że wygląda zarazem niezwykle delikatnie. Pobierz:   Instrukcja obsługi                    (347 KB)','','lukowa-lampa-stojaca-phileas-czern-i-zloto','','','','Łukowa lampa stojąca Phileas, czerń i złoto','','','',''),(1604,1,1,'Lampa ścienna i sufitowa Teti firmy Artemide  Model Teti projektanta Vico Magistretti jest projektem, który pierwotnie powstał w roku 1970. Redukcja do tego, co najistotniejsze jest wciąż wyrazem stylu, który zarówno wówczas, jak i obecnie zyskuje wielu zwolenników. Lampa ścienna Teti składa się zasadniczo tylko z oprawy z kolistą obudową wykonaną z białego lśniącego poliwęglanu - wystarczy włożyć odpowiednią żarówkę - gotowe. Naturalnie w przypadku lampy bez klosza ważne jest zastosowanie dekoracyjnej żarówki, aby zachować estetykę całej lampy.   Teti może być stosowana zarówno jako lampa ścienna, jak i jako lampa sufitowa.   Projekt lampy Teti pochodzi od projektanta i architekta Vico Magistretti, który poza tym, że był projektantem, pracował również jako planista miejski. Vico Magistretti za życia pracował m. in. dla Artemide. Tam również powstała lampa ścienna i sufitowa Teti. Artemide należy do grona najbardziej znanych na świecie producentów lamp designerskich. Oprócz słynnych projektantów, podstawę sukcesu lamp Artemide tworzą własne zakłady produkcyjne, fabryki szkła oraz własne centrum innowacji i badań.  Pobierz:   Specyfikacja techniczna                    (85 KB)    Instrukcja obsługi                    (345 KB)    Instrukcja obsługi 2                    (345 KB)    Photometric Data LDT                    (7 KB)','','artemide-teti-designerska-lampa-sufitowa-biala','','','','Artemide Teti designerska lampa sufitowa, biała','','','',''),(1605,1,1,'Lampa sufitowa Valina z kloszem o indywidualnym kształcie  Lampa sufitowa Valina prezentuje się w ciekawym wzornictwie i zachwyca kloszem. Został on wykonany ze szkła i ma bardzo indywidualnie zaprojektowany kształt. Oprawa sufitowa wykonana jest z żelaza i została pokryta wykończeniem w kolorze chromu.  Powściągliwy, a jednocześnie niepowtarzalny wygląd tej lampy daje neutralny efekt kolorystyczny i może odpowiednio dopasować się do różnych wnętrz. Valina może być wspaniale zintegrowana z własnym salonem i nadaje się również do sektora komercyjnego. Pobierz:   Instrukcja obsługi                    (309 KB)','','lucande-valina-lampa-sufitowa-ze-szkla','','','','Lucande Valina lampa sufitowa ze szkła','','','',''),(1606,1,1,'Lampa sufitowa Limana o sześciokątnym świetle i kloszu kryształowym  To piękne źródło światła wnosi do pokoju szczególny charakter, który zdecydowanie warto zobaczyć. Rama wykonana jest z litego żelaza, a abażur z cennego kryształu. Filigranowe elementy krystaliczne zapewniają indywidualną grę światła na ścianach i suficie.  Wyposażony w sześć palników, Limana może być wyposażony zarówno w źródła światła z funkcją ściemniania, jak i bez funkcji ściemniania - wybór pozostawiamy użytkownikowi. Szczególnie dobrze nadają się jednak źródła światła LED, które dzięki swojej technologii są szczególnie energooszczędne. Oprawa ta może być stosowana zarówno w domu jak i w biznesie. Pobierz:   Instrukcja obsługi                    (493 KB)','','lucande-limana-krysztalowa-lampa-sufitowa-50-cm','','','','Lucande Limana kryształowa lampa sufitowa, 50 cm','','','',''),(1607,1,1,'Klasyczna lampa sufitowa DANIA z polerowanym chromem i szkłem.  Ta elegancka okrągła lampa sufitowa - od dawna sprawdzona - emituje jasne, nieoślepiające światło w łazience, korytarzu i innych pomieszczeniach. Chromowana rama jak również biała okrywa szklana zapewniają ponadczasowy i niezależny stylowo wygląd, dający się wkomponować wszędzie i w każdym czasie. Pobierz:   Specyfikacja techniczna                    (53 KB)    Instrukcja obsługi                    (1.1 MB)','','klasyczna-lampa-sufitowa-denia-wersja-chromowana','','','','Klasyczna lampa sufitowa DENIA wersja chromowana','','','',''),(1608,1,1,'Kryształowe światło sufitowe Limana wyczarowuje na suficie szczególny nastrój  Dzięki swojemu cennemu kloszowi lampa sufitowa Limana przyciąga wszystkie oczy. Jego rama została wykonana z solidnego żelaza, a abażur składa się z wielu kryształowych elementów. Przynoszą one bardzo ciekawe efekty świetlne na suficie i ścianach, które zapewniają szczególną atmosferę.  Wewnątrz klosza ukryte są w sumie cztery palniki, które mogą być wyposażone w żarówki G9. W przypadku zastosowania żarówek z możliwością ściemniania, w razie potrzeby można zmienić jasność oprawy i w ten sposób dostosować warunki oświetleniowe do własnych potrzeb. Pobierz:   Instrukcja obsługi                    (475 KB)','','lucande-limana-krysztalowa-lampa-sufitowa-36-cm','','','','Lucande Limana kryształowa lampa sufitowa, 36 cm','','','',''),(1609,1,1,'Fascynująca lampa sufitowa LED Easy Cruiser dla fanów skatingu  Lampa sufitowa LED Easy Cruiser w kształcie deskorolki prezentuje się jako szczególny rodzaj atrakcji. Deskorolka została pomalowana w jaskrawych kolorach z artystycznym motywem. Pomiędzy osiami kół znajdują się trzy okrągłe spoty LED diodami o barwie ciepłej bieli. Same białe rolki są również wyposażone w małe diody LED i są ozdobą tej lampy. Easy Cruiser nadaje się szczególnie do pomieszczeń młodzieżowych lub hobbystycznych i może być używany z dobrym oświetleniem ogólnym.  Lampa sufitowa LED Easy Cruiser została wyprodukowana w Niemczech i zachwyca fantastycznym designem małych i dużych fanów skatingu.','','lampa-sufitowa-led-easy-cruiser-wyglad-skateboardu','','','','Lampa sufitowa LED Easy Cruiser wygląd Skateboardu','','','',''),(1610,1,1,'Ściemniana lampa sufitowa LED Easy Cruiser Graffiti o wyglądzie deskorolki, sterowana radiowo  Niebieska deskorolka z motywem graffiti już sama w sobie przyciąga wzrok, ale jeśli jest zawieszona na suficie i może emitować światło na kilka sposobów, to jest absolutną atrakcją w pokoju dziecka. Deskorolka wyposażona jest w siedem źródeł światła, które można włączać i wyłączać za pomocą pilota radiowego dostarczonego w zestawie. Jasność trzech spotów LED owych, które są wbudowane w dolnej części elementu z nadrukiem graffiti, można również zmniejszać. Akcenty kolorystyczne tworzy się tu za pomocą elastycznych pasków LED RGB mocowanych do kół. Mogą one być przełączane oddzielnie.  Ta lampa sufitowa Easy Cruiser Graffiti inspiruje małych i dużych miłośników deskorolek swoim nowoczesnym designem i różnorakim oświetleniem LED. ','','deskorolkalampa-led-easy-cruiser-graffiti','','','','Deskorolka–lampa LED Easy Cruiser Graffiti','','','',''),(1611,1,1,'Czarująca lampa sufitowa VELI PRISMA o wyjątkowym designie z materiału „Prisma Lentiflex”  Ta ekskluzywna lampa sufitowa nada każdemu wnętrzu elegancki wygląd, a dzięki łagodnym liniom zachwyca optymalną jakością światła. Niezwykły design zapewni wyjątkowe efekty świetlne.  Lampę można umieścić na suficie za pomocą praktycznego systemu z magnesem. Dzięki niemu klosz lampy można łatwo zdjąć Ułatwia to nie tylko wymianę żarówki, ale również czyszczenie lampy.  Wizjonerskie lampy tworzone przez designerów we Włoszech - Slamp  Włoska kuźnia designerów Slamp z siedzibą w Rzymie została założona na początku lat 90. XX wieku. przez Roberto Zilianiego. Ziliani już wcześniej działał twórczo zanim odkrył swoją pasję i możliwości, jaki daje światło.  Spełniające najwyższe standardy materiały, wykonanie i jakość  Marka Slamp kładzie szczególny nacisk na tworzenie nowych materiałów. Oprócz naturalnych i tradycyjnych surowców takich jak skóra, miedź, kryształ czy stal szlachetna firma Slamp wykorzystuje również własne opatentowane materiały jak Cristalflex®, Opalflex® i Lentiflex®. Dzięki nim możliwe jest stworzenie wyjątkowych efektów świetlnych. Na przykład materiał Lentiflex® służy jako woda, która w zależności od kąta patrzenia zmienia kolor. To właśnie własne materiały marki Slamp oraz powstałe z nich lampy są silnymi atutami firmy. Należą do nich również między innymi spory poziom innowacji, kreatywności oraz oryginalności, a także doskonałe wyczucie działania światła. Pobierz:   Specyfikacja techniczna                    (2.6 MB)','','slamp-veli-prisma-lampa-sufitowa-o-53cm','','','','Slamp Veli Prisma - lampa sufitowa, Ø 53cm','','','',''),(1612,1,1,'Lampa sufitowa LED Keto o cylindrycznym kształcie, emitująca światło o barwie ciepłej bieli  Dzięki cylindrycznej lampie sufitowej LED Keto łazienka jest nie tylko pięknie oświetlona, ale również zostaje wzbogacona o pewien styl, . Dzięki chromowanemu i błyszczącemu cokołowi i eleganckiemu kloszowi z opalowego szkła ta lampa sufitowa jest bowiem szczególnie atrakcyjnym źródłem światła. Światło jest generowane wewnątrz opalowego cienia szkła przez ciepłobiałą diodę LED i emitowane do otoczenia przez klosz w taki sposób, że nie oślepia obserwatora.   Większe łazienki mogą być również pięknie oświetlone za pomocą Keto, ponieważ można lampy te można łączyć w grupy po kilka sztuk, a tym samym wraz z montażem każdej kolejnej lampy zwiększyć też potencjalne natężenie światła.   Posiada stopień ochrony IP44.','','lampa-sufitowa-led-keto-stopien-ochrony-ip44','','','','Lampa sufitowa LED Keto, stopień ochrony IP44','','','',''),(1613,1,1,'Lampa sufitowa BUTTON marki FLOS została wykonana ze szkła i dzięki stopniowi ochrony IP40 nadaje się do użycia w łazience.  Lampa sufitowa BUTTON projektu Piero Lissoniego ze względu na swój prosty przyjemny dla oka design nie przypomina lampy, jeśli wziąć pod uwagę funkcjonalność. W samym środku klosza znajduje się srebrny błyszczący element, nadający jej szczególny wygląd. Właśnie ta prosta forma sprawia, że lampa ta jest ponadczasowa nadaje jej status absolutnego klasyka w dziedzinie oświetlenia. Stopień ochrony IP40 oznacza, że bez problemu można ją umieścić w łazience lub w wilgotnych pomieszczeniach. Odnajdzie się również w kuchni, zapewniając ogólne oświetlenie, gdyż jest to miejsce wymagające dużej ilości światła.   Od ponad 50 lat od czasu swojego powstania marka FLOS, współpracując ze znanymi projektantami, tworzy wyjątkowe, wysokiej jakości oświetlenie, które cieszy się międzynarodowym uznaniem i jest nagradzane w wielu konkursach. Pobierz:   Instrukcja obsługi                    (480 KB)    Specyfikacja techniczna                    (292 KB)    Photometric Data LDT                    (100 KB)','','biala-lampa-sufitowa-button-ip40','','','','Biała lampa sufitowa BUTTON, IP40','','','',''),(1614,1,1,'Kwadratowa lampa sufitowa LED Tian z matową aluminiową rama i satynowanym szklanym kloszem, wyprodukowana w Niemczech  Tian to doskonałej jakości lampa sufitowa LED, wyróżniająca się etykietą „made in Germany”, składająca się w dużej mierze z satynowanego szkła, którego przezroczysty brzeg atrakcyjnie kontrastuje z całością. W środku znajduje się masywny frezowany aluminiowy reflektor w kształcie ramy, dopełniający wyglądu całego przedmiotu o wielowarstwowej stylistyce. Z tyłu ukryto cztery diody LED, emitujące światło pośrednie, zapewniające przytulny wygląd pomieszczeniu. Powierzchnia tej lampy została poddana starannej obróbce ręcznej, a żarówki cechują się niezwykłą energooszczędnością, dzięki czemu powstaje produkt użyteczny i dobry jakościowo, jakim jest właśnie ta lampa sufitowa LED Tian.   - bardzo duża komora na przyłącze, zapewniająca komfortowy montaż  - przeznaczona także do użytku jako lampa ścienna Pobierz:   Instrukcja obsługi                    (258 KB)','','lampa-sufitowa-led-tian-szklany-klosz-25-cm','','','','Lampa sufitowa LED Tian, szklany klosz, 25 cm','','','',''),(1615,1,1,'Spiralna lampa sufitowa Chenoa z kloszami szklanymi  Chenoa jest specjalną lampą sufitową, która skręca się w dół z uchwytu sufitowego. Na ramieniu lampy znajduje się w sumie pięć punktów świetlnych, które są przykryte kloszami wykonanymi ze szkła. Rama wykonana jest z żelaza, które zostało pokryte czarnym wykończeniem powierzchni.  Ten niepowtarzalny wygląd nie tylko we własnym domu, ale również w obszarze handlowym pięknie się prezentuje. Wybór iluminanta pozostawia się użytkownikowi. Prawdziwy przykuwacz oczu na suficie! Pobierz:   Instrukcja obsługi                    (325 KB)','','lucande-chenoa-lampa-sufitowa-ksztalcie-spiralnym','','','','Lucande Chenoa lampa sufitowa kształcie spiralnym','','','',''),(1616,1,1,'Szlachetna lampa sufitowa Kartio z dwoma źródłami światła i elastycznymi przegubami kulowymi  Design lampy sufitowej Kartio nie pozostawia nic do życzenia, ponieważ wygląda ona nie tylko minimalistycznie, lecz także szlachetnie i funkcjonalnie zarazem. Czarna płyta montażowa w kształcie prostokąta wydaje się bardzo obecna i solidna. Miłym kontrastem są dwa abażury w kształcie stożka. Ich geometryczna przejrzystość wnosi do projektu odrobinę lekkości i sprawia, że oprawa wydaje się bardziej dynamiczna. Jednocześnie na pierwszy plan wysuwa się szlachetne wykończenie z mosiądzu, które nadaje Kartio ekskluzywny charakter.  Szczególną cechą tej oprawy są dwa zintegrowane przeguby kulowe, które są zainstalowane u podstawy każdego klosza, ponieważ zapewniają im dodatkową elastyczność. Emisja światła, która jest już wstępnie zdefiniowana przez kształt kloszy, może być więc specjalnie regulowana pod względem kierunku. Gwarantuje to indywidualne akcenty świetlne w pomieszczeniu, które zawsze można na nowo zdefiniować ręcznie.  Wybór źródła światła pozostawiamy użytkownikowi, przy czym jasność oprawy można zmieniać za pomocą ściemnialnych odbłyśników GU10 i zwykłego ściemniacza ściennego. W ten sposób w krótkim czasie można dostosować atmosferę pomieszczenia do własnego nastroju. Pobierz:   Instrukcja obsługi                    (393 KB)','','lucande-kartio-lampa-sufitowa-2-pkt-mosiadz','','','','Lucande Kartio lampa sufitowa, 2-pkt., mosiądz','','','',''),(1617,1,1,'Lampa sufitowa LED Alobani wykonana z cennego szkła kryształowego  Sufitowa lampa LED Alobani zachwyca ekskluzywnym wzornictwem, które jednocześnie robi klasyczne i ponadczasowe wrażenie. Składa się on z wielu elementów wykonanych z cennego kryształu, które pięknie odbijają światło i tym samym dają niepowtarzalne efekty świetlne.  Zainstalowany na stałe moduł LED jest trwały i oszczędny w zużyciu energii. Technologia LED świeci swoją trwałością i jasnością. Istnieje również możliwość regulacji jasności oprawy Alobani za pomocą standardowego ściemniacza ściennego (dimmer exclusive) i tym samym stworzenia przytulnej atmosfery w bardzo prosty sposób. Alobani to prawdziwa atrakcja, która znajduje również miejsce w sektorze hotelarskim i gastronomicznym. Pobierz:   Instrukcja obsługi                    (398 KB)','','lucande-alobani-lampa-sufitowa-led-z-krysztalami','','','','Lucande Alobani lampa sufitowa LED z kryształami','','','',''),(1618,1,1,'Kula wykonana z białego szkła opalowego - lampa sufitowa Mini Glo Ball C/W firmy FLOS  Ponadczasowe wzornictwo - takie jest motto Mini Glo Ball C/W autorstwa projektanta Jaspera Morrisona. Kształt i materiał są w równym stopniu wyrazem klasycznego wzornictwa. Biały opalowy korpus z wytrawionego, dmuchanego szkła ma kształt kuli z lekko spłaszczonymi biegunami. Pod tym względem kształt lampy przypomina naszą Ziemię, która nie do końca odpowiada kształtowi kuli.   Jasper Morrison, który zaprojektował serię lamp Glo Ball dla producenta lamp FLOS, chciał poprzez swój projekt osiągnąć największe możliwe rozproszenie światła przy jednoczesnym zachowaniu pewnej estetyki. Udało mu się to połączyć z lampą sufitową Mini Glo Ball, która może być również montowana jako kinkiet. Światło emitowane przez tę lampę gwarantuje brak olśnień i jest szczególnie delikatne dzięki zastosowaniu szkła opalowego.  Pobierz:   Instrukcja obsługi                    (241 KB)    Specyfikacja techniczna                    (342 KB)    Photometric Data LDT                    (104 KB)','','flos-mini-glo-ball-c-w-designerska-lampa-sufitowa','','','','FLOS Mini Glo-Ball C/W-designerska lampa sufitowa','','','',''),(1619,1,1,'Elegancka lampa sufitowa Veli w srebrnym kolorze  Przepiękna lampa sufitowa Veli oczarowuje każdego obserwatora i przyciąga jego uwagę na długi czas. Po włączeniu lampy powstaje magiczna gra światła, a całe pomieszczenie jest odpowiednio oświetlane we wspaniały sposób. Lampa sufitowa Veli ma średnicę 53 cm i wysokość 20 cm, co czyni z niej smukłą lampę o przyjemnym wyglądzie. Pomimo tych wymiarów i faktu, że lampa ma wbudowany system magnetyczny, jej waga wynosi zaledwie 1,25 kg. Do oświetlenia stosowane są dwie żarówki o mocy 20 W, które można z łatwością wymienić za pomocą wspomnianego systemu magnetycznego. Tylko zamocowanie uchwytu wymaga jednorazowego użycia narzędzi i wysiłku. Następnie wystarczy jednym ruchem ręki zdjąć klosz z sufitu i można z łatwością wykonać wszystkie niezbędne prace. Lampa sufitowa Veli jest zabezpieczona przez stopień ochrony IP20 i klasę ochronności II. Materiały i ich obróbkę charakteryzuje bardzo wysoka jakość, ponieważ staranna praca ma dla designerskiej firmy Slamp duże znaczenie. Dlatego też zastosowany materiał, Steelflex®, został opracowany przez pracowników kuźni designu Slamp. Dzięki temu lampa sufitowa wygląda niepowtarzalnie, a sam materiał idealnie pasuje do jej zakresu zastosowania. Klosz został zaprojektowany niezwykle misternie. Składa się on w dużej mierze z pojedynczych elementów z materiału Steelflex®. Bardzo cienkie płytki zostały uformowane w fantazyjne wzory. Krawędzie płytek są skierowane na zewnątrz, dzięki czemu całość od dołu wygląda jak posrebrzany bukiet. Pomimo tych niezwykłych kształtów tworzy się pewna jednorodność, gdyż każda ćwiartka wygląda dokładnie tak samo jak pozostałe trzy. Wprowadza to do lampy sufitowej Veli nieco spokoju. Tym niemniej zachwyca ona swoim pięknem. Materiał odbija światło w wyjątkowy sposób i pozwala mu tworzyć w pomieszczeniu unikalne gry światła.  Pobierz:   Specyfikacja techniczna                    (2.6 MB)','','slamp-veli-medium-lampa-sufitowa-o-53cm-srebrna','','','','Slamp Veli Medium lampa sufitowa Ø 53cm srebrna','','','',''),(1620,1,1,'Lampa sufitowa Syros - estetycznie zaprojektowana lampa ze szkła  Pierwszą rzeczą, która rzuca się w oczy w lampie sufitowej Syros jest piękny kształt pokrywy, w której umieszczono klosz wykonany całkowicie ze szkła. Światło zastosowanej żarówki emitowane jest w dół bez oślepiania, świeci na wszystkie strony pomieszczenia, a dzięki swojemu kształtowi - również na sufit. Można stosować wszystkie rodzaje żarówek z cokołem E27. Żarówki LED są zalecane do oszczędnego zużycia energii.  Natężenie światła można również regulować za pomocą zewnętrznego ściemniacza.  Ze względu na stopień ochrony IP54 nadaje się również do stosowania w łazienkach. Pobierz:   Instrukcja obsługi                    (165 KB)    Specyfikacja techniczna                    (62 KB)','','astro-syros-lampa-sufitowa-ze-szkla-ip44','','','','Astro Syros lampa sufitowa ze szkła IP44','','','',''),(1621,1,1,'Wysokiej jakości designerska lampa sufitowa Alexaru w podłużnym kształcie ze złotym wykończeniem, sześć płomieni.  Lampa sufitowa Alexaru to naprawdę szlachetny produkt oświetleniowy, który może być wykorzystywany zarówno w celach komercyjnych, jak i prywatnych. Do użytku komercyjnego, ze względu na prawdziwie dekoracyjny wygląd serii lamp, szczególnie hotele i restauracje są polecane jako odpowiednie miejsca użytkowania. Tam lampa sufitowa prezentuje się z wyrazistym charakterem obiektu i nigdy nie jest tylko źródłem światła, lecz zawsze pięknym obiektem wyposażenia wnętrz o bajecznych walorach przyciągających wzrok. Oprawa, którą można również zamontować na ścianie, jest szczególnie obecna w pomieszczeniu już ze względu na swoje wymiary. Sześć podstawowych elementów o lekko zróżnicowanej wysokości, z których każdy wyposażony jest w lampę E27 pośrodku, tworzy razem korpus Alexaru, a na mniejszym poziomie składają się na nie plastry miodu, z których każdy składa się z trzech diamentów na jeszcze mniejszym polu. Jeśli zmienić nieco perspektywę, plastry miodu mogą również wykazywać optyczną trójwymiarowość i przypominać obraz sześcianu. Szybko można więc zauważyć, że jest to przemyślana konstrukcja, która nie przestaje zadziwiać. Wygląd plastra miodu bez wątpienia odpowiada bardzo modnemu trendowi w sektorze wyposażenia wnętrz, a oprawa ścienna i sufitowa uosabia maksymalną indywidualność i luksusowy charakter dzięki swojemu niepowtarzalnemu wyrazowi. Midcentury spotyka się z loftem!  Powierzchnia lampy sufitowej w kolorze złota jest matowo szczotkowana i podkreśla harmonijnie i ciepło szlachetny wygląd. Poza wyglądem tego wysokiej jakości przetworzonego produktu designerskiego nie można pominąć ekstrawaganckiego efektu świetlnego, ponieważ struktura plastra miodu obiecuje magiczną grę światła i cienia, która nie może być bardziej godna uwagi i dodatkowo wzmacnia wrażenie luksusu. W przypadku zastosowania lamp LED z lustrzanym odbiciem na głowicy uzyskuje się wiele zalet, ponieważ światło jest silniej kierowane na strukturę plastra miodu o wysoce geometrycznym wyrazie, a w rezultacie minimalizuje się efekt olśnienia. Kiedy Alexaru jest używany jako oprawa ścienna, możliwe jest nawet uzyskanie całkowicie pośredniego oświetlenia z niepowtarzalną przytulnością. Ponadto diody LED charakteryzują się szczególnie niskim zużyciem energii i są dostępne w bardzo ciepłych barwach światła.','','lucande-alexaru-lampa-sufitowa-6-pkt-zlota-dluga','','','','Lucande Alexaru lampa sufitowa 6-pkt. złota, długa','','','',''),(1622,1,1,'Ekskluzywna lampa sufitowa LED Matwei o szlachetnym wzornictwie z obrotowym reflektorem  Lampa sufitowa LED Matwei wyróżnia się stylowym wyglądem i elegancką kombinacją kolorów. Czarne, matowe wykończenie solidnej, żelaznej ramy pięknie kontrastuje z pierścieniem ze szczotkowanego mosiądzu. Pierścieniowy korpus zdaje się unosić na suficie, co nadaje temu niezwykłemu źródłu światła pewną lekkość. Matwei zanurza sufit w ciepłym białym świetle i emituje je równomiernie i bez oślepień do pomieszczenia.  Dzięki dobrej jasności ta niezwykła lampa designerska idealnie nadaje się jako oświetlenie ogólne do pomieszczeń mieszkalnych i jadalni. Dzięki zintegrowanej funkcji Switch Dim można również stworzyć przyjemne światło otoczenia poprzez stopniowe dostosowywanie jasności do własnych potrzeb.  Mały, zwrotny reflektor zamontowany na okrągłej płycie montażowej jest absolutnym hitem. Dzięki funkcji obracania i wychylania spełnia każde życzenie i w razie potrzeby może stylowo podkreślać wybrane obiekty w pomieszczeniu.   4-stopniowe ściemnianie + wyłączanie:   Dzięki 4-stopniowej technologii ściemniania i funkcji regularnego wyłączania, lampa może być ściemniana do 100%, 60% i 20% swojej zwykłej jasności oraz włączana i wyłączana jak zwykle. Na czwartym poziomie ściemniania, przy pełnej jasności, włączana jest tylko lampka do czytania. Odbywa się to poprzez kilkukrotne naciśnięcie przełącznika.  Pobierz:   Instrukcja obsługi                    (412 KB)','','lucande-matwei-lampa-sufitowa-led-mosiadz','','','','Lucande Matwei lampa sufitowa LED, mosiądz','','','',''),(1623,1,1,'Chromowane światło sufitowe Elinara w ekskluzywnym wzornictwie  Lampa sufitowa Elinara natychmiast inspiruje swoim charakterystycznym wzornictwem i pięknym połączeniem materiałów. Podczas gdy uchwyt sufitowy jest wykonany z żelaza, bujny klosz został wykonany z dmuchanego z ust szkła i przyciąga wszystkie oczy.  Z dolnego otworu cienia, wiele filigranowych elementów wykonanych z kryształu zwisa w dół i tworzy piękne efekty świetlne. Nawet po wyłączeniu, Elinara jest ucztą dla oczu, ponieważ na powierzchni chromowanego klosza widać specjalny wzór, który przypomina nocne niebo. Pobierz:   Instrukcja obsługi                    (397 KB)','','lucande-elinara-lampa-sufitowa-5-pkt-chromowa','','','','Lucande Elinara lampa sufitowa, 5-pkt. chromowa','','','',''),(1624,1,1,'Pięcioczęściowa lampa sufitowa Soralie ze stali nierdzewnej i kryształu  Soralie jest bardzo szczególnym obiektem oświetleniowym, który przyciąga wszystkie oczy dzięki swojemu wspaniałemu wzornictwu. Niektóre filigranowe elementy krystaliczne są przymocowane do płyty sufitowej ze stali nierdzewnej, która kryje pięć punktów zapalnych. Sama płyta sufitowa jest lustrzana i w ten sposób odbija emitowane światło, co prowadzi do indywidualnego rozsyłu światła w pomieszczeniu.  Wybór rodzaju oświetlenia pozostawiamy użytkownikowi, przy czym szczególnie nowoczesne oświetlenie LED doskonale się do tego nadaje, ponieważ jest skuteczne i energooszczędne. Konstrukcja tej oprawy może nie tylko uwydatnić sufit we własnych czterech ścianach, ale także wejść w życie w sektorze komercyjnym. Pobierz:   Instrukcja obsługi                    (437 KB)','','lucande-soralie-krysztalowa-lampa-sufitowa','','','','Lucande Soralie kryształowa lampa sufitowa','','','',''),(1625,1,1,'Lampa sufitowa Kushi z kloszem z dwuwarstwowego, dmuchanego ustnie szkła  Lampa sufitowa Kushi przekonuje miękkimi, naturalnymi krzywiznami, które w swoim ogólnym wyglądzie nawiązują do kształtu jabłka. Klosz z ustnie dmuchanego szkła jest opalowy i ma dwie warstwy. Przez środek przebija się delikatny, kontrastujący kolorystycznie metalowy trzon, który lekko wystaje w głąb pomieszczenia. Dzięki Kushi, różne kształty i kolory łączą się ze sobą, harmonijnie współgrając i dając poczucie lekkości w pomieszczeniu. Rozproszone światło, które promieniuje do pomieszczenia, oświetla otoczenie i sprawia, że Kushi jest eleganckim i ponadczasowym obiektem oświetleniowym do wielu pomieszczeń mieszkalnych i stylów.  - Może być również montowany jako lampa ścienna  W przypadku Kushi z eksploracji prostoty wyraźnie wyłoniło się piękno. Jest to podstawowy pomysł włoskiej firmy Kundalini na temat światła. Dla Kundalini światło to prostota i charakter w równej mierze, a także uniwersalny język o wszechstronnym stylu. Seria została zaprojektowana we współpracy z dwoma projektantami Alberto Saggia &amp; Valerio Sommella, którzy od 2009 roku pracują w szczególny sposób nad projektami związanymi z obiektami w świecie oświetlenia. Łączą swoją wizję techniczną i podejście estetyczne z innowacyjnością kształtów, materiałów, technologii i funkcji.','','kundalini-kushi-lampa-sufitowa-ze-szkla','','','','Kundalini Kushi lampa sufitowa ze szkła','','','',''),(1626,1,1,'Klasyczna lampa sufitowa DAKOTA PLUS 300 o ponadczasowym wzornictwie.  Ta lampa sufitowa o klasycznym kształcie zapewnia niezawodnie wystarczająco jasne oświetlenie. Ta lampa o okrągłym kształcie z chromowaną lub niklowaną oprawą metalową i białym szklanym kloszem jest ponadczasowa i łatwo wtapia się w każde wnętrze. Pobierz:   Specyfikacja techniczna                    (90 KB)    Instrukcja obsługi                    (361 KB)','','klasyczna-lampa-sufitowa-dakota-300-chrom','','','','Klasyczna lampa sufitowa DAKOTA 300 chrom','','','',''),(1627,1,1,'Okrągłe światło sufitowe LED z dmuchanym kloszem z opalu  To oświetlenie ścienne i sufitowe, dzięki ochronie przed wodą rozpryskową, nadaje się do stosowania w łazienkach, pomieszczeniach spa lub wejściach. Metalowa obudowa ma mniejsze rozmiary niż klosz z satynowego opalu dmuchanego, więc ten ostatni tworzy całą widoczną część oprawy. Duża moc światła zapewnia skuteczne oświetlenie podstawowe, które jednocześnie daje przyjemny efekt dzięki miękkiemu efektowi świetlnemu. Prosty, biały design wspaniale pasuje do wielu nowoczesnych wnętrz.  Firma BEGA z Sauerland produkuje i rozwija oprawy zewnętrzne i wewnętrzne z naciskiem na trwałość i jakość. Wielu architektów, klientów publicznych, komercyjnych i prywatnych w wielu krajach polega na oprawach BEGA.','','bega-50651-50652-lampa-sufitowa-led-szklo-opalowe','','','','BEGA 50651/50652 lampa sufitowa LED szkło opalowe','','','',''),(1628,1,1,'Czteropłomienna designerska lampa sufitowa Alexaru w szlachetnym wzorze plastra miodu i ze złotą powierzchnią  Alexaru jest jako lampa sufitowa, ale także z mocowaniem ściennym naprawdę pięknym przyciągaczem wzroku, który nie mógłby wyglądać bardziej szlachetnie i jest przy tym cudownie dekoracyjny. Wizualnie konstrukcja podzielona jest na cztery elementy, z których każdy wyposażony jest w żarówkę E27 umieszczoną pośrodku i lekko przesuniętą na wysokość. Oprawa jest produktem wysokiej jakości, wykonanym zgodnie ze standardami wzornictwa, o niepowtarzalnej charyzmie i prawdziwym charakterze obiektu, dzięki czemu stanowi coś więcej niż tylko zwykłe źródło światła na ścianie lub suficie, ale zawsze również obiekt dekoracyjny o bardzo indywidualnym i luksusowym charakterze. Równie dobrze sprawdza się w pomieszczeniach mieszkalnych, jak i w środowisku komercyjnym, np. w hotelach i restauracjach. Wygląd plastra miodu, który jest podzielony na pastylki, wygląda naprawdę ekscytująco i odpowiada jednemu z najgorętszych trendów w aranżacji wnętrz. Jednak plastry miodu nie tylko służą pięknemu wyglądowi, ale także pomagają Alexaru w magicznej grze świateł, gdy są włączone, co artystycznie przedstawia światło i cień na ścianie lub suficie. Matowa złota powierzchnia filigranowych, wysokiej jakości przetworzonych plastrów miodu podkreśla szlachetny efekt lampy ściennej i nadaje jej szczególnie ciepły, przytulny wyraz.  Jeśli chcesz harmonijnie dopełnić stylowe wrażenie, polecamy lampy LED z lustrzanym odbiciem, które z jednej strony zużywają niewiele prądu, a z drugiej są dostępne w szczególnie ciepłych barwach światła. Ponadto lustrzane odbicie głowy tego typu oświetlaczy wzmacnia szlachetny efekt świetlny i redukuje do minimum efekt olśnienia, a w przypadku zastosowania jako lampa sufitowa daje wyłącznie pośrednie światło, co zawsze jest cenione, gdy chcemy stworzyć atmosferę pełną przytulności.  Unikalny produkt designerski zgodny z hasłem \"Midcentury meets Loft\"!','','lucande-alexaru-lampa-sufitowa-4-pkt-zlota','','','','Lucande Alexaru lampa sufitowa, 4-pkt., złota','','','',''),(1629,1,1,'Lampa sufitowa w kolorze mosiądzu Jugen z dwoma szklanymi kloszami  Dwa klosze są przymocowane do pręta, który wystaje w dół od mosiężnego daszka. Jeden klosz sferyczny wykonany jest z matowego szkła mrożonego i kryje po jednym oprawce E27, do której mogą być podłączone wszystkie pasujące lampy. Specjalny design serii Jugen jest kontynuowany w tej dwupłomieniowej wersji lampy sufitowej Jugen i inspiruje widza niezwykłym wzornictwem. Projekt serii Jugen został opracowany przez włoskiego Davide\'a Negri, znanego architekta i architekta wnętrz.','','mosiezna-lampa-sufitowa-jugen-2-punktowa-pionowa','','','','Mosiężna lampa sufitowa Jugen 2-punktowa pionowa','','','',''),(1630,1,1,'Ciemna lampa sufitowa LED Glimmo z funkcją ściemniania  Niezwykły design i kontrastująca, a jednocześnie harmonijna kolorystyka charakteryzują lampę sufitową LED Glimmo. Posiada okrągłe mocowanie sufitowe i abażur w kształcie pierścienia, który otoczony jest wieloma filigranowymi elementami dekoracyjnymi z mosiądzu.  Nawet po wyłączeniu to źródło światła robi niezapomniane wrażenie. Może wzbogacić wnętrze w Twoim własnym salonie, jak również zapewnić ciekawy wygląd w przestrzeni komercyjnej.  3-step-dim + wył:  Za pomocą przełącznika ściennego można włączać i wyłączać światło w zwykły sposób. Dzięki technologii 3-stopniowego ściemniania ze zintegrowaną funkcją wyłączania można ją również ściemniać do trzech różnych poziomów jasności (100 %, 40 % i 10 %) poprzez kilkukrotne naciśnięcie przełącznika. Pobierz:   Instrukcja obsługi                    (506 KB)','','lucande-glimmo-lampa-sufitowa-led-czarna-mosiadz','','','','Lucande Glimmo lampa sufitowa LED, czarna, mosiądz','','','',''),(1631,1,1,'Duża designerska lampa sufitowa Alexaru w optyce plastra miodu, wykończenie w kolorze złotym, sześciopłomienna - Midcentury meets Loft  Alexaru uosabia indywidualny język designu i jest dużą, prawie okrągłą lampą sufitową, która należy do bardzo dekoracyjnej serii oświetleniowej i ma wyraźny charakter obiektu. Dzięki temu oprawa może być stosowana zarówno w prywatnych pomieszczeniach mieszkalnych, jak i w miejscach publicznych, np. hotelach, restauracjach, galeriach i muzeach, stanowiąc nie tylko źródło światła, ale także element dekoracyjny o luksusowym charakterze. Sześć połączonych ze sobą, ale wizualnie nieco oddzielonych od siebie elementów tworzy razem korpus tej lampy sufitowej, który składa się z wielu matowych plastrów miodu w odcieniu złota, charakteryzujących się bardzo wysoką jakością wykończenia, przy czym struktura plastra miodu należy do najgorętszych trendów naszych czasów. Cały design lampy sprawia wrażenie bardzo luksusowego, a matowa powierzchnia w pięknym złotym odcieniu podkreśla ten efekt i wzbogaca lampę, która nadaje się również do montażu na ścianie, o ciepły wyraz.  Jednak to nie tylko wygląd stanowi o wyjątkowości tej oprawy, również efekt świetlny jest prawdziwie magiczny dzięki strukturze plastra miodu i przypomina grę światła i cienia. Jest to jeszcze bardziej widoczne w przypadku lamp LED do lusterek przednich, ponieważ światło jest wtedy silniej kierowane na estetyczną strukturę na ścianie lub suficie i doskonale ją oświetla. Ponadto do minimum zredukowano w ten sposób efekt olśnienia, a w przypadku montażu na suficie emitowane jest nawet całkowicie pośrednie światło, które sprawia niezwykle przytulne wrażenie. Ponadto lampy LED są zazwyczaj trwałe, energooszczędne i można je nabyć w wyjątkowo ciepłych barwach światła.','','lucande-alexaru-lampa-sufitowa-6-pkt-zlota-okragla','','','','Lucande Alexaru lampa sufitowa 6-pkt złota okrągła','','','',''),(1632,1,1,'Kształtna lampa sufitowa Kartio w modnym niklowym kolorze, elastycznie odchylana i możliwa do zamontowania na ścianie  Solidna rama z żelaza i przejrzyste, geometryczne struktury definiują piękną lampę sufitową Kartio. Wyróżnia się dyskretnym i jednocześnie ekskluzywnym wzornictwem oraz łatwą instalacją. Zgodnie z własnymi życzeniami i potrzebami można dowolnie dobrać pasujący reflektor GU10, w zależności od kąta wiązki, natężenia światła lub barwy światła.  Reflektor jest umieszczony w stożkowym kloszu, który zachwyca nowoczesnym wyglądem w kolorze niklu. Dzięki wbudowanemu przegubowi kulowemu, klosz można łatwo odchylać w górę i w dół, co pozwala na indywidualne ustawienie oświetlenia pomieszczenia. Oprawka w kolorze czarnym stanowi optyczny kontrast dla odcienia. Powierzchnie lampy zostały zmatowione, co jeszcze bardziej podkreśla jej szlachetny charakter. Stylowa kombinacja kolorów oraz szlachetne wykończenie powierzchni tworzą harmonijne wrażenie, które można dostrzec w każdym nowocześnie urządzonym salonie. Pobierz:   Instrukcja obsługi                    (373 KB)','','lucande-kartio-lampa-sufitowa-1-pkt-nikiel','','','','Lucande Kartio lampa sufitowa, 1-pkt., nikiel','','','',''),(1633,1,1,'Lampa sufitowa Kartio z elastycznymi przegubami kulowymi i dwoma kloszami w kształcie stożka  Lampa sufitowa Kartio zaskakuje na całej linii, ponieważ jest zorientowana zarówno na design, jak i na funkcjonalność. Lampa składa się z efektownej płyty montażowej w kształcie czarnego prostokąta. Do niego przymocowane są dwa małe przeguby kulowe, które umożliwiają poruszanie kloszami.  Dzięki specjalnemu kształtowi kloszy, światło może być emitowane tylko w jednym kierunku. W ten sposób nie tylko oferują geometryczną przejrzystość, ale także punktują funkcjonalną cechą. Kierunek emisji światła można dowolnie zmieniać, odchylając klosze do góry lub do dołu. Jeśli wybór źródeł światła padnie na ściemnialne reflektory, jasność oprawy można dostosować do indywidualnych potrzeb za pomocą zwykłego ściemniacza ściennego (ściemniacz na wyłączność).  Wreszcie, oprawa Kartio przekonuje swoim uporządkowanym i ekskluzywnym wzornictwem. Połączenie kolorystyczne niklu i czerni idzie w parze z modnym obecnie metalowym wyglądem. Koncepcja tej serii opraw, zredukowana do niezbędnego minimum, może być stylowo wkomponowana zwłaszcza w pomieszczeniach o nowoczesnym wyposażeniu. Pobierz:   Instrukcja obsługi                    (396 KB)','','lucande-kartio-lampa-sufitowa-2-pkt-nikiel','','','','Lucande Kartio lampa sufitowa, 2-pkt., nikiel','','','',''),(1634,1,1,'Czarna lampa sufitowa LED Cubus o kwadratowej formie  Czarna rama z aluminium czyni małą , kwadratową lampę sufitową LED Cubus pomimo jej prostego designu ozdobą sufitu. Dzięki umieszczonej za satynowanym dyfuzorem diodzie LED przyjemne światło o temperaturze barwowej 2700 kelwinów. Jako samodzielna lampa oświetli małe wnętrze, z kolei w grupie po trzy lub cztery sztuki wypełni ciepłobiałym światłem większe pomieszczenia. Lampę sufitową Cubus można ściemniać za pomocą zewnętrznego ściemniacza (nie zawarty w zestawie).  Producent lampy Cubus może poszczycić się długoletnim doświadczeniem w branży oświetlenia do wnętrz. Marka BOPP z siedzibą w Odenwald tworzy lampy od 1912 roku. Do dzisiaj wszystkie lampy tej firmy produkowane są wyłącznie w Niemczech.','','lampa-sufitowa-led-cubus-czarna','','','','Lampa sufitowa LED Cubus, czarna','','','',''),(1635,1,1,'Kompaktowa diodowa lampa sufitowa Hué, ozdobiona szlachetnym złotym liściem  Lampa sufitowa Hué LED designer jest niezwykła po prostu ze względu na swój specjalny kształt. Ale włoski producent wysokiej jakości, który w swoim projekcie lampy zainspirował się światem mody, dodaje szczególnie elegancki element stylistyczny do tej rzeźby oświetleniowej na sufit. Szlachetny złoty liść nadaje tej uroczo zakrzywionej lampie sufitowej niezwykłego uroku. Wartość kompaktowego oświetlenia sufitowego LED Hué jest również widoczna w rozbudowanej produkcji we Włoszech. Tam praca jest nadal wykonywana ręcznie, dzięki czemu każda z tych ekonomicznych lamp może urzec swoim niepowtarzalnym charakterem. Dzięki złotym akcentom liściowym oprawa może zapewnić szczególnie nastrojowe, zapraszające światło. Pobierz:   Instrukcja obsługi                    (757 KB)    Specyfikacja techniczna                    (904 KB)','','knikerboker-hue-lampa-sufitowa-led-8x15cm-zloto','','','','Knikerboker Hué lampa sufitowa LED 8x15cm złoto','','','',''),(1636,1,1,'Lampa sufitowa Birdie\'s Nest z ręcznie wykonanymi skrzydełkami z gęsiego pióra  Każdy, kto zna Lucellino Ingo Maurera, od razu zauważy, że Gniazdo Ptasie jest wzmocnieniem tego klasycznego oświetlenia. Znak firmowy Lucellino można również znaleźć w Birdie\'s Nest - dosłownie skrzydlatej żarówce, tutaj w nowej wersji LED. Dziesięć lamp LED jest ozdobionych prawdziwymi gęsimi piórami. Jak małe ptaszki, wydają się po prostu opuszczać swoje gniazdo i trzepotać po pokoju. Wrażenie to stwarzają przezroczyste kable i giętkie przewody metalowe, które utrzymują lampy podłączone do okapu sufitowego mimo chęci swobody. Dzięki elastyczności przewodów, niezwykłym lekkim ptakom można zawsze nadać inny kierunek lotu.  Projektant Ingo Maurer jest znany z niezwykłych, kreatywnych projektów oświetleniowych, które ciągle inspirują specjalnymi sztuczkami. Dla przyjaciół pomysłowych wnętrz i oczywiście nie tylko dla miłośników niezwykłej sztuki światła, lampa sufitowa Birdie\'s Nest jest idealna.   Oprawa wyposażona jest w zintegrowany transformator, który umożliwia ściemnianie za pomocą uniwersalnego ściemniacza do diod LED. Pobierz:   Instrukcja obsługi                    (157 KB)    Specyfikacja techniczna                    (253 KB)','','ingo-maurer-birdie-s-nest-lampa-sufitowa-10-pkt','','','','Ingo Maurer Birdie\'s Nest lampa sufitowa 10-pkt','','','',''),(1637,1,1,'Lampa sufitowa LED Edano z szerokim żaglem tkaninowym, funkcja stepdim poprzez przełącznik  Jak ptak żeglujący na wietrze z szeroko rozłożonymi skrzydłami, lampa sufitowa Edano wygląda jak ptak z białym kloszem tekstylnym, który został zaprojektowany w kształcie łuku i zawieszony w niewielkiej odległości od aluminiowego uchwytu sufitowego. Nowoczesne oświetlenie sufitowe LED robi wrażenie swoim niezwykłym designem i rozmiarami, dzięki czemu idealnie nadaje się do dużego salonu lub sypialni.  Emituje ciepłe białe światło, które można przełączyć na trzy różne poziomy jasności za pomocą dowolnego standardowego wyłącznika światła, dzięki czemu można je przyciemnić bez konieczności instalowania ściemniacza. Światło można przełączyć na 100 %, 40 % i 10 % jasności za pomocą przełącznika światła, tak aby w każdej chwili można było wybrać odpowiednie oświetlenie.   3-stopniowe przyciemnianie + wyłączanie:  Za pomocą włącznika ściennego można włączać i wyłączać lampę jak zwykle. Dzięki 3-stopniowej technologii ściemniania ze zintegrowaną funkcją wyłączania, można ją również przyciemnić do trzech różnych poziomów jasności poprzez wielokrotne naciskanie przełącznika: 100 %, 40 % i 10 %. Pobierz:   Instrukcja obsługi                    (1.3 MB)','','lucande-edano-lampa-sufitowa-led-sciemniana','','','','Lucande Edano lampa sufitowa LED, ściemniana','','','',''),(1638,1,1,'Jorna - designerska lampa sufitowa w wersji pięciopłomiennej, kabel z tkaniny w kolorze szarym  W wersji z pięcioma lampami lampa sufitowa Jorna dobrze nadaje się do oświetlania pomieszczeń mieszkalnych i jadalni, a dzięki swojemu ikonicznemu designowi udowadnia, że pięknie przyciąga wzrok. Okrągła oprawa sufitowa z żelaza z wygiętymi ramionami, wywiniętymi na końcu w kolorze czarnym, stanowi podstawę tej lampy, a z niej zwisają luźno szare tekstylne kable, które zapewniają lekki kontrast kolorystyczny i łączą się z gniazdami w dolnej części. Ze względu na dopasowany do materiału design lampa sufitowa Jorna sprawia wrażenie dość minimalistycznej i pasuje nie tylko do stylów nowoczesnych, ale również do tych, które można przypisać do trendu industrialnego.  Oprawa daje efekt dekoracyjny i zapewnia domowe światło, które można dodatkowo zmodyfikować poprzez zastosowanie żarówek ze szkła G95. Większe wymiary szczególnie dobrze pasują do zredukowanego designu, w którym lampy są bardzo atrakcyjne wizualnie. Zasadniczo jednak lampy mogą być dowolnie dobierane. Lampy LED mają zaletę niskiego zużycia energii, a dzięki technologii filamentowej wyglądają bardzo podobnie do klasycznych żarówek. Unikalny design, odpowiedni dla indywidualistów!    Pobierz:   Instrukcja obsługi                    (424 KB)','','lucande-jorna-lampa-sufitowa-5-pkt-kabel-szary','','','','Lucande Jorna lampa sufitowa 5-pkt, kabel szary','','','',''),(1639,1,1,'Stylowa lampa sufitowa Jorna z czerwonym kablem tekstylnym  Lampa sufitowa Jorna prezentuje się w wersji z pięcioma płomieniami. Jego design opiera się na stylistycznej pewności i dbałości o szczegóły. Po wejściu do pomieszczenia od razu rzuca się w oczy jego szczególna koncepcja, która jest szczególnie atrakcyjna wizualnie dla indywidualistów.  Posiada okrągły wspornik sufitowy wykonany z żelaza i pięć ramion lampy, które są wygięte i zakręcone na końcu do wewnątrz. Ze środka uchwytu sufitowego zwisa luźno w dół pięć czerwonych tekstylnych kabli, które są również przymocowane do końcówek ramion lampy. Czerwone tekstylne kable stanowią celowy kontrast kolorystyczny, który sprawia, że oprawa ta przyciąga wzrok, i łączą się bezpośrednio z gniazdami. W tym efektownym projekcie zrezygnowano z abażuru, dzięki czemu światło może bezpośrednio i bez przeszkód rozchodzić się po pomieszczeniu.  Wybór odpowiedniego oświetlacza pozostawia się użytkownikowi. Dekoracyjny charakter tej oprawy podkreśla przede wszystkim dobrze dobrane źródło światła - idealnie nadają się do tego szklane żarówki G95 z nowoczesną technologią LED. Są one szczególnie korzystne ze względu na oszczędne zużycie energii. Lampa sufitowa Jorna może być wykorzystana do wzbogacenia własnych czterech ścian, jak również w sektorze gastronomicznym lub hotelarskim. Pobierz:   Instrukcja obsługi                    (431 KB)','','lucande-jorna-lampa-sufitowa-5-pkt-kabel-czerwony','','','','Lucande Jorna lampa sufitowa 5-pkt. kabel czerwony','','','',''),(1640,1,1,'Foscarini Rituals - lampa sufitowa z dmuchanego szkła  Cienka i delikatna jak japoński lampion papierowy - tak wygląda lampa sufitowa Rituals weneckiej marki premium Foscarini. Ten efekt papieru ryżowego tworzy filigranowy wzór rowków, który przebiega poziomo przez klosz lampy sufitowej. W rzeczywistości Rituals nie jest wykonany z papieru, ale z wysokiej jakości dmuchanego szkła opalowego. Rowki w powierzchni szklanej powstają w wyniku zastosowania specjalnego procesu przemysłowego opartego na kunszcie szlifowania szkła. Szkło nie jest obracane w formie i otrzymuje specjalny dekor poprzez negatywny wzór w formie.   Delikatne rowki tworzą wspaniałą grę światła i cienia na suficie i otaczających go ścianach. Prosta, niemalże neutralna stylistycznie konstrukcja lampy sufitowej pozwala na szeroki zakres zastosowań. Rituals można łatwo łączyć z innymi typami i rozmiarami lamp z rodziny, aby stworzyć jeszcze większe wrażenie poprzez grupę.  Od 1994 roku para projektantów Ludovica + Roberto Palomba posiada własne studio projektowe w Mediolanie. Pracują oni dla wielu międzynarodowych marek i otrzymali już liczne wyróżnienia, w tym Compasso d\'Oro, znaną włoską nagrodę przemysłową.','','foscarini-rituals-szklana-lampa-sufitowa-dmuchana','','','','Foscarini Rituals szklana lampa sufitowa, dmuchana','','','',''),(1641,1,1,'Designerska lampa sufitowa Jorna z czarną metalową ramą i szarymi przewodami z tkaniny, trzy płomienie  Jorna to lampa sufitowa z trzema źródłami światła o wyrazistych walorach designerskich. Okrągły metalowy uchwyt w kolorze czarnym tworzy podstawę, z której wychodzą trzy zgrabne, wygięte ramiona lampy, również wykonane z metalu, zakończone pętlą. W tym miejscu można elastycznie zawiesić kable z szarej tkaniny, ponieważ można je dowolnie rozmieszczać. W gniazdach można zamontować dowolnie wybrane żarówki E27, przy czym żarówki filamentowe podobne do żarówek z technologią LED pasują szczególnie dobrze optycznie. Idealnym rozwiązaniem jest również wybór nieco większej lampy w formacie kuli ziemskiej G95, która spójnie podkreśla ogólny wygląd i jest obecnym elementem całości.  Indywidualnie zaprojektowana lampa sufitowa przyciąga wzrok dzięki przeważnie ikonicznej stylistyce, która dzięki wykonaniu z odpowiedniego materiału sprawia wrażenie minimalistycznej i dobrze pasuje do industrialnego stylu życia. Jorna zawsze daje domowy i dekoracyjny efekt i jest czymś w sam raz dla indywidualistów! Pobierz:   Instrukcja obsługi                    (415 KB)','','lucande-jorna-lampa-sufitowa-3-pkt-kabel-szary','','','','Lucande Jorna lampa sufitowa 3-pkt, kabel szary','','','',''),(1642,1,1,'Nowoczesna lampa sufitowa o współczesnym wzornictwie i unikalnym kształcie  Ta lampa sufitowa z białym kloszem i bardzo dyskretną podstawą ze szlifowanego aluminium prezentuje się bardzo modnie. Również przed przekręceniem włącznika będzie ona wspaniałą ozdobą pomieszczenia.','','nowoczesna-lampa-sufitowa-drop','','','','Nowoczesna lampa sufitowa DROP','','','',''),(1643,1,1,'Przytulna lampa sufitowa LED LARAfelt z filcu bawełnianego  Osłona lampy sufitowej LED LARAfelt w kształcie pierścienia jest wykonana z filcu. O jej finezyjnej estetyce świadczy fakt, iż projektantom udało się umieścić lampę od sufitu na odległość kciuka, dzięki czemu zdaje się ona unosić tuż pod nim, zapewniając subtelne oświetlenie. Podczas gdy zewnętrzna część osłony ma kolor szary, część wewnętrzna utrzymana jest w kolorze pomarańczowym, dzięki czemu zapewnia optymalne rozproszenie światła. Ponadto celowo głęboko osadzony dyfuzor z umieszczonym wewnątrz modułem LED gwarantuje nieoślepiające oświetlenie. Osłona zamykana jest za pomocą specjalnego drewnianego elementu z białego dębu. Nieskomplikowana forma lampy sprawia, że idealnie nadaje się nie tylko do biura projektowego, ale również do pomieszczeń biznesowych i prywatnych.  - ściemniana za pomocą zewnętrznego ściemniacza LEDIM lub TEDIM  Równowaga ekologiczna dzięki ręcznie wykonanym produktom z Niemiec – harmonijna koegzystencja człowieka i przyrody w centrum procesu produkcji oświetlenia  Jako producent oświetlenia marka DOMUS może poszczycić się długoletnim doświadczeniem, gdyż powstała w 1966 roku. Od tego czasu nie zmieniła swej filozofii wprowadzania światła do domów, udoskonalając przy tym proces produkcji z zachowaniem wysokiej jakości oraz równowagi ekologicznej. Nawet jeżeli produkcja odbywa się przy pomocy doskonałego pod względem technicznym sprzętu, marka DOMUS uważa się za manufakturę, w której utalentowani ludzie z oddaniem i znawstwem sztuki rzemiosła tworzą ręcznie wysokiej jakości lampy dla innych ludzi. We współpracy z projektantami, znawcami drewna, konstruktorami oraz projektantami oświetlenia powstają ponadczasowe i wytrzymałe pod względem technicznym lampy, które spełniają nawet najbardziej wygórowane oczekiwania klientów. Odpowiedzialność ekologiczna marki DOMUS przejawia się w stosowaniu w dużej mierze naturalnych surowców odnawialnych oraz unikaniu niepotrzebnego transportu w procesie produkcji w Niemczech.','','larafelt-lampa-sufitowa-z-led-szary-pom','','','','LARAfelt - lampa sufitowa z LED, szary/pom.','','','',''),(1644,1,1,'Lampa sufitowa LED KIOTO 5 z drewna bukowego w stylu japońskim  Kwadratowa lampa sufitowa LED KIOTO 5 inspirowana jest tradycyjną japońską architekturą wnętrz. Oprawa z prawdziwego drewna bukowego oraz kosz z lunopalu wyraźnie nawiązują do ruchomych ekranów shōji stosowanych w japońskich wnętrzach do dzielenia pokoju. Duży klosz, który zdobi wzór w formie oprawy z drewna bukowego, rozprasza łagodne, przyjemne światło.  - do montażu w formie lampy wpuszczanej lub natynkowej -ściemniana za pomocą zewnętrznego ściemniacza LEDIM lub TEDIM  Marka dba o to, aby w czasie produkcji drewno nie straciło swego naturalnego piękna, dlatego do wykańczania powierzchni zamiast lakierów stosowane są oleje roślinne oraz naturalne woski. Lunopal to przypominające papier tworzywo sztuczne, które rozprasza przytulne światło i zachwyca również pod względem funkcjonalności. Jest odporne na promieniowanie UV, niełamliwe oraz nie żółknie i jest łatwe do czyszczenia.  Równowaga ekologiczna dzięki ręcznie wykonanym produktom z Niemiec – harmonijna koegzystencja człowieka i przyrody w centrum procesu produkcji oświetlenia  Jako producent oświetlenia marka DOMUS może poszczycić się długoletnim doświadczeniem, gdyż powstała w 1966 roku. Od tego czasu nie zmieniła swej filozofii wprowadzania światła do domów, udoskonalając przy tym proces produkcji z zachowaniem wysokiej jakości oraz równowagi ekologicznej. Nawet jeżeli produkcja odbywa się przy pomocy doskonałego pod względem technicznym sprzętu, marka DOMUS uważa się za manufakturę, w której utalentowani ludzie z oddaniem i znawstwem sztuki rzemiosła tworzą ręcznie wysokiej jakości lampy dla innych ludzi. We współpracy z projektantami, znawcami drewna, konstruktorami oraz projektantami oświetlenia powstają ponadczasowe i wytrzymałe pod względem technicznym lampy, które spełniają nawet najbardziej wygórowane oczekiwania klientów. Odpowiedzialność ekologiczna marki DOMUS przejawia się w stosowaniu w dużej mierze naturalnych surowców odnawialnych oraz unikaniu niepotrzebnego transportu w procesie produkcji w Niemczech.','','kioto-5-lampa-sufitowa-led-z-drewna-bukowego','','','','KIOTO 5 - lampa sufitowa LED z drewna bukowego','','','',''),(1645,1,1,'Elegancka lampa sufitowa LED Zen, stylowo emitująca światło  Ta minimalistycznie zaprojektowana lampa sufitowa Zen, wykonana ze szlifowanego aluminium i białego szkła, zapewnia doskonałe oświetlenie z góry. Cztery elementy nośne z diodami LED zwisają z prostokątnej szklanej rozety sufitowej i uchodzą do kwadratowego elementu zamykającego, wykonanego z lekkiego metalu.  Dodatek do nowoczesnego stylu urządzania wnętrz mieszkalnych  Matowe, lśniące aluminium i ekstrawagancka konstrukcja sprawiają, że ten przejaw geniuszu firmy Escale przyciąga wzrok w każdym wnętrzu, w którym się znajduje. Dzięki swoim ponadczasowym ekskluzywnym produktom oświetleniowym, niemiecki lider rynku gwarantuje perfekcyjną obróbkę cennych materiałów i nowoczesny design.   Najnowocześniejsza technologia LED gwarantuje, że ta wyjątkowa lampa sufitowa jest bardzo funkcjonalna i ekonomiczna w użytkowaniu. Cztery elementy LED rzucają swoje promienie na jasną szklaną płytkę, która równomiernie odbija światło.  Dzięki zastosowaniu odpowiedniego ściemniacza, można zastosować funkcję Dim to warm lampy. Wówczas barwę światła lampy można ściemniać w zakresie od 3 000 do 2 000 K.','','escale-zen-aluminiowa-lampa-sufitowa-led','','','','Escale Zen - aluminiowa lampa sufitowa LED','','','',''),(1646,1,1,'Duża lampa sufitowa LED wprost z ręki designera, średnica 80 cm  Lampa sufitowa LED Space, stworzona przez Mosru Mohiuddina, mająca bardzo nowoczesny design i kolorystykę, idealnie pasuje do wnętrz urządzonych w stylu współczesnym. Charakteryzuje się on niezwykle powyginanym kształtem i zapewnia odpowiednie oświetlenie ogólne w salonie lub na przykład w sieni, gdzie diody LED zamontowane w formie taśm na ramionach lampy wytwarzają nastrojowe światło, dające ciepłobiały blask. Lampę możemy ściemniać.','','lampa-sufitowa-space-aluminium-80-cm','','','','Lampa sufitowa Space, aluminium, 80 cm','','','',''),(1647,1,1,'Lampa sufitowa Aylis z trzema czarnymi metalowymi kloszami i jasną drewnianą płytą  Aylis przekonuje atrakcyjnym wzornictwem, które stylistycznie pięknie przypomina styl przemysłowy, który coraz częściej znajduje zastosowanie nie tylko w loftach, ale także w zwykłych mieszkaniach. Klosze wykonane są z czarnego metalu i wyposażone są w kilka przegubów i śrub. Pozwala to również na obracanie i wychylanie źródeł światła do momentu uzyskania obrazu świetlnego spełniającego osobiste wymagania. Ładnym dodatkiem do wyglądu jest jasna płyta sufitowa ze sklejki, dzięki czemu lampa sufitowa również ucieleśnia naturalną nutę, która harmonijnie kontrastuje z czarną, metalową powierzchnią.     Pobierz:   Instrukcja obsługi                    (384 KB)','','lindby-aylis-lampa-sufitowa-czarna-drewno-3-pkt','','','','Lindby Aylis lampa sufitowa czarna, drewno, 3-pkt.','','','',''),(1648,1,1,'2-punktowa lampa sufitowa Aylis z kloszem z czarnego metalu i elementem ze sklejki  Aylis to lampa sufitowa, której ogólny wygląd przypomina styl przemysłowy. Klosze są wykonane z metalu i mają typowe dla tego stylu śruby i złącza, a także matową, czarną powierzchnię. Płyta sufitowa wykonana z jasnej sklejki służy jako kontrastujące, a jednocześnie harmonijne uzupełnienie, nadając całej konstrukcji naturalny wygląd. Dwa klosze można obracać i wychylać w zależności od potrzeb w celu precyzyjnego ustawienia.  Pobierz:   Instrukcja obsługi                    (258 KB)','','lindby-aylis-lampa-sufitowa-czarna-drewno-2-pkt','','','','Lindby Aylis lampa sufitowa czarna, drewno, 2-pkt.','','','',''),(1649,1,1,'Industrialnie wyglądająca lampa sufitowa Louisanne, wykonana z metalu w kolorze szarego betonu  Louisanne rzeczywiście wygląda jak lampa sufitowa o antycznym charakterze, ponieważ zastosowano tu znane formy rodem z przeszłości. Ponadto powierzchnia metalowego klosza opatrzona została betonowoszarym wykończeniem, które ma charakter industrialny. Louisanne jest więc lampą sufitową, która może być łączona zarówno ze stylami industrialnymi, jak i elementami antycznymi. Pobierz:   Instrukcja obsługi                    (437 KB)','','lampa-sufitowa-louisanne-styl-industrialny','','','','Lampa sufitowa Louisanne, styl industrialny','','','',''),(1650,1,1,'4-punktowa lampa sufitowa Aylis z czarnymi kloszami i płytą sufitową ze sklejki  Aylis to lampa sufitowa, która ucieleśnia coraz bardziej popularny styl industrialny. Zawdzięcza to przede wszystkim metalowym kloszom z ich matowo-czarną powierzchnią oraz widocznym połączeniom i wkrętom, które służą nie tylko do obracania i wychylania kloszy, ale także specyficznemu wyglądowi lampy. Jednak płyta sufitowa nie jest czarna jak reszta, lecz wykonana z atrakcyjnej sklejki o jasnej powierzchni. Styl przemysłowy uzupełniony jest naturalną nutą, która stanowiąc kontrast, nie jest pozbawiona pewnej harmonii. Pobierz:   Instrukcja obsługi                    (244 KB)','','lindby-aylis-lampa-sufitowa-czarna-drewno-4-pkt','','','','Lindby Aylis lampa sufitowa czarna, drewno, 4-pkt.','','','',''),(1651,1,1,'W modnym wzornictwie przemysłowym: reflektor sufitowy LED Mirka  Mirka to lampa sufitowa LED, która zachwyci Cię dzięki swojemu wyjątkowemu designowi. Oprawa sufitowa wykonana jest z drewna sosnowego, które dzięki swojemu naturalnemu usłojeniu nadaje lampie szczególnie wspaniały wygląd. Design dopełniają wykonane z betonu klosze, które czynią z lampy stylowy element wyposażenia wnętrz. Jasność światła można dostosować do własnych preferencji dzięki ściemnianym diodom LED i dopasować do każdego nastroju. Pobierz:   Instrukcja obsługi                    (449 KB)','','lindby-mirka-lampa-sufitowa-led-sosna-2-pkt','','','','Lindby Mirka lampa sufitowa LED, sosna, 2-pkt.','','','',''),(1652,1,1,'Lampa sufitowa LED Tamin o industrialnym wyglądzie, z dwoma kloszami opatrzonymi siatką i ściemnianymi żarówkami G9  Tamin to lampa sufitowa LED, którą, jeśli chcemy, możemy zamontować także na ścianie. W wyglądzie lampy dominuje nuta industrialna. Efekt ten wywołuje nie tylko siatka, stanowiąca część kloszy. Kolejna osłona wykonana z białego mrożonego szkła zapewnia równomierne rozprowadzenie światła i efekt przyjemny dla oka. Dwa metalowe klosze można zarówno obracać, jak i odchylać, co pozwala na indywidualne ustawienie kierunku padania światła.   Żarówki G9 z technologią LED są energooszczędne, a jasność można regulować za pomocą zewnętrznego ściemniacza, co pozwala na lepszą ustawienie oświetlenia w pomieszczeniu i uzyskanie odpowiedniego nastroju. Pobierz:   Instrukcja obsługi                    (423 KB)','','2-punktowa-lampa-sufitowa-led-tamin-szary-dymny','','','','2-punktowa lampa sufitowa LED Tamin, szary dymny','','','',''),(1653,1,1,'2-punktowa lampa sufitowa LED Tamin w stylu industrialnym  Osłona w postaci siatki, znajdująca się nad kloszami, oraz wykończenie w kolorze prawdziwej rdzy sprawiają, że to ta lampa sufitowa LED wygląda nieco industrialnie, a zarazem nosi cechy starej lampy. Oba klosze można przesuwać w zależności od potrzeb, aby uzyskać lepsze efekty świetlne. Zakres dostawy obejmuje dwie żarówki LED G9, które są nie tylko energooszczędne, ale również dają możliwość regulacji jasności, jeśli dostępny jest ściemniacz zewnętrzny.   Tę lampę można zamontować także jako lampę ścienną.  Pobierz:   Instrukcja obsługi                    (521 KB)','','rdzawobrazowa-lampa-sufitowa-l