wowany w branży oświetleniowej od kilku lat. Tym bardziej więc zaleca się jest wyposażenie lampy sufitowej Jake w szczególnie efektowne źródło światła, takie jak żarówka filamentowa z technologią LED.  Pobierz:   Instrukcja obsługi                    (374 KB)','','lampa-sufitowa-jake-w-kolorze-rdzy','','','','Lampa sufitowa Jake w kolorze rdzy','','','',''),(1657,1,1,'Mirka - lampa sufitowa LED o modnym, industrialnym designie  Wzornictwo przemysłowe charakteryzuje się wykorzystaniem specjalnych materiałów. Lampa sufitowa LED Mirka jest szczególnie pięknym przykładem stylu industrialnego dzięki uchwytowi z drewna sosnowego z naturalnie wyglądającym wykończeniem i betonowym kloszom. Wyposażona w ściemnialną żarówkę GU10, Mirka tworzy przytulną atmosferę z możliwością zmiany jasności światła. Ta lampa sufitowa nadaje się szczególnie do pokoju dziennego lub jako element przyciągający wzrok w korytarzu. Pobierz:   Instrukcja obsługi                    (479 KB)','','lindby-mirka-lampa-sufitowa-led-sosna-3-pkt','','','','Lindby Mirka lampa sufitowa LED, sosna, 3-pkt.','','','',''),(1658,1,1,'Nowoczesna lampa sufitowa Tilen w stylu klasycznych reflektorów scenicznych  Światło zgaszone, spot włączony: okrągła lampa sufitowa Tilen przyciąga wzrok każdego obserwatora. Jej trzy obrotowe i odchylane spoty nawiązują do wyglądu starych reflektorów, które były i są nadal często widywane na scenach lub u fotografów. Przestawiane klapy lampy sufitowej Tilen służą tu do regulacji promienia światła oraz pełnią rolę dekoracyjną. Mimo to Tilen dobrze oświetla pomieszczenia i nadaje się zarówno do stosowania w korytarzach, jak i w nowoczesnych salonach i jadalniach.  Pobierz:   Instrukcja obsługi                    (1.6 MB)','','lampa-sufitowa-tilen-3-pkt-w-stylu-reflektorow','','','','Lampa sufitowa Tilen, 3-pkt. w stylu reflektorów','','','',''),(1659,1,1,'Rustykalna lampa sufitowa Asya z czarnego żelaza i dębu z wiejską atmosferą  Lampa sufitowa Asya ma szczególny urok dzięki swojej atrakcyjnej kolorystyce i solidnej konstrukcji. Drewniana belka jest mocowana poziomo do kompaktowego uchwytu sufitowego, który z kolei posiada trzy imadła i mieści trzy gniazda, do których można włożyć odpowiednie lampy. Aby nadać oprawie jeszcze bardziej ekscytujący wygląd, zaleca się stosowanie żarówek żarnikowych. Stylowe czarne żelazo i drewno dębowe tworzą harmonijną kombinację kolorów i nadają sufitowi przyciągające wzrok akcenty. Podłużny kształt lampy sufitowej Asya doskonale komponuje się z sufitem w salonie, przyciąga ciekawskich spojrzeń i roztacza przyjemną atmosferę wiejskiego domu w ramach wystroju wnętrza. Pobierz:   Instrukcja obsługi                    (315 KB)    Instrukcja obsługi 2                    (318 KB)','','lindby-asya-lampa-sufitowa-drewno-czarne','','','','Lindby Asya lampa sufitowa, drewno, czarne','','','',''),(1660,1,1,'Dwupunktowa lampa sufitowa LED Zera z kloszami o złotym wnętrzu  Zera to naprawdę atrakcyjne źródło światła do salonu. Lampa posiada dwa klosze o pięknym kształcie, które są nie tylko jednokolorowe, ale wyróżniają się także swoją stroną zewnętrzną o antycznym wyglądzie, mającą wykończenie w kolorze rdzy i klosze o złotym wnętrzu. Niektóre style o wyglądzie gdzieś pomiędzy industrialem, nostalgią i antycznością można więc unowocześnić lampą Zera, a uzyskane w ten sposób światło charakteryzuje się przytulnością.  Dołączone w zestawie żarówki wyposażone są w technologię easydim, co oznacza, że można je przyciemnić tylko kilkoma ruchami ręki, korzystając ze zwykłego przełącznika ściennego. Jeśli lampa sufitowa LED jest już załączona, można łatwo rozpocząć proces ściemniania przez dwukrotne naciśnięcie przycisku w czasie krótszym niż dwie sekundy. Następnie mamy dwie opcje: Można albo poczekać, aż wartość jasności osiągnie 10 procent, albo też można powtórzyć proces przełączania i ustawić wybraną jasność.  Pobierz:   Instrukcja obsługi                    (539 KB)','','czarno-zlota-lampa-sufitowa-led-zera-easydim','','','','Czarno-złota lampa sufitowa LED Zera, easydim','','','',''),(1661,1,1,'Oświetlenie sufitowe Gina z czterema obrotowymi i odchylanymi reflektorami  Cały wygląd czteroświetlnej lampy sufitowej Gina doskonale pasuje do pomieszczeń mieszkalnych, które zostały zaprojektowane w stylu industrialnym: Lofty, a także zaadaptowane budynki warsztatowe i fabryczne. Ale można go również wykorzystać do urozmaicenia innych aktualnych trendów w domu. Nie tylko emituje wspaniałe oświetlenie ogólne, które dzięki ruchomym punktom może być wielokrotnie zmieniane, ale także nadaje każdemu pomieszczeniu industrialny charakter.','','lampa-sufitowa-gina-4-punktowa-nikiel-matowy','','','','Lampa sufitowa Gina, 4-punktowa, nikiel matowy','','','',''),(1662,1,1,'Regulowana LED-lampa sufitowa KADIGA z betonu, 4-punktowa  KADIGA sprawdzi się doskonale w kuchni, gdyż jej głowice zapewniają dobre oświetlenie. Jej szczególną cechą jest to, iż klosze nie są wykonane ze szkła, metalu czy też tkaniny, lecz z betonu, z którego również wykonana jest belka. Dzięki niemu lampa od razu budzi skojarzenia ze stylem industrialnym, gdyż beton jest materiałem stosowanym przede wszystkim na budowie, lecz rzadko w produkcji elementów wystroju wnętrz. Ale to, co jest rzadkością niekoniecznie musi być złe, czego dowodem jest właśnie lampa KADIGA. Mimo chłodnej barwy prezentuje się doskonale i stanowi stylowy dodatek do nowoczesnych lub industrialnych wnętrz. Pobierz:   Instrukcja obsługi                    (333 KB)','','4-punktowa-lampa-sufitowa-kadiga-z-betonu','','','','4-punktowa lampa sufitowa KADIGA z betonu','','','',''),(1663,1,1,'2-punktowa lampa sufitowa Carmen Wood - zainspirowana światem przemysłu  Lampa sufitowa Carmen Wood nastraja nostalgicznie i przekonuje do siebie funkcjonalnością. Dzięki połączeniu ciepłego drewna i chłodnego metalu powstaje ciekawy i sympatyczny efekt. Oba klosze można niezależnie od siebie przekręcać, aby postawić akcenty świetlne lub zapewnić jasne oświetlenie tła.  Wszystkie rodzaje wystroju wnętrz stawiające na aspekty praktyczne zyskają przy tym inteligentnie zaprojektowanym modelu. Dwupunktową lampę sufitową Carmen Wood można również z powodzeniem użyć w nowoczesnych wnętrzach. Czy to w salonie czy w sypialni, w korytarzu czy w domowym biurze - lampa sufitowa Carmen Wood z dwoma metalowymi kloszami pasuje do każdego pomieszczenia.','','carmen-wood-lampa-sufitowa-2-pkt','','','','Carmen Wood - lampa sufitowa, 2-pkt.','','','',''),(1664,1,1,'Modna lampa sufitowa LED Mirka z betonu, z możliwością ściemniania  Lampa sufitowa LED Mirka jest w pełni zgodna z trendami dzięki kształtnym kloszom z betonu i uchwytowi z ciemnego, naturalnie wyglądającego drewna sosnowego. Lampa doskonale ucieleśnia industrialny design i stanowi uzupełnienie nowoczesnego salonu lub jadalni. Cztery płomienie promieniują w różnych kierunkach w zależności od ustawienia i zapewniają w ten sposób optymalne oświetlenie przytulnym, ciepłym, białym światłem. Ponadto dzięki ściemnianym diodom LED można zmieniać jasność światła w zależności od osobistych preferencji. Pobierz:   Instrukcja obsługi                    (696 KB)','','lindby-mirka-lampa-sufitowa-led-sosna-4-pkt','','','','Lindby Mirka lampa sufitowa LED, sosna, 4-pkt.','','','',''),(1665,1,1,'Czarno-srebrna lampa sufitowa Lovro z czterema reflektorami  Zaprojektowana w nowoczesnym i atrakcyjnym stylu industrialnym, 4-punktowa lampa sufitowa Lovro urzeka nie tylko swoim stylowym wyglądem zewnętrznym. Cztery reflektory oprawy, wyposażone w żarówki GU10, można indywidualnie obracać i odchylać, co pozwala na ich dopasowanie do potrzeb. Do tego oprawa jest podzielona na dwie części i posiada dwa ramiona, na których zamontowane są po dwa reflektory. Ramiona te mogą być również regulowane w celu zapewnienia optymalnego światła i dostosowania oświetlenia do pomieszczenia.  Pobierz:   Instrukcja obsługi                    (420 KB)','','spot-sufitowy-lovro-4-punktowy','','','','Spot sufitowy Lovro, 4-punktowy','','','',''),(1666,1,1,'Gina - trzylampowa lampa sufitowa w stylu industrialnym  Lampa sufitowa Gina z trzema źródłami światła roztacza industrialny klimat w każdym nowoczesnym salonie. Zgodnie z projektem, to komfortowe źródło światła znajdzie swoje miejsce oczywiście w otoczeniu o architektonicznym stylu, takim jak mieszkanie na poddaszu lub warsztat przekształcony w przestrzeń mieszkalną. Dzięki elastycznie regulowanym spotom lampa sufitowa Gina zapewnia oświetlenie, które zawsze można dopasować do okoliczności.','','lampa-sufitowa-gina-3-punktowa-biala','','','','Lampa sufitowa Gina, 3-punktowa, biała','','','',''),(1667,1,1,'Tilen – 2-punktowa lampa sufitowa ze spotami w stylu reflektorów  Nowoczesna lampa sufitowa Tilen jest źródłem światła i niewątpliwą atrakcją wizualną. Oba spoty zostały zaprojektowane w stylu starych reflektorów i wyposażone w charakterystyczne klapy. Pełnią one tu jednak więcej funkcji dekoracyjnych, ale nadal można je indywidualnie przestawiać. Oba spoty są również regulowane i można je obracać oraz odchylać, aby oświetlić każdy kąt pomieszczenia. Tilen to nowoczesny system oświetlenia salonów, korytarzy i jadalni.  Pobierz:   Instrukcja obsługi                    (1.5 MB)','','lampa-sufitowa-pilen-2-pkt-w-stylu-reflektora','','','','Lampa sufitowa Pilen, 2-pkt. w stylu reflektora','','','',''),(1668,1,1,'Spot sufitowy LED Biona z dyskretnym złotym pierścieniem  Trzy klosze są przymocowane do okrągłego uchwytu sufitowego lampy sufitowej LED Biona. Można je obracać, dzięki czemu światło może być kierowane indywidualnie. Klosze wykonane są z matowego, czarnego metalu i mają w środku dyskretny pierścień w kolorze złotym. Dodatkowo są one wyposażone w siatkę, która nadaje lampie modny vintage look. Dodatkowo, kratka chroni źródło światła LED wewnątrz. Oświetlacz emituje ciepłe, białe światło, które nie oślepia dzięki satynowanej powierzchni. W razie potrzeby można go usunąć i wymienić. Pobierz:   Instrukcja obsługi                    (340 KB)','','lindby-biona-spot-sufitowy-led-zloty-3-pkt','','','','Lindby Biona spot sufitowy LED, złoty, 3-pkt.','','','',''),(1669,1,1,'','','lampa-sufitowa-skansen-3-pkt-regulowana-czarna','','','','Lampa sufitowa Skansen 3-pkt. regulowana, czarna','','','',''),(1670,1,1,'Nowoczesny wygląd reflektora – 2-punktowy spot sufitowy Zoja  Lampa sufitowa, która przekonuje na pierwszy rzut oka i idealnie nadaje się dla miłośników nowoczesnego, industrialnego stylu z akcentem retro: reflektor sufitowy Zoja posiada dwa spoty, których wygląd przypomina reflektory starych samochodów. Rozświetlają one pomieszczenie z poziomu sufitu, zapewniając jasność i nie powodując oślepienia, a oprócz dobrego oświetlenia ogólnego są również wyjątkowo atrakcyjne. Lampa sufitowa Zoja może być używana na wiele sposobów – czy to w domowym salonie, czy w korytarzu. Pobierz:   Instrukcja obsługi                    (296 KB)','','spot-sufitowy-zoja-2-punktowy','','','','Spot sufitowy Zoja, 2-punktowy','','','',''),(1671,1,1,'Lampa sufitowa jednopłomieniowa Gittan z uchwytem betonowym i kloszem z metalowej siatki  Oprawa sufitowa Gittan z kwadratową podstawą prezentuje się jako idealne uzupełnienie nowoczesnego strychu przemysłowego. Jego odcień jest otwartym pionowo prostopadłościanem, którego boki pokryte są chromowaną siatką. Centralne, skierowane ku dołowi gniazdo E27 jest również metaliczne i posiada dekoracyjny gwint na zewnątrz. Płaski, szary betonowy prostopadłościan służy jako wspornik sufitowy, który dopełnia mechaniczny, minimalistyczny wygląd ogólny.','','lampa-sufitowa-gittan-1-punktowa','','','','Lampa sufitowa Gittan, 1-punktowa','','','',''),(1672,1,1,'Lampa sufitowa LED Adeon promieniuje rustykalnym urokiem  Trzylampowe światło sufitowe LED Adeon charakteryzuje się kloszami. Są one szczególnie praktyczne, ponieważ można je obracać. Dzięki temu można je dowolnie ustawiać, tak aby optymalnie oświetlały każde pomieszczenie. Ponadto, odcienie zostały zaopatrzone w kochające szczegóły. Na przykład, przed lampą znajduje się zakrzywiona kratka. Został on pomalowany rdzawo-brązowym odcieniem, aby dopasować go do koloru. Dzięki temu Adeon przypomina lampy, które są zainstalowane na starych statkach. Dzięki temu rustykalnemu urokowi Adeon jest wspaniałym elementem dekoracyjnym, a jednocześnie sprytnym rozwiązaniem oświetleniowym. Pobierz:   Instrukcja obsługi                    (423 KB)','','lindby-adeon-lampa-sufitowa-led-3-punktowa','','','','Lindby Adeon lampa sufitowa LED, 3-punktowa','','','',''),(1673,1,1,'Julin - srebrna kuchenna lampa w stylu vintage z czterema metalowymi kloszami  Swój wygląd w stylu vintage lampa kuchenna Julin zawdzięcza temu, że wewnętrzna część kloszy jest nieregularnie pokryta srebrną folią, co sprawia wrażenie łuszczenia się farby. Zewnętrzna część kloszy oraz reszta oprawy ma matowe niklowe wykończenie. Ponadto każdy klosz można w zależności od potrzeb obracać i odchylać. Do ogólnego oświetlenia podstawowego w kuchni!  Pobierz:   Instrukcja obsługi                    (254 KB)','','lampa-kuchenna-julin-w-stylu-vintage-czteropunkt','','','','Lampa kuchenna Julin w stylu vintage, czteropunkt.','','','',''),(1674,1,1,'Satelitarne światło sufitowe z trzema obrotowymi reflektorami punktowymi  Nowoczesna oprawa sufitowa Satellite to trójpłomieniowy reflektor o przemysłowym wyglądzie. Wszystkie trzy źródła światła mogą być indywidualnie regulowane, dzięki czemu w każdej chwili możliwe jest ukierunkowane oświetlenie pomieszczenia. Satelitarna oprawa sufitowa może być również instalowana jako oprawa ścienna i tym samym oferuje szeroki zakres zastosowań. Czy to w kuchni, przedpokoju, czy w salonie i jadalni - oprawa sufitowa lub ścienna Satellite jest praktycznym źródłem światła i wszędzie przyciąga wzrok.','','industrialna-lampa-sufitowa-satellite','','','','Industrialna lampa sufitowa Satellite','','','',''),(1675,1,1,'Nowoczesne 4-płomieniowe światło sufitowe Satelita  Praktyczna funkcja i nowoczesny design: kwadratowa oprawa sufitowa Satellite posiada cztery obrotowe i uchylne reflektory punktowe, które zapewniają optymalne oświetlenie pomieszczenia i mogą być regulowane indywidualnie. Projekt został opracowany w stylu hiperindustrialnym i zapewnia, że oprawa Satellite będzie prawdziwie przyciągająca wzrok w każdym pomieszczeniu. Czy to w kuchni, salonie czy przedpokoju - światło sufitowe Satellite doskonale pasuje do młodych i nowoczesnych wnętrz.','','kwadratowa-lampa-sufitowa-satellite','','','','Kwadratowa lampa sufitowa Satellite','','','',''),(1676,1,1,'Kwadratowa lampa sufitowa Barnstaple z czterema spotami  Lampa sufitowa Barnstaple stanowi niezwykłą atrakcję w salonach nowoczesnych lub zaaranżowanych w stylu industrialnym czy też na poddaszu. Ma bowiem design w stylu vintage. Cztery stalowe klosze, ocynkowane i wyglądające na zużyte, zamocowane są na kwadratowej rozecie sufitowej, wykonanej ze stali i wyposażonej w okładzinę z ciemnej drewnianej płyty z laserunkiem. Wszystkie klosze wyposażone są w boczne śruby blokujące, za pomocą których można je mocować pod żądanym kątem, tak aby wszystkie cztery spoty emitowały światło w różnych kierunkach.  Specjalny, przyciągający wzrok i modny dodatek do wnętrz w modnym stylu vintage.','','lampa-sufitowa-barnstaplestyl-industrialny4-pkt','','','','Lampa sufitowa Barnstaple,styl industrialny,4-pkt.','','','',''),(1677,1,1,'3-punktowy reflektor sufitowy Henega z trzema czarnymi kloszami o wyglądzie reflektora  Henega jest lampą w stylu vintage, ponieważ trzy klosze, które można ustawiać na różne sposoby, wywołują skojarzenia ze starymi reflektorami, zwłaszcza tymi znanymi ze starych samochodów. Aby uzyskać niezwykle autentyczny wygląd, poryflowane zostało także szkło pełniące rolę pokrywy nad żarówkami. Dlatego Henega jest hołdem składanym minionym czasom, a lampa sufitowa ma piękny, nostalgiczny wygląd, który zawsze zyskuje pozytywne opinie i nadaje wnętrzom indywidualnego charakteru. Warta zobaczenia atrakcja! Pobierz:   Instrukcja obsługi                    (424 KB)','','spot-sufitowy-henega-reflektor-czarny-3-pkt','','','','Spot sufitowy Henega, reflektor, czarny, 3-pkt.','','','',''),(1678,1,1,'2-punktowa lampa sufitowa Anze w stylu industrialnym  Wygląd lampy sufitowej Anze z antycznym mosiężnym wykończeniem doskonale wpisuje się w nowoczesny styl industrialny, jak również do koncepcji przestrzeni utrzymanej w klimacie marynarskim. Lampa Anze, która wyposażona jest w dwa obrotowe i odchylane reflektory z żarówkami GU10, zapewnia dobre światło w każdym kierunku, dzięki czemu doskonale oświetla pomieszczenie. Umieszczona w korytarzach, salonach czy jadalniach, lampa sufitowa Anze urzeka antycznym wdziękiem i nowoczesnym stylem. Pobierz:   Instrukcja obsługi                    (377 KB)','','spot-sufitowy-anze-w-mosieznym-stylu-antycznym','','','','Spot sufitowy Anze w mosiężnym stylu antycznym','','','',''),(1679,1,1,'Dobre światło i świetny wygląd – lampa sufitowa Zoja w stylu retro  Trochę retro, trochę industrialne – wzornictwo 4-punktowej lampy sufitowej Zoja łączy oba te style. Jej cztery spoty przypominają wyglądem reflektory starych samochodów i umożliwiają powrót do atmosfery lat 50. Ten wyjątkowy wygląd sprawia, że reflektor sufitowy Zoja jest popularną oprawą oświetleniową, która zdobywa wysokie noty w nowoczesnych, współczesnych wnętrzach. Ponadto spot emituje również wystarczającą ilość światła, które równomiernie rozchodzi się w pomieszczeniu i nie oślepia. Pobierz:   Instrukcja obsługi                    (332 KB)','','spot-sufitowy-zoja-4-punktowy','','','','Spot sufitowy Zoja, 4-punktowy','','','',''),(1680,1,1,'Pięcioramienna lampa sufitowa Telmos z wygiętymi ramionami  Lampa sufitowa Telmos urzeka swoim niezwykłym designem, który natychmiast przyciąga wszystkie spojrzenia. Sprawdzi się zarówno w większym salonie, jak i w przedpokoju, ponieważ dzięki pięciu źródłom światła oferuje bardzo dobre oświetlenie. Klosze są zaprojektowane w modnym kształcie klatki, dzięki czemu masz wyraźny widok na palące się punkty. Dzięki temu światło może bez przeszkód rozchodzić się we wszystkich kierunkach. Do tej oprawy doskonale pasują energooszczędne żarówki LED w optyce filamentowej. Pobierz:   Instrukcja obsługi                    (724 KB)','','lindby-telmos-lampa-sufitowa-5-punktowa','','','','Lindby Telmos lampa sufitowa, 5-punktowa','','','',''),(1681,1,1,'Industrialna lampa sufitowa Gina z ruchomymi punktami - 2 płomienie  Oba reflektory tej białej lampy sufitowej można odchylać i obracać. W ten sposób umożliwiają one oświetlenie pomieszczenia, które jest całkowicie dostosowane do osobistych życzeń. Wizualnie zaprojektowana w stylu industrialnym, stanowi idealny dodatek do wyposażenia oświetleniowego np. loftu. Dwulampowa lampa sufitowa Gina wygląda jednak bardzo dobrze również w każdym innym nowocześnie urządzonym salonie i roztacza przyjemne światło.','','lampa-sufitowa-gina-2-punktowa-biala','','','','Lampa sufitowa Gina, 2-punktowa, biała','','','',''),(1682,1,1,'Wykonany z betonu LED-reflektor KADIGA z dwoma kloszami  LED-Reflektor KADIGA stwarza wiele możliwości aranżacyjnych, gdyż nadaje się do montażu nie tylko na ścianie, ale i na suficie. Jednak nieco ograniczone możliwości daje wygląd lampy, gdyż nie pasuje do każdego stylu. Nie może być tu mowy o całkowicie prostym designie, gdyż osoby decydujące się na lampy wykonane z betonu nie wybierają ich ze względu na ich prosty, dyskretny wygląd. Wręcz przeciwnie, dlatego KADIGA przypadnie do gustu tym, którzy chcą dodać wnętrzu charakteru. Może to być loft w industrialnym stylu, który nawiązuje do swej dawnej funkcji i klimatu starej fabryki, jak również zwykłe wnętrze, w którym brakuje wyjątkowej dekoracji, która będzie przyciągać spojrzenia. Pobierz:   Instrukcja obsługi                    (308 KB)','','dwupunktowy-reflektor-kadiga-z-betonu-gu10','','','','Dwupunktowy reflektor KADIGA z betonu, GU10','','','',''),(1683,1,1,'Staromodnie wyglądający reflektor LED Ebbi w wersji dwupunktowej, z wygodną technologią easydim  Ebbi jest wykonana w całości z metalu o barwie starego mosiądzu, dzięki czemu może błyszczeć i wyglądać tak, jakby naprawdę była stara. Dwa pojedyncze reflektory mogą być obracane i odchylane oddzielnie, co korzystnie wpływa na możliwość indywidualnego ustawienia kierunku padania światła. Aby efekt „starej lampy” był jeszcze bardziej autentyczny, w tym reflektorze LED wykorzystano osłony siatkowe, umieszczone nad kloszami.   Ten reflektor LED wygląda tak nostalgicznie, jak nowoczesna jest zastosowana w nim technologia. Dzieje się tak dlatego, że w lampie zastosowano żarówki LED z innowacyjną funkcją easydim. Ten reflektor LED jest łatwo ściemnić, ponieważ wymaga tylko przełącznika ściennego i nie potrzeba do niego żadnych specjalnych ściemniaczy. Jeśli chcesz zacząć ściemniać lampę, wystarczy po załączeniu reflektora LED dwukrotnie szybko nacisnąć przełącznik. Aby przerwać proces ściemniania lub wybrać odpowiednią jasność, należy powtórzyć procedurę.  Pobierz:   Instrukcja obsługi                    (510 KB)','','2-punktowy-reflektor-led-ebbi-z-easydim','','','','2-punktowy reflektor LED Ebbi z easydim','','','',''),(1684,1,1,'Hit na suficie - 4-punktowa lampa sufitowa Bente o industrialnym charakterze  Dzięki rdzawej powierzchni i masywnej sylwetce ta lampa sufitowa uosabia najmodniejsze trendy stylu industrialnego, stając się nieodzownym elementem wyposażania wszystkich fanów tego stylu. Światło wydobywa się z czterech dowolnie regulowanych reflektorów w odpowiednie miejsca. Zaleca się użycie żarówek LED GU10 o mocy maksymalnej do 4 watów.','','poruszajaca-industrialna-lampa-sufitowa-bente','','','','Poruszająca industrialna lampa sufitowa Bente','','','',''),(1685,1,1,'3-punktowa lampa sufitowa Bentli z regulowanymi spotami  Ta lampa sufitowa pasuje nie tylko do nowoczesnego salonu, ale również do nowoczesnego loftu o charakterze industrialnym. Przede wszystkim rustykalna forma i rdzawo-brązowa powierzchnia sprawiają, że lampa sufitowa Bentli jest idealna do tego stylu, w którym królują postarzane elementy. Dzięki możliwości przestawiania poszczególnych spotów gwarantowane jest doskonałe oświetlenie.','','regulowana-lampa-sufitowa-bentli-w-kolorze-rdzy','','','','Regulowana lampa sufitowa Bentli w kolorze rdzy','','','',''),(1686,1,1,'','','lampa-sufitowa-gunther-z-metalu-czarna-4-pkt','','','','Lampa sufitowa Günther z metalu, czarna, 4-pkt.','','','',''),(1687,1,1,'Lampa sufitowa LED PERSEAS z żarówkami LED GU10 oraz powierzchnią w kolorze antycznego mosiądzu  Lampa sufitowa PERSEAS to połączenie wyglądu w stylu antycznym oraz nowoczesnej technologii oświetleniowej. Dlatego doskonale odnajdzie się w klasycznych wnętrzach, wypełniając je w ekonomiczny sposób pięknym światłem. Objęte dostawą żarówki LED posiadają trzonek GU10. Dzięki trzem reflektorom i okrągłej konstrukcji lampa PERSEAS zapewni we wnętrzu mnóstwo przyjemnego, jasnego światła.   Cechy żarówek z trzonkiem GU10 (w zestawie):  - niski stopień zużycia energii, energooszczędność aż do 80%  - jednolite oświetlenie dzięki dużemu kątowi rozsyłania światła 90°  - bardzo długi okres użytkowania do 30 000 godzin  - odporna na wstrząsy  - żarówka bez rtęci  - czynnik wydajności: 0,5  - bez możliwości ściemniania Pobierz:   Instrukcja obsługi                    (384 KB)','','perseas-lampa-sufitowa-led-gu10-3-pkt','','','','PERSEAS - lampa sufitowa LED GU10, 3-pkt.','','','',''),(1688,1,1,'Kolor niklu, lampa sufitowa Brinley  3-punktowa lampa sufitowa Brinley zapewnia szczególnie przytulne oświetlenie otoczenia. Poszczególne lampki, stanowiące jej część, wyglądają niemal jak słoiki z dżemami. Szklane klosze są przezroczyste, a światło wydostaje się we wszystkich kierunkach. Najlepsze warunki do zapewnienia odpowiedniego oświetlenia otoczenia, takiego, jakie potrzebne jest w danym pomieszczeniu.  Ta lampa sufitowa, inspirowana stylem industrialnym, nadaje się jako stylowe źródło światła, szczególnie w pomieszczeniach urządzonych w stylu przemysłowym lub vintage, prywatnych lub gastronomicznych, i współpracuje z odpowiednimi żarówkami retro. Można je nabyć w dziale „Akcesoria dodatkowe”.','','lampa-sufitowa-brinley-3-pkt','','','','Lampa sufitowa Brinley 3-pkt.','','','',''),(1689,1,1,'3-punktowa lampa sufitowa Carmen Wood - industrialne oświetlenie w nowoczesnej interpretacji  Zainspirowany funkcjonalnymi lampami przemysłowymi czy teatralnymi, model ten prezentuje się w skromnie-eleganckiej odsłonie. Element sufitowy wykonany z drewna zachwyca swoim ciepłym kolorem. Zdecydowanie łagodzi zdecydowaną surowość metalowego klosza. 3-punktowa lampa sufitowa Carmen Wood nastraja nostalgicznie i przekonuje do siebie elastycznością. Każdy z trzech kloszy można skierować w inną stronę, tworząc albo przyjemne oświetlenie w tle, albo stawiając zdecydowane akcenty świetlne.  Dzięki wyglądowi retro 3-punktowa lampa sufitowa Carmen Wood fantastycznie pasuje do nowoczesnego stylu industrialnego. Kompaktowa lampa Carmen wood pasuje tak samo dobrze jako oświetlenie ogólne w salonie, jak i jako wymyślne oświetlenie stołu.','','lampa-sufitowa-carmen-wood-3-pkt','','','','Lampa sufitowa Carmen Wood, 3-pkt.','','','',''),(1690,1,1,'Idealna do kuchni, korytarza i salonu - lampa sufitowa LED Joline  Lampę sufitową LED Joline można określić jako niezwykle delikatną, o purystycznym designie. Wąski pierścień przypominający precel łączy się z okrągłym zamocowaniem sufitowym, tworząc lampę. Brzmi skromnie, ale efekty są znakomite. Warto wspomnieć, że zdobiące pierścień diody LED dają stosunkowo równomierne światło. Chromowana powierzchnia o wysokim połysku nadaje lampie niezwykle elegancki wygląd. Bardo stylowa, nowoczesna oprawa do wnętrz! Pobierz:   Instrukcja obsługi                    (415 KB)','','joline-piekna-lampa-sufitowa-led','','','','Joline - piękna lampa sufitowa LED','','','',''),(1691,1,1,'','','lampa-sufitowa-led-venida-czarna-dwa-kwadraty','','','','Lampa sufitowa LED Venida, czarna, dwa kwadraty','','','',''),(1692,1,1,'Lampa sufitowa Joffrey równomiernie rozprowadza światło  Prosta, nowoczesna i klasycznie ponadczasowa - taka jest lampa sufitowa Joffrey . Składa się on z kątowej płyty sufitowej, do której przymocowane są dwa metalowe pręty. Krzyżują się one na środku, dzięki czemu wystają daleko w głąb pomieszczenia. Oprawy oświetleniowe są równomiernie rozmieszczone na rozpórkach. Zapewnia to nie tylko harmonijny wygląd ogólny, ale również idealny rozsył światła. Oznacza to, że Joffrey może bez problemu oświetlać również większe pomieszczenia. Kolejną zaletą jest to, że oprawy oświetleniowe są inaczej ustawione i można je regulować. Oznacza to, że żaden zakątek nie jest pozostawiony w ciemności. Pobierz:   Instrukcja obsługi                    (379 KB)','','lindby-joffrey-lampa-sufitowa-5-pkt-czarna','','','','Lindby Joffrey lampa sufitowa, 5-pkt., czarna','','','',''),(1693,1,1,'','','lampa-sufitowa-led-frame-pilot-czarna','','','','Lampa sufitowa LED Frame, pilot, czarna','','','',''),(1694,1,1,'Lampa sufitowa ELAINA z kloszami ze szkła opalowego i żarówkami LED E14  Ta 3-punktowa lampa sufitowa z białymi szklanymi kloszami oraz metalową oprawą w postaci wygiętych prętów daje piękne, równomierne światło. Dzięki tym właściwościom lampa ELAINA stanowi uniwersalne źródło światła, które można stosować na wiele sposobów w różnych pomieszczeniach i aranżacjach. Dostawa obejmuje żarówki LED z trzonkiem E14 emitujące ciepłe białe światło oraz charakteryzujące się wysoką energooszczędnością i długim okresem użytkowania.  Pobierz:   Instrukcja obsługi                    (501 KB)','','elegancka-lampa-sufitowa-led-elaina-3pkt-nikiel','','','','Elegancka lampa sufitowa LED ELAINA, 3pkt., nikiel','','','',''),(1695,1,1,'Tekstylna lampa sufitowa Hotel z pięcioma kloszami w kolorze białym, czarnym i szarym  Pięć tekstylnych kloszy o różnych średnicach i kolorach, które składają się na lampę sufitową Hotel, tworzy wspaniałą strukturę. Każdy z pięciu kloszy jest zamknięty od dołu dyfuzorem, który zapewnia równomierny rozsył nieoślepiającego światła. Kombinacja kolorystyczna bieli, czerni i szarości podkreśla nowoczesny charakter lampy, która nadaje się przede wszystkim do oświetlania większych salonów i sypialni lub – jak sama nazwa wskazuje – pokoi hotelowych.','','lampa-sufitowa-hotel-piec-tekstylnych-kloszy','','','','Lampa sufitowa Hotel, pięć tekstylnych kloszy','','','',''),(1696,1,1,'Lampa sufitowa LED z możliwością ściemniania Duetto z dwoma kwadratowymi antracytowymi ramkami świetlnymi  Duetto to lampa sufitowa LED o bardzo nowoczesnym wyglądzie. Obie ramy w formie kwadratu są filigranowe, a w środku łączą się w całość. Tam znajduje się dodatkowy element oświetleniowy, który jest również kwadratowy. Lampę sufitową z diodami LED można wygodnie regulować w trzech stopniach jasności za pomocą zwykłego przełącznika ściennego. Ton powierzchni w kolorze antracytu wygląda bardzo szlachetnie i może być łączony z wieloma nowoczesnymi stylami wyposażenia wnętrz.','','lindby-duetto-lampa-sufitowa-led-antracyt-28w','','','','Lindby Duetto lampa sufitowa LED antracyt 28W','','','',''),(1697,1,1,'Lampa sufitowa LED Mendosa o eleganckim wyglądzie drewna  Oświetlenie sufitowe LED charakteryzuje się szczególnie jasnym i przyjaznym wzornictwem. Powodem tego jest piękny akrylowy element, który oprawia okrągłą lampę. Utrzymana jest w jasnym, drewnianym wyglądzie i nadaje lampie skandynawski charakter. Z tym Mendosa jest w pełni w modzie.  Oświetlenie sufitowe LED szczególnie dobrze integruje się z nowoczesnym domem. Doskonale komponuje się z innymi elementami wyposażenia wnętrz w podobnych kolorach jasnego drewna. Pobierz:   Instrukcja obsługi                    (737 KB)','','lindby-mendosa-lampa-sufitowa-led-drewno-okragla','','','','Lindby Mendosa lampa sufitowa LED, drewno, okrągła','','','',''),(1698,1,1,'','','lampa-sufitowa-mona-3-punktowa-biala','','','','Lampa sufitowa Mona, 3-punktowa, biała','','','',''),(1699,1,1,'4-punktowa lampa sufitowa LED Tomoki z regulowanymi w różny sposób kloszami wykonanymi z białego metalu  Ta lampa sufitowa z serii reflektorów Tomoki jest 4-punktowa i dlatego bardzo dobrze nadaje się do stosowania jako oświetlenie ogólne w pomieszczeniu takim jak kuchnia, salon lub korytarz. Każdy okrągły, cylindryczny reflektor może być dowolnie ustawiony, co pozwala na dostosowanie światła do sytuacji. Zintegrowano cztery żarówki LED GU10, które świecą ładną barwą ciepłej bieli, a także mają dobrą wydajność. Piękny, uniwersalny produkt dla większości nowoczesnych stylów! Pobierz:   Instrukcja obsługi                    (341 KB)','','elc-tomoki-lampa-sufitowa-led-biala-4-punktowa','','','','ELC Tomoki lampa sufitowa LED, biała, 4-punktowa','','','',''),(1700,1,1,'Biała tkaninowa lampa sufitowa Pikka z trzystopniowo ściemnianymi diodami LED  Pikka ma cylindryczny kształt i posiada nie jeden, lecz dwa klosze. Rezultatem tego jest efektowny wygląd lampy, w której klosz wewnętrzny wykonany jest z mocniejszej, gęsto tkanej tkaniny, a klosz zewnętrzny o delikatnej konsystencji organzy wygląda na taki, który szczególnie dobrze przepuszcza światło. Światło ulega także również równomiernemu rozproszeniu przez dolną osłonę dyfuzorów, co sprawia, że staje się ono bardziej przytulne.   Tym, którzy chcieliby mieć możliwość stopniowej regulacji jasności światła, doradzamy nabyć tę lampę sufitową LED Pikka z tkaniny, gdyż znajdujące się w niej diody LED można przyciemniać trójstopniowo, korzystając z przełącznika ściennego.  Pobierz:   Instrukcja obsługi                    (1.3 MB)','','lampa-sufitowa-led-pikka-sciemniana-biala','','','','Lampa sufitowa LED Pikka, ściemniana, biała','','','',''),(1701,1,1,'2-punktowa lampa sufitowa LED Gesina z obracanymi białymi spotami  Ta lampa sufitowa LED jest całkowicie biała, dzięki czemu uosabia współczesność, ale i dyskrecję. Oba cylindryczne reflektory znajdują się po lewej i prawej stronie mocowania sufitowego, który ma również cylindryczny kształt. Nie są one jednak sztywno do niego przymocowane. Można je dowolnie obracać za pomocą przegubu. W ten sposób efekt świetlny można lepiej dostosować do lokalnych warunków. Światło jest punktowe i ukierunkowane, ale zależy to również od wyboru żarówki GU10 i jej kąta padania światła.  Pobierz:   Instrukcja obsługi                    (1.0 MB)','','lampa-sufitowa-gesina-2-punktowa-biala','','','','Lampa sufitowa Gesina, 2-punktowa, biała','','','',''),(1702,1,1,'Antracytowe światło sufitowe LED Caitlin w geometrycznym wykonaniu  Lampa sufitowa Caitlin LED łączy w sobie subtelną kolorystykę z zabawnym wzornictwem. Składa się ona z trzech prostokątnych ram, które łączą się na wsporniku sufitowym, nakładając się na siebie, tworząc ciekawy wzór. Wewnątrz elementów geometrycznych umieszczone są stałe diody LED, których kolor światła można zmieniać w zależności od potrzeb. Za pomocą pilota zdalnego sterowania można sterować barwą światła w zakresie 3.000 K -6.000 K. Pozwala to na oświetlenie w zależności od nastroju i łatwą obsługę. Oświetlenie sufitowe Caitlin LED ze spokojnej stali antracytowej bez trudu integruje się z resztą mebli, nie naruszając przy tym stylu aranżacji wnętrza. Ciekawy wygląd uwydatnia każdy pokój w sposób życzliwy i tworzy atrakcyjne akcenty na suficie mieszkania. Pobierz:   Instrukcja obsługi                    (1.3 MB)    Instrukcja obsługi 2                    (291 KB)','','lindby-caitlin-lampa-sufitowa-led-antracyt','','','','Lindby Caitlin - lampa sufitowa LED, antracyt','','','',''),(1703,1,1,'','','lampa-sufitowa-tube-6-punktowa-czarna','','','','Lampa sufitowa Tube 6-punktowa czarna','','','',''),(1704,1,1,'Lampa sufitowa LED Agostina z 4 rozpórkami świetlnymi i powierzchnią z niklu  Agostina bardzo dobrze komponuje się z nowoczesnymi wnętrzami i jest również lampą, które zapewnia dobrą jasność. Dlatego też lampa sufitowa LED może być bardzo dobrze wykorzystana do oświetlenia ogólnego pomieszczeń. Każdy drążek świetlny jest wykonany w kształcie fali, a cztery elementy częściowo się krzyżują. Światło o barwie ciepłej bieli wydaje się przytulne i dzięki satynowanej pokrywie z tworzywa sztucznego emitowane jest dość równomiernie do pomieszczenia. Wizualnie, lampa sufitowa LED Agostina również punktuje eleganckim niklowym wykończeniem, które charakteryzuje prawie całą powierzchnię.  Pobierz:   Instrukcja obsługi                    (389 KB)','','elc-agostina-lampa-sufitowa-led-nikiel','','','','ELC Agostina lampa sufitowa LED, nikiel','','','',''),(1705,1,1,'Trzypunktowa lampa sufitowa Svean z niklowaną oprawą  Lampa sufitowa Svean składa się z lekką wygiętej oprawy o niklowym, matowym wykończeniu oraz umieszczonych na niej kloszy z białego opalowego szkła. Dzięki wygiętej formie odznacza się fantazyjnym designem z nowoczesnymi akcentami. Ze względu na piękne, przytulne światło, jakie emituje lampa Svean, stanowić będzie codzienne oświetlenie salonu, gdzie zapewni odpowiednio jasne światło.  Pobierz:   Instrukcja obsługi                    (706 KB)','','svean-trzypunktowa-lampa-sufitowa','','','','Svean - trzypunktowa lampa sufitowa','','','',''),(1706,1,1,'Okrągła lampa sufitowa LED Marlo z białym obramowaniem i stopniem ochrony IP44  Ta lampa sufitowa LED wyróżnia się dużą mocą światła oraz możliwością wykorzystania w pomieszczeniach o podwyższonej wilgotności, którą gwarantuje stopień ochrony IP44 zapewniający doskonałą szczelność lampy. Biała, okrągła ramka nadaje lampie sufitowej LED bardzo prosty wygląd i umożliwia jej łączenie z różnymi stylami wyposażenia wnętrz - oprawa stanowi bardzo funkcjonalne źródło światła nawet w przypadku zastosowań komercyjnych.  Pobierz:   Instrukcja obsługi                    (5.3 MB)    Photometric Data LDT                    (85 KB)    Dimension drawing                    (129 KB)','','lampa-led-marlo-biala-4000k-okragla-182cm','','','','Lampa LED Marlo biała 4 000 K okrągła 18,2cm','','','',''),(1707,1,1,'Okrągła łazienkowa lampa sufitowa FLAVI z saynowaną, niklowaną oprawką  Lampa sufitowa FLAVI posiada stopień ochrony IP44, co czyni ją idealnym rozwiązaniem do łazienek. Klosz lampy wykonany jest z białego szkła i otoczony jest metalowym pierścieniem o satynowanej, niklowanej powierzchni. Wybór żarówki jest dowolny, gdyż lampa posiada oprawkę E27, dla której jest szeroki wachlarz źródeł światła.  Pobierz:   Instrukcja obsługi                    (518 KB)','','lindby-flavi-lazienkowa-lampa-sufitowa-23cm-nikiel','','','','Lindby Flavi łazienkowa lampa sufitowa 23cm nikiel','','','',''),(1708,1,1,'Podłużny panel LED Livel z barwą światła uniwersalna biel  Livel zawiera liczne diody LED o barwie światła uniwersalna biel, które razem tworzą równomierny i przyjemny obraz świetlny. Duża moc światła pozwala rozjaśnić każde wnętrze. Nie ma prawie żadnych ograniczeń w wyborze pomieszczenia, a lampa sufitowa LED jest szczególnie odpowiednia dla tych pomieszczeń, w których aspekty funkcjonalne oświetlenia mają być traktowane priorytetowo, lub dla tych, którzy generalnie preferują proste, praktyczne wzornictwo. Livel może być również stosowana w kuchni lub korytarzu, lub zainstalowana w gabinecie - cel, do którego idealnie pasuje panel LED.    Pobierz:   Instrukcja obsługi                    (839 KB)','','lindby-livel-panel-led-4000k-80-cm-x-30-cm','','','','Lindby Livel panel LED 4 000 K, 80 cm x 30 cm','','','',''),(1709,1,1,'','','lampa-sufitowa-mona-4-punktowa-biala','','','','Lampa sufitowa Mona, 4-punktowa, biała','','','',''),(1710,1,1,'Lampa ścienna z tkaniny Vasilia w kolorach czarnym i złotym  Dzięki trzem indywidualnie regulowanym lampom pięknie zaprojektowanej lampy sufitowej Vasilia nawet większe pomieszczenia mogą być oświetlone sposób nastrojowy. Dzięki tej lampie żaden zakamarek nie pozostanie nieoświetlony, czy to w kuchni, czy w salonie, czy w sypialni, czy też w biurze. Rezultatem jest kompleksowa koncepcja oświetleniowa, która niesamowicie zachwyca.  Zewnętrzna część lampy sufitowej ma barwę głębokiej czerni, przez co dyskretnie wtapia się w domowe wnętrze. Punktem kulminacyjnym jest przede wszystkim złote wnętrze, które zapewnia szlachetny połysk i uzupełnia liniowy design o ujmująco piękną tkaninę. Pobierz:   Instrukcja obsługi                    (312 KB)','','lampa-sufitowa-vasilia-czarno-zlota-3-punktowa','','','','Lampa sufitowa Vasilia, czarno-złota, 3-punktowa','','','',''),(1711,1,1,'Srebrna lampa sufitowa LED Charlok z dwoma owalnymi pierścieniami, ściemniana za pomocą przełącznika  Charlok to lampa sufitowa LED, która przekonuje nowoczesnym językiem designu. W centrum znajduje się okrągły element, który świeci tak samo jasno, jak dwa owalne pierścienie, które lekko zachodzą na siebie wokół świetlistego centrum. Srebrna powierzchnia aluminiowej ramy dobrze harmonizuje z wewnętrznie nowoczesnym wyrazem, a za pomocą konwencjonalnego przełącznika, jaki zwykle znajduje się na ścianie pomieszczenia, można w kilku prostych krokach ściemniać lampę sufitową LED w trzech stopniach. Pobierz:   Instrukcja obsługi                    (2.0 MB)','','lindby-charlok-lampa-sufitowa-led-sciemniana','','','','Lindby Charlok lampa sufitowa LED, ściemniana','','','',''),(1712,1,1,'Nowoczesna lampa sufitowa do jadalnie Svean z sześcioma kloszami z białego opalowego szkła  Lampa sufitowa do jadalni Svean zapewnia odpowiednie jasne światło, gdyż wyposażona jest w sześć kloszy, które przystosowane są do żarówek E14 o mocy do 40 watów. Każdy klosz ma okrągły kulisty kształt, a w jego dolnej części posiada otwór, przez który z każdej perspektywy można dostrzec białe szkło, które rozprasza światło w postaci łagodnej poświaty i delikatnie je tłumi.  Pobierz:   Instrukcja obsługi                    (632 KB)','','lampa-sufitowa-do-jadalni-svean-6-punktowa','','','','Lampa sufitowa do jadalni Svean, 6-punktowa','','','',''),(1713,1,1,'Lampa sufitowa z tkaniny Laurenz z trzema źródłami światła w różnych kolorach i rozmiarach  Klosze z tkaniny tej lampy sufitowej są okrągłe w kształcie i stosunkowo płaskie w konstrukcji. Różnią się one jednak wielkością i kolorem poszczególnych odcieni. Biały, szary i brązowy to kolory, które dają efekt ziemi i dlatego można je dobrze łączyć z odpowiednimi kolorami wyposażenia wnętrz. Ponadto dają one przyjemne, domowe światło, zwłaszcza że od spodu znajduje się biały dyfuzor, który sprawia, że światło rozchodzi się szczególnie równomiernie. Pobierz:   Instrukcja obsługi                    (349 KB)','','lindby-laurenz-lampa-sufitowa-3-pkt-szara-brazowa','','','','Lindby Laurenz lampa sufitowa 3-pkt. szara brązowa','','','',''),(1714,1,1,'','','lampa-sufitowa-frame-cct-pilot-czarna-drewniana','','','','Lampa sufitowa Frame CCT, pilot, czarna/drewniana','','','',''),(1715,1,1,'Lampa sufitowa LED Kyron ściemniana za pomocą przełącznika  Prostszy sposób ściemniania jest obecnie niemal niemożliwy. Po podłączeniu lampy można ją ściemniać w trzech stopniach za pomocą standardowego przełącznika, który jest montowany w prawie wszystkich mieszkaniach. Wystarczająca jasność jest osiągana dzięki lampie sufitowej LED Kyron w 100%, a jeśli nastrój stanie się nieco bardziej romantyczny, wówczas natężenie światła można zmniejszyć o 50% lub 25%. Diody LED znajdują się na zewnątrz łuków i mogą bez przeszkód emitować światło o barwie ciepłej bieli. Łuki lampy o tytanowym kolorze wydają się lekkie jak piórko, utrzymywane tylko przez rozetę sufitową. Pobierz:   Instrukcja obsługi                    (1.2 MB)','','lindby-kyron-lampa-sufitowa-led-srebrna-tytanowa','','','','Lindby Kyron lampa sufitowa LED, srebrna tytanowa','','','',''),(1716,1,1,'2-punktowy spot sufitowy Wanessa  2-punktowa lampa sufitowa Wanessa, dzięki ciepłemu, szlachetnemu połączeniu drewna z białymi kloszami, wygląda nowocześnie. Dwa klosze, które wewnątrz wyposażono w dwie oprawy E14, mogą być indywidualnie ustawiane za pomocą ruchomego przegubu. Dzięki temu światło, niezależnie od tego, czy ma świecić w bok, czy bezpośrednio w dół, może być łatwo regulowane. Dlatego też reflektor sufitowy jest bardzo dobrym rozwiązaniem dla mniejszych pomieszczeń, które są odpowiednio oświetlane tym wystarczająco jasnym i nie oślepiającym reflektorem.     Pobierz:   Instrukcja obsługi                    (218 KB)','','lindby-wanessa-spot-sufitowy-2-punktowy','','','','Lindby Wanessa spot sufitowy, 2-punktowy','','','',''),(1717,1,1,'Lampa sufitowa LED Katris w czarnym matowym kolorze z trzema świecącymi łukami, ściemniana za pomocą przełącznika  Katris wytwarza jasne światło i jest lampą sufitową, która szczególnie dobrze odnajdzie się w nowocześnie urządzonych mieszkaniach. Powierzchnia trzech łukowych elementów oświetleniowych jest matowo czarna, a wysoka jasność wydajnych diod LED może być ściemniana w trzech stopniach, jeśli używany jest zwykły przełącznik ścienny. Lampa może być instalowana we wszelkiego rodzaju pomieszczeniach mieszkalnych i zapewnia niezawodne światło w każdym miejscu.  Pobierz:   Instrukcja obsługi                    (406 KB)','','lindby-katris-lampa-sufitowa-led-58-cm-czarna','','','','Lindby Katris lampa sufitowa LED, 58 cm, czarna','','','',''),(1718,1,1,'Lampa sufitowa Stannis oświetli każdy zakątek pomieszczenia  Lampa sufitowa Stannis przekonuje powściągliwym wzornictwem, które pasuje do różnych stylów wyposażenia i dlatego jest uniwersalna. Stannis posiada cztery klosze z białej tkaniny, które zapewniają bezpośredni i jednocześnie przyjemny rozkład światła. Możliwe jest również dostosowanie wiązki światła do warunków panujących w pomieszczeniu poprzez zmianę ustawienia kloszy za pomocą przegubów. W ten sposób lampa sufitowa Stannis pozwala oświetlić każdy zakątek pomieszczenia.','','lindby-stannis-lampa-sufitowa-z-4-kloszami','','','','Lindby Stannis lampa sufitowa z 4 kloszami','','','',''),(1719,1,1,'Czarno-złoty downlight Maylou z oprawą GU10  Maylou punktuje przede wszystkim swoją kolorystyką w czerni i złocie. Dzięki temu downlight jest w stanie zapewnić pięknie ciepłe refleksy świetlne, ponieważ matowy, złoty reflektor wewnątrz lampy świeci przytulnym światłem. Jest duża swoboda odnośnie wyboru pasujących żarówek GU10. Szczególnie polecane są wydajne żarówki LED, które są dostępne w różnych barwach światła i o różnych kątach świecenia. Dzięki okrągłemu kształtowi i samej w sobie dość prostej konstrukcji aluminiowej obudowy, downlight może być nie tylko używany prywatnie, ale może być również używany w środowisku komercyjnym, pięknie go oświetlając.  Pobierz:   Instrukcja obsługi                    (470 KB)','','elc-maylou-downlight-okragly-czarno-zloty-gu10','','','','ELC Maylou downlight, okrągły, czarno-złoty, GU10','','','',''),(1720,1,1,'','','lampa-sufitowa-veken-6b-czarna-i-miedziana','','','','Lampa sufitowa Veken 6B czarna i miedziana','','','',''),(1721,1,1,'Trendowy reflektor sufitowy Evinora z trzema palnikami  Sufitowy reflektor Evinora przekonuje nowoczesnym wzornictwem, które łączy w sobie zarówno efektowne jak i naturalne elementy. Trzy klosze są wykonane ze stali i mają czarne wykończenie powierzchni. Otwarta siatka optyczna daje specjalne efekty świetlne i cieniowe po włączeniu światła.  Dzięki trzem palącym się punktom, jeszcze większe salony lub korytarze mogą być dobrze oświetlone. Rama wykonana z drewna nadaje lampie ciepłą i przyjemną atmosferę, dzięki czemu Evinora wprowadza przytulność do pomieszczenia nawet po jego wyłączeniu.','','lindby-evinora-reflektor-sufitowy-z-drewna-3-pkt','','','','Lindby Evinora reflektor sufitowy z drewna, 3-pkt.','','','',''),(1722,1,1,'Czarny reflektor sufitowy Joffrey z ruchomymi kloszami  Dzięki swojemu ponadczasowemu wzornictwu, reflektor sufitowy Joffrey może być stosowany w wielu pomieszczeniach i łączony z szeroką gamą stylów. Trzy klosze mają cylindryczny kształt i dzięki przegubowi można je obracać i wychylać, aby lepiej kierować światłem. Matowa czerń nadaje Joffrey nowoczesny wygląd i stanowi przyjemny kontrast z białymi sufitami. Pobierz:   Instrukcja obsługi                    (289 KB)','','lindby-joffrey-spot-sufitowy-3-punktowy-czarny','','','','Lindby Joffrey spot sufitowy, 3-punktowy, czarny','','','',''),(1723,1,1,'Porywająca lampa sufitowa Tornado  Ten produkt oświetleniowy nie bez powodu nosi miano Tornado – podobnie jak w przypadku prawdziwego tornado złożona jest ona z plątaniny metalowych pasów, które tworzą wyjątkowo dynamiczną i oryginalną całość. Poza nowoczesnymi kształtami zachwyca również czarny lakier, pokrywający całą lampę. Trzy źródła światła E27 zapewniają równomierne i wielkopowierzchniowe oświetlenie otoczenia. Funkcja przyciemniania za pomocą domowej instalacji elektrycznej.','','czarna-lampa-sufitowa-tornado','','','','Czarna lampa sufitowa Tornado','','','',''),(1724,1,1,'Biały downlight Aleena z regulowaną wkładką żarówki  Aleena to prosty, okrągły downlight o matowej, białej powierzchni, który może być używany w wielu różnych zastosowaniach i nie jest ograniczony do konkretnego pomieszczenia lub indywidualnych stylów. Cylindryczny kształt klosza wydaje się bardzo uniwersalny i pasuje do wszystkich rodzajów wnętrz. Warto również zauważyć, że wewnętrzny wkład żarówki GU10 można obracać w dowolny sposób, aby uzyskać optymalny kierunek światła. Pobierz:   Instrukcja obsługi                    (514 KB)','','elc-aleena-downlight-regulowany-okragly-bialy','','','','ELC Aleena downlight, regulowany, okrągły, biały','','','',''),(1725,1,1,'Lampa sufitowa ELAINA z kloszami ze szkła opalowego i żarówkami LED E14  Ta 5-punktowa lampa sufitowa z białymi szklanymi kloszami oraz metalową oprawą w postaci wygiętych prętów daje piękne, równomierne światło. Dzięki tym właściwościom lampa ELAINA stanowi uniwersalne źródło światła, które można stosować na wiele sposobów w różnych pomieszczeniach i aranżacjach. Dostawa obejmuje żarówki LED z trzonkiem E14 emitujące ciepłe białe światło oraz charakteryzujące się wysoką energooszczędnością i długim okresem użytkowania.  Pobierz:   Instrukcja obsługi                    (547 KB)','','piekna-lampa-sufitowa-led-elaina-5-pkt-nikiel','','','','Piękna lampa sufitowa LED ELAINA, 5-pkt., nikiel','','','',''),(1726,1,1,'Biało-złota lampa sufitowa Gerwina z metalowym kloszem i oprawą E27  Gerwina jest bardzo stylowo wyglądającą lampą pasującą do całego obszaru mieszkalnego, która łączy w sobie białą powierzchnię zewnętrzną ze złotym wykończeniem wnętrza. Wynikiem jest bardzo harmonijny styl, który można łączyć z wieloma współczesnymi wnętrzami, a także wykorzystać w stylizacjach skandynawskich, ponieważ występują tu elementy „zredukowanego detalu” i „ciepłej ekspresji”. Ponieważ klosz lampy sufitowej jest złoty wewnątrz, światło emitowane przez żarówkę E27 tworzy bardzo ciepły i komfortowy efekt. Aby uzyskać stylowy wygląd, należy użyć żarówek filamentowych lub rustykalnych. Są one dostępne głównie w technologii LED i mogą być również zakupione w bardzo ciepłych barwach światła, aby podkreślić przytulność w salonie.  Pobierz:   Instrukcja obsługi                    (206 KB)','','metalowa-lampa-sufitowa-gerwina-bialo-zlota','','','','Metalowa lampa sufitowa Gerwina, biało-złota','','','',''),(1727,1,1,'Oświetlenie sufitowe LED Milada ze zmienną temperaturą barwową i praktyczną funkcją pamięci  Lampa sufitowa LED Milada przekonuje swoją zaawansowaną technologią, która okazuje się być niezwykle praktyczna w codziennym życiu. Posiada zainstalowane na stałe diody LED, które są zarówno jasne jak i ekonomiczne w użyciu. Ich jasność i temperaturę kolorów można dostosować do indywidualnych wymagań za pomocą dostarczonego pilota.  Ponadto lampa posiada funkcję pamięci, dzięki której poziom jasności i temperatura barwowa już ustawionego światła są zapisywane i mogą być wykorzystane przy następnym włączeniu lampy. Klasyczna konstrukcja i kolorystyka dopełniają nowoczesny design tego światła. Pobierz:   Instrukcja obsługi                    (745 KB)    Instrukcja obsługi 2                    (251 KB)','','lindby-milada-lampa-sufitowa-led-czarna','','','','Lindby Milada lampa sufitowa LED, czarna','','','',''),(1728,1,1,'Okrągła lampa sufitowa Marees przekonuje białym elementem przypominającym szyszkę  Gdy ta lampa sufitowa Marees zostanie wyposażona w trzy żarówki, zapewnia ciepłe światło w całym pomieszczeniu. Jest ona bezpośrednio połączona z sufitem przy użyciu stabilnego metalowego mocowania, a zaokrąglony korpus tej lampy, świecącej w pomieszczeniu, wygląda jak szyszka jodły. Mocowanie wygląda na element chromowany, z kolei szyszkę wykonano z białego akrylu. Doskonałej jakości plastik został poddany tak starannej obróbce, że można tu zobaczyć wszystkie filigranowe szyszki, a sama lampa sufitowa Marees jako całość zapewnia niezwykle różnorodne oświetlenie. Idealnie nadaje się do zapewniania przytulnego oświetlenia pośredniego.Pobierz:   Instrukcja obsługi                    (375 KB)','','lampa-sufitowa-marees-biala-okragla','','','','Lampa sufitowa Marees, biała, okrągła','','','',''),(1729,1,1,'Dwupunktowy reflektor sufitowy Evinora z jasnego drewna i stali  Ten sufitowy reflektor wyczarowuje na suficie szczególny wygląd. Można go używać zarówno w salonie, jak i na korytarzu. Rama wykonana jest z jasnego drewna, a dwa klosze są wykonane ze stali i pokryte czarnym wykończeniem.  Reflektor sufitowy Evinora wyróżnia się szczególnie cylindrycznymi kloszami, które zostały zaprojektowane w modnym, siatkowym stylu. Efektem tego jest tworzenie pięknych efektów świetlnych w pomieszczeniu. Do dwóch punktów świetlnych zaleca się stosowanie żarówek dekoracyjnych, ponieważ podkreślają one charakter oprawy.','','lindby-evinora-reflektor-sufitowy-z-drewna-2-pkt','','','','Lindby Evinora reflektor sufitowy z drewna, 2-pkt.','','','',''),(1730,1,1,'Hotel – tekstylna lampa sufitowa z czterema okrągłymi kloszami  Tekstylna lampa sufitowa Hotel, którą tworzą cztery połączone, okrągłe, różnej wielkości klosze w kolorze białym, czarnym i szarym, prezentuje się bardzo nowocześnie, modnie i efektownie. Każdy klosz posiada w dolnej części dyfuzor, który zapewnia równomierny rozsył nieoślepiającego światła. Ta lampa sufitowa stanowi piękne źródło światła zarówno w nowocześnie urządzonych salonach i sypialniach, jak i – zgodnie z nazwą – w pokojach hotelowych. Można ją wyposażyć w nowoczesne żarówki LED, a w przypadku zastosowania żarówek ściemnianych – również ściemniać.','','lampa-sufitowa-hotel-cztery-tekstylne-klosze','','','','Lampa sufitowa Hotel, cztery tekstylne klosze','','','',''),(1731,1,1,'Kątowa lampa sufitowa LED w kolorze chromu i srebra  Ta lampa sufitowa LED o pięknym kształcie jest nie tylko dobrym systemem oświetleniowym, ale także ozdobą każdej przestrzeni mieszkalnej. Przestronne wzornictwo lampy nadaje pomieszczeniu nowoczesny i świeży wygląd.   Lampa składa się z prostokątnych chromowo-srebrnych elementów oświetleniowych o różnych rozmiarach, które są montowane na suficie za pomocą równie prostokątnej pokrywy kabla. Prostokąty można obracać i optymalnie rozdzielają one światło w pomieszczeniu. Intensywność światła można również regulować w zależności od potrzeb za pomocą ściemniacza stopniowego.','','lampa-sufitowa-led-3128-018-sciemniana-wlacznikiem','','','','Lampa sufitowa LED 3128-018 ściemniana włącznikiem','','','',''),(1732,1,1,'Lśniąca lampa sufitowa LED Tioklia z czterema ruchomymi elementami oświetleniowymi w kształcie pierścienia  Tioklia zapewnia dobre oświetlenie podstawowe o barwie światła ciepła biel w małych i średniej wielkości pomieszczeniach, dlatego też lampa sufitowa LED może zostać przeznaczona do użytku prywatnego. Nie ma konwencjonalnych kloszy, ale zamiast tego pierścienie świetlne są połączone z metalowym prętem za pomocą przegubów i można je obracać i wychylać w zależności od potrzeb. Cała lampa sufitowa ma powierzchnię o wysokim połysku w kolorze chromu, dzięki czemu wygląda bardzo szlachetnie i nowocześnie.  Pobierz:   Instrukcja obsługi                    (369 KB)','','elc-tioklia-lampa-sufitowa-led-chrom-4-punktowa','','','','ELC Tioklia lampa sufitowa LED, chrom, 4-punktowa','','','',''),(1733,1,1,'Okrągła łazienkowa lampa sufitowa FLAVI z saynowaną, niklowaną oprawką  Lampa sufitowa FLAVI posiada stopień ochrony IP44, co czyni ją idealnym rozwiązaniem do łazienek. Klosz lampy wykonany jest z białego szkła i otoczony jest metalowym pierścieniem o satynowanej, niklowanej powierzchni. Wybór żarówki jest dowolny, gdyż lampa posiada oprawkę E27, dla której jest szeroki wachlarz źródeł światła.  Pobierz:   Instrukcja obsługi                    (518 KB)','','lindby-flavi-lazienkowa-lampa-sufitowa-23cm-nikiel','','','','Lindby Flavi łazienkowa lampa sufitowa 23cm nikiel','','','',''),(1734,1,1,'Nowoczesna lampa sufitowa do jadalnie Svean z sześcioma kloszami z białego opalowego szkła  Lampa sufitowa do jadalni Svean zapewnia odpowiednie jasne światło, gdyż wyposażona jest w sześć kloszy, które przystosowane są do żarówek E14 o mocy do 40 watów. Każdy klosz ma okrągły kulisty kształt, a w jego dolnej części posiada otwór, przez który z każdej perspektywy można dostrzec białe szkło, które rozprasza światło w postaci łagodnej poświaty i delikatnie je tłumi.  Pobierz:   Instrukcja obsługi                    (632 KB)','','lampa-sufitowa-do-jadalni-svean-6-punktowa','','','','Lampa sufitowa do jadalni Svean, 6-punktowa','','','',''),(1735,1,1,'Biała łazienkowa lampa sufitowa Lennie ze szkła  Nierzucający się w oczy uchwyt sufitowy Lennie jest niklowany, a pozostałą część oprawy wykonano z wybrzuszonego szkła, co sprawia bardzo harmonijne wrażenie. Łazienkowa lampa sufitowa Lennie ma oprawkę E27, w który można wstawiać, między innymi, trwałe i energooszczędne lampy LED zastępujące tradycyjne źródła światła z trzonkiem tej wielkości.  Pobierz:   Instrukcja obsługi                    (324 KB)','','okragla-lazienkowa-lampa-sufitowa-lennie','','','','Okrągła, łazienkowa lampa sufitowa Lennie','','','',''),(1736,1,1,'Trzypunktowa lampa sufitowa LED Ciala o pięknym kształcie  Lampa sufitowa LED Ciala ma mocno wygięte ramiona, co nadaje jej fantazyjny wygląd, mimo to jednak jest to urządzenie oświetleniowe dobrze pasujące do nowoczesnych wnętrz, z uwagi na niklową powierzchnię i satynowane wykończenie kloszy. Trzy wykonane ze szkła klosze są kuliste i mają z przodu otwory, przez które po włączeniu lampy płynie przyjemne światło. Diody LED, dołączane w zestawie, zapewniają niski pobór prądu i dobry stopień energooszczędności. Dzięki trzem punktom świetlnym Ciala sprawdzi się w małych i średniej wielkości pomieszczeniach, odpowiednio je oświetlając.  Pobierz:   Instrukcja obsługi                    (440 KB)','','lampa-sufitowa-led-ciala-3-punktowa-nikiel','','','','Lampa sufitowa LED Ciala, 3-punktowa, nikiel','','','',''),(1737,1,1,'Kwadratowa lampa sufitowa i ścienna Lole z satynowaną szklaną płytą  LOLE to wykonana z wysokiej jakości materiałów lampa sufitowa i ścienna. Tworzy ją kwadratowy klosz z hartowanego szkła odznaczającego się wysoką odpornością na uderzenia i wstrząsy. Wzrok przyciąga kwadratowy dekoracyjny element na środku klosza pokryty złotym szlagmetalem. Pod wpływem padającego ciepłobiałego światła diod LED marki Citizen powierzchnia tego elementu pięknie lśni, wypełniając otoczenie eleganckim blaskiem. Światło jest pośrednie i kierowane z tylnej części klosza na zewnątrz, zapewniając całościowe, nieoślepiające oświetlenie pomieszczenia. Szczególną cechą lampy są przezroczyste kanty szklanego klosza. Pięknie załamują światło , które tworzy wspaniałe efekty.  Jeśli nie jest potrzebne oświetlenie o maksymalnej jasności 1800 lumenów, istnieje możliwość indywidualnego dostosowania światła za pomocą ściemniacza LEDIM lub TEDIM. Wyprodukowana w Niemczech lampa LOLE jest przystosowana do montażu na suficie lub ścianie. Bez względu na jej miejsce przeznaczenia, wszędzie zapewni takie samo, stylowe światło. Pobierz:   Instrukcja obsługi                    (205 KB)','','wysokiej-jakosci-lampa-sufitowa-led-lole','','','','Wysokiej jakości lampa sufitowa LED LOLE','','','',''),(1738,1,1,'Częściowo chromowana lampa sufitowa Ravena ze szklanymi kulami o różnej wielkości  Dzięki obecności błyszczącego chromowania Ravena emanuje czymś bardzo wysublimowanym i pełna jest swoistej elegancji, a przy tym tworzy piękny efekt lustra. Kule wykonane są ze szkła i mają różną wielkość. Jako ze żarówki są doskonale widoczne, zaleca się wybierać je z rozwagą. Preferowane są tu zwłaszcza żarówki filamentowe czy rustykalne o stylowym wyglądzie.   Wspaniały element wystroju pomieszczenia, bez wątpienia przyciągający wzrok! Pobierz:   Instrukcja obsługi                    (318 KB)','','lampa-sufitowa-ravena-z-kulkami-4-punktowa','','','','Lampa sufitowa Ravena z kulkami, 4-punktowa','','','',''),(1739,1,1,'Otoczona chromowanym pierścieniem lampa sufitowa FLAVI z żarówkami LED E27  Lampa sufitowa FLAVI dostarczana jest wraz z wymiennymi żarówkami LED E27. Ale jej średni okres użytkowania jest właściwie tak długi, że trzeba będzie długo czekać z wymianą żarówek. Pewne jest jednak to, że lampa nie zużywa dużo prądu, gdyż technologia LED znana jest z dobrej efektywności energetycznej.   To wszystko czyni lampę sufitową FLAVI godnym polecenia źródłem światła, które dodatkowo posiada odpowiedni stopień ochrony. Klosz z białego szkła uzupełnia chromowany brzeg i razem tworzą piękną kompozycję.  Pobierz:   Instrukcja obsługi                    (517 KB)','','lindby-flavi-lampa-sufitowa-led-do-lazienki-chrom','','','','Lindby Flavi lampa sufitowa LED do łazienki chrom','','','',''),(1740,1,1,'Lampa sufitowa Flavi w ciemności jako nowoczesne oświetlenie łazienkowe  Lampa sufitowa Flavi charakteryzuje się stopniem ochrony IP44, który zapewnia jej dobrą ochronę przed wilgocią, co czyni ją idealną do stosowania w łazienkach.   Korpus wykonany jest z żelaza i ma matowe czarne wykończenie, co nadaje lampie nowoczesny i nieco charakterystyczny wygląd. Opalowo-biały klosz działa jak dyfuzor i pozwala na równomierne i delikatne rozprowadzenie światła w otoczeniu. Pobierz:   Instrukcja obsługi                    (542 KB)','','lindby-flavi-lampa-sufitowa-o-28-cm-czarna','','','','Lindby Flavi lampa sufitowa, Ø 28 cm, czarna','','','',''),(1741,1,1,'Kwadratowa lampa sufitowa LED Lole w mosiądzu z oświetleniem pośrednim, najwyższa jakość made in Germany  Lole doskonale pasuje do współczesnego otoczenia i charakteryzuje się pewną nowoczesnością dzięki swojemu liniowemu, kwadratowemu kształtowi, podczas gdy centralny element mosiężny nadaje klasyczny charakter całemu wzornictwu lampy sufitowej LED. Lampa zapewnia pomieszczeniu piękne oświetlenie pośrednie, które promieniuje wysokim komfortem. W razie potrzeby można regulować moc światła za pomocą zewnętrznego ściemniacza fazowego lub fazowo-kątowego.   Podczas montażu lampy sufitowej dostępna jest bardzo duża przestrzeń przyłączeniowa, dzięki czemu każdy rodzaj okablowania może być łatwo ukryty, bez problemów dla wolnego miejsca. Masywny aluminiowy reflektor w środku z ręcznie wykańczaną mosiężną powierzchnią uzupełnia kwadratową płytę wykonaną z częściowo satynowanego szkła, a Lole jest produktem oświetleniowym najwyższej jakości, który może pochwalić się sygnaturą „made in Germany”.  Pobierz:   Instrukcja obsługi                    (212 KB)','','lucande-lole-lampa-sufitowa-matowy-mosiadz','','','','Lucande Lole lampa sufitowa, matowy mosiądz','','','',''),(1742,1,1,'Amilia – lampa sufitowa ze szklanym kloszem i niklowaną podstawą  Dzięki okrągłemu kształtowi i połączeniu białego szkła z metalem ta lampa sufitowa wygląda prosto i ponadczasowo, a tym samym można ją wkomponować w liczne style aranżacji wnętrz. Biały klosz rozkłada światło dość równomiernie, dzięki czemu nie trzeba się obawiać oślepiania, lecz można cieszyć się miłym domowym światłem. Trzy oprawki E27 pozwalają stworzyć przyjemnie jasne światło, a stopień ochrony IP44 wskazuje, że Amilia może być bezpiecznie stosowana w łazience.  Pobierz:   Instrukcja obsługi                    (331 KB)','','lampa-sufitowa-amilia-z-niklowana-podstawa-ip44','','','','Lampa sufitowa Amilia z niklowaną podstawą, IP44','','','',''),(1743,1,1,'Prosta lampa sufitowa Ummi z metalową obręczą w kolorze mosiądzu  Lampa sufitowa Ummi wydaje się prosta, a jednocześnie wyjątkowa. Łączy w sobie klasyczny design i dyskretny klosz w kolorze białym z efektowną metalową obwódką w mosiężnym wyglądzie.  Ich płaski, okrągły wygląd pasuje do prawie każdej przestrzeni życiowej, nie będąc przy tym natarczywym. Dzięki oszronionej powierzchni szklany klosz wpuszcza światło do pomieszczenia bez olśnień i działa jak dyfuzor. Jeśli Ummi jest wyposażona w lampę E27 z możliwością ściemniania, jej jasność można regulować za pomocą ściemniacza ściennego (wyłącznie ściemniacze). Pobierz:   Instrukcja obsługi                    (210 KB)','','lindby-ummi-lampa-sufitowa-mosiadz-antyczny','','','','Lindby Ummi lampa sufitowa, mosiądz antyczny','','','',''),(1744,1,1,'Czarna matowa lampa sufitowa Flavi w okrągłej formie jako piękne oświetlenie łazienkowe  Ta piękna lampa prezentuje się w klasycznym, okrągłym wzornictwie i żelaznej ramie, która jest ozdobiona czarnym, matowym wykończeniem. Ten wygląd jest zarówno subtelny, jak i modny, ponieważ wygląd lampy sufitowej Flavi wnosi do łazienki nowoczesną lekkość.  Dzięki stopniowi ochrony IP44 jest bardzo odporny na wilgoć i dlatego stanowi optymalne oświetlenie przestrzeni łazienki. Światło jest rozproszone i równomiernie emitowane przez matowy klosz opalowy, dzięki czemu obserwator nie jest oślepiony. Pobierz:   Instrukcja obsługi                    (548 KB)','','lindby-flavi-lampa-sufitowa-o-23-cm-czarna','','','','Lindby Flavi lampa sufitowa, Ø 23 cm, czarna','','','',''),(1745,1,1,'Lampa sufitowa Lembit, okrągła, średnica 38 cm  Lampa sufitowa z serii Lembit ma okrągły kształt i średnicę 38 centymetrów. Lampa jest wykonana z wysokiej jakości materiałów i wyróżnia się doskonałym wykończeniem. Białe szkło opalowe spoczywa w ozdobnej oprawie z antycznego mosiądzu. Optymalną jasność zapewniają trzy żarówki o mocy 40 watów.','','lampa-sufitowa-lembit-38-cm','','','','Lampa sufitowa Lembit, 38 cm','','','',''),(1746,1,1,'Wielopunktowa lampa sufitowa LED Elaina z białym kloszem ze szkła opalowego  W przypadku tej lampy zastosowano wymienne żarówki LED Retrofit do oprawki E14, które odznaczają się niskim zużyciem energii. Emitują przytulne ciepłobiałe światło. Lampa doskonale nadaje się do salonu, a jej oprawa posiada matową niklowaną powierzchnię, z kolei kuliste szklane klosze mają biały kolor. Oba ramiona są ruchome.  Pobierz:   Instrukcja obsługi                    (435 KB)','','wielopunktowa-lampa-sufitowa-led-elaina-nikiel','','','','Wielopunktowa lampa sufitowa LED ELAINA, nikiel','','','',''),(1747,1,1,'Lampa sufitowa Judi wykonana z przezroczystego, dymionego, szarego szkła  Lampa sufitowa Judi urzeka harmonijną, szklaną optyką. Odcień transparentnej szarości dymu przynosi luksus i wygląda bardzo wysokiej jakości. Gdy lampa jest wyłączona, powierzchnia jest lekko zwierciadlana. Gdy tylko zostanie włączona, świeci w pełnym blasku i emituje swoje światło dookoła oraz bezpośrednio w dół do otoczenia.  Jako oświetlacz zalecana jest żarówka, która nadaje lampie bardzo stylowy wygląd i znacznie zwiększa współczynnik dekoracyjny.  - zewnętrznie ściemnialny Pobierz:   Specyfikacja techniczna                    (2.2 MB)','','lampa-sufitowa-judi-ze-szkla-o-305-cm','','','','Lampa sufitowa Judi ze szkła, Ø 30,5 cm','','','',''),(1748,1,1,'Okrągła lampa sufitowa Ummi w nowoczesnym stylu  Lampa sufitowa Ummi przekonuje swoim prostym wyglądem i klasycznym, okrągłym wzornictwem. Metalowa obręcz lampy o niklowym wyglądzie nadaje jej współczesny charakter, który można łatwo wkomponować w różne style wystroju wnętrza.  Klosz z matowego szkła służy jako rozpraszacz i równomiernie rozprowadza światło w całym pomieszczeniu. Gniazdo E27 ukryte pod kloszem może być również wyposażone w lampę z funkcją ściemniania. Przy pomocy standardowego ściemniacza ściennego można w mgnieniu oka dostosować jasność do własnych wymagań. Pobierz:   Instrukcja obsługi                    (372 KB)','','lindby-ummi-lampa-sufitowa-satyna-niklowa','','','','Lindby Ummi lampa sufitowa, satyna niklowa','','','',''),(1749,1,1,'Ryflowane szkło – lampa sufitowa American Diner  Lampa sufitowa American Diner jest idealnym urządzeniem oświetleniowym do łazienki lub kuchni, ponieważ ma stopień ochrony IP44, zapewniający odpowiednie zabezpieczenie przed wodą i kurzem. Lampa ma także bardzo atrakcyjny wygląd: okrągłe mocowanie ścienne utrzymane jest w szlachetnym kolorze chromu, natomiast szklany klosz ma barwę mlecznej bieli i staromodną, ryflowaną fakturę. U dołu klosza umieszczona jest mała metalowa nasadka, która optycznie doskonale pasuje do mocowania, nadając całości wyjątkowego wyglądu. Wewnątrz klosza znajdują się oprawki E14 na dwa źródła światła E14 w kształcie świec. American Diner to zdecydowanie właściwy wybór do pomieszczeń, w których wymaga się odporniejszej oprawy oświetleniowej.','','ryflowana-lampa-sufitowa-american-diner','','','','Ryflowana lampa sufitowa American Diner','','','',''),(1750,1,1,'','','lampa-sufitowa-p1d-o-28-cm-sosna','','','','Lampa sufitowa P1D, Ø 28 cm, sosna','','','',''),(1751,1,1,'Satynowane, przepuszczające światło szkło i metalowe elementy w kolorze starego mosiądzu tworzą w lampie sufitowej BRAHAMA doskonałe połączenie  Przyjemne światło rozsyłane przez lampę sufitową BRAHAMA idealnie nadaje się do sypialni, ale pasuje także do korytarzy i pokoi dziennych. Wykończenie w kolorze starego mosiądzu sprawia antyczne wrażenie.','','subtelna-lampa-sufitowa-brahama','','','','Subtelna lampa sufitowa BRAHAMA','','','',''),(1752,1,1,'Lampa sufitowa Valina z kloszem o indywidualnym kształcie  Lampa sufitowa Valina prezentuje się w ciekawym wzornictwie i zachwyca kloszem. Został on wykonany ze szkła i ma bardzo indywidualnie zaprojektowany kształt. Oprawa sufitowa wykonana jest z żelaza i została pokryta wykończeniem w kolorze chromu.  Powściągliwy, a jednocześnie niepowtarzalny wygląd tej lampy daje neutralny efekt kolorystyczny i może odpowiednio dopasować się do różnych wnętrz. Valina może być wspaniale zintegrowana z własnym salonem i nadaje się również do sektora komercyjnego. Pobierz:   Instrukcja obsługi                    (309 KB)','','lucande-valina-lampa-sufitowa-ze-szkla','','','','Lucande Valina lampa sufitowa ze szkła','','','',''),(1753,1,1,'Szklana lampa sufitowa Fußball o czarno-białej powierzchni - to hit do pokoju dziecięcego  Ta świecąca piłka nożna wprowadza radość do pokoju dziecięcego, naśladuje w klasyczny sposób ulubioną skórę, a używa się jej z dużą radością na każdym boisku szkolnym podczas przerwy, w każdej hali sportowej i na każdym trawniku. Jednak nie tylko dzieci kochają tę grę w piłkę, która jako hobby nr 1 po prostu wszystkich zachwyca, i tak ta szklana lampa sufitowa może jako dowcipny hołd znaleźć z pewnością miejsce także w innych pokojach, ponieważ jej praktyczny cel zapewnienia odpowiedniej jasności w pokoju, realizuje w każdym przypadku! Można zastosować klasyczne żarówki do 60 W, ale chętnie także żarówki energooszczędne lub żarówki LED z oprawką E27.  Pobierz:   Instrukcja obsługi                    (251 KB)','','czarno-biala-lampa-sufitowa-fussball','','','','Czarno-biała lampa sufitowa Fußball','','','',''),(1754,1,1,'Lśniące planety w metalowym śnie - lampa sufitowa WAKUSEI  Poprzez niezwykłe wzornictwo lampa sufitowa WAKUSEI przypomina zbiór gwiazd. Lampa sufitowa WAKUSEI nadaje pomieszczeniu wyjątkowy blask, a źródła światła tworzą na gładkich powierzchniach kulek bardzo interesujące efekty świetlne.  Plastyczność nadają małe szklane kulki, które umieszczone na ozdobnych prętach rozchodzą się we wszystkich kierunkach.','','futurystyczna-lampa-sufitowa-wakusei-chromowana','','','','Futurystyczna lampa sufitowa WAKUSEI, chromowana','','','',''),(1755,1,1,'Klasyczna prosta lampa sufitowa Flush w kształcie okrągłym  Lampa sufitowa Flush jest ucieleśnieniem ponadczasowego stylu życia i dlatego jest uniwersalna. Składa się ona z okrągłego klosza z białego szkła opalowego i jest wyposażona w ozdobny pierścień z chromowanego metalu. Ta prosta i gustowna lampa może być stosowana w łazience ze względu na stopień ochrony IP44, ale nadaje się również do oświetlenia korytarza lub sypialni.','','lampa-sufitowa-flush-ip44-o-23-cm-chrom','','','','Lampa sufitowa Flush IP44, Ø 23 cm, chrom','','','',''),(1756,1,1,'Lampa sufitowa TALYA ze stylową krawędzią w kolorze starzonego mosiądzu  Ta klasyczna lampa sufitowa wnosi dzięki kloszowi z mlecznego szkła i elementom metalowym w kolorze starzonego mosiądzu atmosferę przytulności, rozświetlając pomieszczenie miękkim, nieco przytłumionym światłem. TALYA jest doskonałą propozycją dla wszystkich miłośników antycznego stylu.','','delikatna-lampa-sufitowa-talya-sr-395-cm','','','','Delikatna lampa sufitowa TALYA, śr. 39,5 cm','','','',''),(1757,1,1,'','','lampa-sufitowa-sofia-szklany-klosz-bursztynowy','','','','Lampa sufitowa Sofia, szklany klosz bursztynowy','','','',''),(1758,1,1,'Okrągła lampa sufitowa Lonika o klasycznym wyrazie i powierzchni w stylu starego mosiądzu  Lonika wspaniale komponuje się z klasycznymi stylami wyposażenia wnętrz i rozprzestrzenia odrobinę romantyzmu, a przede wszystkim tworzy piękny nastrój oświetleniowy. Kloszem jest szklana misa o powierzchni imitującej alabaster. Tworzy to bardzo przytulne światło dla pomieszczeń mieszkalnych. W górnej części znajduje się metalowa podstawa z atrakcyjnym wykończeniem w starym mosiądzu, która jest częściowo artystycznie zakrzywiona i dlatego nawiązuje do romantycznego stylu. Piękny dodatek do wystroju całej przestrzeni mieszkalnej i sypialni.  Pobierz:   Instrukcja obsługi                    (373 KB)','','szklana-lampa-sufitowa-lonika-mosiezna-blyszczaca','','','','Szklana lampa sufitowa Lonika, mosiężna błyszcząca','','','',''),(1759,1,1,'Wygięta lampa sufitowa LED Ciala w nowoczesnym mosiężnym stylu  Lampa sufitowa LED Ciala jest wykonana z żelaza i pokryta wykończeniem powierzchni w kolorze mosiądzu. Posiada zakrzywione ramiona lampy, które nadają jej elegancki wygląd. Trzy klosze wykonane są z białego szkła opalowego i mają klasyczny kulisty kształt. Lampa Ciala może zapewnić wystarczające oświetlenie zarówno w małych, jak i średnich pomieszczeniach, a na suficie wygląda bardzo stylowo. Pobierz:   Instrukcja obsługi                    (407 KB)','','lindby-lampa-sufitowa-led-ciala-3-pkt-mosiadz','','','','Lindby lampa sufitowa LED Ciala, 3-pkt. mosiądz','','','',''),(1760,1,1,'Bajeczne światło dzięki lampie sufitowej Esfera  Lampa sufitowa Esfera tworzy tak wiele refleksów, że nie sposób sobie tego wyobrazić! Dzieje się tak, gdyż niezliczone małe kryształki zostały zestawione tu z różnej wielkości szklanymi kulkami o błyszczącej, lustrzanej powierzchni. Bez wątpienia światło żarówek L9 nie przenika bezpośrednio na zewnątrz, tylko przedostaje się między kulkami i kryształkami, w których odbija się, tworząc niezwykłe refleksy. Idealna lampa dla wszystkich tych, którzy pragną wprowadzić do nowoczesnego wnętrza nieco blasku i luksusu. Pobierz:   Instrukcja obsługi                    (245 KB)','','ozdobiona-szklanymi-kulami-lampa-sufitowa-esfera','','','','Ozdobiona szklanymi kulami lampa sufitowa Esfera','','','',''),(1761,1,1,'Lampa sufitowa LED Manja z pięknymi, chromowymi elementami  Szkło i chrom to niezwykle atrakcyjne i nowoczesne połączenie, dlatego zamontowanie lampy Manja nada wnętrzu szykowny wyraz. Powierzchnia powyżej diod LED ma lekki połysk, ponieważ pokryto ją folią reflektorową. Takie rozwiązanie umożliwia stosunkowo równomierne rozproszenie światła, a przezroczysta, szklana powierzchnia zapewnia całości nowoczesną elegancję. Kompaktowa konstrukcja lampy sufitowej LED Manja umożliwia jej zamocowanie w dowolnym miejscu.  Pobierz:   Instrukcja obsługi                    (463 KB)','','mala-lampa-sufitowa-led-manja','','','','Mała lampa sufitowa LED Manja','','','',''),(1762,1,1,'Lampa sufitowa w kształcie klatki Aloam z czterema kulistymi kloszami z białego szkła  Lampa sufitowa Aloam przyciąga wzrok geometrycznym kontrastem kul i prostych linii. Zewnętrzna, bardzo filigranowa rama przypomina klatkę i ma atrakcyjne złote wykończenie ze szlachetnym efektem, natomiast białe kule szklane są bardzo dobrze widoczne dzięki półprzezroczystej optyce i zapewniają łagodny rozkład światła. Dzięki oprawom E14 można stosować wiele różnych żarówek. Szczególnie polecane są żarówki z technologią LED.   Niezależnie od tego, czy jest to pokój dzienny, przedpokój czy sypialnia, lampa sufitowa Aloam jest atrakcyjnym obiektem świetlnym posiadającym „to coś”.  Pobierz:   Instrukcja obsługi                    (495 KB)','','lampa-sufitowa-led-aloam-z-4-szklanymi-kulami','','','','Lampa sufitowa LED Aloam z 4 szklanymi kulami','','','',''),(1763,1,1,'Okrągła lampa sufitowa LED Toan z białym szklanym kloszem, 3-stopniową technologią ściemniania i stopniem ochrony IP44, do użytku w łazience  Toan to lampa sufitowa LED o dość prostym wyglądzie, ponieważ w jej przypadku w zasadzie widać tylko płaski, okrągły szklany klosz o białej powierzchni. Stopień ochrony IP44 oznacza, że lampa sufitowa LED przeznaczona jest przede wszystkim do stosowania w pomieszczeniach o podwyższonej wilgotności, ponieważ jest dostatecznie zabezpieczone przed brudem i wodą, a także ponieważ klosz i podstawa są dobrze uszczelnione.   Ściemnianie Toan jest sterowane zwykłym przełącznikiem ściennym, który może być użyty do trójstopniowej zmiany jasności światła. Diody LED charakteryzują się również dobrą energooszczędnością i zużywają bardzo mało energii elektrycznej. Pobierz:   Instrukcja obsługi                    (1.1 MB)','','toan-biala-szklana-lampa-sufitowa-led-ip44','','','','Toan – biała, szklana lampa sufitowa LED, IP44','','','',''),(1764,1,1,'Okrągła lampa sufitowa Amilia ze szklanym kloszem i stopniem ochrony IP44  Amilia wygląda bardzo dyskretnie i z pewnością wkomponuje się w każde otoczenie. Biały klosz ze szkła zapewnia przytulne i delikatne rozchodzenie się światła emitowanego przez dwie żarówki E27. Stopień ochrony IP44 wskazuje, że uszczelnienie jest dobre, a woda i brud praktycznie nie mają szans dostać się do wnętrza lampy. Dzięki temu lampę możemy z powodzeniem zamontować w łazience lub innym wilgotnym pomieszczeniu.  Pobierz:   Instrukcja obsługi                    (349 KB)','','okragla-lampa-sufitowa-amilia-ip44','','','','Okrągła lampa sufitowa Amilia, IP44','','','',''),(1765,1,1,'Lampa sufitowa Vintus z cylindrycznym kloszem szklanym  To źródło światła na pierwszy rzut oka promieniuje czymś wyjątkowym. Lampa sufitowa Vintus ma uderzający design, który jest szczególnie uderzający ze względu na czarną żelazną ramę. Natomiast przezroczysty klosz wykonany ze szkła tworzy bardzo ładny kontrast.  W razie potrzeby oprawę można regulować w zależności od własnych potrzeb za pomocą lampy z funkcją ściemniania oraz zwykłego ściemniacza ściennego (ściemniacz i lampa ekskluzywna). Oświetlacz należy dobierać ostrożnie, ponieważ jest on wyraźnie widoczny przez szklany klosz ze wszystkich kierunków. Pobierz:   Instrukcja obsługi                    (241 KB)','','lindby-vintus-lampa-sufitowa-czarna','','','','Lindby Vintus lampa sufitowa, czarna','','','',''),(1766,1,1,'Dyskretna lampa sufitowa NEW YORK w szlachetnym stylu Tiffany  Miłośnicy klasycznego designu będą zachwyceni lampą sufitową NEW YORK. Rozłożysty klosz wykonany jest w stylu Tiffany i został zmontowany z wielu pojedynczych szklanych elementów Tiffany. W ten sposób lampa sufitowa zapewnia przyjemnie jasne światło w całym pomieszczeniu. Rama w kolorze starego mosiądzu harmonijnie uzupełnia elegancki design.','','new-york-klasyczna-lampa-sufitowa-styl-tiffany','','','','New York - klasyczna lampa sufitowa, styl Tiffany','','','',''),(1767,1,1,'Oświetlenie sufitowe Cosmo z ośmioma szklanymi kulami  Osiem kul ze szkła borokrzemianowego, przezroczystego na zewnątrz i z wewnętrzną warstwą matową, tworzy klosze lampy sufitowej dystansowej Cosmo. Są one przymocowane do końcówek rozgałęzionej ramy z czarnego lakierowanego metalu, której centralny cylinder jest ozdobiony złotymi detalami. Do okrągłego baldachimu dołączony jest czarny pręt (dwie długości 30 cm i 50 cm). Dzięki cieniom zorientowanym we wszystkich kierunkach, Cosmo może być wykorzystywane jako główne źródło światła w pomieszczeniu.','','lampa-sufitowa-cosmo-8-punktowa','','','','Lampa sufitowa Cosmo, 8-punktowa','','','',''),(1768,1,1,'Klasyczna lampa sufitowa DANIA z polerowanym chromem i szkłem.  Ta elegancka okrągła lampa sufitowa - od dawna sprawdzona - emituje jasne, nieoślepiające światło w łazience, korytarzu i innych pomieszczeniach. Chromowana rama jak również biała okrywa szklana zapewniają ponadczasowy i niezależny stylowo wygląd, dający się wkomponować wszędzie i w każdym czasie. Pobierz:   Specyfikacja techniczna                    (53 KB)    Instrukcja obsługi                    (1.1 MB)','','klasyczna-lampa-sufitowa-denia-wersja-chromowana','','','','Klasyczna lampa sufitowa DENIA wersja chromowana','','','',''),(1769,1,1,'Lampa sufitowa Caecillia z alabastrowym kloszem i zachwycającą oprawą  Lampa sufitowa Caecilia zachwyca misowatym, szklanym kloszem w kolorze szampana, który otacza szerokie obramowanie o antycznym charakterze. Metal w kolorze rdzy rozjaśniono gdzieniegdzie jasnymi akcentami o złotawym odcieniu, co nadaje tej lampie sufitowej szczególnie szlachetny wygląd.  Caecilia wyśmienicie nadaje się do tworzenia efektownych akcentów we wnętrzach mieszkalnych urządzonych w antycznym lub w klasycznym stylu, w idealny sposób dekorując salony lub hole wejściowe.','','caecilia-lampa-sufitowa-o-antycznej-formie-33-cm','','','','Caecilia lampa sufitowa o antycznej formie 33 cm','','','',''),(1770,1,1,'Okrągła lampa sufitowa LED Babylon z funkcją switch dimm  Nowoczesna, ponadczasowa i efektywna – oto okrągła lampa sufitowa LED Babylon. Stonowany design pasuje do każdego stylu aranżacji wnętrz i dlatego lampa ta stanowi uniwersalny element oświetleniowy. Ta lampa ma srebrne mocowanie, które może być montowane do ściany lub do sufitu. Biały klosz ze szkła znajduje się dokładnie na mocowaniu i zapewnia na dużym obszarze światło, które nie oślepia. W przypadku większych pomieszczeń możliwe jest również umieszczenie dwóch lub więcej lamp ściennych Babylon w jednym pomieszczeniu. Dodatkowym plusem jest możliwość ściemniania światła w trzech różnych poziomach jasności - poprzez wielokrotne naciśnięcie włącznika ściennego - ponieważ w ten sposób lampa może zapewnić odpowiednie oświetlenie w zależności od sytuacji. Dzięki stopniowi ochrony IP 44, lampa sufitowa Babylon jest zabezpieczone przed kurzem pryskającą wodą, więc nic nie stoi na przeszkodzie, by instalować ją w pomieszczeniach o podwyższonej wilgotności.','','babylon-lampa-sufitowa-led-do-lazienki-23cm','','','','Babylon – lampa sufitowa LED do łazienki 23 cm','','','',''),(1771,1,1,'Elegancka lampa sufitowa o prostej formie  Dominującą cechą designu tej lampy sufitowej jest królewska elegancja. O ekskluzywności i luksusowym charakterze decyduje jej forma i wizualnie postarzany materiał, z którego jest wykonana. Podczas oksydowania metal jest poddawany obróbce chemicznej, powodującej powstawanie czarnego zabarwienia, które podkreśla antyczny design. Prosty w formie opalizowany klosz idealnie pasuje do oksydowanego metalu i sprawia, że jest to lampa o antycznym designie a równocześnie dzieło sztuki, które nie traci nic na swojej funkcjonalności. W serii dostępne są także przepiękne lampy wiszące, sufitowe i ścienne, pozwalające na zapewnienie podstawowego oświetlenia pomieszczeń zaaranżowanych w antycznym stylu.','','piekna-lampa-sufitowa-impery-w-antycznym-stylu','','','','Piękna lampa sufitowa Impery w antycznym stylu','','','',''),(1772,1,1,'Lampa sufitowa Kensington z trzema kloszami szklanymi i IP44  Jako że trzy klosze szklane można obracać i wychylać na chromowanym uchwycie, światło może być emitowane na określone obszary w pomieszczeniu i akcentować te przestrzenie dzięki otworom w kloszach. Także i oświetlenie ogólne pomieszczenia nie jest zbyt małe, gdyż dzięki satynowanym kloszom światło rozchodzi się równomiernie. Okrągła lampa sufitowa Kensington, mając zabezpieczenie typu IP44, może być montowana także w łazience.','','kensington-trzyramienna-lampa-sufitowa-chrom','','','','Kensington - trzyramienna lampa sufitowa, chrom','','','',''),(1773,1,1,'','','lampa-sufitowa-sofia-klosz-z-dymionego-szkla','','','','Lampa sufitowa Sofia klosz z dymionego szkła','','','',''),(1774,1,1,'Elegancka lampa sufitowa Sonika ze szklanym kloszem  To piękne światło sufitowe przekonuje swoją prymitywną i nowoczesną formą. Rama żelazna została wykończona modnym niklem. Na pierwszym planie widać jednak wystający klosz.  Jest on wykonany w całości ze szkła o opalowo-matowym wyglądzie, który natychmiast urzeka. Duży, owalny kształt wydaje się prawie tak lekki jak chmura, która zdaje się unosić na suficie. Matowa powierzchnia działa również jako dyfuzor, pozwalając na równomierne rozprowadzenie światła bez olśnień.  W przypadku wyposażenia Soniki w lampę z możliwością ściemniania, jasność można regulować w zależności od indywidualnych potrzeb za pomocą zwykłego ściemniacza ściennego (wyłącznie ściemniacz). Pobierz:   Instrukcja obsługi                    (384 KB)','','lindby-sonika-lampa-sufitowa','','','','Lindby Sonika lampa sufitowa','','','',''),(1775,1,1,'Lampa sufitowa Kourtney przekonuje szklanym kloszem w optyce dymionego szkła  Lampa sufitowa Kourtney składa się z okrągłego klosza. Jest on utrzymany w pięknym chromowanym kolorze. Kolor ten nazywany jest również wędzonym szkłem. Wygląda bowiem na to, że szkło zostało zabarwione przez płomień świecy. Ciemna powierzchnia pozwala na przepuszczanie światła tylko w sposób wyciszony. Tworzy to domową atmosferę. Jednak cień jest otwarty na dole. W ten sposób emitowane jest wystarczająco dużo światła, aby jasno oświetlić pomieszczenie. Po włączeniu, źródło światła jest wyraźnie widoczne (nie jest dołączone). Dlatego też należy stosować oświetlacz z modną optyką żarniwną. Pobierz:   Instrukcja obsługi                    (745 KB)','','lindby-kourtney-lampa-sufitowa-ze-szklanym-kloszem','','','','Lindby Kourtney lampa sufitowa ze szklanym kloszem','','','',''),(1776,1,1,'Kinkiet łazienkowy LED nad lustro Theia o długości 120 cm z błyszczącym chromowanym wykończeniem  Diody LED wbudowane w długi kinkiet łazienkowy nad lustro Theia emitują swoje światło o barwie ciepłej bieli (2 900 K) w górę i w dół, dzięki czemu jasno oświetlony jest nie tylko obszar przed lustrem, ale również całe pomieszczenie, które rozświetla emitowane w górę światło pośrednie.. Wąski i długi kinkiet łazienkowy LED nad lustro z błyszczącym chromowanym wykończeniem wyposażony jest na dole i na górze w satynowaną pokrywę i chroniony przed wodą rozpryskową, co gwarantuje stopień ochrony IP44.','','helestra-theia-oswietlenie-lustra-led-120cm','','','','Helestra Theia oświetlenie lustra LED, 120 cm','','','',''),(1777,1,1,'Wysokiej jakości lampa ścienna Kartio w szlachetnej kombinacji kolorystycznej i z regulowaną emisją światła  To piękne źródło światła inspiruje zredukowanymi, ale wyraźnie określonymi geometrycznymi kształtami i charakterystycznym wzornictwem. Zarówno prosta podstawa, jak i stożkowy klosz kinkietu Kartio wykonano w całości z wytrzymałego żelaza.  Szlachetny kontrast kolorystyczny wyróżnia Kartio, ponieważ podczas gdy podstawa utrzymana była w klasycznej matowej czerni, zgrabny klosz otrzymał matowe wykończenie z mosiądzu. W procesie obróbki dużą wagę przywiązuje się do delikatnego wykończenia powierzchni, co nadaje lampie podniosły charakter.  Ponadto Kartio punktuje regulowaną emisją światła, ponieważ dzięki dobrze ukształtowanemu kloszowi światło może być emitowane tylko w dół. Ma to tę zaletę, że z jednej strony obserwator nie jest oślepiany, a z drugiej strony w przestrzeni mieszkalnej można stworzyć specyficzne efekty świetlne. Stosowane są ekonomiczne żarówki reflektorowe GU10, które są dostępne oddzielnie za pośrednictwem akcesoriów i mogą być dobierane według własnych potrzeb. Pobierz:   Instrukcja obsługi                    (372 KB)','','lucande-kartio-lampa-scienna-1-pkt-mosiadz','','','','Lucande Kartio lampa ścienna, 1-pkt., mosiądz','','','',''),(1778,1,1,'Kinkiet Mida dla szlachetnego otoczenia  Okrągła lampa ścienna Mida urzeka swoim unikalnym wyglądem, który uszlachetnia pomieszczenie niczym biżuteria. Projekt Adriano Rachele inspirowany jest wysokiej jakości kamieniami szlachetnymi o gładkich i szlifowanych powierzchniach, które zostały połączone w niewidoczną strukturę za pomocą magnetycznych uchwytów w kwiat o olśniewających i jedwabistych kolorach. Wykonana w całości ręcznie, Mida została wyprodukowana z białego Opalflex® zadrukowanego Lentiflex® ze specjalnym cieniowaniem i efektem jedwabiu, na przemian ze szczotkowanymi i metalizowanymi elementami.  Mida może być również alternatywnie instalowana jako lampa sufitowa. Została ona wyposażona w trzy lampy E27 i emituje przefiltrowane światło, które tworzy imponujące efekty na suficie lub ścianie.   Lampa Mida jest produkowana przez włoską firmę wytwarzającą lampy Slamp, założoną w 1992 roku przez Roberto Ziliani z wizją połączenia wysokiej jakości, rzemiosła i znakomitej produkcji przemysłowej.   Made in Italy. Pobierz:   Specyfikacja techniczna                    (276 KB)','','slamp-mida-lampa-scienna-50-cm-bialo-zlota','','','','Slamp Mida lampa ścienna, 50 cm, biało-złota','','','',''),(1779,1,1,'Czarna lampa ścienna Alexaru w spektakularnym kształcie plastra miodu: wspaniały nastrój do salonu, sypialni i korytarzy  Kinkiet Alexaru jest szlachetną oprawą o charakterze obiektowym, która wyjątkowo dobrze nadaje się do stosowania w pomieszczeniach mieszkalnych, ale także wygląda bardzo wytwornie w środowiskach komercyjnych, takich jak hotele i restauracje, nadając pomieszczeniu indywidualny i luksusowy charakter. Ekscytujący wygląd plastra miodu - jeśli przyjrzeć się uważnie, można w nim również dostrzec diamenty - wpisuje się w trend bioder i tworzy szlachetną grę światła na ścianie, gdzie struktura oprawy ponownie odbija się w grze światła i cienia. Nie ma wątpliwości, że tworzy to szczególną aurę o charakterze projektowym, która z pewnością zainspiruje niemal każdego. Midcentury meets Loft!  Przy wyborze odpowiedniej lampy, jako odpowiedni dodatek do całościowego projektu, można szczególnie polecić lampę LED z odblaskową głowicą. W ten sposób można nie tylko zapewnić niskie zużycie energii, ale również wyeliminować blask od samego początku.   Dekoracyjny wzór w kolorze czarnym o nieporównywalnym wyglądzie!','','lucande-alexaru-lampa-scienna-plaster-miodu-czarna','','','','Lucande Alexaru lampa ścienna plaster miodu czarna','','','',''),(1780,1,1,'Lampa ścienna Bari: szczególnie efektywna w przypadku stosowania jej w parach  Do odpowiedniego oświetlenia lustra w łazience, jak również w saunie i strefie Spa, idealna jest nowocześnie zaprojektowana lampa ścienna Bari. Bari jest wykonana z metalowego uchwytu ściennego i smukłego, opalowego cylindra szklanego, który emituje światło bez oślepiania na wszystkie strony. Wyposażona w oprawę G9, w którą można włożyć zarówno lampy halogenowe, jak i energooszczędne żarówki LED z odpowiednim cokołem.','','astro-bari-kinkiet-do-lazienki','','','','Astro Bari kinkiet do łazienki','','','',''),(1781,1,1,'2-punktowy kinkiet Kartio w matowym wykończeniu z dwoma kątami świecenia  Ten specjalny kinkiet odznacza się oryginalnym wzornictwem i nowoczesną kolorystyką. Połączenie czerni i niklu oraz fakt, że cała lampa wykonana jest z żelaza idzie w parze z aktualnym metalowym trendem, z powierzchnią precyzyjnie wykończoną w procesie matowienia. Ten detal podkreśla szlachetny charakter kinkietu Kartio i nadaje mu pewien dodatkowy charakter.  Klosze w kształcie stożka charakteryzują się przejrzystością geometryczną i zapewniają ukierunkowaną emisję światła - zarówno w górę, jak i w dół. Za pomocą dwóch reflektorów GU10, które można dobrać do indywidualnych wymagań, lampa emituje miękką wiązkę światła bez oślepiania obserwatora. Tworzy to przyjemną atmosferę w pomieszczeniu. W razie potrzeby można ją dodatkowo dostosować do własnego nastroju, regulując jasność lampy za pomocą zewnętrznego ściemniacza ściennego (ściemniacz nie należy do kompletu). Pobierz:   Instrukcja obsługi                    (380 KB)','','lucande-kartio-lampa-scienna-2-pkt-up-down-nikiel','','','','Lucande Kartio lampa ścienna 2-pkt. up down nikiel','','','',''),(1782,1,1,'Pojedyncza lampa ścienna Jugen z dmuchanego szkła  Lampa ścienna Jugen wykonana jest z modnych materiałów - metalu i szkła, jak wszystkie lampy z serii Jugen. Składa się z czarnego uchwytu ściennego, do którego poziomo przymocowany jest dyskretny metalowy pręt. Biała szklana kula umieszczona na drążku stylowo ozdobi każdą ścianę. Mlecznobiała powierzchnia kuli zapewnia miękkie i przyjemne światło.  Lampa pochodzi z linii produktów Miloox firmy Sforzin, która charakteryzuje się niezwykle świeżym designem i połączeniem modnych materiałów. Pobierz:   Specyfikacja techniczna                    (1.9 MB)','','lampa-scienna-jugen-czarna-biala-1-punktowa','','','','Lampa ścienna Jugen, czarna/biała, 1-punktowa','','','',''),(1783,1,1,'Lampa ścienna BALL. Stylowe wyposażenie wnętrza bez oślepiania.  Jakość Made in Germany!  Na wizerunek lampy ściennej BALL składa się niemal doskonale okrągły korpus, który w jednej trzeciej wydaje się znikać w ścianie i dzięki temu prezentuje się bardzo atrakcyjnie. Biały, dmuchany ustnie klosz, u dołu którego umieszczony jest element ze szlifowanego aluminium, zapewnia oświetlenie bez oślepiania. Górna część lampy jest otwarta, dzięki czemu światło jest emitowane pod ciekawym kątem i zapewnia efektowną grę świateł na ścianie. Wszystkie te elementy składają się na tę elegancką i klasyczną lampę ścienną.','','lampa-scienna-ball','','','','Lampa ścienna BALL','','','',''),(1784,1,1,'Lampa ścienna Mini Glo-Ball Lustro w ustach dmuchane szkło opalowe  Ten piękny kinkiet lub lampa lustrzana - projekt autorstwa projektanta Jaspera Morrisona dla kuźni FLOS z Włoch - wykonany jest z dmuchanego, deskowego szkła opalowego. Powierzchnia zewnętrzna jest wytrawiana. Szkło przytrzymywane jest przez pierścień ślimakowy wykonany z białego PPS formowanego wtryskowo. Pierścień uchwytu lustra jest również wykonany z tworzywa sztucznego PPS.  Uniwersalna oprawa szklana, która zanurza otoczenie w miękkim, rozproszonym świetle, może być również stosowana do oświetlenia sufitowego. W przypadku montażu na lustrze, do zamontowania Mini Glo-Ball potrzebny jest otwór o średnicy 35 mm. Pobierz:   Instrukcja obsługi                    (241 KB)    Specyfikacja techniczna                    (342 KB)    Photometric Data LDT                    (104 KB)','','flos-mini-glo-ball-mirror-lampa-scienna-biala','','','','FLOS Mini Glo-Ball Mirror lampa ścienna, biała','','','',''),(1785,1,1,'Costanzina - atrakcyjny kinkiet z klasycznym abażurem  Ponadczasowy kinkiet Costanzina to prawdziwy klasyk wzornictwa. Przemyślany projekt serii lamp Costanza, za który odpowiedzialny jest włoski projektant i współtwórca wysokiej klasy marki Luceplan Paolo Rizzatto, powstał już w 1986 roku.   Kinkiet wykonany jest z wysokiej jakości aluminium, który uzupełniony jest kloszem wykonanym ze specjalnego poliwęglanu. Osłona ta znajduje się tylko w dwóch punktach montażowych i może być łatwo montowana i wymieniana. Światło ucieka nie tylko w dół, aby zapewnić wystarczającą jasność do czytania, ale także w górę i do pomieszczenia przez górny otwór cienia. Tworzy to jednocześnie nastrojowe światło w pomieszczeniu, które zapewnia przyjemną jasność otoczenia. Lampa ścienna Costanzina jest włączana i wyłączana za pomocą przełącznika w kształcie pręta znajdującego się na gnieździe.','','luceplan-costanzina-lampa-scienna-aluminium','','','','Luceplan Costanzina lampa ścienna aluminium','','','',''),(1786,1,1,'Stylowa i nowoczesna - lampa ścienna Wabi w kolorze złotym  Wabi to designerska lampa ścienna renomowanego producenta lamp Terzaniego i uchodzi za przykład włoskiej sztuki rzemieślniczej. Jest ona podobna do abstrakcyjnej rzeźby ściennej, przedstawiającej chropowatą i popękaną powierzchnię pnia drzewa. W połączeniu ze złotym wykończeniem wygląda wprost niewiarygodnie stylowo i nowocześnie. Światło doskonale podkreśla wzór, gdyż wydaje się być pośrednio kierowane ku górze i ku dołowi, wprost z obudowy lampy o naturalnych kształtach.','','wabi-lampa-scien-w-kol-zlotym-swietny-design','','','','Wabi - lampa ścien. w kol. złotym, świetny design','','','',''),(1787,1,1,'Kinkiet LED Islet z poetyckim światłem  Islet, czyli mała wyspa - tak nazywa się ten kinkiet LED fińskiego projektanta Mikko Lakkonena, który celowo umieścił filigranowy wzór na przedniej pokrywie lampy. Małe przerwy mają przedstawiać małe wyspy w oddali, odbijające się w wodzie. Niewielkie otwory zostały stworzone w ten sposób, że wycięto je do połowy z materiału, a następnie lekko wygięto. Światło wpada przez przerwy i częściowo jest załamywane, a częściowo jest emitowane bezpośrednio. Na końcu powstaje poetycki efekt świetlny, który oglądany z oddali rzeczywiście wygląda jak krajobraz wyspy z odbijającymi się refleksami w wodzie.   Model Islet może być ściemniany oddzielnym przyciskiem dzięki funkcji Push. Do tego celu wymagany jest 5-żyłowy przewód połączeniowy.   Artemide jest znanym na całym świecie producentem wysokiej jakości innowacyjnych lamp designerskich. Przedsiębiorstwo, którego siedziba główna wciąż znajduje się w pobliżu Mediolanu, zostało założone w roku 1960 przez Ernesto Gismondiego. Własne zakłady produkcyjne i fabryki szkła oraz własne centrum badawcze, w którym są opracowywane i testowane najnowsze technologie oświetleniowe, w połączeniu z nowymi materiałami i technikami obróbki, należą obecnie do koncernu Artemide. Znani projektanci - zarówno z kraju, jak i z zagranicy - pracują dla włoskiego przedsiębiorstwa i za swoje lampy otrzymali już wiele nagród i wyróżnień.  Pobierz:   Instrukcja obsługi                    (1.7 MB)    Instrukcja obsługi 2                    (1.7 MB)    Light distribution curve                    (124 KB)    Photometric Data IES                    (90 KB)    Photometric Data LDT                    (71 KB)','','designerska-lampa-scienna-islet-z-diodami-led','','','','Designerska lampa ścienna Islet z diodami LED','','','',''),(1788,1,1,'Kinkiet LED Easy Cruiser Black o wyglądzie deskorolki z oświetleniem RBG i ściemnianym reflektorem, w komplecie z pilotem  Easy Cruiser Black to wyjątkowy kinkiet LED, który zainspiruje zarówno małych jak i dużych miłośników deskorolki. Deskorolka w stylu lat 90-tych jest przymocowana do uchwytu ściennego, dzięki czemu widoczny jest spód deski z unikalnym czarnym wzorem i napisem BLACK.   Oświetlenie składa się z reflektora w uchwycie ściennym, który jest wyposażony w ściemnianą taśmę LED. Kółka deskorolki wyposażone są w elastyczne taśmy RBG LED, które stanowią kolorowe akcenty i tworzą nastrojowe oświetlenie. Reflektor i oświetlenie RBG mogą być przełączane oddzielnie. Włączanie i wyłączanie, włączanie poszczególnych elementów oświetlenia i ściemnianie są możliwe za pomocą dołączonego pilota.','','kinkiet-led-skateboard-easy-cruiser-black','','','','Kinkiet LED Skateboard Easy Cruiser Black','','','',''),(1789,1,1,'Klasyczna lampa ścienna ANTON to przyjemne światło w łazience.  Ta klasyczna lampa ścienna oświetla równomiernie łazienkę i w szczególności lustro. Chromowana powierzchnia i szklany satynowy klosz tworzą harmonijną całość i nadają tej lampie ściennej nutę elegancji. Pobierz:   Specyfikacja techniczna                    (55 KB)    Instrukcja obsługi                    (146 KB)','','klasyczna-lampa-scienna-anton','','','','Klasyczna lampa ścienna ANTON','','','',''),(1790,1,1,'Bursztynowa lampa ścienna RONDO z wyginanymi kloszami ze szkła Murano  Lampa ścienna RONDO została wykonana z pozłacanego 24-karatowym złotem metalu i ręcznie wykonanego szkła Murano. Z uchwytu wychodzą w prawo wyginane rurki ze szkła Murano w kolorze bursztynowym. Szklane rurki wyglądają szczególnie efektownie na tle leżącej za nimi pozłacanej płyty. Dwie żarówki, umieszczonme między metalową płytą a szklanymi rurkami, zapewniają jasne światło o ciekawym efekcie.','','lampa-scienna-rondo-z-bursztynowego-szkla-murano','','','','Lampa ścienna RONDO z bursztynowego szkła Murano','','','',''),(1791,1,1,'Minimalistyczny kinkiet LED Pin w wersji dwupunktowej  Pin zalicza się do kinkietów ściennych LED, zapewniających oświetlenie pośrednie. Praktycznie każdy wie, że takie oświetlenie jest szczególnie przytulne, ponieważ wtedy światło wydaje się miękkie i płynne, a nigdy nie drażni bezpośrednim strumieniem ani nie oślepia. Powierzchnia tego kinkietu LED, mającego kształt prostokąta, ma matowoczarne wykończenie, które wygląda szczególnie elegancko. Dwie podświetlane głowice zawierają diody LED, emitujące światło o barwie ciepłej bieli i o dobrej efektywności energetycznej. Jeśli chcesz, aby oświetlenie było bardziej indywidualne, zaleca się zainstalowanie kilku opraw ściennych serii w bezpośrednim sąsiedztwie oraz pomanipulowanie kształtem i światłem.','','2-punktowy-kinkiet-led-pin','','','','2-punktowy kinkiet LED Pin','','','',''),(1792,1,1,'Lampa ścienna Omega 2 z możliwością montażu pionowego lub poziomego  Lampa ścienna Omega 2 składa się z podstawy stalowej z chromowanym wykończeniem. Omega 2 staje się gotową oprawą poprzez włożenie lampy do oprawy S14, która powinna mieć szkło opalizujące, aby skierować światło do pomieszczenia bez olśnień. Podstawa lampy Omega 2 jest kompaktowo wykonana i może być montowana poziomo lub pionowo na ścianie, co pozwala użytkownikowi na stworzenie indywidualnej koncepcji oświetlenia. Pobierz:   Instrukcja obsługi                    (679 KB)','','decor-walther-omega-2-lampa-scienna-chrom','','','','Decor Walther Omega 2 lampa ścienna chrom','','','',''),(1793,1,1,'Zeppo Wall - wysokiej jakości szklane źródło światła odpowiednie do łazienek  Okrągły kinkiet łazienkowy Zeppo jest pasjansem do oświetlenia ściennego w łazienkach, korytarzach, a także w salonach i sypialniach. Jego estetycznie ukształtowany odcień wykonany z wysokiej jakości szkła duplex urzeka wszechstronną emisją światła. Zeppo jest wyposażone w lampę G9, w którą można włożyć wszystkie typy lamp o klasie efektywności energetycznej A++-D. Zalecane są energooszczędne lampy LED z odpowiednią podstawą.  Używane w parach jako oświetlenie lustrzane, Zeppo okazuje się być stylistycznym dodatkiem meblowym o ponadczasowej, nowoczesnej atmosferze życia. Pobierz:   Instrukcja obsługi                    (171 KB)    Specyfikacja techniczna                    (104 KB)','','astro-zeppo-kinkiet-do-lazienki-ze-szkla','','','','Astro Zeppo kinkiet do łazienki ze szkła','','','',''),(1794,1,1,'Lampa i garderoba w jednym: kinkiet LED Han  Absolutny hit pod kątem wyglądu i funkcjonalności: oto właśnie kinkiet LED Han duetu projektantów Guoli i Figuery. Łączy w sobie garderobę i źródło światła, tworząc element świetlny, który również w stanie wyłączonym za sprawą dekoracyjnego designu ubogaca każde wnętrze. Po włączeniu światła będzie wyglądał jak delikatny, świetlisty wieniec wokół większej, okrągłej, metalowej części. Okrągły kształt jest kontynuowany w czterech wieszakach na ubrania, które są połączone z lampą poprzez prosty element ścienny.','','jako-garderoba-kinkiet-led-han-czarny','','','','Jako garderoba kinkiet LED Han czarny','','','',''),(1795,1,1,'Szklana lampa ścienna uniwersalna Lumi Sfera w wykonaniu kulistym z uchwytem ściennym Grivory®  Proste wzornictwo jako sfera sferyczna i zmienne obszary zastosowania we wnętrzu dają w efekcie nowoczesne źródło światła. Lampa ścienna Lumi Sfera, zaprojektowana przez Alberto Saggię i Valerio Sommellę dla włoskiego producenta Fabbian, może być używana w korytarzu, salonie itp., ale także jako źródło światła w łazience i może być montowana jako lampa sufitowa. Szronione, dmuchane szkło o kulistym odcieniu świeci się równomiernie podczas użytkowania, zapewniając przyjemne, pozbawione olśnień światło dookoła. Dyskretny uchwyt ścienny wykonany jest z Grivory® - tworzywa sztucznego wzmocnionego włóknem szklanym.','','fabbian-lumi-sfera-szklana-lampa-scienna-grivory','','','','Fabbian Lumi Sfera szklana lampa ścienna, Grivory®','','','',''),(1796,1,1,'Oprawa ścienna LED Krosno do jednolitego oświetlenia lustrzanego  Uchwyt ścienny oprawy zwierciadlanej LED Loom wykonany jest z matowego, pomalowanego na czarno metalu i umieszczony centralnie z tyłu klosza rurowego. Ten ostatni wykonany jest z satynowego akrylu, dzięki czemu zapewniony jest jednorodny i pozbawiony olśnień efekt świetlny. Zamontowane pionowo obok lustra lub poziomo nad nim, Krosno stwarza doskonałe warunki oświetleniowe.  Zbudowana zgodnie ze stopniem ochrony IP44, nawet rozbryzgi wody nie stanowią problemu dla oprawy lustrzanej. Dzięki swojemu prostemu wzornictwu, zredukowanemu do niezbędnego minimum, Loom jest idealnym wyborem do szatni lub łazienki w nowoczesnym wnętrzu.','','helestra-loom-oswietlenie-lustra-led-czarne','','','','Helestra Loom oświetlenie lustra LED czarne','','','',''),(1797,1,1,'Lampa ścienna w kolorze złotym La Lollo  Zainspirowana latami 50-tymi ubiegłego wieku, lampa ścienna La Lollo, która składa się z czterech umieszczonych w rzędzie rur o różnym wzornictwie. Jej powierzchnię w kolorze złotym podświetlają dwie żarówki E14, które tworzą wspaniałe efekty świetlne. Projektantka Lorenza Bozzoli sprawiła, że La Lollo wygląda jak biżuteria, która ozdabia ściany niczym prawdziwa biżuteria swoją wszechstronnością. Zarówno pojedynczo, jak i w połączeniu z innymi lampami La Lollo, lampa ścienna zachwyci każdego obserwatora.  Lorenza Bozzoli jest aktywna na arenie międzynarodowej z tendencją do wzornictwa przemysłowego i współpracuje z włoskim producentem lamp Slamp od 2015 roku. Firma Slamp została założona w 1992 roku przez Roberto Zilianiego, który stworzył unikalne i przystępne cenowo lampy designerskie znane na całym świecie. Na szczególną uwagę zasługują wytrzymałe materiały z technopolimerów i szklanych kryształów, z których Slamp wytwarza swoje lampy metodą ręcznej produkcji.  Made in Italy. Pobierz:   Specyfikacja techniczna                    (838 KB)','','slamp-la-lollo-lampa-scienna-zlote-kolory','','','','Slamp La Lollo lampa ścienna, złote kolory','','','',''),(1798,1,1,'Oświetlenie ścienne LED Krosno do montażu obok luster  Zainstalowane z prawej i lewej strony lub nad lustrem w łazience lub szatni, ścienne światło Loom LED zapewnia przyjemne, ciepłe, białe światło, zapewniając warunki oświetlenia dla osób praworęcznych. Klosz lampy składa się z rurki wykonanej z satynowego akrylu, uchwyt ścienny wykonany jest z matowego, czarnego metalu malowanego na czarno.  Dzięki satynowanej tubie światło zintegrowanych diod LED jest rozpraszane absolutnie równomiernie i nie powoduje olśnień. Konstrukcja o stopniu ochrony IP44 oferuje wystarczającą ochronę dla zastosowania oprawy w łazienkach. Pobierz:   Instrukcja obsługi                    (14 KB)','','helestra-loom-oswietlenie-lustra-led-czarne-30-cm','','','','Helestra Loom oświetlenie lustra LED czarne 30 cm','','','',''),(1799,1,1,'Ekskluzywna designerska lampa ścienna Jorna z czarną ramą z drewna lodowego o zaokrąglonym kształcie i czerwonym kablem z tkaniny  Jorna ma wszechstronnie minimalistyczny efekt dzięki dopasowanemu do materiału wzornictwu i jako lampa ścienna przyciąga wzrok swoim ikonicznym designem. Jednocześnie lampa ze swoimi szczególnymi detalami wydaje się wręcz wyjątkowa i wpisuje się w ten żywy trend, w którym na pierwszy plan wysuwa się wzornictwo w stylu industrialnym. Stelaż lampy wykonany z czarnego żelaza z pętelką wygląda lekko i delikatnie, kabel z tkaniny w kolorze czerwonym skutecznie rozluźnia ciemny wygląd efektowną świeżością i mocnym tonem w kolorystyce. Jest on również owinięty wokół ramy i dzięki temu można go stosunkowo swobodnie pozycjonować.  Oprócz ramy, źródło światła odgrywa główną rolę w zespole i jest obecne w nim w sposób, którego nie da się przeoczyć. Może być dowolnie dobrana, ale powinna być wizualnie dopasowana do całości i idealnie łączyć technologię LED i optykę żarnika, aby była stylowa i energooszczędna. Świetnie sprawdzają się tutaj żarówki w formacie G95, które są nieco większe od zwykłych żarówek E27.  Lampa ścienna Jorna przekonuje designem, który sprawia wrażenie zarówno domowego, jak i dekoracyjnego, i jest z pewnością odpowiednim źródłem światła dla indywidualistów, dla których każdy szczegół musi być odpowiedni!  Pobierz:   Instrukcja obsługi                    (389 KB)','','lucande-jorna-lampa-scienna-czarna-kabel-czerwony','','','','Lucande Jorna lampa ścienna czarna, kabel czerwony','','','',''),(1800,1,1,'Prosta lampa ścienna CUBE ponadczasowy design.  Ta ponadczasowa lampa ścienna w kształcie sześcianu emitując ciepłe światło tworzy przyjemny nastrój. Chromowany cokół i klosz w kształcie kostki z mlecznobiałego szkła podkreślają wysoką jakość wykonania. Pobierz:   Specyfikacja techniczna                    (113 KB)    Instrukcja obsługi                    (307 KB)','','prosta-lampa-scienna-cube','','','','Prosta lampa ścienna CUBE','','','',''),(1801,1,1,'Krótka lampa ścienna w kolorze brzoskwiniowym z dodatkiem stali  Lampa ścienna Birdy idealnie nadaje się do przedpokoju lub innych mniejszych pomieszczeń, ponieważ jej wysięg wynosi zaledwie 31,5 cm. Jego wysokość to tylko 19 cm. Dzięki przegubowi można ją indywidualnie regulować, tak aby nie oślepiała i oświetlała właściwe miejsce. Jego kolorystyka to czerń i mosiądz. Pierwszy z nich dotyczy klosza i uchwytu ściennego, który ma średnicę 12,5 cm.  Lampa ścienna Birdy ma kabel zasilający (czarny) o długości 200 cm z wtyczką i przełącznikiem. Pobierz:   Instrukcja obsługi                    (73 KB)    Specyfikacja techniczna                    (346 KB)','','northern-birdy-spot-retro-czarny','','','','Northern Birdy spot retro, czarny','','','',''),(1802,1,1,'Lampa ścienna La Lollo w formie rurki  Projektując kinkiet La Lollo, projektantka Lorenza Bozzoli inspirowała się latami 50. La Lollo składa się optycznie z czterech rur ułożonych w rzędzie o różnych wzorach, które charakteryzują się nowoczesnymi odcieniami kolorów i metalizacją. Wykonana z unikalnych, całkowicie nietłukących się technopolimerów producenta Slamp, lampa świeci jak klejnot i sprawia, że każde pomieszczenie lśni. Czy to w domach prywatnych, czy na korytarzach hotelowych, La Lollo z łatwością wtapia się w różne środowiska.  Lorenza Bozzoli i Slamp pracują razem od 2015 roku. Bozzoli jest wyszkoloną projektantką z tendencjami w zakresie wzornictwa przemysłowego i sama się tego nauczyła. Włoski producent oświetlenia Slamp został założony w 1992 roku przez Roberto Ziliani w celu dystrybucji unikalnych i niedrogich projektowych lamp na całym świecie. Na szczególną uwagę zasługują nietłukące się materiały wykonane z technopolimerów i kryształów szklanych oraz kunszt, z jakim produkowane są designerskie lampy.  Made in Italy. Pobierz:   Specyfikacja techniczna                    (838 KB)','','slamp-la-lollo-lampa-scienna-cynowo-biala','','','','Slamp La Lollo lampa ścienna, cynowo-biała','','','',''),(1803,1,1,'Dostosowywalne lampy ścienne LED  Na pierwszy rzut oka lampa ścienna Tubs sprawia sztywne, linearne wrażenie. Jednak przy bliższym poznaniu artysta dał Tubsowi znacznie większe możliwości manewrowania i adaptacji: Drążek można odchylić do 35° od ściany, obrócić do 180°, a źródło światła do 300°. Dzięki temu oprawa może być stosowana jako oświetlenie pośrednie lub do bezpośredniego oświetlania obiektów. Szlachetne materiały i wysokiej jakości technologia LED dopełniają Tubs i sprawiają, że dzięki prostemu wzornictwu świeci ona jasno zarówno w środowiskach komercyjnych, jak i prywatnych.  - zaprojektowany przez Nahtrang Disseny','','grok-tubs-kinkiet-led-obrotowy-i-wychylny','','','','Grok Tubs kinkiet LED obrotowy i wychylny','','','',''),(1804,1,1,'Lampa ścienna ze złotym kryształem Miraia  Lampa ścienna Miraia punktuje swoim unikalnym charakterem, który wnosi odrobinę luksusu do Twoich własnych czterech ścian. Składa się ona ze stali nierdzewnej i kryształu - dwóch materiałów, które nie mogły być bardziej przeciwstawne, a jednak łączą się w tej lampie do harmonijnej jedności.  Powierzchnia metalu została wykończona złotym wykończeniem. Zawieszone w dole elementy kryształowe powodują, że światło jest pięknie załamane i nadają mu szczególny wygląd. Dwa punkty świetlne mogą być wyposażone w dowolnie wybrane przez użytkownika źródła światła. Miraia to wszechstronne, piękne źródło światła do użytku prywatnego lub komercyjnego. Pobierz:   Instrukcja obsługi                    (405 KB)','','lucande-miraia-krysztalowa-lampa-scienna-zlota','','','','Lucande Miraia kryształowa lampa ścienna, złota','','','',''),(1805,1,1,'Made in Italy – uzupełniające akcenty świetlne dzięki lampie ściennej Miconos  Miconos zachwyca kulistym kloszem z dmuchanego ustnie szkła zawieszonym za ucho na haku mocowania ściennego. Przezroczyste szkło i błyszcząca powierzchnia mocowania ściennego z polerowanego chromu doskonale ze sobą współgrają, tworząc na ścianie i w pomieszczeniu niezwykłe akcenty świetlne. Miconos zapewnia optymalne oświetlenie, a dzięki nowoczesnej formie doskonale pasuje do wielu stylów wyposażenia wnętrz.   Lampa ścienna Miconos jest wytwarzana we Włoszech przez producenta opraw oświetleniowych Artemide, który posiada własne placówki badawcze i laboratoria umożliwiające uzyskanie wysokiego standardu materiałów i metod produkcji, a także integrację wymagań socjokulturowych. Seria opraw Miconos została zaprojektowana przez założyciela firmy Ernesto Gismondiego. Pobierz:   Instrukcja obsługi                    (216 KB)','','artemide-miconos-szklana-lampa-scienna-chrom','','','','Artemide Miconos szklana lampa ścienna, chrom','','','',''),(1806,1,1,'Pięknie wykonany kinkiet LED Lian z dwoma zakrzywionymi osłonami, ściemniany, made in Germany  Lian to lampa ścienna o matowej, mosiężnej powierzchni składającej się z dwóch elegancko zakrzywionych elementów. Uszlachetnienie z wykończeniem zostało przeprowadzone w misternej pracy ręcznej, a kinkiet LED został również wyprodukowany zgodnie z najwyższymi standardami jakości w Niemczech. Piękny kontrast wynika z czarnego zabarwienia uchwytu ściennego, a obraz świetlny jest nie tylko ciepły i zachęcający ze względu na mosiężną powierzchnię, ale także dlatego, że diody LED mają barwę światła ciepła biel, która imituje światło klasycznej żarówki. Bardzo duża komora przyłączeniowa ułatwia instalację, ponieważ wszystkie elementy do ukrycia można łatwo umieścić w puszce ściennej.  Światło jest emitowane zarówno w górę, jak i w dół, dzięki czemu jest ono bardzo przytulne. Ponadto lampa ścienna Lian charakteryzuje się bardzo dobrym oddawaniem barw, dzięki czemu kolory w pomieszczeniu mogą być odtwarzane jak najwierniej, nawet przy sztucznym oświetleniu.    - możliwość ściemniania za pomocą ściemniacza z trybem odcinania fazy lub fazowo-kątowego Pobierz:   Instrukcja obsługi                    (217 KB)','','lucande-lian-kinkiet-led-mosiadz-czarna','','','','Lucande Lian kinkiet LED, mosiądz, czarna','','','',''),(1807,1,1,'Szlachetna lampa ścienna Sotiana z przezroczystą szklaną kulą i elementami w mosiądzu i czerni  Sotiana to lampa ścienna, która przekonuje atrakcyjnym wzornictwem w stylu vintage. Klosz lampy składa się z przezroczystej szklanej kuli, czarnego matowego uchwytu ściennego oraz elementu metalowego z mosiężnym wykończeniem jako przejście od podstawy do klosza. Wszystko to razem wygląda bardzo szlachetnie i mogłoby pochodzić z innych czasów. Żarówka jest w tej lampie ściennej szczególnie obecna, ponieważ klosz jest dosłownie krystalicznie przejrzysty. Dlatego też wyposażając lampę w żarówkę E14 należy zwrócić uwagę na stylowy wygląd. Żarówki filament LED w formie kropli szczególnie dobrze nadają się jako uzupełnienie eleganckiego wyglądu, a także oferują niski pobór prądu, który w dzisiejszych czasach zawsze jest pożądany.','','lucande-sotiana-lampa-scienna-szklana-kula-mosiadz','','','','Lucande Sotiana lampa ścienna szklana kula mosiądz','','','',''),(1808,1,1,'Elegancka lampa ścienna Anjita z przewodem wtykowym i włącznikiem oraz przezroczystym kloszem  Anjita posiada okrągły, czarny uchwyt ścienny i wygiętą podstawę, która prowadzi do klosza. Jest on wykonany w całości ze szlachetnego przezroczystego szkła i ma atrakcyjny kształt. Dodatkowo, mosiężna oprawa żarówki jest przez to dobrze widoczna, a rezultatem jest niezwykle atrakcyjny, trójskładnikowy wygląd, który doskonale podkreśla styl vintage tej lampy ściennej. Lampę ścienną można szybko i wygodnie podłączyć do sieci elektrycznej za pomocą przewodu wtykowego ze zintegrowanym wyłącznikiem.','','lucande-anjita-lampa-scienna-szklany-klosz','','','','Lucande Anjita lampa ścienna, szklany klosz','','','',''),(1809,1,1,'Szlachetna lampa ścienna SAGARA o klasycznym kształcie kuli do nowoczesnej, eleganckiej łazienki. Lampa ścienna o eleganckim, klasycznym wyglądzie do eleganckiej łazienki. Mleczne szkło zapewnia równomierne i przyjemne oświetlenie przy lustrze i nie oślepia. Pobierz:   Instrukcja obsługi                    (1.2 MB)    Specyfikacja techniczna                    (88 KB)','','elegancka-lampa-scienna-o-ksztalcie-kuli-sagara','','','','Elegancka lampa ścienna o kształcie kuli SAGARA','','','',''),(1810,1,1,'Biały kinkiet LED Lian – made in Germany  Kinkiet LED Lian idealnie nadaje się na ekskluzywne źródło dodatkowego światła w przedpokoju lub w salonie. Lian całkowicie pozbawiony jest wymyślnych zawijasów czy rzucających się w oczy zdobień. Mimo to jako purystyczny i eleganckie źródło światła zapewnia on naprawdę wyjątkowy efekt. Do stworzenia tak ekskluzywnej lampy wystarczyły jedynie dwa wykonane z jakościowego aluminium żagle w kształcie litery S. Żagle są rozmieszczone geometryczne w tak precyzyjny sposób, że całość tworzy bardzo zamaszystą pętlę. Pośrodku niej znajduje się ukryte przed obserwatorem źródło światła. Zastosowano tu energooszczędne diody LED o barwie światła ciepłej bieli, które przekonują do siebie nie tylko możliwością regulowania poziomu jasności (przez ściemniacz z trybem nacinania lub odcinania fazy), lecz również niezwykle wysokim współczynnikiem CRI (CRI 90), zapewniającym idealne oddawanie barw.  Zasadniczo Lian roztacza wokół siebie przejrzystość i czystość – właściwości wynikające z kolorystyki, którą w całości utrzymano w bieli. Dwa aluminiowe żagle nie zostały polakierowane samą białą farbą, ale pokryte również specjalną powłoką kryjącą, której delikatna struktura nadaje oprawie nie tylko wyjątkowe wrażenie optyczne, lecz również sensoryczne.    Pobierz:   Instrukcja obsługi                    (213 KB)','','szlachetny-bialy-kinkiet-led-lian-ze-sciemniaczem','','','','Szlachetny biały kinkiet LED Lian ze ściemniaczem','','','',''),(1811,1,1,'Uskrzydlony gęsimi piórami Lucellino NT - designerski kinkiet LED  Wersja LED Lucellino NT jest kolejnym rozwinięciem tej designerskiej lampy ściennej, która inspiruje każdą ścianę swoim unikalnym wyglądem.   Nazewnictwo lampy ściennej Lucellino NT LED jest świetną grą słów włoskich pojęć „luce”, czyli „światło” i „ucellino”, czyli „ptaszek”. Stąd pochodzi kompozycja „Lucellino”, która w przenośni oznacza lśniącego ptaszka. Ponieważ lampa LED jest wyposażona w gęsie pióra i jest połączona z okrągłym uchwytem ściennym tylko za pomocą cienkiego drutu mosiężnego, lampa ta naprawdę wygląda, jakby zaraz miała odlecieć.   Żarówka jest żarówką LED, która została wyprodukowana specjalnie dla Ingo Maurer. Lampa jest dostarczana w komplecie z żarówką.  Designerski kinkiet LED nie jest przeznaczony do pomieszczeń o dużej wilgotności powietrza, ani do montażu na suficie. Pobierz:   Instrukcja obsługi                    (262 KB)    Specyfikacja techniczna                    (806 KB)','','ingo-maurer-lucellino-nt-kinkiet-led','','','','Ingo Maurer Lucellino NT kinkiet LED','','','',''),(1812,1,1,'Designerska lampa ścienna LED FOLD SURFACE, 22 cm, kremowy/mat.  Lampę ścienną LED FOLD SURFACE wyróżnia posta, geometryczna forma. Przy włączonym świetle tworzy na ścianie niezwykłe akcenty.','','purystyczna-lampa-scienna-led-fold-surface-2-pkt','','','','Purystyczna lampa ścienna LED FOLD SURFACE, 2-pkt.','','','',''),(1813,1,1,'Atrakcyjna designerska lampa ścienna Lua w kolorze białym, z mocnymi diodami LED  W serii opraw Lua emitowanie światła w sposób pośredni ma ogromne znaczenie, ponieważ diody LED znajdują się z tyłu płaskiego panelu aluminiowego i po załączeniu lampy oświetlają ścianę, to znaczy obserwatorzy nie widzą bezpośrednio tych diod, a jedynie ich piękne, ciepłobiałe światło. Zwłaszcza w purystycznych salonach ta designerska lampa ścienna jest doskonałym dodatkiem, który pokazuje, że minimalistyczny, zorientowany na design styl aranżacji wnętrza i efekt przytulnego oświetlenia nie wykluczają się wzajemnie.   Jako że ta lampa ścienna ma przegub umiejscowiony między mocowaniem ściennym a kloszem, można ją ustawiać w różny sposób.  Pobierz:   Specyfikacja techniczna                    (737 KB)','','designerska-lampa-scienna-lua-z-led','','','','Designerska lampa ścienna Lua z LED','','','',''),(1814,1,1,'Minimalistyczny kinkiet LED Pin z czarną, matową, lakierowaną powierzchnią  Kinkiet LED Pin to designerski produkt firmy Vibia, który może wyróżnić się minimalistycznym wyglądem. Ta lampa ścienna składa się z metalowej podstawy, łączącej uchwyt ścienny z kloszem. Oba te elementy są okrągłe. Światło nie jest emitowane do pomieszczenia przez klosz przypominający szybę, ale skierowane jest na ścianę, powodując efekt oświetlenia pośredniego. Wygląda to nie tylko przytulnie. Można bowiem również liczyć na specjalne efekty świetlne, gdy oświetlenie optycznie przypomina aureolę wokół głowicy lampy. Uzyskujemy piękne plamy świetlne na ścianie, a szczególnie gdy połączymy kilka lamp z tej serii, możemy uzyskać najwyższej klasy efekty świetlne, które wyglądają niemal artystycznie.','','czarny-kinkiet-led-pin','','','','Czarny kinkiet LED Pin','','','',''),(1815,1,1,'Elegancka lampa ścienna Neo Retro z elastycznymi ramionami  Lampa ścienna Neo Retro posiada klosz z mlecznobiałego szkła, który można dowolnie przesuwać. Docelowe światło można uzyskać dzięki elastycznym przegubom, które umożliwiają różne pozycje poprzez podnoszenie i opuszczanie. Czarny metalowy stelaż, przeguby w kolorze mosiądzu i biały abażur tworzą nowoczesne połączenie kolorystyczne, które doskonale wpisuje się w aktualne trendy. Mosiężne detale natychmiast sprawią, że każde pomieszczenie stanie się cieplejsze i bardziej eleganckie. Lampa ścienna nadaje się szczególnie do tego, aby nadać pomieszczeniom stylowy wygląd. Może być również montowana jako lampa sufitowa.  Lampa pochodzi z linii produktów Miloox firmy Sforzin, która charakteryzuje się niezwykle świeżym designem i połączeniem modnych materiałów. Pobierz:   Specyfikacja techniczna                    (5.4 MB)','','lampa-scienna-neo-retro-dwa-ruchome-ramiona','','','','Lampa ścienna Neo Retro, dwa ruchome ramiona','','','',''),(1816,1,1,'Wyszukana lampa ścienna FILOU - oryginalna ozdoba  Osobom lubiącym niezwykłe wyposażenie i oświetlenie wnętrz lampa FILOU przypadnie do gustu. Ta wykonana z metalu i tworzywa lampa ścienna swoim kształtem imituje muchę, zapewniając przy tym przyjemne i nastrojowe światło i zachwycając swoim wyglądem, również po wyłączeniu. Uszko zamocowane na tylnej nodze muchy umożliwia jej zamontowanie w dowolnym miejscu. Designerskim akcentem są tu sitka do herbaty, spełniające rolę oczu i ryjka. Długość kabla wraz z włącznikiem wynosi 1 m.','','wyszukana-lampa-scienna-filou','','','','Wyszukana lampa ścienna FILOU','','','',''),(1817,1,1,'Lampa ścienna DL20 z trójwarstwowym metalowym kloszem i przełącznikiem  Dzięki wyposażeniu w przełącznik bezpośrednio na okrągłym, chromowanym uchwycie ściennym lampa ścienna DL20 nadaje się nie tylko do pomieszczeń mieszkalnych, ale także do sypialni. Oprawa o skandynawskim designie oferuje bardzo przyjemne oświetlenie dzięki specjalnemu rozmieszczeniu poszczególnych elementów klosza, które umożliwia promieniowanie światła w dół, a także na wszystkie strony przez szczeliny. W kontraście do matowego, lakierowanego odcienia, uchwyt ścienny został zaprojektowany w błyszczącym chromowanym wykończeniu.  Lampa ścienna DL20 jest jedną z wielu różnych lamp z serii DL firmy Dyberg Larsen, duńskiej firmy oświetleniowej, która koncentruje się na projektowaniu i produkcji niedrogich lamp, ale nie zapomina przy tym o designie i efekcie świetlnym, a także o jakości.','','dyberg-larsen-dl20-kinkiet-metal-20cm','','','','Dyberg Larsen DL20 kinkiet metal 20cm','','','',''),(1818,1,1,'Minimalizm w najpiękniejszej formie - lampa ścienna Beat Wall  Wyraźne formy w charakterystycznym wzornictwie serii, która osiąga swoją niezależność dzięki przemyślanym detalom, składają się na ogólny wygląd lampy ściennej Beat. Wysokiej jakości mosiądz jest ręcznie bity. Na zewnątrz prezentuje się w matowo-czarnej powłoce proszkowej. Wnętrze lśni mosiądzem, dzięki czemu światło wydaje się jeszcze cieplejsze i tworzy modny kontrast z ciemną stroną zewnętrzną.  Klosz w kształcie lejka można odchylać na boki, dzięki czemu można indywidualnie wpływać na kierunek padania światła. Światło wydobywa się tylko przez skierowany w dół otwór klosza i oświetla konkretnie żądany obszar. Beat Wall jest również idealna jako lampa do czytania obok łóżka lub kanapy, ponieważ można ją wygodnie obsługiwać za pomocą wbudowanego przełącznika ściemniacza na okrągłym uchwycie ściennym.  Seria produktów Beat została zaprojektowana przez Toma Dixona i cieszy się ogromną popularnością na całym świecie. Proste mosiężne garnki do gotowania i tradycyjne naczynia na wodę z Indii były źródłem inspiracji dla ważnego brytyjskiego projektanta. Pobierz:   Specyfikacja techniczna                    (624 KB)','','tom-dixon-beat-wall-kinkiet-czarny-mosiadz','','','','Tom Dixon Beat Wall kinkiet, czarny/mosiądz','','','',''),(1819,1,1,'Lampa ścienna z tkaniny Vasilia w kolorach czarnym i złotym  Zapewnianie ukierunkowanego światła: lampa ścienna z tkaniny Vasilia tworzy promienny akcent w korytarzu lub w części mieszkalnej. Lampa o liniowej konstrukcji może być również używana w sypialni, gdzie pozwala uzyskać światło w ciemności.  Dzięki czarnej obudowie lampa prezentuje się jako dyskretny element przyciągający wzrok, który po włączeniu staje się prawdziwą atrakcją. Złote wnętrze nadaje światłu szlachetny połysk, samo zaś światło świeci w tył na ścianę, przedostając się przez tkaninę. W ten sposób specjalne obrazy lub inne bliskie sercu elementy wyposażenia mogą być oświetlone w nastrojowy sposób. Pobierz:   Instrukcja obsługi                    (328 KB)','','lampa-scienna-vasilia-czarno-zlota-1-punktowa','','','','Lampa ścienna Vasilia, czarno-złota, 1-punktowa','','','',''),(1820,1,1,'','','kinkiet-led-forrestal-szerokosc-40-cm','','','','Kinkiet LED Forrestal, szerokość 40 cm','','','',''),(1821,1,1,'Jednopłomieniowa oprawa ścienna Enoire - udane współgranie kontrastów  Jak wiadomo, przeciwieństwa przyciągają - a w przypadku oprawy ściennej Enoire tworzą nawet harmonijny całościowy obraz. Sferyczny klosz wykonany ze szkła opalowego wytwarza światło, które jest emitowane równomiernie we wszystkich kierunkach. Jest on montowany przed aluminiowym wspornikiem ściennym, który jest zaprojektowany jako czarny, prostokątny pręt. Enoire robi doskonałe wrażenie w prywatnych salonach z nowoczesnym wyposażeniem, ale może być również umieszczony jako dodatkowe źródło światła, na przykład we foyer w miejscach publicznych.','','kinkiet-enoire-czarno-bialy-1-punktowy','','','','Kinkiet Enoire czarno-biały, 1-punktowy','','','',''),(1822,1,1,'Stylowy kinkiet LED Safia o nowoczesnym wyglądzie  Safia doskonale pasuje do purystycznego stylu wyposażenia wnętrz, dla którego charakterystyczna jest duża liczba nowoczesnych mebli. Elementy przytwierdzone do mocowania ściennego zamiast klosza mają filigranową, falistą formę, a jednocześnie stanowią podkład dla dużej liczby niewielkich diod LED emitujących światło o barwie ciepłej bieli. Światło diod jest bardzo jasne, a mimo to nie generuje dużego zużycia energii.','','kinkiet-led-safia-w-falistej-formie','','','','Kinkiet LED Safia w falistej formie','','','',''),(1823,1,1,'Czarny kinkiet LED Pria z metalowym korpusem  Pria ucieleśnia swego rodzaju styl retro i dlatego można ją dobrze połączyć z wnętrzem, które faktycznie jest starsze, takim jak na przykład zawierające piękny, niepowtarzalny element ze sklepu second hand lub ze zbioru pamiątek rodzinnych. Czarny klosz, który jest wyposażony w żarówkę LED E14, dzięki rozbudowanej podstawie wystaje daleko w głąb pomieszczenia, a światło może być wykorzystane na przykład do czytania lub do ułatwienia pracy rzemiosła, które jest coraz częściej uprawiane przez młodsze pokolenia To cudowne bowiem, gdy można stworzyć obiekt użytkowy lub dekoracyjny własnymi rękami i zaprojektować go w sposób indywidualny.   Głowicę można wyginać i odchylać, a dla wygody użytkowania ten kinkiet LED wyposażony jest we własny przełącznik, który znajduje się w środku na okrągłym uchwycie ściennym i może być obsługiwany jednym ruchem ręki.   ‑ z przewodem o długości 1,8 m, zaopatrzonym we wtyczkę Pobierz:   Instrukcja obsługi                    (478 KB)','','szeroki-kinkiet-led-pria-czarny','','','','Szeroki kinkiet LED Pria, czarny','','','',''),(1824,1,1,'Lampa ścienna Enoire z dwoma kloszami opalizującymi i czarnym uchwytem ściennym  Dwupłomieniowa oprawa ścienna Enoire, charakteryzująca się czarującą grą kontrastów i jasnym językiem projektowania, oferuje odpowiedni element wyposażenia nowoczesnych wnętrz - czy to w prywatnych pomieszczeniach mieszkalnych, czy na przykład w publicznej galerii. Jego odcienie są zaprojektowane jako symetryczne, jasne kule z opalizowanego szkła, które zapewniają równomierną emisję światła dookoła. Natomiast aluminiowy wspornik ścienny ma kształt długiego, czarnego prostokąta; odcienie są rozmieszczone asymetrycznie wzdłuż niego, pozostawiając obszar wspornika całkowicie wolny. Pobierz:   Instrukcja obsługi                    (596 KB)','','kinkiet-enoire-czarno-bialy-2-punktowy','','','','Kinkiet Enoire czarno-biały, 2-punktowy','','','',''),(1825,1,1,'Piękna lampa ścienna do czytania Merle z białego metalu z wysuwanym ramieniem nożycowym  Merle dobrze komponuje się z nowoczesnymi wnętrzami o stylowym wyglądzie, ale jest również klasycznym elementem oświetleniowym, ponieważ lampy ścienne z ramionami nożycowymi znane były już w ubiegłym stuleciu i spełniają swoje zadanie, będąc jednocześnie bardzo atrakcyjne wizualnie, zwłaszcza gdy są wykonane z metalu.  Światło możemy ustawić wręcz idealnie, gdyż ta lampa ścienna ma teleskopowe i obrotowe ramię nożycowe, prowadzące od podstawy do klosza, a sama lampa doskonale nada się jako lampka do czytania, gdy zamontujemy ją w pobliżu sofy lub łóżka.  Pobierz:   Instrukcja obsługi                    (194 KB)','','lampa-scienna-do-czytania-merle-wysuwana-biala','','','','Lampa ścienna do czytania Merle, wysuwana, biała','','','',''),(1826,1,1,'Heiko – biały kinkiet LED z gipsu  Jeśli masz ten kinkiet LED, światło świeci w górę i w dół w sposób bardzo efektowny i przede wszystkim daje wrażenie przytulności. Obudowa lampy ma półkolisty kształt, który jest postrzegany jako uroczy i atrakcyjny i może być łączony z kilkoma stylami.   Kto nosi się z zamiarem dostosowania kolorystycznego kinkietu LED do otoczenia, śmiało może wziąć do ręki farbę i pędzel, gdyż lampy z gipsu doskonale nadają się do tego, by móc je pomalować lub opatrzyć rysunkami. Pobierz:   Instrukcja obsługi                    (378 KB)','','piekny-kinkiet-led-heiko-z-gipsu','','','','Piękny kinkiet LED Heiko z gipsu','','','',''),(1827,1,1,'Obrazy w pełnym świetle bez prądu - Lampa do obrazów LED Tommy zasilana na baterie  Tommy wyróżnia się dwiema specjalnymi funkcjami: Po pierwsze, oświetlenie obrazów posiada oszczędne diody LED o barwie ciepłej bieli, a po drugie, nie jest potrzebne przyłącze zasilania w ścianie, aby oświetlić piękne obrazy, ponieważ oświetlenie pobiera wymaganą moc z trzech baterii AA (nie należą do kompletu). Obudowa jest ze szczotkowanej stali szlachetnej i pod względem elegancji i uroku w niczym nie ustępuje oświetlanym obiektom. Z boku lampa ta ma przełącznik do włączania i wyłączania. Drążki boczne lampy są stałe i nie można ich przechylać ani regulować.   kąt padania światła 120°','','lampa-do-obrazow-led-tommy-na-baterie','','','','Lampa do obrazów LED Tommy na baterie','','','',''),(1828,1,1,'Doskonały pod względem formy kinkiet LED Desirio z wkręconym metalowym kloszem w kolorze czarnym i złotym  Desirio to bardzo atrakcyjny element oświetleniowy dla całego obszaru mieszkalnego, który urzeka unikalnym, artystycznym wyglądem. Metalowy klosz wygląda jak wkręcona kartka papieru lub rodzaj spirali i przekonuje swoim stylowym, dwukolorowym wzornictwem. Zewnętrzna strona metalowego klosza jest czarna, wnętrze złote, a końce nakładają się na górze i na dole z obudową, co wyraźnie podkreśla kontrast kolorów. Światło żarówki LED G9 jest pięknie odbijane przez elegancki złoty odcień i przy tej konstrukcji tworzy bardzo przytulny efekt. Każda ściana w części mieszkalnej, na której znajduje się ta lampa, w mgnieniu oka zyskuje nowoczesny wygląd.  Pobierz:   Instrukcja obsługi                    (1.2 MB)','','metalowy-kinkiet-led-desirio-czarno-zloty','','','','Metalowy kinkiet LED Desirio, czarno-złoty','','','',''),(1829,1,1,'Lampa ścienna Konstantin z gipsu nadającego się do malowania  Konstantin to lampa ścienna relatywnie dyskretna i prosta, a jednak za tą delikatną fasadą kryją się niezliczone możliwości stosowania - po pierwsze dlatego, że pasuje kształtem i kolorem do wielu stylów i koncepcji aranżacji wnętrz, ale także po drugie dlatego, że gips jest powierzchnią, która pozwala jeszcze na późniejsze zmiany i nadaje się lepiej niż każda inna lampa do kreatywnego tworzenia oświetlenia. Można zrealizować w mgnieniu oka wiele życzeń, np. pomalować tę lampę ścienną w odcieniu ściany, albo w kolorze kontrastującym z pozostałym wyposażeniem lub wykonać na niej jakiś motyw czy ilustrację, co jest opcją wartą rozważenia np. w pokoju dziecięcym. Nie ma żadnych granic dla artystów w dziedzinie oświetlenia, a do przygotowania powierzchni dołączono - standardowo - rękawiczki i papier ścierny.   Światło świeci do dołu - tu znajduje się dodatkowa przesłona z mlecznego szkła - ale także do góry i jest przyjemnie delikatne, roztaczając przy tym przytulną aurę.  Pobierz:   Instrukcja obsługi                    (209 KB)','','wygieta-lampa-scienna-konstantin-z-bialego-gipsu','','','','Wygięta lampa ścienna Konstantin z białego gipsu','','','',''),(1830,1,1,'Biało-złoty kinkiet LED Desirio z metalu  Klosz tej lampy ściennej z żarówką LED G9 przypomina bardziej spiralę lub wkręcony papier niż klasyczny klosz. To właśnie czyni go tak wyjątkowym, ponieważ natychmiast przyciąga wzrok i wyróżnia się wśród innych produktów. Konstrukcja wpływa nie tylko na wygląd lampy, ale również na jej oświetlenie, ponieważ oba końce nakładają się z obudową zarówno na górze, jak i na dole. Na zewnątrz klosz jest biały, wewnątrz urzeka pięknym, złotym odcieniem, który wciąż jest dobrze widoczny na górze i na dole i który w połączeniu ze światłem promieniuje cudownym ciepłem, przyczyniającym się do stworzenia przytulnej atmosfery w mieszkaniu.  Pobierz:   Instrukcja obsługi                    (1.0 MB)','','metalowy-kinkiet-led-desirio-bialo-zloty','','','','Metalowy kinkiet LED Desirio, biało-złoty','','','',''),(1831,1,1,'Ekstrawagancki kształt kinkietu LED Hayley z wiszącym szklanym kloszem i błyszczącą chromowaną ramką ścienną  Hayley ma okrągły uchwyt ścienny, z którego schodzi wygięte ramię. Oba elementy są chromowane na wysoki połysk, co wygląda bardzo nowocześnie, a z ramienia w górnej części wychodzi linka, która prowadzi do szklanej kuli jak w klasycznej lampie wiszącej. Kula ta jest przezroczysta i została wykonana z atrakcyjnego szkła bąbelkowego, natomiast część dolna posiada metalowy element, który, podobnie jak podstawa, jest utrzymany w chromie. Światło może wyjść bezpośrednio i pośrednio, przy czym bezpośrednia część światła jest bardziej miękka dzięki satynowanej powierzchni szklanej na dole klosza. Technologia LED lampy ściennej zapewnia niskie zużycie energii.  Pobierz:   Instrukcja obsługi                    (292 KB)','','kinkiet-led-hayley-z-wiszaca-kula-chrom','','','','Kinkiet LED Hayley z wiszącą kulą, chrom','','','',''),(1832,1,1,'','','kinkiet-marley-stary-mosiadz-up-down','','','','Kinkiet Marley, stary mosiądz, Up & Down','','','',''),(1833,1,1,'Lampa ścienna ze sklepieniem Karla ze szkła i metalu  Ta lampa ścienna urzeka wspaniałym wyglądem, szklany klosz tworzy lekkie sklepienie i jest uzupełniany od dołu metalową aplikacją o matowej niklowanej powierzchni. Lampa Karla umieszczona na ścianie wygląda bardzo elegancko i oczywiście nowocześnie. Satynowana wkładka ze szkła powoduje miękkie i ciepłe rozprowadzanie światła, przy czym wybór źródła światła jest w pełnym sensie nieograniczony, ponieważ oprawka E-27 pozwala na zastosowanie zarówno żarówek, jak i halogenów oraz wydajnych i oszczędnych lamp LED.  Pobierz:   Instrukcja obsługi                    (398 KB)','','ekskluzywna-lampa-scienna-karla','','','','Ekskluzywna lampa ścienna Karla','','','',''),(1834,1,1,'Piękna lampa ścienna Malthe ze szkła i metalu  Ta lampa ścienna urzeka bardzo pięknym widokiem, szklany klosz wystaje ku górze, a na dole jest uzupełniany przez metalowy element z połyskującego chromu. Lampa Malthe umieszczona na ścianie wygląda bardzo elegancko i oczywiście nowocześnie. Satynowana wkładka ze szkła powoduje miękkie i ciepłe rozprowadzanie światła, przy czym wybór źródła światła jest w pełnym sensie nieograniczony, ponieważ oprawka E-27 pozwala na zastosowanie zarówno żarówek, jak i halogenów oraz wydajnych i oszczędnych lamp LED.  Pobierz:   Instrukcja obsługi                    (311 KB)','','malthe-nowoczes-lampa-scienna-ze-szkla-i-metalu','','','','Malthe - nowoczes. lampa ścienna ze szkła i metalu','','','',''),(1835,1,1,'','','spot-scienny-corralee-bialy-1-punktowy','','','','Spot ścienny Corralee, biały, 1-punktowy','','','',''),(1836,1,1,'Elegancka lampa ścienna Yola z białym półprzezroczystym szklanym kloszem  Ta stylowa i prosta lampa ma harmonijny i wysublimowany wygląd. Klosz z półprzezroczystego mlecznego szkła zapewnia miłe dla oka światło nie powodujące efektu oślepienia. Cokół wykonano tu ze stali, a jego chromowane wykończenie nadaje całości efektowne, nowoczesne akcenty.  Lampa ścienna Yola może zostać wyposażona w trzy energooszczędne żarówki E27. Należy je nabyć oddzielnie. Wreszcie, co nie mniej ważne, model Yola współgra z klasycznymi, ponadczasowymi pomysłami wnętrzarskimi, a także pasuje do nostalgicznego stylu wyposażenia. Pobierz:   Instrukcja obsługi                    (343 KB)','','lampa-scienna-yola-ze-szklanym-kloszem-chrom','','','','Lampa ścienna Yola ze szklanym kloszem, chrom','','','',''),(1837,1,1,'Lampa ścienna Stannis jako nowoczesne rozwiązanie oświetleniowe z tekstylnym kloszem  Elegancki klosz lampy ściennej Stannis został wykonany z białej tkaniny. Lampa nie tylko uzyskuje szczególny wygląd, ale również zapewnia doskonałe oświetlenie. Światło prześwieca delikatnie przez tkaninę i zanurza otoczenie w przyjemnym, miękkim świetle. Światło może bez przeszkód wydostawać się w dół, dzięki czemu zapewnione jest również wystarczające oświetlenie. Dzięki swojemu abstrakcyjnemu wyglądowi Stannis nadaje się jako uzupełniające źródło światła w nowoczesnym salonie lub sypialni.','','lindby-stannis-lampa-scienna-tkanina-matowy-nikiel','','','','Lindby Stannis lampa ścienna tkanina matowy nikiel','','','',''),(1838,1,1,'Prostokątna lampa ścienna Trinity z aluminium  Lampa ścienna Trinity charakteryzuje się nowoczesną grą z geometrycznymi kształtami. Skromny, prostokątny kształt lampy przerywany jest przez trójkątne konstrukcje reliefowe, nadające lampie dynamiczny, a jednocześnie elegancki wygląd.   Szlachetny wygląd podkreśla wysokiej jakości wykonanie z wytrzymałych materiałów. Tworzywa sztuczne i aluminium spotykają się tutaj, aby stworzyć całościowy, lśniący obraz. Zintegrowane lampy LED zapewniają jasne oświetlenie. Barwa światła może być ponadto ustawiana indywidualnie. Lampa ścienna może być również montowana na suficie, dzięki czemu może być używana na wiele różnych sposobów.','','kinkiet-led-trinity-regulowana-barwa-swiatla','','','','kinkiet LED Trinity - regulowana barwa światła','','','',''),(1839,1,1,'Kinkiet LED 2080 z elastycznym ramieniem z płytą do montażu przy łóżku  Czy to po lewej, po prawej czy u góry przy łóżku - dzięki płycie montażowej regulowanej pod kątem 90°, kinkiet LED 2080 może być zamontowany w dowolnym miejscu. Długie ramię elastyczne oferuje maksymalną elastyczność pod względem orientacji światła, dzięki czemu pozycja światła może być optymalnie dopasowana podczas wieczornego czytania przed snem. Wyłącznik został zintegrowany z podstawą kątową lampy, dzięki czemu jest łatwo dostępny z łóżka. Kinkiet LED 2080 dostarczana jest z wymienną żarówką GU10 LED, długość przezroczystego kabla wynosi 180 cm.','','kinkiet-led-2080-do-montazu-przy-lozku','','','','Kinkiet LED 2080 do montażu przy łóżku','','','',''),(1840,1,1,'Kinkiet LED Sten – ściemniany poprzez sterowanie gestami  Innowacyjnie zaprojektowany kinkiet LED Sten nadaje się do wielu zastosowań. Wystarczy przykręcić go do ściany, np. nad łóżkiem w sypialni, a następnie będzie on emitować ciepłobiałe światło LED, które jest bardzo przytulne. Lampa ta tym samym staje się idealnym towarzyszem na długie wieczory z książką. Światło można płynnie przyciemniać za pomocą sterowania gestami i w ten sposób precyzyjnie dostosować je do swoich indywidualnych wymagań stawianych oświetleniu.','','sterowany-gestami-sciemniany-kinkiet-led-sten','','','','Sterowany gestami ściemniany kinkiet LED Sten','','','',''),(1841,1,1,'Połączenie czarnego metalu z jasnym drewnem: kinkiet LED Arina Dzięki stylowemu, nieco purystycznemu wyglądowi i drobnemu drewnianemu elementowi, Arina doskonale pasuje do tych stylów aranżacji wnętrz, które można przypisać skandynawskiemu wzornictwu, gdzie przytulność i nowoczesna prostolinijność tworzą doskonałe połączenie.  Klosz można przesuwać zgodnie z życzeniem, a dzięki technologii LED, zastosowanej w żarówkach, podczas pracy z lampą ścienną Arina można mieć pewność, że zużywa się tylko niewiele energii elektrycznej, choć światło jest jasne i bardzo komfortowe. Pobierz:   Instrukcja obsługi                    (542 KB)','','czarny-kinkiet-led-arina-z-drewnem','','','','Czarny kinkiet LED Arina z drewnem','','','',''),(1842,1,1,'Purystyczna lampa ścienna LED Szanghaj  Wąski pręt zamocowany na okrągłym uchwycie ściennym, czyli lampa ścienna Szanghaj. Ciepłobiałe diody LED są ustawione w kierunku ściany, dzięki czemu oświetlają pomieszczenie tylko pośrednio. Wykonany w całości z czarnego aluminium, Shanghai nadaje ścianie znaczną długość i pasuje do nowoczesnych i minimalistycznych wnętrz. Dzięki przejrzystemu, bezpretensjonalnemu wzornictwu, energooszczędna oprawa ścienna LED jest bardzo popularna zarówno w prywatnych pomieszczeniach mieszkalnych i sypialnych, jak i w budynkach użyteczności publicznej czy obiektach hotelowych.','','kinkiet-led-shanghai-1-pkt-3000-k-czarna','','','','Kinkiet LED Shanghai 1-pkt. 3 000 K czarna','','','',''),(1843,1,1,'Smukła lampa ścienna LED Thiago w kolorze białym  Nowoczesny, smukły wygląd i dyskretna kolorystyka są połączone w lampie ściennej Thiago LED. Korpus lampy składa się z uchwytu ściennego i wąskiego rozpórki, które są wykonane z aluminium. Jego diody LED są montowane tak, że siedzą za rozpórką i świecą swoim światłem na ścianie. Dzięki temu ciekawemu ułożeniu światła, lampa ścienna Thiago LED jest otoczona i podkreślona własnym światłem. Ciepłe białe światło diod LED tworzy przyjemną atmosferę i jest idealne do oświetlenia akcentującego. Ale także niewielkie rozmiary oprawy sprawiają, że jest ona idealnym towarzyszem w oświetleniu korytarzy. Jest o wiele bardziej oszczędny w przestrzeni niż wiszące oprawy ścienne, a jego prosty wygląd sprawia, że jest doskonałym uzupełnieniem nowoczesnego stylu projektowania wnętrz. Pobierz:   Instrukcja obsługi                    (333 KB)    Photometric Data LDT                    (9 KB)    Dimension drawing                    (99 KB)','','arrchio-kinkiet-led-thiago-bialy','','','','Arrchio kinkiet LED Thiago biały','','','',''),(1844,1,1,'Piękna lampa ścienna ELAINA ze szkła opalowego z żarówką LED E14  Klosz tej lampy ściennej ma kształt kuli i został wykonany ze szkła opalowego, dzięki czemu daje łagodne, przyjemne światło. Znajdujący się na podstawie włącznik dźwigniowy umożliwia szybką obsługę lampy, dlatego z powodzeniem można umieścić ją nad fotelem, kanapą lub łóżkiem.   Dostawa obejmuje żarówkę LED E14 w ciepłym białym kolorze o wysokiej energooszczędności.  Pobierz:   Instrukcja obsługi                    (593 KB)','','spot-scienny-led-elaina-matowy-nikiel','','','','Spot ścienny LED ELAINA, matowy nikiel','','','',''),(1845,1,1,'Atrakcyjna lampa ścienna POLA o klasycznym designie  Ta lampa ścienna wraz z materiałowym abażurem w szampańskim kolorze oraz podstawą w kolorze mosiądzu wprost emanuje klasyką. Dlatego doskonale odnajdzie się we wnętrzach urządzonych w klasycznym stylu. Materiałowy abażur o jasnej, ciepłej barwie rozprasza światło w formie przyjemnej poświaty i został uzupełniony o elegancki mosiężny kolor w postaci podstawy o polerowanej powierzchni. Cechą charakterystyczną tej lampy jest znajdujący się pod abażurem przegub, który umożliwia regulację wysięgu, co stwarza wiele możliwości ustawiania lampy i dostosowywania światła do własnych potrzeb. W ten sposób abażur można obracać i przyciągać do siebie. Pobierz:   Instrukcja obsługi                    (328 KB)','','lampa-scienna-pola-na-wysiegniku','','','','Lampa ścienna POLA na wysięgniku','','','',''),(1846,1,1,'Atrakcyjna materiałowa lampa ścienna POLA z białym abażurem na wysięgniku  Zastosowana kolorystyka nadaje lampie POLA nowoczesny wygląd, z kolei formą nawiązuje ona do klasyki. To harmonijne połączenie czyni z niej ponadczasowe źródło światła, z do tego biały materiałowy abażur sprawi, że wpasuje się w każdy wystrój wnętrza. Idealnie spisze się nad łóżkiem lub sofą. Wbudowany przegub pozwala na przyciąganie abażuru do siebie, z kolei wbudowany przełącznik umożliwia wygodne włączanie i wyłączanie lampy.  Pobierz:   Instrukcja obsługi                    (336 KB)','','materialowa-lampa-scienna-pola-z-wysiegnikiem','','','','Materiałowa lampa ścienna POLA z wysięgnikiem','','','',''),(1847,1,1,'Mały spot sufitowy Wanessa - odpowiedni również na ścianie  1-punktowy spot sufitowy Wanessa wyposażony jest w szlachetne połączenie jasnego drewna i satynowej bieli. Klosz utrzymany w bieli znajduje się na rozecie sufitowej z jasnego drewna o pięknej fakturze. Klosz jest ruchomy dzięki przegubowi, dzięki czemu może być w każdej chwili regulowany i indywidualnie dostosowywany. Reflektor sufitowy Wanessa może być również zainstalowany na ścianie i wykorzystywany jako małe dodatkowe źródło światła, na przykład do czytania w salonie.  Pobierz:   Instrukcja obsługi                    (193 KB)','','lindby-wanessa-spot-1-punktowy','','','','Lindby Wanessa spot, 1-punktowy','','','',''),(1848,1,1,'Trendowy ścienny reflektor Evinora wykonany z udanego połączenia materiałów  Evinora to piękny kinkiet, który przyciąga wszystkie oczy swoim ciemnym kloszem. Szczególnie imponuje połączeniem różnych materiałów. Podczas gdy rama wykonana jest z lekkiego drewna, klosz cylindryczny wykonany jest ze stali.  Światło jest emitowane ze wszystkich stron, przy czym optyka klosza zapewnia indywidualne akcenty świetlne. Nie ma żadnych ograniczeń w doborze oświetlacza do gniazda E14, a energooszczędny oświetlacz LED w modnej optyce żarniwnej jest tutaj oferowany.','','lindby-evinora-reflektor-scienny-z-drewna','','','','Lindby Evinora reflektor ścienny z drewna','','','',''),(1849,1,1,'','','kinkiet-led-lagos-z-przelacznikiem-czarny','','','','Kinkiet LED Lagos z przełącznikiem, czarny','','','',''),(1850,1,1,'','','lampa-scienna-997-z-wtyczka-1-punktowa-czarna','','','','Lampa ścienna 997 z wtyczką, 1-punktowa, czarna','','','',''),(1851,1,1,'Gipsowa lampa ścienna LED Marit o stopniowanym wyglądzie  Marit to prawdziwie czarujące źródło światła dla strefy mieszkalnej. Efekt świetlny jest naprawdę niesamowity, ponieważ powstaje piękna gra światła i cienia. Dzieje się tak dzięki stopniowanej konstrukcji klosza, ponieważ umożliwia ona wydostawanie się światła w różnych miejscach. Pobierz:   Instrukcja obsługi                    (500 KB)','','lindby-marit-kinkiet-led-gips-stopniowany','','','','Lindby Marit kinkiet LED gips, stopniowany','','','',''),(1852,1,1,'','','kinkiet-circle-o-okraglym-ksztalcie-czarny','','','','Kinkiet Circle o okrągłym kształcie, czarny','','','',''),(1853,1,1,'Lampa ścienna czarno-biała Enoire z trzema szklanymi kloszami  Trzystopniowa oprawa ścienna Enoire charakteryzuje się kontrastowymi kształtami i kolorami uchwytu ściennego oraz kloszy. Ten pierwszy jest wykonany z aluminium i ma kształt długiego, prostokątnego paska w kolorze czarnym. Podtrzymuje on odcienie w pozycji asymetrycznej; dwa są montowane jako para na jednym końcu, podczas gdy jeden odcień stoi oddzielnie. Ich kuliste kule są wykonane ze szkła opalowego, dzięki czemu równomierne i rozproszone światło jest emitowane we wszystkich kierunkach. W zależności od preferencji, Enoire może być montowany pionowo, poziomo lub pod kątem. Oprawa ścienna może być łączona na różne sposoby z nowoczesnymi wnętrzami, zarówno w pomieszczeniach prywatnych jak i publicznych.','','kinkiet-enoire-czarno-bialy-3-punktowy','','','','Kinkiet Enoire czarno-biały, 3-punktowy','','','',''),(1854,1,1,'Kinkiet LED Jolka zapewnia przyjemne światło do czytania  Dzięki diodowej lampce do czytania Jolka można czytać do późnych godzin nocnych. Kiedy na dworze robi się powoli ciemno, Jolka wkracza do akcji. Kinkiet jest obsługiwany za pomocą małego włącznika na uchwycie ściennym. Jasne diody LED świecą i oświetlają niewielką powierzchnię. Dzięki elastycznemu ramieniu, stożek świetlny może być różnie ustawiony. Satynowa pokrywa zapewnia równomierny rozkład światła, a także nie oślepia.  Pobierz:   Instrukcja obsługi                    (374 KB)','','lindby-jolka-lampka-do-czytania-led-mosiadz','','','','Lindby Jolka lampka do czytania LED mosiądz','','','',''),(1855,1,1,'Lśniąca lampa ścienna Kosta z niklową podstawą i przełącznikiem  Lampa ścienna Kosta to naprawdę atrakcyjny obiekt oświetleniowy do mieszkania o szlachetnym wzornictwie. Ruchomy klosz, który jest mocowany do podstawy za pomocą przegubu, może być regulowany w zależności od potrzeb i charakteryzuje się eleganckim wyglądem, ponieważ jest wyposażony w przezroczyste, polerowane elementy szklane, które po włączeniu żarówki E14 tworzą piękny blask, który natychmiast zachwyci każdego obserwatora. Przełącznik znajduje się na okrągłej podstawie z powierzchnią w kolorze niklu, co ułatwia obsługę lampy ściennej Kosta z łóżka lub kanapy.  Pobierz:   Instrukcja obsługi                    (334 KB)','','lindby-kosta-lampa-scienna-z-przelacznikiem-nikiel','','','','Lindby Kosta lampa ścienna z przełącznikiem nikiel','','','',''),(1856,1,1,'Czarna lampa ścienna LED Ignazia wykonana z metalu dla przyjemnego oświetlenia salonu  Ignazia jest nowoczesnym elementem oświetleniowym o prostym wyglądzie, który szczególnie nadaje się do wnętrz purystycznych, ale dobrze komponuje się również z innymi stylami. Technologia LED w oprawie ściennej zapewnia dobrą wydajność energetyczną, a światło jest przyjemnie olśniewające. Lampa ścienna LED jest więc idealna do stosowania na korytarzach i w salonach, najlepiej jako oświetlenie akcentujące lub uzupełniające. Światło jest skierowane zarówno w górę jak i w dół, a matowa, czarna powierzchnia w atrakcyjny sposób udoskonala zredukowany design. Pobierz:   Instrukcja obsługi                    (484 KB)','','lindby-ignazia-lampa-scienna-led-28-cm-czarna','','','','Lindby Ignazia lampa ścienna LED, 28 cm, czarna','','','',''),(1857,1,1,'','','kinkiet-led-lagos-czarny','','','','Kinkiet LED Lagos, czarny','','','',''),(1858,1,1,'Funkcjonalny biały kinkiet LED Milow z praktycznym elastycznym ramieniem i gniazdem USB do ładowania telefonu  W tym kinkiecie LED przełącznik jest zainstalowany w mocowaniu ściennym, a elastyczne ramię umożliwia ustawianie światła we wszystkich możliwych kierunkach. To oznacza, że Milow nadaje się w szczególności jako oświetlenie do czytania, które można ustawić obok łóżka czy sofy. Przemawia za tym również gniazdo USB, które umożliwia jednocześnie ładowanie telefonu lub innego urządzenia elektrycznego.  Pobierz:   Instrukcja obsługi                    (1.9 MB)','','kinkiet-led-milow-elastyczne-ramie-gniazdo-usb','','','','Kinkiet LED Milow, elastyczne ramię, gniazdo USB','','','',''),(1859,1,1,'Czarny kinkiet LED Nikolae o kanciastym kształcie  Kinkiet LED Nikolae nadaje się szczególnie do stosowania przede wszystkim w nowoczesnych salonach, gdyż ukośny kształt i wylot światła umieszczony z przodu oraz czarna powierzchnia sprawiają, że lampa emanuje chłodną elegancją i ma w sobie to coś. Światło może wydostawać się zarówno w górę, jak i w dół, dając przytulne oświetlenie, które nie oślepia. Światło diod LED charakteryzuje się dużą energooszczędnością, a i źródła światła są również uważane za trwałe.','','kinkiet-led-nikolae-40-cm-czarny','','','','Kinkiet LED Nikolae, 40 cm, czarny','','','',''),(1860,1,1,'Niklowany reflektor LED Farida z ruchomą głowicą lampy  Ten reflektor LED jest przeznaczony przede wszystkim do stosowania na ścianie, gdzie Farida jest praktyczną lampą. Głowicę można obracać i wychylać w celu precyzyjnego ustawienia światła. Spot wyposażony jest w bardzo dobrze widoczną żarówkę LED, która jest wydajna i ma przyjemną, przytulną barwę światła ciepłej bieli. Powierzchnia metalowej podstawy jest niklowana i podobnie jak kształt lampy sprawia wrażenie nowoczesnej, ale dyskretnej. Dzięki temu Farida nadaje się do szerokiego zakresu zastosowań.','','elc-farida-spot-led-nikiel-1-punktowy','','','','ELC Farida spot LED, nikiel, 1-punktowy','','','',''),(1861,1,1,'Czarno-złota lampa ścienna Jördis w kształcie półkola, regulacja strumienia świetlnego  Jördis doskonale pasuje do nowoczesnego stylu wyposażenia wnętrz i jest lampą ścienną, która nie tylko przekonuje swoją czarno-złotą kolorystyką, ale również możliwością regulacji wzoru świetlnego poprzez regulację dwóch klap wewnątrz lampy, co pozwala na zmianę kąta emisji światła. Światło wydostaje się w górę i w dół z taką samą szerokością, albo strumień światła jest wąski i skoncentrowany z jednej strony oraz szeroki i rozłożysty z drugiej. Rezultatem jest efektowny obraz świetlny, który można podziwiać nawet w pewnej odległości od ściany i który jest szczególnie ciekawy, gdy kilka lamp ściennych zostanie zamontowanych obok siebie.  Pobierz:   Instrukcja obsługi                    (657 KB)','','elc-jordis-lampa-scienna-g9-okragla-czarna','','','','ELC Jördis lampa ścienna, G9, okrągła, czarna','','','',''),(1862,1,1,'Lampa ścienna z tkaniny Vasilia w kolorach czarnym i złotym  Zapewnianie ukierunkowanego światła: lampa ścienna z tkaniny Vasilia tworzy promienny akcent w korytarzu lub w części mieszkalnej. Lampa o liniowej konstrukcji może być również używana w sypialni, gdzie pozwala uzyskać światło w ciemności.  Dzięki czarnej obudowie lampa prezentuje się jako dyskretny element przyciągający wzrok, który po włączeniu staje się prawdziwą atrakcją. Złote wnętrze nadaje światłu szlachetny połysk, samo zaś światło świeci w tył na ścianę, przedostając się przez tkaninę. W ten sposób specjalne obrazy lub inne bliskie sercu elementy wyposażenia mogą być oświetlone w nastrojowy sposób. Pobierz:   Instrukcja obsługi                    (328 KB)','','lampa-scienna-vasilia-czarno-zlota-1-punktowa','','','','Lampa ścienna Vasilia, czarno-złota, 1-punktowa','','','',''),(1863,1,1,'','','kinkiet-led-forrestal-szerokosc-40-cm','','','','Kinkiet LED Forrestal, szerokość 40 cm','','','',''),(1864,1,1,'Rustykalna lampa ścienna Raisa w kształcie latarni  Raisa jest wspaniałym elementem oświetleniowym dla wszystkich dekoratorów wnętrz, którzy cenią sobie nostalgiczny wygląd, ponieważ lampa ścienna została zaprojektowana w formie zabytkowej latarni sprzed stuleci, tyle że w tamtym czasie nie była ona jeszcze zasilana elektrycznie, ale prawdziwymi świecami lub naftą. Powierzchnia w kolorze rdzy jest również bardzo dobrze dopasowana do ogólnego wzornictwa i podkreśla nostalgiczny efekt pierwszorzędnej lampy ściennej Raisa. Do stosowania z żarówkami świecami E14.  Pobierz:   Instrukcja obsługi                    (427 KB)','','lindby-raisa-lampa-scienna-latarnia-kolory-rdzy','','','','Lindby Raisa lampa ścienna, latarnia, kolory rdzy','','','',''),(1865,1,1,'Stylowy kinkiet LED Safia o nowoczesnym wyglądzie  Safia doskonale pasuje do purystycznego stylu wyposażenia wnętrz, dla którego charakterystyczna jest duża liczba nowoczesnych mebli. Elementy przytwierdzone do mocowania ściennego zamiast klosza mają filigranową, falistą formę, a jednocześnie stanowią podkład dla dużej liczby niewielkich diod LED emitujących światło o barwie ciepłej bieli. Światło diod jest bardzo jasne, a mimo to nie generuje dużego zużycia energii.','','kinkiet-led-safia-w-falistej-formie','','','','Kinkiet LED Safia w falistej formie','','','',''),(1866,1,1,'Wspaniałe, piękne światło dzięki złotemu kinkietowi LED Hayley z przezroczystą, szklaną kulą  Hayley jest bardzo ciekawym obiektem oświetleniowym, który wygląda atrakcyjnie zarówno pod względem optyki, jak i obrazu świetlnego. Szklana kula jest przezroczysta i ma niezwykle piękną strukturę bąbelkową, która tworzy wyjątkowe efekty. W dolnej części kulę uzupełnia metalowy element o lśniącym złotym odcieniu, dzięki czemu doskonale dopasowuje się do powierzchni podstawy i ramienia. Ramię to jest kątowe, a na końcu znajduje się linka, która prowadzi do klosza jak w lampie wiszącej. W ten sposób lampa ścienna staje się godnym uwagi obiektem oświetleniowym, któremu nie brakuje blasku i stylu.  Pobierz:   Instrukcja obsługi                    (375 KB)','','kinkiet-led-hayley-z-wiszaca-kula-zloty','','','','Kinkiet LED Hayley z wiszącą kulą, złoty','','','',''),(1867,1,1,'Jednopunktowy spot LED Leonor z żarówką GU10 i efektem patyny  Lampa Leonor ma ruchomy klosz i można zamontować ją zarówno na ścianie, jak i na suficie. Spot LED jest stylizowany na antyczny, ponieważ cała powierzchnia wygląda tak, jakby wiele lat minęło od produkcji tej oprawy, a znaki czasu odcisnęły swój ślad na metalu. Całość zdobi efekt patyny, która odpowiada za proces starzenia metali.  Pobierz:   Instrukcja obsługi                    (359 KB)','','leonor-spot-led-zefektem-patyny','','','','Leonor - spot LED z efektem patyny','','','',''),(1868,1,1,'Heiko – biały kinkiet LED z gipsu  Jeśli masz ten kinkiet LED, światło świeci w górę i w dół w sposób bardzo efektowny i przede wszystkim daje wrażenie przytulności. Obudowa lampy ma półkolisty kształt, który jest postrzegany jako uroczy i atrakcyjny i może być łączony z kilkoma stylami.   Kto nosi się z zamiarem dostosowania kolorystycznego kinkietu LED do otoczenia, śmiało może wziąć do ręki farbę i pędzel, gdyż lampy z gipsu doskonale nadają się do tego, by móc je pomalować lub opatrzyć rysunkami. Pobierz:   Instrukcja obsługi                    (378 KB)','','piekny-kinkiet-led-heiko-z-gipsu','','','','Piękny kinkiet LED Heiko z gipsu','','','',''),(1869,1,1,'1-punktowy reflektor LED Filiz z drewna i betonu Filiz stanowi kombinację dwóch modnych materiałów, a mianowicie drewna i betonu. Dzięki temu lampa zyskuje wyjątkowy wygląd, który można łączyć zarówno ze stylem industrialnym, jak i skandynawskim, i który pasuje nawet do nowoczesnego stylu rustykalnego. Ten reflektor z betonu można dowolnie obracać i odchylać i nadaje się zarówno do montażu na ścianie, jak i na suficie. Drewniana podstawa sprawia bardzo naturalne wrażenie i emanuje stylową elegancją.  Żarówka LED E14 zapewnia niskie zużycie prądu. Pobierz:   Instrukcja obsługi                    (477 KB)','','filiz-reflektor-led-z-drewna-i-betonu','','','','Filiz – reflektor LED z drewna i betonu','','','',''),(1870,1,1,'Doskonały pod względem formy kinkiet LED Desirio z wkręconym metalowym kloszem w kolorze czarnym i złotym  Desirio to bardzo atrakcyjny element oświetleniowy dla całego obszaru mieszkalnego, który urzeka unikalnym, artystycznym wyglądem. Metalowy klosz wygląda jak wkręcona kartka papieru lub rodzaj spirali i przekonuje swoim stylowym, dwukolorowym wzornictwem. Zewnętrzna strona metalowego klosza jest czarna, wnętrze złote, a końce nakładają się na górze i na dole z obudową, co wyraźnie podkreśla kontrast kolorów. Światło żarówki LED G9 jest pięknie odbijane przez elegancki złoty odcień i przy tej konstrukcji tworzy bardzo przytulny efekt. Każda ściana w części mieszkalnej, na której znajduje się ta lampa, w mgnieniu oka zyskuje nowoczesny wygląd.  Pobierz:   Instrukcja obsługi                    (1.2 MB)','','metalowy-kinkiet-led-desirio-czarno-zloty','','','','Metalowy kinkiet LED Desirio, czarno-złoty','','','',''),(1871,1,1,'Jednopłomieniowa oprawa ścienna Enoire - udane współgranie kontrastów  Jak wiadomo, przeciwieństwa przyciągają - a w przypadku oprawy ściennej Enoire tworzą nawet harmonijny całościowy obraz. Sferyczny klosz wykonany ze szkła opalowego wytwarza światło, które jest emitowane równomiernie we wszystkich kierunkach. Jest on montowany przed aluminiowym wspornikiem ściennym, który jest zaprojektowany jako czarny, prostokątny pręt. Enoire robi doskonałe wrażenie w prywatnych salonach z nowoczesnym wyposażeniem, ale może być również umieszczony jako dodatkowe źródło światła, na przykład we foyer w miejscach publicznych.','','kinkiet-enoire-czarno-bialy-1-punktowy','','','','Kinkiet Enoire czarno-biały, 1-punktowy','','','',''),(1872,1,1,'Ekstrawagancki kształt kinkietu LED Hayley z wiszącym szklanym kloszem i błyszczącą chromowaną ramką ścienną  Hayley ma okrągły uchwyt ścienny, z którego schodzi wygięte ramię. Oba elementy są chromowane na wysoki połysk, co wygląda bardzo nowocześnie, a z ramienia w górnej części wychodzi linka, która prowadzi do szklanej kuli jak w klasycznej lampie wiszącej. Kula ta jest przezroczysta i została wykonana z atrakcyjnego szkła bąbelkowego, natomiast część dolna posiada metalowy element, który, podobnie jak podstawa, jest utrzymany w chromie. Światło może wyjść bezpośrednio i pośrednio, przy czym bezpośrednia część światła jest bardziej miękka dzięki satynowanej powierzchni szklanej na dole klosza. Technologia LED lampy ściennej zapewnia niskie zużycie energii.  Pobierz:   Instrukcja obsługi                    (292 KB)','','kinkiet-led-hayley-z-wiszaca-kula-chrom','','','','Kinkiet LED Hayley z wiszącą kulą, chrom','','','',''),(1873,1,1,'Biało-złoty kinkiet LED Desirio z metalu  Klosz tej lampy ściennej z żarówką LED G9 przypomina bardziej spiralę lub wkręcony papier niż klasyczny klosz. To właśnie czyni go tak wyjątkowym, ponieważ natychmiast przyciąga wzrok i wyróżnia się wśród innych produktów. Konstrukcja wpływa nie tylko na wygląd lampy, ale również na jej oświetlenie, ponieważ oba końce nakładają się z obudową zarówno na górze, jak i na dole. Na zewnątrz klosz jest biały, wewnątrz urzeka pięknym, złotym odcieniem, który wciąż jest dobrze widoczny na górze i na dole i który w połączeniu ze światłem promieniuje cudownym ciepłem, przyczyniającym się do stworzenia przytulnej atmosfery w mieszkaniu.  Pobierz:   Instrukcja obsługi                    (1.0 MB)','','metalowy-kinkiet-led-desirio-bialo-zloty','','','','Metalowy kinkiet LED Desirio, biało-złoty','','','',''),(1874,1,1,'Lampa ścienna Konstantin z gipsu nadającego się do malowania  Konstantin to lampa ścienna relatywnie dyskretna i prosta, a jednak za tą delikatną fasadą kryją się niezliczone możliwości stosowania - po pierwsze dlatego, że pasuje kształtem i kolorem do wielu stylów i koncepcji aranżacji wnętrz, ale także po drugie dlatego, że gips jest powierzchnią, która pozwala jeszcze na późniejsze zmiany i nadaje się lepiej niż każda inna lampa do kreatywnego tworzenia oświetlenia. Można zrealizować w mgnieniu oka wiele życzeń, np. pomalować tę lampę ścienną w odcieniu ściany, albo w kolorze kontrastującym z pozostałym wyposażeniem lub wykonać na niej jakiś motyw czy ilustrację, co jest opcją wartą rozważenia np. w pokoju dziecięcym. Nie ma żadnych granic dla artystów w dziedzinie oświetlenia, a do przygotowania powierzchni dołączono - standardowo - rękawiczki i papier ścierny.   Światło świeci do dołu - tu znajduje się dodatkowa przesłona z mlecznego szkła - ale także do góry i jest przyjemnie delikatne, roztaczając przy tym przytulną aurę.  Pobierz:   Instrukcja obsługi                    (209 KB)','','wygieta-lampa-scienna-konstantin-z-bialego-gipsu','','','','Wygięta lampa ścienna Konstantin z białego gipsu','','','',''),(1875,1,1,'Lampa ścienna Enoire z dwoma kloszami opalizującymi i czarnym uchwytem ściennym  Dwupłomieniowa oprawa ścienna Enoire, charakteryzująca się czarującą grą kontrastów i jasnym językiem projektowania, oferuje odpowiedni element wyposażenia nowoczesnych wnętrz - czy to w prywatnych pomieszczeniach mieszkalnych, czy na przykład w publicznej galerii. Jego odcienie są zaprojektowane jako symetryczne, jasne kule z opalizowanego szkła, które zapewniają równomierną emisję światła dookoła. Natomiast aluminiowy wspornik ścienny ma kształt długiego, czarnego prostokąta; odcienie są rozmieszczone asymetrycznie wzdłuż niego, pozostawiając obszar wspornika całkowicie wolny. Pobierz:   Instrukcja obsługi                    (596 KB)','','kinkiet-enoire-czarno-bialy-2-punktowy','','','','Kinkiet Enoire czarno-biały, 2-punktowy','','','',''),(1876,1,1,'Czarny spot Aylis z płytą ze sklejki dla dekoracyjnego akcentu  Metalowy klosz reflektora ściennego Aylis ma matową, czarną powierzchnię i może przekonywać przemysłowym wyglądem, ponieważ śruby i przeguby ozdabiają całościowe wzornictwo, które dzięki temu wygląda bardziej rustykalnie. Oznacza to również, że kierunek światła można dowolnie regulować, ponieważ klosz można obracać i wychylać. Jasna sklejka do montażu ściennego lub sufitowego jest wartościowym akcentem, który nadaje temu reflektorowi bardziej naturalny wygląd.  Pobierz:   Instrukcja obsługi                    (384 KB)','','lindby-aylis-spot-czarna-drewno-1-punktowa','','','','Lindby Aylis Spot, czarna, drewno, 1-punktowa','','','',''),(1877,1,1,'Lampa ścienna ze sklepieniem Karla ze szkła i metalu  Ta lampa ścienna urzeka wspaniałym wyglądem, szklany klosz tworzy lekkie sklepienie i jest uzupełniany od dołu metalową aplikacją o matowej niklowanej powierzchni. Lampa Karla umieszczona na ścianie wygląda bardzo elegancko i oczywiście nowocześnie. Satynowana wkładka ze szkła powoduje miękkie i ciepłe rozprowadzanie światła, przy czym wybór źródła światła jest w pełnym sensie nieograniczony, ponieważ oprawka E-27 pozwala na zastosowanie zarówno żarówek, jak i halogenów oraz wydajnych i oszczędnych lamp LED.  Pobierz:   Instrukcja obsługi                    (398 KB)','','ekskluzywna-lampa-scienna-karla','','','','Ekskluzywna lampa ścienna Karla','','','',''),(1878,1,1,'Lampa ścienna Aiden w kolorze mosiądzu, z cylindryczną lampką do czytania i białym kloszem z tkaniny.  Ta lampa ścienna z tkaniny doskonale sprawdzi się w sypialni obok łóżka. Niesie też ze sobą wszelkie korzyści wynikające z obecności dwóch różnych źródeł światła. Klosz z tkaniny w kolorze białym sprawia, że światło jest przytulne, równomierne, nie oślepia i sprzyja relaksowi. Z kolei cylindryczna lampka do czytania ma diody LED i emituje światło punktowe o dużej jasności, co pozwala optymalnie odciążyć oczy podczas czytania. Ta lampa ścienna doskonale sprawdzi się także w salonie za sofą. Jej zaletę stanowi fakt, że ma ona dwa przełączniki pozwalające obsługiwać ją niezależnie. Dlatego też, w zależności od wyboru, użytkownik może załączać obie żarówki lub tylko jedną z nich.   Powierzchnia metalowej podstawy ma odcień matowego brązu i wzmacnia klasyczny wygląd tej lampy ściennej, której można używać także w komercyjnych pomieszczeniach hotelowych.   Lampka do czytania:  - ciepła biel (3 000 K)  - 310 lumenów Pobierz:   Instrukcja obsługi                    (302 KB)','','lampa-scienna-aiden-z-lampka-bialy-mosiadz','','','','Lampa ścienna Aiden z lampką, biały, mosiądz','','','',''),(1879,1,1,'Indywidualnie regulowany spot ścienny Svenda o nowoczesnej drewnopodobnej stylistyce  Spot ścienny Svenda oznacza nie tylko źródło światła o elastycznych możliwościach ustawiania, ale również element wyposażenia, który dzięki naturalnemu drewnianemu wyglądowi wniesie do salonu sporą dawkę ciepła. Mimo drewnianej podstawy spot ścienny nie wygląda staroświecko, ponieważ w połączeniu z chromowanymi i lakierowanymi na biało elementami metalowymi powstaje bardzo nowoczesna i modna całość. Wbudowany przegub kulowy umożliwia indywidualną zmianę kierunku padania światła.','','spot-scienny-svenda-z-olejowanego-drewna-debowego','','','','Spot ścienny Svenda z olejowanego drewna dębowego','','','',''),(1880,1,1,'Piękna lampa ścienna Malthe ze szkła i metalu  Ta lampa ścienna urzeka bardzo pięknym widokiem, szklany klosz wystaje ku górze, a na dole jest uzupełniany przez metalowy element z połyskującego chromu. Lampa Malthe umieszczona na ścianie wygląda bardzo elegancko i oczywiście nowocześnie. Satynowana wkładka ze szkła powoduje miękkie i ciepłe rozprowadzanie światła, przy czym wybór źródła światła jest w pełnym sensie nieograniczony, ponieważ oprawka E-27 pozwala na zastosowanie zarówno żarówek, jak i halogenów oraz wydajnych i oszczędnych lamp LED.  Pobierz:   Instrukcja obsługi                    (311 KB)','','malthe-nowoczes-lampa-scienna-ze-szkla-i-metalu','','','','Malthe - nowoczes. lampa ścienna ze szkła i metalu','','','',''),(1881,1,1,'','','spot-scienny-corralee-bialy-1-punktowy','','','','Spot ścienny Corralee, biały, 1-punktowy','','','',''),(1882,1,1,'Elegancka lampa ścienna Yola z białym półprzezroczystym szklanym kloszem  Ta stylowa i prosta lampa ma harmonijny i wysublimowany wygląd. Klosz z półprzezroczystego mlecznego szkła zapewnia miłe dla oka światło nie powodujące efektu oślepienia. Cokół wykonano tu ze stali, a jego chromowane wykończenie nadaje całości efektowne, nowoczesne akcenty.  Lampa ścienna Yola może zostać wyposażona w trzy energooszczędne żarówki E27. Należy je nabyć oddzielnie. Wreszcie, co nie mniej ważne, model Yola współgra z klasycznymi, ponadczasowymi pomysłami wnętrzarskimi, a także pasuje do nostalgicznego stylu wyposażenia. Pobierz:   Instrukcja obsługi                    (343 KB)','','lampa-scienna-yola-ze-szklanym-kloszem-chrom','','','','Lampa ścienna Yola ze szklanym kloszem, chrom','','','',''),(1883,1,1,'Piękna lampa ścienna ELAINA ze szkła opalowego z żarówką LED E14  Klosz tej lampy ściennej ma kształt kuli i został wykonany ze szkła opalowego, dzięki czemu daje łagodne, przyjemne światło. Znajdujący się na podstawie włącznik dźwigniowy umożliwia szybką obsługę lampy, dlatego z powodzeniem można umieścić ją nad fotelem, kanapą lub łóżkiem.   Dostawa obejmuje żarówkę LED E14 w ciepłym białym kolorze o wysokiej energooszczędności.  Pobierz:   Instrukcja obsługi                    (359 KB)','','jednopunktowa-lampa-scienna-led-elaina-mosiezna','','','','Jednopunktowa lampa ścienna LED ELAINA, mosiężna','','','',''),(1884,1,1,'','','kinkiet-marley-stary-mosiadz-up-down','','','','Kinkiet Marley, stary mosiądz, Up & Down','','','',''),(1885,1,1,'Lampa ścienna Stannis jako nowoczesne rozwiązanie oświetleniowe z tekstylnym kloszem  Elegancki klosz lampy ściennej Stannis został wykonany z białej tkaniny. Lampa nie tylko uzyskuje szczególny wygląd, ale również zapewnia doskonałe oświetlenie. Światło prześwieca delikatnie przez tkaninę i zanurza otoczenie w przyjemnym, miękkim świetle. Światło może bez przeszkód wydostawać się w dół, dzięki czemu zapewnione jest również wystarczające oświetlenie. Dzięki swojemu abstrakcyjnemu wyglądowi Stannis nadaje się jako uzupełniające źródło światła w nowoczesnym salonie lub sypialni.','','lindby-stannis-lampa-scienna-tkanina-matowy-nikiel','','','','Lindby Stannis lampa ścienna tkanina matowy nikiel','','','',''),(1886,1,1,'Kinkiet LED Tamin w stylu industrialnym, z efektowną osłoną z siatki  Tamin to ruchomy kinkiet LED, który można obracać i odchylać, a także zamontować na suficie w razie potrzeby. Metalowa powierzchnia ma wykończenie w rdzawym kolorze, dlatego też do złudzenia przypomina prawdziwy zardzewiały metal. Sprawia to, że sama lampa wygląda na starą i nadaje jej nutkę nostalgii. Ogólny design tej lampy ściennej przydaje jej industrialnego uroku. Efekt ten wywoływany jest przez osłonę z siatki, która znajduje się przed elementem szklanym i przed żarówką.  Pobierz:   Instrukcja obsługi                    (290 KB)','','rdzawy-kinkiet-led-tamin-styl-industrialny','','','','Rdzawy kinkiet LED Tamin, styl industrialny','','','',''),(1887,1,1,'Elegancka lampa ścienna Kalinda z kloszem z szarego betonu i okrągłą ramą z dębowego drewna  Lampa ścienna Kalinda jest idealnym uzupełnieniem skandynawskich stylów życia, ponieważ łączy w sobie betonowy klosz z okrągłą ramą ścienną wykonaną z jasnego drewna dębowego. W ten sposób ciepłe tony drewna i znacznie chłodniejszy beton łączą się w bardzo estetyczny sposób. W ten sposób szybko powstają skojarzenia ze skandynawskim stylem życia, który charakteryzuje się tym, że używa się jednocześnie jasnego języka formy i podstawowych materiałów o przytulnym wyglądzie. Stylowe oświetlenie akcentujące do salonu i sypialni! Pobierz:   Instrukcja obsługi                    (421 KB)','','lucande-kalinda-lampa-scienna-z-betonowym-kloszem','','','','Lucande Kalinda lampa ścienna z betonowym kloszem','','','',''),(1888,1,1,'Smukła lampa ścienna LED Thiago w kolorze białym  Nowoczesny, smukły wygląd i dyskretna kolorystyka są połączone w lampie ściennej Thiago LED. Korpus lampy składa się z uchwytu ściennego i wąskiego rozpórki, które są wykonane z aluminium. Jego diody LED są montowane tak, że siedzą za rozpórką i świecą swoim światłem na ścianie. Dzięki temu ciekawemu ułożeniu światła, lampa ścienna Thiago LED jest otoczona i podkreślona własnym światłem. Ciepłe białe światło diod LED tworzy przyjemną atmosferę i jest idealne do oświetlenia akcentującego. Ale także niewielkie rozmiary oprawy sprawiają, że jest ona idealnym towarzyszem w oświetleniu korytarzy. Jest o wiele bardziej oszczędny w przestrzeni niż wiszące oprawy ścienne, a jego prosty wygląd sprawia, że jest doskonałym uzupełnieniem nowoczesnego stylu projektowania wnętrz. Pobierz:   Instrukcja obsługi                    (333 KB)    Photometric Data LDT                    (9 KB)    Dimension drawing                    (99 KB)','','arrchio-kinkiet-led-thiago-bialy','','','','Arrchio kinkiet LED Thiago biały','','','',''),(1889,1,1,'Połączenie czarnego metalu z jasnym drewnem: kinkiet LED Arina Dzięki stylowemu, nieco purystycznemu wyglądowi i drobnemu drewnianemu elementowi, Arina doskonale pasuje do tych stylów aranżacji wnętrz, które można przypisać skandynawskiemu wzornictwu, gdzie przytulność i nowoczesna prostolinijność tworzą doskonałe połączenie.  Klosz można przesuwać zgodnie z życzeniem, a dzięki technologii LED, zastosowanej w żarówkach, podczas pracy z lampą ścienną Arina można mieć pewność, że zużywa się tylko niewiele energii elektrycznej, choć światło jest jasne i bardzo komfortowe. Pobierz:   Instrukcja obsługi                    (542 KB)','','czarny-kinkiet-led-arina-z-drewnem','','','','Czarny kinkiet LED Arina z drewnem','','','',''),(1890,1,1,'Piękna lampa ścienna ELAINA ze szkła opalowego z żarówką LED E14  Klosz tej lampy ściennej ma kształt kuli i został wykonany ze szkła opalowego, dzięki czemu daje łagodne, przyjemne światło. Znajdujący się na podstawie włącznik dźwigniowy umożliwia szybką obsługę lampy, dlatego z powodzeniem można umieścić ją nad fotelem, kanapą lub łóżkiem.   Dostawa obejmuje żarówkę LED E14 w ciepłym białym kolorze o wysokiej energooszczędności.  Pobierz:   Instrukcja obsługi                    (593 KB)','','spot-scienny-led-elaina-matowy-nikiel','','','','Spot ścienny LED ELAINA, matowy nikiel','','','',''),(1891,1,1,'Thorin – drewniany spot z metalowym kloszem w kolorze białym  Thorin wnosi naturalny styl do salonu, ponieważ podstawa spotu na dużej powierzchni wykonana jest z drewna, które daje wrażenie ciepła. Dzięki temu lampa doskonale wpasowuje się w każdy styl zabudowy wiejskiej, od nowoczesnego po stosunkowo klasyczny. Z drugiej zaś strony klosz przypomina kulę i wykonany jest z całkowicie białego metalu. Ze względu na nieprzezroczystość tego materiału światło wydostaje się w z góry określonym kierunku, ku przodowi. Drewniany spot może być montowany zarówno na suficie, jak i na ścianie, a dzięki przegubowi można go ustawiać w sposób dowolny.  Pobierz:   Instrukcja obsługi                    (433 KB)','','drewniany-spot-thorin-z-bialym-metalowym-kloszem','','','','Drewniany spot Thorin z białym metalowym kloszem','','','',''),(1892,1,1,'Atrakcyjna lampa ścienna POLA o klasycznym designie  Ta lampa ścienna wraz z materiałowym abażurem w szampańskim kolorze oraz podstawą w kolorze mosiądzu wprost emanuje klasyką. Dlatego doskonale odnajdzie się we wnętrzach urządzonych w klasycznym stylu. Materiałowy abażur o jasnej, ciepłej barwie rozprasza światło w formie przyjemnej poświaty i został uzupełniony o elegancki mosiężny kolor w postaci podstawy o polerowanej powierzchni. Cechą charakterystyczną tej lampy jest znajdujący się pod abażurem przegub, który umożliwia regulację wysięgu, co stwarza wiele możliwości ustawiania lampy i dostosowywania światła do własnych potrzeb. W ten sposób abażur można obracać i przyciągać do siebie. Pobierz:   Instrukcja obsługi                    (328 KB)','','lampa-scienna-pola-na-wysiegniku','','','','Lampa ścienna POLA na wysięgniku','','','',''),(1893,1,1,'Reflektor LED Tamin z osłoną z siatki, do montażu na ścianie lub suficie  Tamin to reflektor z metalu o szarej powierzchni, której kolor od razu przywodzi na myśl powierzchnie wykonane z betonu. Klosz w kształcie puszki jest z przodu pokryty osłoną z mrożonego szkła i siatką, co nadaje lampie wygląd bardzo industrialny. Jako że lampa ma pałąk, łączący klosz z mocowaniem, ten reflektor LED można obracać i odchylać, co ułatwia odpowiednie ustawienie światła. Ta lampa LED z cokołem G9 jest energooszczędna i zużywa bardzo mało prądu.  Pobierz:   Instrukcja obsługi                    (442 KB)','','szary-dymny-reflektor-led-tamin-styl-industrialny','','','','Szary dymny reflektor LED Tamin, styl industrialny','','','',''),(1894,1,1,'Atrakcyjna materiałowa lampa ścienna POLA z białym abażurem na wysięgniku  Zastosowana kolorystyka nadaje lampie POLA nowoczesny wygląd, z kolei formą nawiązuje ona do klasyki. To harmonijne połączenie czyni z niej ponadczasowe źródło światła, z do tego biały materiałowy abażur sprawi, że wpasuje się w każdy wystrój wnętrza. Idealnie spisze się nad łóżkiem lub sofą. Wbudowany przegub pozwala na przyciąganie abażuru do siebie, z kolei wbudowany przełącznik umożliwia wygodne włączanie i wyłączanie lampy.  Pobierz:   Instrukcja obsługi                    (336 KB)','','materialowa-lampa-scienna-pola-z-wysiegnikiem','','','','Materiałowa lampa ścienna POLA z wysięgnikiem','','','',''),(1895,1,1,'Mały spot sufitowy Wanessa - odpowiedni również na ścianie  1-punktowy spot sufitowy Wanessa wyposażony jest w szlachetne połączenie jasnego drewna i satynowej bieli. Klosz utrzymany w bieli znajduje się na rozecie sufitowej z jasnego drewna o pięknej fakturze. Klosz jest ruchomy dzięki przegubowi, dzięki czemu może być w każdej chwili regulowany i indywidualnie dostosowywany. Reflektor sufitowy Wanessa może być również zainstalowany na ścianie i wykorzystywany jako małe dodatkowe źródło światła, na przykład do czytania w salonie.  Pobierz:   Instrukcja obsługi                    (193 KB)','','lindby-wanessa-spot-1-punktowy','','','','Lindby Wanessa spot, 1-punktowy','','','',''),(1896,1,1,'Lampa ścienna Wibke z kloszem wewnętrznym lakierowanym na złoto  Nowoczesna lampa ścienna Wibke przypomina styl skandynawski. Jej klosz jest stożkowy i lakierowany wewnątrz na kolor złoty. Po włączeniu światła, lampa ścienna utrzymana w kolorystyce czystej bieli wytwarza przyjemną i przytulną zarazem atmosferę. Praktyczny przełącznik umieszczony bezpośrednio na górze klosza sprawia, że obsługa lampy Wibke jest dziecinnie prosta. Klosz jest również ruchomy, dzięki czemu można indywidualnie regulować ustawienie światła. Dzięki temu Wibke jest modnym oświetleniem dodatkowym do kącika czytelniczego lub nowoczesnego salonu.  Pobierz:   Instrukcja obsługi                    (451 KB)','','lucande-wibke-lampa-scienna-w-kolorze-bialym','','','','Lucande Wibke lampa ścienna w kolorze białym','','','',''),(1897,1,1,'Doskonale wykonana lampa ścienna Vlada w kolorze czarnym i mosiężnym, z przewodem z wtyczką i przełącznikiem dźwigniowym  Vlada doskonale pasuje do tzw. skandynawskich stylów wyposażenia wnętrz, ponieważ na pierwszym planie mamy tutaj zdecydowanie zredukowany wygląd w połączeniu ze stylowym językiem formy. Podstawa jest głównie czarna, natomiast klosz, który również jest wykonany z metalu, wyróżnia się pięknym, matowym mosiężnym odcieniem. Lampa ścienna idealnie nadaje się do czytania i wymaga jedynie gniazda wtykowego jako połączenia zasilania, ponieważ jest dostarczana z przewodem z wtyczką. Przełącznik umieszczony jest w sposób przyjazny dla użytkownika nad kloszem na czarnym elemencie w kształcie cylindra.  Pobierz:   Instrukcja obsługi                    (264 KB)','','lindby-vlada-lampa-scienna-do-czytania-czarna','','','','Lindby Vlada lampa ścienna do czytania, czarna','','','',''),(1898,1,1,'Trendowy ścienny reflektor Evinora wykonany z udanego połączenia materiałów  Evinora to piękny kinkiet, który przyciąga wszystkie oczy swoim ciemnym kloszem. Szczególnie imponuje połączeniem różnych materiałów. Podczas gdy rama wykonana jest z lekkiego drewna, klosz cylindryczny wykonany jest ze stali.  Światło jest emitowane ze wszystkich stron, przy czym optyka klosza zapewnia indywidualne akcenty świetlne. Nie ma żadnych ograniczeń w doborze oświetlacza do gniazda E14, a energooszczędny oświetlacz LED w modnej optyce żarniwnej jest tutaj oferowany.','','lindby-evinora-reflektor-scienny-z-drewna','','','','Lindby Evinora reflektor ścienny z drewna','','','',''),(1899,1,1,'','','kinkiet-led-lagos-z-przelacznikiem-czarny','','','','Kinkiet LED Lagos z przełącznikiem, czarny','','','',''),(1900,1,1,'','','lampa-scienna-997-z-wtyczka-1-punktowa-czarna','','','','Lampa ścienna 997 z wtyczką, 1-punktowa, czarna','','','',''),(1901,1,1,'Gipsowa lampa ścienna LED Marit o stopniowanym wyglądzie  Marit to prawdziwie czarujące źródło światła dla strefy mieszkalnej. Efekt świetlny jest naprawdę niesamowity, ponieważ powstaje piękna gra światła i cienia. Dzieje się tak dzięki stopniowanej konstrukcji klosza, ponieważ umożliwia ona wydostawanie się światła w różnych miejscach. Pobierz:   Instrukcja obsługi                    (500 KB)','','lindby-marit-kinkiet-led-gips-stopniowany','','','','Lindby Marit kinkiet LED gips, stopniowany','','','',''),(1902,1,1,'','','kinkiet-circle-o-okraglym-ksztalcie-czarny','','','','Kinkiet Circle o okrągłym kształcie, czarny','','','',''),(1903,1,1,'Modna lampa ścienna Wibke z czarno-złotym kloszem  Lampa ścienna Wibke znakomicie nadaje się jako małe światło dodatkowe w kąciku do czytania, w ulubionym fotelu lub jako nowoczesne oświetlenie przy łóżku. Urzeka swoim stożkowatym kloszem, którego wnętrze pomalowano na złoto, dzięki czemu tworzy przyjemną atmosferę po włączeniu światła. Regulacja klosza i włącznik/wyłącznik bezpośrednio na lampie sprawiają, że Wibke to praktyczna lampa ścienna, która również pięknie wygląda. Pobierz:   Instrukcja obsługi                    (306 KB)','','lucande-wibke-lampa-scienna-w-kolorze-czarnym','','','','Lucande Wibke lampa ścienna w kolorze czarnym','','','',''),(1904,1,1,'Czarna lampa ścienna LED Ignazia wykonana z metalu dla przyjemnego oświetlenia salonu  Ignazia jest nowoczesnym elementem oświetleniowym o prostym wyglądzie, który szczególnie nadaje się do wnętrz purystycznych, ale dobrze komponuje się również z innymi stylami. Technologia LED w oprawie ściennej zapewnia dobrą wydajność energetyczną, a światło jest przyjemnie olśniewające. Lampa ścienna LED jest więc idealna do stosowania na korytarzach i w salonach, najlepiej jako oświetlenie akcentujące lub uzupełniające. Światło jest skierowane zarówno w górę jak i w dół, a matowa, czarna powierzchnia w atrakcyjny sposób udoskonala zredukowany design. Pobierz:   Instrukcja obsługi                    (484 KB)','','lindby-ignazia-lampa-scienna-led-28-cm-czarna','','','','Lindby Ignazia lampa ścienna LED, 28 cm, czarna','','','','');
